INSERT INTO `rules` VALUES (1,'InsufficientCommentDensity','InsufficientCommentDensity','common-java','<p>An issue is created on a file as soon as the comment density coverage on this file is less than the required threshold. It gives the number of comment lines to be written in order to reach the required threshold.</p>',2,NULL,'Insufficient comment density','READY','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,13,NULL,'LINEAR',NULL,'3min',NULL,NULL,NULL,NULL,NULL,0,'HTML'),(2,'DuplicatedBlocks','DuplicatedBlocks','common-java','<p>An issue is created on a file as soon as there is a block of duplicated code on this file. It gives the number of blocks in the file.</p>',2,NULL,'Duplicated blocks','READY','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,26,NULL,'LINEAR',NULL,'1h',NULL,NULL,NULL,NULL,NULL,0,'HTML'),(3,'SkippedUnitTests','SkippedUnitTests','common-java','<p>Skipped unit tests are considered as dead code. Either they should be activated again (and updated) or they should be removed.</p>',2,NULL,'Skipped unit tests','READY','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,39,NULL,'LINEAR',NULL,'10min',NULL,NULL,NULL,NULL,NULL,0,'HTML'),(4,'InsufficientLineCoverage','InsufficientLineCoverage','common-java','<p>An issue is created on a file as soon as the line coverage on this file is less than the required threshold. It gives the number of lines to be covered in order to reach the required threshold.</p>',2,NULL,'Insufficient line coverage by unit tests','READY','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,36,NULL,'LINEAR',NULL,'3min',NULL,NULL,NULL,NULL,NULL,0,'HTML'),(5,'FailedUnitTests','FailedUnitTests','common-java','<p>Test failures or errors generally indicate that regressions have been introduced. Those tests should be handled as soon as possible to reduce the cost to fix the corresponding regressions.</p>',2,NULL,'Failed unit tests','READY','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,36,NULL,'LINEAR',NULL,'1h',NULL,NULL,NULL,NULL,NULL,0,'HTML'),(6,'InsufficientBranchCoverage','InsufficientBranchCoverage','common-java','<p>An issue is created on a file as soon as the branch coverage on this file is less than the required threshold.It gives the number of branches to be covered in order to reach the required threshold.</p>',2,NULL,'Insufficient branch coverage by unit tests','READY','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,36,NULL,'LINEAR',NULL,'10min',NULL,NULL,NULL,NULL,NULL,0,'HTML'),(7,'NM_FIELD_NAMING_CONVENTION','NM_FIELD_NAMING_CONVENTION','findbugs','<p>\n      Names of fields that are not final should be in mixed case \n      with a lowercase first letter and the first letters of subsequent words capitalized.\n      </p>',2,NULL,'Field names should start with a lower case letter','READY','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(8,'RV_NEGATING_RESULT_OF_COMPARETO','RV_NEGATING_RESULT_OF_COMPARETO','findbugs','<p>This code negatives the return value of a compareTo or compare method. This is a questionable or bad \nprogramming practice, since if the return value is Integer.MIN_VALUE, negating the return value won\'t \nnegate the sign of the result. You can achieve the same intended result by reversing the order of the \noperands rather than by negating the results.</p>',1,NULL,'Negating the result of compareTo()/compare()','READY','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(9,'EQ_CHECK_FOR_OPERAND_NOT_COMPATIBLE_WITH_THIS','EQ_CHECK_FOR_OPERAND_NOT_COMPATIBLE_WITH_THIS','findbugs','<p> This equals method is checking to see if the argument is some incompatible type\n(i.e., a class that is neither a supertype nor subtype of the class that defines\nthe equals method). For example, the Foo class might have an equals method\nthat looks like:\n\n<p><code><pre>\npublic boolean equals(Object o) {\n  if (o instanceof Foo)\n    return name.equals(((Foo)o).name);\n  else if (o instanceof String)\n    return name.equals(o);\n  else return false;\n</pre></code></p>\n\n<p>This is considered bad practice, as it makes it very hard to implement an equals method that\nis symmetric and transitive. Without those properties, very unexpected behavoirs are possible.\n</p>',2,NULL,'Bad practice - Equals checks for noncompatible operand','READY','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(10,'TQ_MAYBE_SOURCE_VALUE_REACHES_NEVER_SINK','TQ_MAYBE_SOURCE_VALUE_REACHES_NEVER_SINK','findbugs','<p>\n      A value that is annotated as possibility being an instance of\n	the values denoted by the type qualifier, and the value is guaranteed to be used\n	in a way that prohibits values denoted by that type qualifier.\n      </p>',3,NULL,'Correctness - Value that might carry a type qualifier is always used in a way prohibits it from having that type qualifier','READY','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5h',NULL,NULL,NULL,0,'HTML'),(11,'VA_FORMAT_STRING_BAD_ARGUMENT','VA_FORMAT_STRING_BAD_ARGUMENT','findbugs','<p>\nThe format string placeholder is incompatible with the corresponding\nargument. For example,\n<code>\n  System.out.println(\"%d\\n\", \"hello\");\n</code>\n<p>The %d placeholder requires a numeric argument, but a string value is\npassed instead. \nA runtime exception will occur when \nthis statement is executed.\n</p>',3,NULL,'Correctness - Format string placeholder incompatible with passed argument','READY','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(12,'UPM_UNCALLED_PRIVATE_METHOD','UPM_UNCALLED_PRIVATE_METHOD','findbugs','<p> This private method is never called. Although it is\npossible that the method will be invoked through reflection,\nit is more likely that the method is never used, and should be\nremoved.\n</p>\n\n<p>\nThis rule is deprecated, use {rule:squid:UnusedPrivateMethod} instead.\n</p>',3,NULL,'Performance - Private method is never called','DEPRECATED','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(13,'DMI_THREAD_PASSED_WHERE_RUNNABLE_EXPECTED','DMI_THREAD_PASSED_WHERE_RUNNABLE_EXPECTED','findbugs','<p> A Thread object is passed as a parameter to a method where \na Runnable is expected. This is rather unusual, and may indicate a logic error\nor cause unexpected behavior.\n   </p>',2,NULL,'Dodgy - Thread passed where Runnable expected','READY','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(14,'BC_UNCONFIRMED_CAST_OF_RETURN_VALUE','BC_UNCONFIRMED_CAST_OF_RETURN_VALUE','findbugs','<p>\nThis code performs an unchecked cast of the return value of a method.\nThe code might be calling the method in such a way that the cast is guaranteed to be\nsafe, but FindBugs is unable to verify that the cast is safe.  Check that your program logic ensures that this\ncast will not fail.\n</p>',3,NULL,'Unchecked/unconfirmed cast of return value from method','READY','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(15,'VO_VOLATILE_REFERENCE_TO_ARRAY','VO_VOLATILE_REFERENCE_TO_ARRAY','findbugs','<p>This declares a volatile reference to an array, which might not be what\nyou want. With a volatile reference to an array, reads and writes of\nthe reference to the array are treated as volatile, but the array elements\nare non-volatile. To get volatile array elements, you will need to use\none of the atomic array classes in java.util.concurrent (provided\nin Java 5.0).</p>',2,NULL,'Multithreaded correctness - A volatile reference to an array doesn\'t treat the array elements as volatile','READY','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(16,'DM_NUMBER_CTOR','DM_NUMBER_CTOR','findbugs','<p>\n      Using <code>new Integer(int)</code> is guaranteed to always result in a new object whereas\n      <code>Integer.valueOf(int)</code> allows caching of values to be done by the compiler, class library, or JVM.\n      Using of cached values avoids object allocation and the code will be faster.\n      </p>\n      <p>\n      Values between -128 and 127 are guaranteed to have corresponding cached instances\n      and using <code>valueOf</code> is approximately 3.5 times faster than using constructor.\n      For values outside the constant range the performance of both styles is the same.\n      </p>\n      <p>\n      Unless the class must be compatible with JVMs predating Java 1.5,\n      use either autoboxing or the <code>valueOf()</code> method when creating instances of\n      <code>Long</code>, <code>Integer</code>, <code>Short</code>, <code>Character</code>, and <code>Byte</code>.\n      </p>',3,NULL,'Performance - Method invokes inefficient Number constructor; use static valueOf instead','READY','java','2014-11-26 15:18:21','2014-11-26 15:18:21',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(17,'RCN_REDUNDANT_NULLCHECK_OF_NULL_VALUE','RCN_REDUNDANT_NULLCHECK_OF_NULL_VALUE','findbugs','<p> This method contains a redundant check of a known null value against\nthe constant null.</p>',3,NULL,'Dodgy - Redundant nullcheck of value known to be null','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(18,'IJU_TEARDOWN_NO_SUPER','IJU_TEARDOWN_NO_SUPER','findbugs','<p> Class is a JUnit TestCase and implements the tearDown method. The tearDown method should call\nsuper.tearDown(), but doesn\'t.</p>',3,NULL,'Correctness - TestCase defines tearDown that doesn\'t call super.tearDown()','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(19,'DM_BOXED_PRIMITIVE_TOSTRING','DM_BOXED_PRIMITIVE_TOSTRING','findbugs','<p>A boxed primitive is allocated just to call toString(). It is more effective to just use the static\n  form of toString which takes the primitive value. So,</p>\n  <table>\n     <tr><th>Replace...</th><th>With this...</th></tr>\n     <tr><td>new Integer(1).toString()</td><td>Integer.toString(1)</td></tr>\n     <tr><td>new Long(1).toString()</td><td>Long.toString(1)</td></tr>\n     <tr><td>new Float(1.0).toString()</td><td>Float.toString(1.0)</td></tr>\n     <tr><td>new Double(1.0).toString()</td><td>Double.toString(1.0)</td></tr>\n     <tr><td>new Byte(1).toString()</td><td>Byte.toString(1)</td></tr>\n     <tr><td>new Short(1).toString()</td><td>Short.toString(1)</td></tr>\n     <tr><td>new Boolean(true).toString()</td><td>Boolean.toString(true)</td></tr>\n  </table>',2,NULL,'Performance - Method allocates a boxed primitive just to call toString','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,20,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(20,'NM_BAD_EQUAL','NM_BAD_EQUAL','findbugs','<p>\n      This class defines a method <code>equal(Object)</code>.  \n      This method does not override the <code>equals(Object)</code> method \n      in <code>java.lang.Object</code>, which is probably what was intended.\n      </p>',3,NULL,'Class defines equal(Object); should it be equals(Object)?','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(21,'IJU_SUITE_NOT_STATIC','IJU_SUITE_NOT_STATIC','findbugs','<p> Class is a JUnit TestCase and implements the suite() method.\n The suite method should be declared as being static, but isn\'t.</p>',3,NULL,'Correctness - TestCase implements a non-static suite method','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(22,'HE_HASHCODE_USE_OBJECT_EQUALS','HE_HASHCODE_USE_OBJECT_EQUALS','findbugs','<p> This class defines a <code>hashCode()</code> method but inherits its\n  <code>equals()</code> method from <code>java.lang.Object</code>\n  (which defines equality by comparing object references).&nbsp; Although\n  this will probably satisfy the contract that equal objects must have\n  equal hashcodes, it is probably not what was intended by overriding\n  the <code>hashCode()</code> method.&nbsp; (Overriding <code>hashCode()</code>\n  implies that the object\'s identity is based on criteria more complicated\n  than simple reference equality.)</p>\n<p>If you don\'t think instances of this class will ever be inserted into a HashMap/HashTable,\nthe recommended <code>hashCode</code> implementation to use is:</p>\n<p><pre>public int hashCode() {\n  assert false : \"hashCode not designed\";\n  return 42; // any arbitrary constant will do\n  }</pre></p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1206} instead.\n</p>',3,NULL,'Bad practice - Class defines hashCode() and uses Object.equals()','DEPRECATED','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(23,'IM_MULTIPLYING_RESULT_OF_IREM','IM_MULTIPLYING_RESULT_OF_IREM','findbugs','<p>\nThe code multiplies the result of an integer remaining by an integer constant.\nBe sure you don\'t have your operator precedence confused. For example\ni % 60 * 1000 is (i % 60) * 1000, not i % (60 * 1000).\n</p>',3,NULL,'Correctness - Integer multiply of result of integer remainder','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(24,'SR_NOT_CHECKED','SR_NOT_CHECKED','findbugs','<p> This method ignores the return value of\n  <code>java.io.InputStream.skip()</code> which can skip multiple bytes.&nbsp;\n  If the return value is not checked, the caller will not be able to correctly\n  handle the case where fewer bytes were skipped than the caller requested.&nbsp;\n  This is a particularly insidious kind of bug, because in many programs,\n  skips from input streams usually do skip the full amount of data requested,\n  causing the program to fail only sporadically. With Buffered streams, however,\n  skip() will only skip data in the buffer, and will routinely fail to skip the\n  requested number of bytes.</p>',2,NULL,'Bad practice - Method ignores results of InputStream.skip()','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(25,'DB_DUPLICATE_SWITCH_CLAUSES','DB_DUPLICATE_SWITCH_CLAUSES','findbugs','<p>\n      This method uses the same code to implement two clauses of a switch statement.\n	This could be a case of duplicate code, but it might also indicate\n	a coding mistake.\n      </p>',3,NULL,'Dodgy - Method uses the same code for two switch clauses','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(26,'NP_NULL_PARAM_DEREF_NONVIRTUAL','NP_NULL_PARAM_DEREF_NONVIRTUAL','findbugs','<p>\n      A possibly-null value is passed to a nonnull method parameter.\n	Either the parameter is annotated as a parameter that should\n	always be nonnull, or analysis has shown that it will always be \n	dereferenced.\n      </p>',3,NULL,'Correctness - Non-virtual method call passes null for nonnull parameter','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(27,'NP_METHOD_PARAMETER_TIGHTENS_ANNOTATION','NP_METHOD_PARAMETER_TIGHTENS_ANNOTATION','findbugs','<p>\nA method should always implement the contract of a method it overrides. Thus, if a method takes a parameter\nthat is marked as @Nullable, you shouldn\'t override that method in a subclass with a method where that parameter is @Nonnull.\nDoing so violates the contract that the method should handle a null parameter.\n</p>',2,NULL,'Method tightens nullness annotation on parameter','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(28,'RV_RETURN_VALUE_IGNORED','RV_RETURN_VALUE_IGNORED','findbugs','<p> The return value of this method should be checked. One common\ncause of this warning is to invoke a method on an immutable object,\nthinking that it updates the object. For example, in the following code\nfragment,</p>\n<blockquote>\n<pre>\nString dateString = getHeaderField(name);\ndateString.trim();\n</pre>\n</blockquote>\n<p>the programmer seems to be thinking that the trim() method will update\nthe String referenced by dateString. But since Strings are immutable, the trim()\nfunction returns a new String value, which is being ignored here. The code\nshould be corrected to: </p>\n<blockquote>\n<pre>\nString dateString = getHeaderField(name);\ndateString = dateString.trim();\n</pre>\n</blockquote>',1,NULL,'Correctness - Method ignores return value','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(29,'RV_EXCEPTION_NOT_THROWN','RV_EXCEPTION_NOT_THROWN','findbugs','<p> This code creates an exception (or error) object, but doesn\'t do anything with it. For example,\nsomething like </p>\n<blockquote>\n<pre>\nif (x &lt; 0)\n  new IllegalArgumentException(\"x must be nonnegative\");\n</pre>\n</blockquote>\n<p>It was probably the intent of the programmer to throw the created exception:</p>\n<blockquote>\n<pre>\nif (x &lt; 0)\n  throw new IllegalArgumentException(\"x must be nonnegative\");\n</pre>\n</blockquote>',3,NULL,'Correctness - Exception created and dropped rather than thrown','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,30,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(30,'DP_CREATE_CLASSLOADER_INSIDE_DO_PRIVILEGED','DP_CREATE_CLASSLOADER_INSIDE_DO_PRIVILEGED','findbugs','<p> This code creates a classloader,  which requires a security manager.\n  If this code will be granted security permissions, but might be invoked by code that does not\n  have security permissions, then the classloader creation needs to occur inside a doPrivileged block.</p>',2,NULL,'Bad practice - Classloaders should only be created inside doPrivileged block','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,18,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(31,'MS_SHOULD_BE_REFACTORED_TO_BE_FINAL','MS_SHOULD_BE_REFACTORED_TO_BE_FINAL','findbugs','<p>\nThis static field public but not final, and\ncould be changed by malicious code or\nby accident from another package.\nThe field could be made final to avoid\nthis vulnerability. However, the static initializer contains more than one write\nto the field, so doing so will require some refactoring.\n</p>',2,NULL,'Field isn\'t final but should be refactored to be so','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(32,'DM_CONVERT_CASE','DM_CONVERT_CASE','findbugs','<p> A String is being converted to upper or lowercase, using the platform\'s default encoding. This may\n      result in improper conversions when used with international characters. Use the </p>\n      <table><tr><td>String.toUpperCase( Locale l )</td></tr><tr><td>String.toLowerCase( Locale l )</td></tr></table>\n      <p>versions instead.</p>',0,NULL,'Internationalization - Consider using Locale parameterized version of invoked method','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,7,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(33,'INT_VACUOUS_COMPARISON','INT_VACUOUS_COMPARISON','findbugs','<p> There is an integer comparison that always returns\nthe same value (e.g., x &lt;= Integer.MAX_VALUE).\n</p>',3,NULL,'Dodgy - Vacuous comparison of integer value','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5h',NULL,NULL,NULL,0,'HTML'),(34,'MS_FINAL_PKGPROTECT','MS_FINAL_PKGPROTECT','findbugs','<p>\n   A mutable static field could be changed by malicious code or\n        by accident from another package.\n        The field could be made package protected and/or made final\n   to avoid\n        this vulnerability.</p>',2,NULL,'Malicious code vulnerability - Field should be both final and package protected','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,15,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(35,'PZ_DONT_REUSE_ENTRY_OBJECTS_IN_ITERATORS','PZ_DONT_REUSE_ENTRY_OBJECTS_IN_ITERATORS','findbugs','<p>The entrySet() method is allowed to return a view of the underlying Map in which an <code>Iterator</code> \nand <code>Map.Entry</code>. This clever idea was used in several Map implementations, but introduces the possibility of\n nasty coding mistakes. If a map m returns such an iterator for an entrySet, then <code>c.addAll(m.entrySet())</code> will \n go badly wrong. All of the Map implementations in OpenJDK 1.7 have been rewritten to avoid this, you should to.</p>',2,NULL,'Don\'t reuse entry objects in iterators','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(36,'TQ_MAYBE_SOURCE_VALUE_REACHES_ALWAYS_SINK','TQ_MAYBE_SOURCE_VALUE_REACHES_ALWAYS_SINK','findbugs','<p>\n      A value that is annotated as possibility not being an instance of\n	the values denoted by the type qualifier, and the value is guaranteed to be used\n	in a way that requires values denoted by that type qualifier.\n      </p>',3,NULL,'Correctness - Value that might not carry a type qualifier is always used in a way requires that type qualifier','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5h',NULL,NULL,NULL,0,'HTML'),(37,'DMI_RANDOM_USED_ONLY_ONCE','DMI_RANDOM_USED_ONLY_ONCE','findbugs','<p> This code creates a java.util.Random object, uses it to generate one random number, and then discards\nthe Random object. This produces mediocre quality random numbers and is inefficient. \nIf possible, rewrite the code so that the Random object is created once and saved, and each time a new random number\nis required invoke a method on the existing Random object to obtain it.\n</p>\n\n<p>If it is important that the generated Random numbers not be guessable, you <em>must</em> not create a new Random for each random\nnumber; the values are too easily guessable. You should strongly consider using a java.security.SecureRandom instead\n(and avoid allocating a new SecureRandom for each random number needed).\n</p>',3,NULL,'Bad practice - Random object created and used only once','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,18,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(38,'BX_BOXING_IMMEDIATELY_UNBOXED_TO_PERFORM_COERCION','BX_BOXING_IMMEDIATELY_UNBOXED_TO_PERFORM_COERCION','findbugs','<p>A primitive boxed value constructed and then immediately converted into a different primitive type\n(e.g., <code>new Double(d).intValue()</code>). Just perform direct primitive coercion (e.g., <code>(int) d</code>).</p>',2,NULL,'Performance - Primitive value is boxed then unboxed to perform primitive coercion','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(39,'BIT_SIGNED_CHECK_HIGH_BIT','BIT_SIGNED_CHECK_HIGH_BIT','findbugs','<p> This method compares an expression such as\n<pre>((event.detail &amp; SWT.SELECTED) &gt; 0)</pre>.\nUsing bit arithmetic and then comparing with the greater than operator can\nlead to unexpected results (of course depending on the value of\nSWT.SELECTED). If SWT.SELECTED is a negative number, this is a candidate\nfor a bug. Even when SWT.SELECTED is not negative, it seems good practice\nto use \'!= 0\' instead of \'&gt; 0\'.\n</p>\n<p>\n<em>Boris Bokowski</em>\n</p>',3,NULL,'Correctness - Check for sign of bitwise operation','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(40,'RV_CHECK_FOR_POSITIVE_INDEXOF','RV_CHECK_FOR_POSITIVE_INDEXOF','findbugs','<p> The method invokes String.indexOf and checks to see if the result is positive or non-positive.\n   It is much more typical to check to see if the result is negative or non-negative. It is\n   positive only if the substring checked for occurs at some place other than at the beginning of\n   the String.</p>',1,NULL,'Dodgy - Method checks to see if result of String.indexOf is positive','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(41,'DMI_USELESS_SUBSTRING','DMI_USELESS_SUBSTRING','findbugs','<p>\nThis code invokes substring(0) on a String, which returns the original value.\n</p>',3,NULL,'Dodgy - Invocation of substring(0), which returns the original value','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5h',NULL,NULL,NULL,0,'HTML'),(42,'DM_MONITOR_WAIT_ON_CONDITION','DM_MONITOR_WAIT_ON_CONDITION','findbugs','<p>\n      This method calls <code>wait()</code> on a\n      <code>java.util.concurrent.locks.Condition</code> object.&nbsp;\n      Waiting for a <code>Condition</code> should be done using one of the <code>await()</code>\n      methods defined by the <code>Condition</code> interface.\n      </p>',2,NULL,'Multithreaded correctness - Monitor wait() called on Condition','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(43,'NP_LOAD_OF_KNOWN_NULL_VALUE','NP_LOAD_OF_KNOWN_NULL_VALUE','findbugs','<p> The variable referenced at this point is known to be null due to an earlier\n   check against null. Although this is valid, it might be a mistake (perhaps you\nintended to refer to a different variable, or perhaps the earlier check to see if the\nvariable is null should have been a check to see if it was nonnull).\n</p>',3,NULL,'Dodgy - Load of known null value','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(44,'EQ_OVERRIDING_EQUALS_NOT_SYMMETRIC','EQ_OVERRIDING_EQUALS_NOT_SYMMETRIC','findbugs','<p> This class defines an equals method that overrides an equals method in a superclass. Both equals methods\nmethods use <code>instanceof</code> in the determination of whether two objects are equal. This is fraught with peril,\nsince it is important that the equals method is symmetrical (in other words, <code>a.equals(b) == b.equals(a)</code>).\nIf B is a subtype of A, and A\'s equals method checks that the argument is an instanceof A, and B\'s equals method\nchecks that the argument is an instanceof B, it is quite likely that the equivalence relation defined by these\nmethods is not symmetric.\n</p>',2,NULL,'Correctness - equals method overrides equals in superclass and may not be symmetric','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(45,'EC_UNRELATED_INTERFACES','EC_UNRELATED_INTERFACES','findbugs','<p> This method calls equals(Object) on two references of unrelated\ninterface types, where neither is a subtype of the other,\nand there are no known non-abstract classes which implement both interfaces.\nTherefore, the objects being compared\nare unlikely to be members of the same class at runtime\n(unless some application classes were not analyzed, or dynamic class\nloading can occur at runtime).\nAccording to the contract of equals(),\nobjects of different\nclasses should always compare as unequal; therefore, according to the\ncontract defined by java.lang.Object.equals(Object),\nthe result of this comparison will always be false at runtime.\n</p>',3,NULL,'Correctness - Call to equals() comparing different interface types','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(46,'DM_FP_NUMBER_CTOR','DM_FP_NUMBER_CTOR','findbugs','<p>\n      Using <code>new Double(double)</code> is guaranteed to always result in a new object whereas\n      <code>Double.valueOf(double)</code> allows caching of values to be done by the compiler, class library, or JVM.\n      Using of cached values avoids object allocation and the code will be faster.\n      </p>\n      <p>\n      Unless the class must be compatible with JVMs predating Java 1.5,\n      use either autoboxing or the <code>valueOf()</code> method when creating instances of <code>Double</code> and <code>Float</code>.\n      </p>',2,NULL,'Performance - Method invokes inefficient floating-point Number constructor; use static valueOf instead','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(47,'SE_COMPARATOR_SHOULD_BE_SERIALIZABLE','SE_COMPARATOR_SHOULD_BE_SERIALIZABLE','findbugs','<p> This class implements the <code>Comparator</code> interface. You\nshould consider whether or not it should also implement the <code>Serializable</code>\ninterface. If a comparator is used to construct an ordered collection\nsuch as a <code>TreeMap</code>, then the <code>TreeMap</code>\nwill be serializable only if the comparator is also serializable.\nAs most comparators have little or no state, making them serializable\nis generally easy and good defensive programming.\n</p>',2,NULL,'Bad practice - Comparator doesn\'t implement Serializable','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(48,'DE_MIGHT_IGNORE','DE_MIGHT_IGNORE','findbugs','<p> This method might ignore an exception.&nbsp; In general, exceptions\n  should be handled or reported in some way, or they should be thrown\n  out of the method.</p>',2,NULL,'Bad practice - Method might ignore exception','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,30,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(49,'DMI_BAD_MONTH','DMI_BAD_MONTH','findbugs','<p>\nThis code passes a constant month\nvalue outside the expected range of 0..11 to a method.\n</p>',3,NULL,'Correctness - Bad constant value for month','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(50,'FI_MISSING_SUPER_CALL','FI_MISSING_SUPER_CALL','findbugs','<p> This <code>finalize()</code> method does not make a call to its\n  superclass\'s <code>finalize()</code> method.&nbsp; So, any finalizer\n  actions defined for the superclass will not be performed.&nbsp;\n  Add a call to <code>super.finalize()</code>.</p>',2,NULL,'Bad practice - Finalizer does not call superclass finalizer','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(51,'IJU_SETUP_NO_SUPER','IJU_SETUP_NO_SUPER','findbugs','<p> Class is a JUnit TestCase and implements the setUp method. The setUp method should call\nsuper.setUp(), but doesn\'t.</p>',3,NULL,'Correctness - TestCase defines setUp that doesn\'t call super.setUp()','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(52,'CD_CIRCULAR_DEPENDENCY','CD_CIRCULAR_DEPENDENCY','findbugs','<p>\n      This class has a circular dependency with other classes. This makes building these classes\n      difficult, as each is dependent on the other to build correctly. Consider using interfaces\n      to break the hard dependency.\n      </p>',0,NULL,'Experimental - Test for circular dependencies among classes','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,24,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'3h',NULL,NULL,NULL,0,'HTML'),(53,'SQL_BAD_PREPARED_STATEMENT_ACCESS','SQL_BAD_PREPARED_STATEMENT_ACCESS','findbugs','<p> A call to a setXXX method of a prepared statement was made where the\nparameter index is 0. As parameter indexes start at index 1, this is always a mistake.</p>',3,NULL,'Correctness - Method attempts to access a prepared statement parameter with index 0','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(54,'EQ_UNUSUAL','EQ_UNUSUAL','findbugs','<p> This class doesn\'t do any of the patterns we recognize for checking that the type of the argument \nis compatible with the type of the <code>this</code> object. There might not be anything wrong with\nthis code, but it is worth reviewing.\n</p>',1,NULL,'Dodgy - Unusual equals method','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5h',NULL,NULL,NULL,0,'HTML'),(55,'SE_TRANSIENT_FIELD_OF_NONSERIALIZABLE_CLASS','SE_TRANSIENT_FIELD_OF_NONSERIALIZABLE_CLASS','findbugs','<p> The field is marked as transient, but the class isn\'t Serializable, so marking it as transient\nhas absolutely no effect. \nThis may be leftover marking from a previous version of the code in which the class was transient, or\nit may indicate a misunderstanding of how serialization works.\n</p>',2,NULL,'Dodgy - Transient field of class that isn\'t Serializable.','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(56,'HE_USE_OF_UNHASHABLE_CLASS','HE_USE_OF_UNHASHABLE_CLASS','findbugs','<p> A class defines an equals(Object)  method but not a hashCode() method,\nand thus doesn\'t fulfill the requirement that equal objects have equal hashCodes.\nAn instance of this class is used in a hash data structure, making the need to\nfix this problem of highest importance.',3,NULL,'Correctness - Use of class without a hashCode() method in a hashed data structure','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(57,'TQ_EXPLICIT_UNKNOWN_SOURCE_VALUE_REACHES_ALWAYS_SINK','TQ_EXPLICIT_UNKNOWN_SOURCE_VALUE_REACHES_ALWAYS_SINK','findbugs','<p>\n      A value is used in a way that requires it to be always be a value denoted by a type qualifier, but\n	there is an explicit annotation stating that it is not known where the value is required to have that type qualifier.\n	Either the usage or the annotation is incorrect.\n      </p>',3,NULL,'Correctness - Value required to have type qualifier, but marked as unknown','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(58,'INT_BAD_COMPARISON_WITH_INT_VALUE','INT_BAD_COMPARISON_WITH_INT_VALUE','findbugs','<p>This code compares an int value with a long constant that is outside the range of values that can\n be represented as an int value. This comparison is vacuous and possibily to be incorrect.</p>',2,NULL,'Bad comparison of int value with long constant','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(59,'JCIP_FIELD_ISNT_FINAL_IN_IMMUTABLE_CLASS','JCIP_FIELD_ISNT_FINAL_IN_IMMUTABLE_CLASS','findbugs','<p> The class is annotated with net.jcip.annotations.Immutable, and the rules for that annotation require\nthat all fields are final.\n   .</p>',1,NULL,'Bad practice - Fields of immutable classes should be final','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,24,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(60,'EQ_SELF_USE_OBJECT','EQ_SELF_USE_OBJECT','findbugs','<p> This class defines a covariant version of the <code>equals()</code>\n  method, but inherits the normal <code>equals(Object)</code> method\n  defined in the base <code>java.lang.Object</code> class.&nbsp;\n  The class should probably define a <code>boolean equals(Object)</code> method.\n  </p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1201} instead.\n</p>',2,NULL,'Correctness - Covariant equals() method defined, Object.equals(Object) inherited','DEPRECATED','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(61,'RCN_REDUNDANT_NULLCHECK_OF_NONNULL_VALUE','RCN_REDUNDANT_NULLCHECK_OF_NONNULL_VALUE','findbugs','<p> This method contains a redundant check of a known non-null value against\nthe constant null.</p>',3,NULL,'Dodgy - Redundant nullcheck of value known to be non-null','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(62,'BC_IMPOSSIBLE_INSTANCEOF','BC_IMPOSSIBLE_INSTANCEOF','findbugs','<p>\nThis instanceof test will always return false. Although this is safe, make sure it isn\'t\nan indication of some misunderstanding or some other logic error.\n</p>',3,NULL,'Correctness - instanceof will always return false','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(63,'SE_NONFINAL_SERIALVERSIONID','SE_NONFINAL_SERIALVERSIONID','findbugs','<p> This class defines a <code>serialVersionUID</code> field that is not final.&nbsp;\n  The field should be made final\n   if it is intended to specify\n   the version UID for purposes of serialization.</p>',3,NULL,'Bad practice - serialVersionUID isn\'t final','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(64,'EI_EXPOSE_REP2','EI_EXPOSE_REP2','findbugs','<p> This code stores a reference to an externally mutable object into the\n  internal representation of the object.&nbsp;\n   If instances\n   are accessed by untrusted code, and unchecked changes to\n   the mutable object would compromise security or other\n   important properties, you will need to do something different.\n  Storing a copy of the object is better approach in many situations.</p>',2,NULL,'Malicious code vulnerability - May expose internal representation by incorporating reference to mutable object','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,17,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(65,'RV_REM_OF_RANDOM_INT','RV_REM_OF_RANDOM_INT','findbugs','<p> This code generates a random signed integer and then computes\nthe remainder of that value modulo another value. Since the random\nnumber can be negative, the result of the remainder operation\ncan also be negative. Be sure this is intended, and strongly\nconsider using the Random.nextInt(int) method instead.\n</p>',3,NULL,'Dodgy - Remainder of 32-bit signed random integer','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5h',NULL,NULL,NULL,0,'HTML'),(66,'AM_CREATES_EMPTY_JAR_FILE_ENTRY','AM_CREATES_EMPTY_JAR_FILE_ENTRY','findbugs','<p>The code calls <code>putNextEntry()</code>, immediately\nfollowed by a call to <code>closeEntry()</code>. This results\nin an empty JarFile entry. The contents of the entry\nshould be written to the JarFile between the calls to\n<code>putNextEntry()</code> and\n<code>closeEntry()</code>.</p>',2,NULL,'Bad practice - Creates an empty jar file entry','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(67,'NP_NULL_PARAM_DEREF','NP_NULL_PARAM_DEREF','findbugs','<p>\n      This method call passes a null value for a nonnull method parameter.\n	Either the parameter is annotated as a parameter that should\n	always be nonnull, or analysis has shown that it will always be \n	dereferenced.\n      </p>',3,NULL,'Correctness - Method call passes null for nonnull parameter','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(68,'RV_RETURN_VALUE_IGNORED_INFERRED','RV_RETURN_VALUE_IGNORED_INFERRED','findbugs','<p>This code calls a method and ignores the return value. The return value is the same type as the type the \nmethod is invoked on, and from our analysis it looks like the return value might be important (e.g., like \nignoring the return value of <code>String.toLowerCase()</code>).\n</p>\n<p>We are guessing that ignoring the return value might be a bad idea just from a simple analysis of the \nbody of the method. You can use a <code>@CheckReturnValue</code> annotation to instruct FindBugs as to whether \nignoring the return value of this method is important or acceptable.<p>\n<p>Please investigate this closely to decide whether it is OK to ignore the return value. </p>',1,NULL,'Method ignores return value, is this OK?','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(69,'DM_STRING_CTOR','DM_STRING_CTOR','findbugs','<p> Using the <code>java.lang.String(String)</code> constructor wastes memory\n  because the object so constructed will be functionally indistinguishable\n  from the <code>String</code> passed as a parameter.&nbsp; Just use the\n  argument <code>String</code> directly.</p>',2,NULL,'Performance - Method invokes inefficient new String(String) constructor','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(70,'SE_NO_SERIALVERSIONID','SE_NO_SERIALVERSIONID','findbugs','<p> This class implements the <code>Serializable</code> interface, but does\n  not define a <code>serialVersionUID</code> field.&nbsp;\n  A change as simple as adding a reference to a .class object\n    will add synthetic fields to the class,\n   which will unfortunately change the implicit\n   serialVersionUID (e.g., adding a reference to <code>String.class</code>\n   will generate a static field <code>class$java$lang$String</code>).\n   Also, different source code to bytecode compilers may use different\n   naming conventions for synthetic variables generated for\n   references to class objects or inner classes.\n   To ensure interoperability of Serializable across versions,\n   consider adding an explicit serialVersionUID.</p>',2,NULL,'Bad practice - Class is Serializable, but doesn\'t define serialVersionUID','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,5,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(71,'SE_BAD_FIELD_STORE','SE_BAD_FIELD_STORE','findbugs','<p> A non-serializable value is stored into a non-transient field\nof a serializable class.</p>',3,NULL,'Bad practice - Non-serializable value stored into instance field of a serializable class','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(72,'SE_NO_SUITABLE_CONSTRUCTOR_FOR_EXTERNALIZATION','SE_NO_SUITABLE_CONSTRUCTOR_FOR_EXTERNALIZATION','findbugs','<p> This class implements the <code>Externalizable</code> interface, but does\n  not define a void constructor. When Externalizable objects are deserialized,\n   they first need to be constructed by invoking the void\n   constructor. Since this class does not have one,\n   serialization and deserialization will fail at runtime.</p>',2,NULL,'Bad practice - Class is Externalizable but doesn\'t define a void constructor','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(73,'EC_UNRELATED_TYPES_USING_POINTER_EQUALITY','EC_UNRELATED_TYPES_USING_POINTER_EQUALITY','findbugs','<p> This method uses using pointer equality to compare two references that seem to be of\ndifferent types.  The result of this comparison will always be false at runtime.\n</p>',3,NULL,'Correctness - Using pointer equality to compare different types','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(74,'RU_INVOKE_RUN','RU_INVOKE_RUN','findbugs','<p> This method explicitly invokes <code>run()</code> on an object.&nbsp;\n  In general, classes implement the <code>Runnable</code> interface because\n  they are going to have their <code>run()</code> method invoked in a new thread,\n  in which case <code>Thread.start()</code> is the right method to call.</p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1217} instead.\n</p>',2,NULL,'Multithreaded correctness - Invokes run on a thread (did you mean to start it instead?)','DEPRECATED','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(75,'UUF_UNUSED_PUBLIC_OR_PROTECTED_FIELD','UUF_UNUSED_PUBLIC_OR_PROTECTED_FIELD','findbugs','<p>This field is never used.  The field is public or protected, so perhaps it is intended to be used \nwith classes not seen as part of the analysis. If not, consider removing it from the class.</p>',0,NULL,'Unused public or protected field','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(76,'SQL_BAD_RESULTSET_ACCESS','SQL_BAD_RESULTSET_ACCESS','findbugs','<p> A call to getXXX or updateXXX methods of a result set was made where the\nfield index is 0. As ResultSet fields start at index 1, this is always a mistake.</p>',3,NULL,'Correctness - Method attempts to access a result set field with index 0','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(77,'BX_BOXING_IMMEDIATELY_UNBOXED','BX_BOXING_IMMEDIATELY_UNBOXED','findbugs','<p>A primitive is boxed, and then immediately unboxed. This probably is due to a manual\n	boxing in a place where an unboxed value is required, thus forcing the compiler\nto immediately undo the work of the boxing.\n</p>',2,NULL,'Performance - Primitive value is boxed and then immediately unboxed','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(78,'IJU_ASSERT_METHOD_INVOKED_FROM_RUN_METHOD','IJU_ASSERT_METHOD_INVOKED_FROM_RUN_METHOD','findbugs','<p> A JUnit assertion is performed in a run method. Failed JUnit assertions\njust result in exceptions being thrown.\nThus, if this exception occurs in a thread other than the thread that invokes\nthe test method, the exception will terminate the thread but not result\nin the test failing.\n</p>',3,NULL,'Correctness - JUnit assertion in run method will not be noticed by JUnit','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(79,'VA_FORMAT_STRING_BAD_CONVERSION_FROM_ARRAY','VA_FORMAT_STRING_BAD_CONVERSION_FROM_ARRAY','findbugs','<p>\nOne of the arguments being formatted with a format string is an array. This will be formatted\nusing a fairly useless format, such as [I@304282, which doesn\'t actually show the contents\nof the array.\nConsider wrapping the array using <code>Arrays.asList(...)</code> before handling it off to a formatted.\n</p>',2,NULL,'Correctness - Array formatted in useless way using format string','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(80,'UI_INHERITANCE_UNSAFE_GETRESOURCE','UI_INHERITANCE_UNSAFE_GETRESOURCE','findbugs','<p>Calling <code>this.getClass().getResource(...)</code> could give\nresults other than expected if this class is extended by a class in\nanother package.</p>',2,NULL,'Bad practice - Usage of GetResource may be unsafe if class is extended','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(81,'SI_INSTANCE_BEFORE_FINALS_ASSIGNED','SI_INSTANCE_BEFORE_FINALS_ASSIGNED','findbugs','<p> The class\'s static initializer creates an instance of the class\nbefore all of the static final fields are assigned.</p>',3,NULL,'Bad practice - Static initializer creates instance before all static final fields assigned','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(82,'RpC_REPEATED_CONDITIONAL_TEST','RpC_REPEATED_CONDITIONAL_TEST','findbugs','<p>The code contains a conditional test is performed twice, one right after the other\n(e.g., <code>x == 0 || x == 0</code>). Perhaps the second occurrence is intended to be something else\n(e.g., <code>x == 0 || y == 0</code>). \n</p>',2,NULL,'Correctness - Repeated conditional tests','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(83,'NP_SYNC_AND_NULL_CHECK_FIELD','NP_SYNC_AND_NULL_CHECK_FIELD','findbugs','<p>Since the field is synchronized on, it seems not likely to be null.\nIf it is null and then synchronized on a NullPointerException will be\nthrown and the check would be pointless. Better to synchronize on \nanother field.</p>',2,NULL,'Multithreaded correctness - Synchronize and null check on the same field.','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(84,'DLS_DEAD_LOCAL_STORE_IN_RETURN','DLS_DEAD_LOCAL_STORE_IN_RETURN','findbugs','<p>\nThis statement assigns to a local variable in a return statement. This assignment \nhas effect. Please verify that this statement does the right thing.\n</p>',3,NULL,'Correctness - Useless assignment in return statement','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(85,'HE_INHERITS_EQUALS_USE_HASHCODE','HE_INHERITS_EQUALS_USE_HASHCODE','findbugs','<p> This class inherits <code>equals(Object)</code> from an abstract\n  superclass, and <code>hashCode()</code> from\n<code>java.lang.Object</code> (which returns\n  the identity hash code, an arbitrary value assigned to the object\n  by the VM).&nbsp; Therefore, the class is very likely to violate the\n  invariant that equal objects must have equal hashcodes.</p>\n\n  <p>If you don\'t want to define a hashCode method, and/or don\'t\n   believe the object will ever be put into a HashMap/Hashtable,\n   define the <code>hashCode()</code> method\n   to throw <code>UnsupportedOperationException</code>.</p>',3,NULL,'Bad practice - Class inherits equals() and uses Object.hashCode()','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(86,'RE_CANT_USE_FILE_SEPARATOR_AS_REGULAR_EXPRESSION','RE_CANT_USE_FILE_SEPARATOR_AS_REGULAR_EXPRESSION','findbugs','<p>\nThe code here uses <code>File.separator</code> \nwhere a regular expression is required. This will fail on Windows\nplatforms, where the <code>File.separator</code> is a backslash, which is interpreted in a\nregular expression as an escape character. Amoung other options, you can just use\n<code>File.separatorChar==\'\\\\\' &amp; \"\\\\\\\\\" : File.separator</code> instead of\n<code>File.separator</code>\n\n</p>',3,NULL,'Correctness - File.separator used for regular expression','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,8,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(87,'WA_NOT_IN_LOOP','WA_NOT_IN_LOOP','findbugs','<p> This method contains a call to <code>java.lang.Object.wait()</code>\n  which is not in a loop.&nbsp; If the monitor is used for multiple conditions,\n  the condition the caller intended to wait for might not be the one\n  that actually occurred.</p>',3,NULL,'Multithreaded correctness - Wait not in loop','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(88,'OS_OPEN_STREAM_EXCEPTION_PATH','OS_OPEN_STREAM_EXCEPTION_PATH','findbugs','<p> The method creates an IO stream object, does not assign it to any\nfields, pass it to other methods, or return it, and does not appear to close\nit on all possible exception paths out of the method.&nbsp;\nThis may result in a file descriptor leak.&nbsp; It is generally a good\nidea to use a <code>finally</code> block to ensure that streams are\nclosed.</p>',3,NULL,'Bad practice - Method may fail to close stream on exception','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,30,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(89,'DMI_ANNOTATION_IS_NOT_VISIBLE_TO_REFLECTION','DMI_ANNOTATION_IS_NOT_VISIBLE_TO_REFLECTION','findbugs','<p> Unless an annotation has itself been annotated with  @Retention(RetentionPolicy.RUNTIME), the annotation can\'t be observed using reflection\n(e.g., by using the isAnnotationPresent method).\n   .</p>',2,NULL,'Correctness - Can\'t use reflection to check for presence of annotation without runtime retention','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(90,'NP_METHOD_RETURN_RELAXING_ANNOTATION','NP_METHOD_RETURN_RELAXING_ANNOTATION','findbugs','<p>\nA method should always implement the contract of a method it overrides. Thus, if a method takes is annotated\nas returning a @Nonnull value,\nyou shouldn\'t override that method in a subclass with a method annotated as returning a @Nullable or @CheckForNull value.\nDoing so violates the contract that the method shouldn\'t return null.\n</p>',2,NULL,'Method relaxes nullness annotation on return value','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(91,'NP_ALWAYS_NULL','NP_ALWAYS_NULL','findbugs','<p> A null pointer is dereferenced here.&nbsp; This will lead to a\n<code>NullPointerException</code> when the code is executed.</p>',3,NULL,'Correctness - Null pointer dereference','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(92,'STCAL_STATIC_CALENDAR_INSTANCE','STCAL_STATIC_CALENDAR_INSTANCE','findbugs','<p>Even though the JavaDoc does not contain a hint about it, Calendars are inherently unsafe for multihtreaded use. \nSharing a single instance across thread boundaries without proper synchronization will result in erratic behavior of the\napplication. Under 1.4 problems seem to surface less often than under Java 5 where you will probably see\nrandom ArrayIndexOutOfBoundsExceptions or IndexOutOfBoundsExceptions in sun.util.calendar.BaseCalendar.getCalendarDateFromFixedDate().</p>\n<p>You may also experience serialization problems.</p>\n<p>Using an instance field is recommended.</p>\n<p>For more information on this see <a href=\"http://bugs.sun.com/bugdatabase/view_bug.do?bug_id=6231579\">Sun Bug #6231579</a>\nand <a href=\"http://bugs.sun.com/bugdatabase/view_bug.do?bug_id=6178997\">Sun Bug #6178997</a>.</p>',3,NULL,'Multithreaded correctness - Static Calendar','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(93,'UUF_UNUSED_FIELD','UUF_UNUSED_FIELD','findbugs','<p> This field is never used.&nbsp; Consider removing it from the class.</p>',2,NULL,'Performance - Unused field','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(94,'NP_GUARANTEED_DEREF_ON_EXCEPTION_PATH','NP_GUARANTEED_DEREF_ON_EXCEPTION_PATH','findbugs','<p>\n			  There is a statement or branch on an exception path\n				that if executed guarantees that\n			  a value is null at this point, and that \n			  value that is guaranteed to be dereferenced\n			  (except on forward paths involving runtime exceptions).\n			  </p>',3,NULL,'Correctness - Value is null and guaranteed to be dereferenced on exception path','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(95,'IS_FIELD_NOT_GUARDED','IS_FIELD_NOT_GUARDED','findbugs','<p> This field is annotated with net.jcip.annotations.GuardedBy, \nbut can be accessed in a way that seems to violate the annotation.</p>',3,NULL,'Multithreaded correctness - Field not guarded against concurrent access','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(96,'HE_EQUALS_NO_HASHCODE','HE_EQUALS_NO_HASHCODE','findbugs','<p> This class overrides <code>equals(Object)</code>, but does not\n  override <code>hashCode()</code>.&nbsp; Therefore, the class may violate the\n  invariant that equal objects must have equal hashcodes.</p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1206} instead.\n</p>',2,NULL,'Bad practice - Class defines equals() but not hashCode()','DEPRECATED','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(97,'NP_CLONE_COULD_RETURN_NULL','NP_CLONE_COULD_RETURN_NULL','findbugs','<p>\n	This clone method seems to return null in some circumstances, but clone is never\n	allowed to return a null value.  If you are convinced this path is unreachable, throw an AssertionError\n	instead.\n      </p>',3,NULL,'Bad practice - Clone method may return null','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(98,'INT_BAD_COMPARISON_WITH_SIGNED_BYTE','INT_BAD_COMPARISON_WITH_SIGNED_BYTE','findbugs','<p> Signed bytes can only have a value in the range -128 to 127. Comparing\na signed byte with a value outside that range is vacuous and likely to be incorrect.\nTo convert a signed byte <code>b</code> to an unsigned value in the range 0..255,\nuse <code>0xff &amp; b</code>\n</p>',3,NULL,'Correctness - Bad comparison of signed byte','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(99,'NM_WRONG_PACKAGE','NM_WRONG_PACKAGE','findbugs','<p> The method in the subclass doesn\'t override a similar method in a superclass because the type of a parameter doesn\'t exactly match\nthe type of the corresponding parameter in the superclass. For example, if you have:</p>\n\n<blockquote>\n<pre>\nimport alpha.Foo;\npublic class A {\n  public int f(Foo x) { return 17; }\n}\n----\nimport beta.Foo;\npublic class B extends A {\n  public int f(Foo x) { return 42; }\n}\n</pre>\n</blockquote>\n\n<p>The <code>f(Foo)</code> method defined in class <code>B</code> doesn\'t\noverride the \n<code>f(Foo)</code> method defined in class <code>A</code>, because the argument\ntypes are <code>Foo</code>\'s from different packages.\n</p>',2,NULL,'Correctness - Method doesn\'t override method in superclass due to wrong package for parameter','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(100,'UCF_USELESS_CONTROL_FLOW','UCF_USELESS_CONTROL_FLOW','findbugs','<p> This method contains a useless control flow statement, where\ncontrol flow continues onto the same place regardless of whether or not\nthe branch is taken. For example,\nthis is caused by having an empty statement\nblock for an <code>if</code> statement:</p>\n<pre>\n    if (argv.length == 0) {\n	// TODO: handle this case\n	}\n</pre>',3,NULL,'Dodgy - Useless control flow','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5h',NULL,NULL,NULL,0,'HTML'),(101,'DMI_USING_REMOVEALL_TO_CLEAR_COLLECTION','DMI_USING_REMOVEALL_TO_CLEAR_COLLECTION','findbugs','<p> If you want to remove all elements from a collection <code>c</code>, use <code>c.clear</code>,\nnot <code>c.removeAll(c)</code>.\n	</p>',3,NULL,'Correctness - Don\'t use removeAll to clear a collection','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(102,'NP_EQUALS_SHOULD_HANDLE_NULL_ARGUMENT','NP_EQUALS_SHOULD_HANDLE_NULL_ARGUMENT','findbugs','<p>\n      This implementation of equals(Object) violates the contract defined\n      by java.lang.Object.equals() because it does not check for null\n      being passed as the argument.  All equals() methods should return\n      false if passed a null value.\n      </p>',3,NULL,'Bad practice - equals() method does not check for null argument','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(103,'SQL_PREPARED_STATEMENT_GENERATED_FROM_NONCONSTANT_STRING','SQL_PREPARED_STATEMENT_GENERATED_FROM_NONCONSTANT_STRING','findbugs','<p>The code creates an SQL prepared statement from a nonconstant String.\nIf unchecked, tainted data from a user is used in building this String, SQL injection could\nbe used to make the prepared statement do something unexpected and undesirable.\n</p>',3,NULL,'Security - A prepared statement is generated from a nonconstant String','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,17,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(104,'ICAST_BAD_SHIFT_AMOUNT','ICAST_BAD_SHIFT_AMOUNT','findbugs','<p>\nThe code performs an integer shift by a constant amount outside\nthe range 0..31.\nThe effect of this is to use the lower 5 bits of the integer\nvalue to decide how much to shift by. This probably isn\'t want was expected,\nand it at least confusing.\n</p>',3,NULL,'Correctness - Integer shift by an amount not in the range 0..31','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(105,'ICAST_IDIV_CAST_TO_DOUBLE','ICAST_IDIV_CAST_TO_DOUBLE','findbugs','<p>\nThis code casts the result of an integer division operation to double or \nfloat.\nDoing division on integers truncates the result\nto the integer value closest to zero.  The fact that the result\nwas cast to double suggests that this precision should have been retained.\nWhat was probably meant was to cast one or both of the operands to\ndouble <em>before</em> performing the division.  Here is an example:\n</p>\n<blockquote>\n<pre>\nint x = 2;\nint y = 5;\n// Wrong: yields result 0.0\ndouble value1 =  x / y;\n\n// Right: yields result 0.4\ndouble value2 =  x / (double) y;\n</pre>\n</blockquote>',3,NULL,'Dodgy - int division result cast to double or float','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(106,'SE_READ_RESOLVE_MUST_RETURN_OBJECT','SE_READ_RESOLVE_MUST_RETURN_OBJECT','findbugs','<p> In order for the readResolve method to be recognized by the serialization\nmechanism, it must be declared to have a return type of Object.\n</p>',2,NULL,'Bad practice - The readResolve method must be declared with a return type of Object.','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(107,'BOA_BADLY_OVERRIDDEN_ADAPTER','BOA_BADLY_OVERRIDDEN_ADAPTER','findbugs','<p> This method overrides a method found in a parent class, where that class is an Adapter that implements\na listener defined in the java.awt.event or javax.swing.event package. As a result, this method will not\nget called when the event occurs.</p>',3,NULL,'Correctness - Class overrides a method implemented in super class Adapter wrongly','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(108,'SIO_SUPERFLUOUS_INSTANCEOF','SIO_SUPERFLUOUS_INSTANCEOF','findbugs','<p> Type check performed using the instanceof operator where it can be statically determined whether the object\nis of the type requested. </p>',3,NULL,'Correctness - Unnecessary type check done using instanceof operator','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(109,'USM_USELESS_SUBCLASS_METHOD','USM_USELESS_SUBCLASS_METHOD','findbugs','<p>\n      This derived method merely calls the same superclass method passing in the exact parameters\n      received. This method can be removed, as it provides no additional value.\n      </p>',0,NULL,'Experimental - Method superfluously delegates to parent class method','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(110,'WMI_WRONG_MAP_ITERATOR','WMI_WRONG_MAP_ITERATOR','findbugs','<p> This method accesses the value of a Map entry, using a key that was retrieved from\na keySet iterator. It is more efficient to use an iterator on the entrySet of the map, to avoid the\nMap.get(key) lookup.</p>',3,NULL,'Performance - Inefficient use of keySet iterator instead of entrySet iterator','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(111,'UCF_USELESS_CONTROL_FLOW_NEXT_LINE','UCF_USELESS_CONTROL_FLOW_NEXT_LINE','findbugs','<p> This method contains a useless control flow statement in which control\nflow follows to the same or following line regardless of whether or not\nthe branch is taken.\nOften, this is caused by inadvertently using an empty statement as the\nbody of an <code>if</code> statement, e.g.:</p>\n<pre>\n    if (argv.length == 1);\n        System.out.println(\"Hello, \" + argv[0]);\n</pre>',3,NULL,'Correctness - Useless control flow to next line','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(112,'EI_EXPOSE_STATIC_REP2','EI_EXPOSE_STATIC_REP2','findbugs','<p> This code stores a reference to an externally mutable object into a static\n   field.\n   If unchecked changes to\n   the mutable object would compromise security or other\n   important properties, you will need to do something different.\n  Storing a copy of the object is better approach in many situations.</p>',2,NULL,'Malicious code vulnerability - May expose internal static state by storing a mutable object into a static field','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,17,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(113,'NP_GUARANTEED_DEREF','NP_GUARANTEED_DEREF','findbugs','<p>\n			  There is a statement or branch that if executed guarantees that\n			  a value is null at this point, and that \n			  value that is guaranteed to be dereferenced\n			  (except on forward paths involving runtime exceptions).\n			  </p>',4,NULL,'Correctness - Null value is guaranteed to be dereferenced','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(114,'WA_AWAIT_NOT_IN_LOOP','WA_AWAIT_NOT_IN_LOOP','findbugs','<p> This method contains a call to <code>java.util.concurrent.await()</code>\n   (or variants)\n  which is not in a loop.&nbsp; If the object is used for multiple conditions,\n  the condition the caller intended to wait for might not be the one\n  that actually occurred.</p>',3,NULL,'Multithreaded correctness - Condition.await() not in loop','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(115,'NM_FUTURE_KEYWORD_USED_AS_MEMBER_IDENTIFIER','NM_FUTURE_KEYWORD_USED_AS_MEMBER_IDENTIFIER','findbugs','<p>This identifier is used as a keyword in later versions of Java. This code, and \nany code that references this API, \nwill need to be changed in order to compile it in later versions of Java.</p>',2,NULL,'Bad practice - Use of member identifier that is a keyword in later versions of Java','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,5,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(116,'SC_START_IN_CTOR','SC_START_IN_CTOR','findbugs','<p> The constructor starts a thread. This is likely to be wrong if\n   the class is ever extended/subclassed, since the thread will be started\n   before the subclass constructor is started.</p>',3,NULL,'Multithreaded correctness - Constructor invokes Thread.start()','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(117,'PZLA_PREFER_ZERO_LENGTH_ARRAYS','PZLA_PREFER_ZERO_LENGTH_ARRAYS','findbugs','<p> It is often a better design to\nreturn a length zero array rather than a null reference to indicate that there\nare no results (i.e., an empty list of results).\nThis way, no explicit check for null is needed by clients of the method.</p>\n\n<p>On the other hand, using null to indicate\n\"there is no answer to this question\" is probably appropriate.\nFor example, <code>File.listFiles()</code> returns an empty list\nif given a directory containing no files, and returns null if the file\nis not a directory.</p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1168} instead.\n</p>',2,NULL,'Dodgy - Consider returning a zero length array rather than null','DEPRECATED','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(118,'DMI_INVOKING_HASHCODE_ON_ARRAY','DMI_INVOKING_HASHCODE_ON_ARRAY','findbugs','<p>\nThe code invokes hashCode on an array. Calling hashCode on\nan array returns the same value as System.identityHashCode, and ingores\nthe contents and length of the array. If you need a hashCode that\ndepends on the contents of an array <code>a</code>, \nuse <code>java.util.Arrays.hashCode(a)</code>.\n\n</p>',3,NULL,'Correctness - Invocation of hashCode on an array','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(119,'UR_UNINIT_READ_CALLED_FROM_SUPER_CONSTRUCTOR','UR_UNINIT_READ_CALLED_FROM_SUPER_CONSTRUCTOR','findbugs','<p>This method is invoked in the constructor of of the superclass. At this point, the fields of the class have not yet initialized. To make this more concrete, consider the following classes:</p>\n<pre>\n  abstract class A {\n    int hashCode;\n    abstract Object getValue();\n    A() {\n      hashCode = getValue().hashCode();\n    }\n  }\n  class B extends A {\n    Object value;\n    B(Object v) {\n      this.value = v;\n    }\n    Object getValue() {\n      return value;\n    }\n  }\n</pre>\n<p>When a B is constructed, the constructor for the A class is invoked before the constructor for B sets value. Thus, when the constructor for A invokes getValue, an uninitialized value is read for value.</p>',2,NULL,'Correctness - Uninitialized read of field method called from constructor of superclass','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(120,'SA_LOCAL_SELF_COMPUTATION','SA_LOCAL_SELF_COMPUTATION','findbugs','<p> This method performs a nonsensical computation of a local variable with another\nreference to the same variable (e.g., x&x or x-x). Because of the nature\nof the computation, this operation doesn\'t seem to make sense,\nand may indicate a typo or\na logic error.  Double check the computation.\n</p>',3,NULL,'Correctness - Nonsensical self computation involving a variable (e.g., x & x)','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(121,'VA_FORMAT_STRING_ILLEGAL','VA_FORMAT_STRING_ILLEGAL','findbugs','<p>\nThe format string is syntactically invalid, \nand a runtime exception will occur when \nthis statement is executed.\n</p>',3,NULL,'Correctness - Illegal format string','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(122,'NP_NULL_PARAM_DEREF_ALL_TARGETS_DANGEROUS','NP_NULL_PARAM_DEREF_ALL_TARGETS_DANGEROUS','findbugs','<p>\n      A possibly-null value is passed at a call site where all known\n      target methods require the parameter to be nonnull.\n	Either the parameter is annotated as a parameter that should\n	always be nonnull, or analysis has shown that it will always be \n	dereferenced.\n      </p>',3,NULL,'Correctness - Method call passes null for nonnull parameter (ALL_TARGETS_DANGEROUS)','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(123,'FB_MISSING_EXPECTED_WARNING','FB_MISSING_EXPECTED_WARNING','findbugs','<p>\n      FindBugs didn\'t generate generated a warning that, according to a @ExpectedWarning annotated,\n      is expected or desired\n      </p>',0,NULL,'Experimental - Missing expected or desired warning from FindBugs','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(124,'SE_READ_RESOLVE_IS_STATIC','SE_READ_RESOLVE_IS_STATIC','findbugs','<p> In order for the readResolve method to be recognized by the serialization\nmechanism, it must not be declared as a static method.\n</p>',2,NULL,'Correctness - The readResolve method must not be declared as a static method.','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(125,'RI_REDUNDANT_INTERFACES','RI_REDUNDANT_INTERFACES','findbugs','<p>\n    This class declares that it implements an interface that is also implemented by a superclass.\n    This is redundant because once a superclass implements an interface, all subclasses by default also\n    implement this interface. It may point out that the inheritance hierarchy has changed since\n    this class was created, and consideration should be given to the ownership of\n    the interface\'s implementation.\n    </p>',2,NULL,'Dodgy - Class implements same interface as superclass','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(126,'MTIA_SUSPECT_SERVLET_INSTANCE_FIELD','MTIA_SUSPECT_SERVLET_INSTANCE_FIELD','findbugs','<p>\n    This class extends from a Servlet class, and uses an instance member variable. Since only\n    one instance of a Servlet class is created by the J2EE framework, and used in a\n    multithreaded way, this paradigm is highly discouraged and most likely problematic. Consider\n    only using method local variables.\n    </p>',3,NULL,'Dodgy - Class extends Servlet class and uses instance variables','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(127,'FI_FINALIZER_ONLY_NULLS_FIELDS','FI_FINALIZER_ONLY_NULLS_FIELDS','findbugs','<p> This finalizer does nothing except null out fields. This is completely pointless, and requires that\nthe object be garbage collected, finalized, and then garbage collected again. You should just remove the finalize\nmethod.',2,NULL,'Bad practice - Finalizer only nulls fields','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(128,'VA_FORMAT_STRING_NO_PREVIOUS_ARGUMENT','VA_FORMAT_STRING_NO_PREVIOUS_ARGUMENT','findbugs','<p>\nThe format string specifies a relative index to request that the argument for the previous format specifier\nbe reused. However, there is no previous argument.\nFor example, \n</p>\n<p><code>formatter.format(\"%&lt;s %s\", \"a\", \"b\")</code>\n</p>\n<p>would throw a MissingFormatArgumentException when executed.\n</p>',3,NULL,'Correctness - No previous argument for format string','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(129,'OBL_UNSATISFIED_OBLIGATION','OBL_UNSATISFIED_OBLIGATION','findbugs','<p>\n      This method may fail to clean up (close, dispose of) a stream,\n      database object, or other\n      resource requiring an explicit cleanup operation.\n      </p>\n      <p>\n      In general, if a method opens a stream or other resource,\n      the method should use a try/finally block to ensure that\n      the stream or resource is cleaned up before the method\n      returns.\n      </p>\n      <p>\n      This bug pattern is essentially the same as the\n      OS_OPEN_STREAM and ODR_OPEN_DATABASE_RESOURCE\n      bug patterns, but is based on a different\n      (and hopefully better) static analysis technique.\n      We are interested is getting feedback about the\n      usefulness of this bug pattern.\n      To send feedback, either:\n      </p>\n      <ul>\n        <li>send email to findbugs@cs.umd.edu</li>\n        <li>file a bug report: <a href=\"http://findbugs.sourceforge.net/reportingBugs.html\">http://findbugs.sourceforge.net/reportingBugs.html</a></li>\n      </ul>\n      <p>\n      In particular,\n      the false-positive suppression heuristics for this\n      bug pattern have not been extensively tuned, so\n      reports about false positives are helpful to us.\n      </p>\n      <p>\n      See Weimer and Necula, <i>Finding and Preventing Run-Time Error Handling Mistakes</i>, for\n      a description of the analysis technique.\n      </p>',0,NULL,'Experimental - Method may fail to clean up stream or resource','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'3h',NULL,NULL,NULL,0,'HTML'),(130,'USM_USELESS_ABSTRACT_METHOD','USM_USELESS_ABSTRACT_METHOD','findbugs','<p>\n      This abstract method is already defined in an interface that is implemented by this abstract \n      class. This method can be removed, as it provides no additional value.\n      </p>',0,NULL,'Experimental - Abstract Method is already defined in implemented interface','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,24,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(131,'DMI_UNSUPPORTED_METHOD','DMI_UNSUPPORTED_METHOD','findbugs','<p>All targets of this method invocation throw an UnsupportedOperationException.\n</p>',2,NULL,'Dodgy - Call to unsupported method','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(132,'RV_01_TO_INT','RV_01_TO_INT','findbugs','<p>A random value from 0 to 1 is being coerced to the integer value 0. You probably\nwant to multiple the random value by something else before coercing it to an integer, or use the <code>Random.nextInt(n)</code> method.\n</p>',2,NULL,'Correctness - Random value from 0 to 1 is coerced to the integer 0','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(133,'IA_AMBIGUOUS_INVOCATION_OF_INHERITED_OR_OUTER_METHOD','IA_AMBIGUOUS_INVOCATION_OF_INHERITED_OR_OUTER_METHOD','findbugs','<p> An inner class is invoking a method that could be resolved to either a inherited method or a method defined in an outer class. By the Java semantics,\nit will be resolved to invoke the inherited method, but this may not be want\nyou intend. If you really intend to invoke the inherited method,\ninvoke it by invoking the method on super (e.g., invoke super.foo(17)), and\nthus it will be clear to other readers of your code and to FindBugs\nthat you want to invoke the inherited method, not the method in the outer class.\n</p>',2,NULL,'Dodgy - Ambiguous invocation of either an inherited or outer method','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,24,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(134,'BIT_AND_ZZ','BIT_AND_ZZ','findbugs','<p> This method compares an expression of the form (e &amp; 0) to 0,\nwhich will always compare equal.\nThis may indicate a logic error or typo.</p>',3,NULL,'Correctness - Check to see if ((...) & 0) == 0','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(135,'DM_STRING_VOID_CTOR','DM_STRING_VOID_CTOR','findbugs','<p> Creating a new <code>java.lang.String</code> object using the\n  no-argument constructor wastes memory because the object so created will\n  be functionally indistinguishable from the empty string constant\n  <code>\"\"</code>.&nbsp; Java guarantees that identical string constants\n  will be represented by the same <code>String</code> object.&nbsp; Therefore,\n  you should just use the empty string constant directly.</p>',2,NULL,'Performance - Method invokes inefficient new String() constructor','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(136,'UL_UNRELEASED_LOCK','UL_UNRELEASED_LOCK','findbugs','<p> This method acquires a JSR-166 (<code>java.util.concurrent</code>) lock,\nbut does not release it on all paths out of the method.  In general, the correct idiom\nfor using a JSR-166 lock is:\n</p>\n<pre>\n    Lock l = ...;\n    l.lock();\n    try {\n        // do something\n    } finally {\n        l.unlock();\n    }\n</pre>',3,NULL,'Multithreaded correctness - Method does not release lock on all paths','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(137,'HRS_REQUEST_PARAMETER_TO_HTTP_HEADER','HRS_REQUEST_PARAMETER_TO_HTTP_HEADER','findbugs','<p>This code directly writes an HTTP parameter to an HTTP header, which allows for a HTTP response splitting\nvulnerability. See <a href=\"http://en.wikipedia.org/wiki/HTTP_response_splitting\">http://en.wikipedia.org/wiki/HTTP_response_splitting</a>\nfor more information.</p>\n<p>FindBugs looks only for the most blatant, obvious cases of HTTP response splitting.\nIf FindBugs found <em>any</em>, you <em>almost certainly</em> have more \nvulnerabilities that FindBugs doesn\'t report. If you are concerned about HTTP response splitting, you should seriously \nconsider using a commercial static analysis or pen-testing tool.\n</p>',2,NULL,'Security - HTTP Response splitting vulnerability','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,17,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(138,'CN_IMPLEMENTS_CLONE_BUT_NOT_CLONEABLE','CN_IMPLEMENTS_CLONE_BUT_NOT_CLONEABLE','findbugs','<p> This class defines a clone() method but the class doesn\'t implement Cloneable.\nThere are some situations in which this is OK (e.g., you want to control how subclasses \ncan clone themselves), but just make sure that this is what you intended.\n</p>',2,NULL,'Bad practice - Class defines clone() but doesn\'t implement Cloneable','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(139,'DL_SYNCHRONIZATION_ON_SHARED_CONSTANT','DL_SYNCHRONIZATION_ON_SHARED_CONSTANT','findbugs','<p> The code synchronizes on interned String.\n<pre>\nprivate static String LOCK = \"LOCK\";\n...\n  synchronized(LOCK) { ...}\n...\n</pre>\n</p>\n<p>Constant Strings are interned and shared across all other classes loaded by the JVM. Thus, this could\nis locking on something that other code might also be locking. This could result in very strange and hard to diagnose\nblocking and deadlock behavior. See <a href=\"http://www.javalobby.org/java/forums/t96352.html\">http://www.javalobby.org/java/forums/t96352.html</a> and <a href=\"http://jira.codehaus.org/browse/JETTY-352\">http://jira.codehaus.org/browse/JETTY-352</a>.\n</p>',3,NULL,'Multithreaded correctness - Synchronization on interned String could lead to deadlock','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(140,'MF_METHOD_MASKS_FIELD','MF_METHOD_MASKS_FIELD','findbugs','<p> This method defines a local variable with the same name as a field\nin this class or a superclass.  This may cause the method to\nread an uninitialized value from the field, leave the field uninitialized,\nor both.</p>',2,NULL,'Correctness - Method defines a variable that obscures a field','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(141,'UWF_UNWRITTEN_PUBLIC_OR_PROTECTED_FIELD','UWF_UNWRITTEN_PUBLIC_OR_PROTECTED_FIELD','findbugs','<p>No writes were seen to this public/protected field.  All reads of it will return the default value. \nCheck for errors (should it have been initialized?), or remove it if it is useless.</p>',1,NULL,'Unwritten public or protected field','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(142,'SA_FIELD_SELF_COMPARISON','SA_FIELD_SELF_COMPARISON','findbugs','<p> This method compares a field with itself, and may indicate a typo or\na logic error.  Make sure that you are comparing the right things.\n</p>',3,NULL,'Correctness - Self comparison of field with itself','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(143,'SE_INNER_CLASS','SE_INNER_CLASS','findbugs','<p> This Serializable class is an inner class.  Any attempt to serialize\nit will also serialize the associated outer instance. The outer instance is serializable,\nso this won\'t fail, but it might serialize a lot more data than intended.\nIf possible, making the inner class a static inner class (also known as a nested class) should solve the \nproblem.',2,NULL,'Bad practice - Serializable inner class','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(144,'CI_CONFUSED_INHERITANCE','CI_CONFUSED_INHERITANCE','findbugs','<p>\n      This class is declared to be final, but declares fields to be protected. Since the class\n      is final, it can not be derived from, and the use of protected is confusing. The access\n      modifier for the field should be changed to private or public to represent the true\n      use for the field.\n      </p>',1,NULL,'Dodgy - Class is final but declares protected field','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(145,'UWF_UNWRITTEN_FIELD','UWF_UNWRITTEN_FIELD','findbugs','<p>This field is never written.  All reads of it will return the default value. Check for errors (should it have been initialized?), or remove it if it is useless.</p>',1,NULL,'Correctness - Unwritten field','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:22',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(146,'FI_USELESS','FI_USELESS','findbugs','<p> The only thing this <code>finalize()</code> method does is call\n  the superclass\'s <code>finalize()</code> method, making it\n  redundant.&nbsp; Delete it.</p>',1,NULL,'Bad practice - Finalizer does nothing but call superclass finalizer','READY','java','2014-11-26 15:18:22','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(147,'NM_METHOD_CONSTRUCTOR_CONFUSION','NM_METHOD_CONSTRUCTOR_CONFUSION','findbugs','<p> This regular method has the same name as the class it is defined in. It is likely that this was intended to be a constructor.\n      If it was intended to be a constructor, remove the declaration of a void return value.\n	If you had accidently defined this method, realized the mistake, defined a proper constructor\n	but can\'t get rid of this method due to backwards compatibility, deprecate the method.\n</p>',2,NULL,'Correctness - Apparent method/constructor confusion','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(148,'ML_SYNC_ON_UPDATED_FIELD','ML_SYNC_ON_UPDATED_FIELD','findbugs','<p> This method synchronizes on an object\n   referenced from a mutable field.\n   This is unlikely to have useful semantics, since different\nthreads may be synchronizing on different objects.</p>',2,NULL,'Multithreaded correctness - Method synchronizes on an updated field','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(149,'FL_MATH_USING_FLOAT_PRECISION','FL_MATH_USING_FLOAT_PRECISION','findbugs','<p>\n   The method performs math operations using floating point precision.\n   Floating point precision is very imprecise. For example,\n   16777216.0f + 1.0f = 16777216.0f. Consider using double math instead.</p>',3,NULL,'Correctness - Method performs math using floating point precision','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(150,'VA_FORMAT_STRING_EXPECTED_MESSAGE_FORMAT_SUPPLIED','VA_FORMAT_STRING_EXPECTED_MESSAGE_FORMAT_SUPPLIED','findbugs','A method is called that expects a Java printf format string and a list of arguments. However, the format string doesn\'t contain any format specifiers (e.g., %s) but does contain message format elements (e.g., {0}). It is likely that the code is supplying a MessageFormat string when a printf-style format string is required. At runtime, all of the arguments will be ignored and the format string will be returned exactly as provided without any formatting.',2,NULL,'Correctness - MessageFormat supplied where printf style format expected','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(151,'DMI_NONSERIALIZABLE_OBJECT_WRITTEN','DMI_NONSERIALIZABLE_OBJECT_WRITTEN','findbugs','<p>\nThis code seems to be passing a non-serializable object to the ObjectOutput.writeObject method.\nIf the object is, indeed, non-serializable, an error will result.\n</p>',3,NULL,'Dodgy - Non serializable object written to ObjectOutput','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(152,'MTIA_SUSPECT_STRUTS_INSTANCE_FIELD','MTIA_SUSPECT_STRUTS_INSTANCE_FIELD','findbugs','<p>\n    This class extends from a Struts Action class, and uses an instance member variable. Since only\n    one instance of a struts Action class is created by the Struts framework, and used in a\n    multithreaded way, this paradigm is highly discouraged and most likely problematic. Consider\n    only using method local variables. Only instance fields that are written outside of a monitor\n    are reported. \n    </p>',3,NULL,'Dodgy - Class extends Struts Action class and uses instance variables','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(153,'EQ_OTHER_USE_OBJECT','EQ_OTHER_USE_OBJECT','findbugs','<p> This class defines an <code>equals()</code>\n  method, that doesn\'t override the normal <code>equals(Object)</code> method\n  defined in the base <code>java.lang.Object</code> class.&nbsp;\n  The class should probably define a <code>boolean equals(Object)</code> method.\n  </p>',2,NULL,'Correctness - equals() method defined that doesn\'t override Object.equals(Object)','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(154,'DLS_DEAD_LOCAL_INCREMENT_IN_RETURN','DLS_DEAD_LOCAL_INCREMENT_IN_RETURN','findbugs','<p>\nThis statement has a return such as <code>return x++;</code>.\nA postfix increment/decrement does not impact the value of the expression,\nso this increment/decrement has no effect.\nPlease verify that this statement does the right thing.\n</p>',2,NULL,'Useless increment in return statement','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(155,'RCN_REDUNDANT_COMPARISON_OF_NULL_AND_NONNULL_VALUE','RCN_REDUNDANT_COMPARISON_OF_NULL_AND_NONNULL_VALUE','findbugs','<p> This method contains a reference known to be non-null with another reference\nknown to be null.</p>',3,NULL,'Dodgy - Redundant comparison of non-null value to null','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(156,'VA_FORMAT_STRING_USES_NEWLINE','VA_FORMAT_STRING_USES_NEWLINE','findbugs','<p>This format string include a newline character (\\n). In format strings, it is generally preferable \nbetter to use %n, which will produce the platform-specific line separator.</p>',2,NULL,'Format string should use %n rather than \\n','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(157,'MS_CANNOT_BE_FINAL','MS_CANNOT_BE_FINAL','findbugs','<p>\n A mutable static field could be changed by malicious code or\n        by accident from another package.\n   Unfortunately, the way the field is used doesn\'t allow\n   any easy fix to this problem.</p>',2,NULL,'Malicious code vulnerability - Field isn\'t final and can\'t be protected from malicious code','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,15,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(158,'NP_STORE_INTO_NONNULL_FIELD','NP_STORE_INTO_NONNULL_FIELD','findbugs','<p> A value that could be null is stored into a field that has been annotated as NonNull. </p>',3,NULL,'Correctness - Store of null value into field annotated NonNull','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(159,'DMI_INVOKING_TOSTRING_ON_ANONYMOUS_ARRAY','DMI_INVOKING_TOSTRING_ON_ANONYMOUS_ARRAY','findbugs','<p>\nThe code invokes toString on an (anonymous) array.  Calling toString on an array generates a fairly useless result\nsuch as [C@16f0472. Consider using Arrays.toString to convert the array into a readable\nString that gives the contents of the array. See Programming Puzzlers, chapter 3, puzzle 12.\n</p>',3,NULL,'Correctness - Invocation of toString on an anonymous array','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(160,'IM_BAD_CHECK_FOR_ODD','IM_BAD_CHECK_FOR_ODD','findbugs','<p>\nThe code uses x % 2 == 1 to check to see if a value is odd, but this won\'t work\nfor negative numbers (e.g., (-5) % 2 == -1). If this code is intending to check\nfor oddness, consider using x &amp; 1 == 1, or x % 2 != 0.\n</p>',3,NULL,'Dodgy - Check for oddness that won\'t work for negative numbers','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(161,'SP_SPIN_ON_FIELD','SP_SPIN_ON_FIELD','findbugs','<p> This method spins in a loop which reads a field.&nbsp; The compiler\n  may legally hoist the read out of the loop, turning the code into an\n  infinite loop.&nbsp; The class should be changed so it uses proper\n  synchronization (including wait and notify calls).</p>',2,NULL,'Multithreaded correctness - Method spins on field','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(162,'IS2_INCONSISTENT_SYNC','IS2_INCONSISTENT_SYNC','findbugs','<p> The fields of this class appear to be accessed inconsistently with respect\n  to synchronization.&nbsp; This bug report indicates that the bug pattern detector\n  judged that\n  </p>\n  <ol>\n  <li> The class contains a mix of locked and unlocked accesses,</li>\n  <li> At least one locked access was performed by one of the class\'s own methods, and</li>\n  <li> The number of unsynchronized field accesses (reads and writes) was no more than\n       one third of all accesses, with writes being weighed twice as high as reads</li>\n  </ol>\n\n  <p> A typical bug matching this bug pattern is forgetting to synchronize\n  one of the methods in a class that is intended to be thread-safe.</p>\n\n  <p> You can select the nodes labeled \"Unsynchronized access\" to show the\n  code locations where the detector believed that a field was accessed\n  without synchronization.</p>\n\n  <p> Note that there are various sources of inaccuracy in this detector;\n  for example, the detector cannot statically detect all situations in which\n  a lock is held.&nbsp; Also, even when the detector is accurate in\n  distinguishing locked vs. unlocked accesses, the code in question may still\n  be correct.</p>',3,NULL,'Multithreaded correctness - Inconsistent synchronization','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(163,'ICAST_INT_CAST_TO_DOUBLE_PASSED_TO_CEIL','ICAST_INT_CAST_TO_DOUBLE_PASSED_TO_CEIL','findbugs','<p>\nThis code converts an int value to a double precision\nfloating point number and then\npassing the result to the Math.ceil() function, which rounds a double to\nthe next higher integer value. This operation should always be a no-op,\nsince the converting an integer to a double should give a number with no fractional part.\nIt is likely that the operation that generated the value to be passed\nto Math.ceil was intended to be performed using double precision\nfloating point arithmetic.\n</p>',3,NULL,'Correctness - int value cast to double and then passed to Math.ceil','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(164,'ODR_OPEN_DATABASE_RESOURCE_EXCEPTION_PATH','ODR_OPEN_DATABASE_RESOURCE_EXCEPTION_PATH','findbugs','<p> The method creates a database resource (such as a database connection\nor row set), does not assign it to any\nfields, pass it to other methods, or return it, and does not appear to close\nthe object on all exception paths out of the method.&nbsp; Failure to\nclose database resources on all paths out of a method may\nresult in poor performance, and could cause the application to\nhave problems communicating with the database.</p>',3,NULL,'Bad practice - Method may fail to close database resource on exception','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,30,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(165,'CN_IDIOM','CN_IDIOM','findbugs','<p>\n   Class implements Cloneable but does not define or\n   use the clone method.</p>',2,NULL,'Bad practice - Class implements Cloneable but does not define or use clone method','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(166,'DMI_SCHEDULED_THREAD_POOL_EXECUTOR_WITH_ZERO_CORE_THREADS','DMI_SCHEDULED_THREAD_POOL_EXECUTOR_WITH_ZERO_CORE_THREADS','findbugs','<p>(<a href=\"http://java.sun.com/javase/6/docs/api/java/util/concurrent/ScheduledThreadPoolExecutor.html#ScheduledThreadPoolExecutor(int)\">Javadoc</a>)\nA ScheduledThreadPoolExecutor with zero core threads will never execute anything; changes to the max pool size are ignored.\n</p>',1,NULL,'Correctness - Creation of ScheduledThreadPoolExecutor with zero core threads','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(167,'GC_UNCHECKED_TYPE_IN_GENERIC_CALL','GC_UNCHECKED_TYPE_IN_GENERIC_CALL','findbugs','<p> This call to a generic collection method passes an argument\n	while compile type Object where a specific type from\n	the generic type parameters is expected.\n	Thus, neither the standard Java type system nor static analysis\n	can provide useful information on whether the\n	object being passed as a parameter is of an appropriate type.\n	</p>',3,NULL,'Bad practice - Unchecked type in generic call','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(168,'DL_SYNCHRONIZATION_ON_BOOLEAN','DL_SYNCHRONIZATION_ON_BOOLEAN','findbugs','<p> The code synchronizes on a boxed primitive constant, such as an Boolean.\n<pre>\nprivate static Boolean inited = Boolean.FALSE;\n...\n  synchronized(inited) { \n    if (!inited) {\n       init();\n       inited = Boolean.TRUE;\n       }\n     }\n...\n</pre>\n</p>\n<p>Since there normally exist only two Boolean objects, this code could be synchronizing on the same object as other, unrelated code, leading to unresponsiveness\nand possible deadlock</p>',3,NULL,'Multithreaded correctness - Synchronization on Boolean could lead to deadlock','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(169,'SW_SWING_METHODS_INVOKED_IN_SWING_THREAD','SW_SWING_METHODS_INVOKED_IN_SWING_THREAD','findbugs','<p>(<a href=\"http://java.sun.com/developer/JDCTechTips/2003/tt1208.html#1\">From JDC Tech Tip</a>): The Swing methods\nshow(), setVisible(), and pack() will create the associated peer for the frame.\nWith the creation of the peer, the system creates the event dispatch thread.\nThis makes things problematic because the event dispatch thread could be notifying\nlisteners while pack and validate are still processing. This situation could result in\ntwo threads going through the Swing component-based GUI -- it\'s a serious flaw that\ncould result in deadlocks or other related threading issues. A pack call causes\ncomponents to be realized. As they are being realized (that is, not necessarily\nvisible), they could trigger listener notification on the event dispatch thread.</p>',2,NULL,'Bad practice - Certain swing methods needs to be invoked in Swing thread','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(170,'SF_DEAD_STORE_DUE_TO_SWITCH_FALLTHROUGH_TO_THROW','SF_DEAD_STORE_DUE_TO_SWITCH_FALLTHROUGH_TO_THROW','findbugs','<p>\n      A value stored in the previous switch case is ignored here due to a switch fall through to a place where an exception is thrown. \n      It is likely that you forgot to put a break or return at the end of the previous case.\n      </p>',3,NULL,'Dead store due to switch statement fall through to throw','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(171,'NP_NULL_ON_SOME_PATH_FROM_RETURN_VALUE','NP_NULL_ON_SOME_PATH_FROM_RETURN_VALUE','findbugs','<p>\nThe return value from a method is dereferenced without a null check,\nand the return value of that method is one that should generally be checked for null (which requires to use Findbugs annotations to express the developer\'s intend).\nThis may lead to a <code>NullPointerException</code> when the code is executed.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\npublic long getTime() {\n  return getDate().getTime();      // NullPointerException may occur\n}\n\n@CheckForNull                      // See javax.annotation.CheckForNull (JSR-305)\npublic Date getDate() { /* ... */ }\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\npublic long getTime() {\n  Date date = getDate();\n  if (date == null) {\n    throw new IllegalStateException(\"...\");\n  }\n  return date.getTime();\n}\n\n@CheckForNull                      // See javax.annotation.CheckForNull (JSR-305)\npublic Date getDate() { /* ... */ }\n</pre>',3,NULL,'Dodgy - Possible null pointer dereference due to return value of called method','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(172,'DM_DEFAULT_ENCODING','DM_DEFAULT_ENCODING','findbugs','<p>Found a call to a method which will perform a byte to String (or String to byte) conversion, \nand will assume that the default platform encoding is suitable. This will cause the application \nbehaviour to vary between platforms. Use an alternative API and specify a charset name or \nCharset object explicitly.</p>',2,NULL,'Reliance on default encoding','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,8,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(173,'DC_DOUBLECHECK','DC_DOUBLECHECK','findbugs','<p> This method may contain an instance of double-checked locking.&nbsp;\n  This idiom is not correct according to the semantics of the Java memory\n  model.&nbsp; For more information, see the web page\n  <a href=\"http://www.cs.umd.edu/~pugh/java/memoryModel/DoubleCheckedLocking.html\"\n  >http://www.cs.umd.edu/~pugh/java/memoryModel/DoubleCheckedLocking.html</a>.</p>',2,NULL,'Multithreaded correctness - Possible double check of field','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(174,'EC_BAD_ARRAY_COMPARE','EC_BAD_ARRAY_COMPARE','findbugs','<p>\nThis method invokes the .equals(Object o) method on an array. Since arrays do not override the equals\nmethod of Object, calling equals on an array is the same as comparing their addresses. To compare the\ncontents of the arrays, use java.util.Arrays.equals(Object[], Object[]).\n</p>\n<p>\n  This rule is deprecated, use {rule:squid:S1294} instead.\n</p>',3,NULL,'Correctness - Invocation of equals() on an array, which is equivalent to ==','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(175,'REC_CATCH_EXCEPTION','REC_CATCH_EXCEPTION','findbugs','<p>\n  This method uses a try-catch block that catches Exception objects, but Exception is not\n  thrown within the try block, and RuntimeException is not explicitly caught.  It is a common bug pattern to\n  say try { ... } catch (Exception e) { something } as a shorthand for catching a number of types of exception\n  each of whose catch blocks is identical, but this construct also accidentally catches RuntimeException as well,\n  masking potential bugs.\n  </p>',2,NULL,'Dodgy - Exception is caught when Exception is not thrown','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(176,'TQ_NEVER_VALUE_USED_WHERE_ALWAYS_REQUIRED','TQ_NEVER_VALUE_USED_WHERE_ALWAYS_REQUIRED','findbugs','<p>\n        A value specified as not carrying a type qualifier annotation is guaranteed\n        to be consumed in a location or locations requiring that the value does\n        carry that annotation.\n        </p>\n        \n        <p>\n        More precisely, a value annotated with a type qualifier specifying when=NEVER\n        is guaranteed to reach a use or uses where the same type qualifier specifies when=ALWAYS.\n        </p>\n\n        <p>\n        TODO: example\n        </p>',3,NULL,'Correctness - Value annotated as never carrying a type qualifier used where value carrying that qualifier is required','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(177,'UR_UNINIT_READ','UR_UNINIT_READ','findbugs','<p> This constructor reads a field which has not yet been assigned a value.&nbsp;\n  This is often caused when the programmer mistakenly uses the field instead\n  of one of the constructor\'s parameters.</p>',2,NULL,'Correctness - Uninitialized read of field in constructor','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(178,'DMI_VACUOUS_SELF_COLLECTION_CALL','DMI_VACUOUS_SELF_COLLECTION_CALL','findbugs','<p> This call doesn\'t make sense. For any collection <code>c</code>, calling <code>c.containsAll(c)</code> should\nalways be true, and <code>c.retainAll(c)</code> should have no effect.\n	</p>',3,NULL,'Correctness - Vacuous call to collections','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(179,'DMI_FUTILE_ATTEMPT_TO_CHANGE_MAXPOOL_SIZE_OF_SCHEDULED_THREAD_POOL_EXECUTOR','DMI_FUTILE_ATTEMPT_TO_CHANGE_MAXPOOL_SIZE_OF_SCHEDULED_THREAD_POOL_EXECUTOR','findbugs','<p>(<a href=\"http://java.sun.com/javase/6/docs/api/java/util/concurrent/ScheduledThreadPoolExecutor.html\">Javadoc</a>)\nWhile ScheduledThreadPoolExecutor inherits from ThreadPoolExecutor, a few of the inherited tuning methods are not useful for it. In particular, because it acts as a fixed-sized pool using corePoolSize threads and an unbounded queue, adjustments to maximumPoolSize have no useful effect.\n	</p>',1,NULL,'Correctness - Futile attempt to change max pool size of ScheduledThreadPoolExecutor','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(180,'BIT_AND','BIT_AND','findbugs','<p> This method compares an expression of the form (e &amp; C) to D,\nwhich will always compare unequal\ndue to the specific values of constants C and D.\nThis may indicate a logic error or typo.</p>',3,NULL,'Correctness - Incompatible bit masks (BIT_AND)','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(181,'DMI_COLLECTIONS_SHOULD_NOT_CONTAIN_THEMSELVES','DMI_COLLECTIONS_SHOULD_NOT_CONTAIN_THEMSELVES','findbugs','<p> This call to a generic collection\'s method would only make sense if a collection contained \nitself (e.g., if <code>s.contains(s)</code> were true). This is unlikely to be true and would cause\nproblems if it were true (such as the computation of the hash code resulting in infinite recursion).\nIt is likely that the wrong value is being passed as a parameter.\n	</p>',3,NULL,'Correctness - Collections should not contain themselves','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(182,'OBL_UNSATISFIED_OBLIGATION_EXCEPTION_EDGE','OBL_UNSATISFIED_OBLIGATION_EXCEPTION_EDGE','findbugs','<p>This method may fail to clean up (close, dispose of) a stream, database object, or other resource requiring an \nexplicit cleanup operation.<br/>In general, if a method opens a stream or other resource, the method should use a try/finally block to ensure \nthat the stream or resource is cleaned up before the method returns.<p/>\n<p>This bug pattern is essentially the same as the OS_OPEN_STREAM and ODR_OPEN_DATABASE_RESOURCE bug patterns, but is based on a different \n(and hopefully better) static analysis technique. See Weimer and Necula, Finding and Preventing Run-Time Error Handling Mistakes, for a \ndescription of the analysis technique. .</p>',3,NULL,'Method may fail to clean up stream or resource on checked exception','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,30,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(183,'HE_SIGNATURE_DECLARES_HASHING_OF_UNHASHABLE_CLASS','HE_SIGNATURE_DECLARES_HASHING_OF_UNHASHABLE_CLASS','findbugs','<p> A method, field or class declares a generic signature where a non-hashable class\nis used in context where a hashable class is required.\nA class that declares an equals method but inherits a hashCode() method\nfrom Object is unhashable, since it doesn\'t fulfill the requirement that\nequal objects have equal hashCodes.\n</p>',3,NULL,'Correctness - Signature declares use of unhashable class in hashed construct','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(184,'EC_NULL_ARG','EC_NULL_ARG','findbugs','<p> This method calls equals(Object), passing a null value as\nthe argument. According to the contract of the equals() method,\nthis call should always return <code>false</code>.</p>',3,NULL,'Correctness - Call to equals() with null argument','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(185,'TQ_UNKNOWN_VALUE_USED_WHERE_ALWAYS_STRICTLY_REQUIRED','TQ_UNKNOWN_VALUE_USED_WHERE_ALWAYS_STRICTLY_REQUIRED','findbugs','<p>\nA value is being used in a way that requires the value be annotation with a type qualifier. The type qualifier is strict, so the tool rejects any values that do not have the appropriate annotation.\n</p>\n<p>\nTo coerce a value to have a strict annotation, define an identity function where the return value is annotated with the strict annotation. This is the only way to turn a non-annotated value into a value with a strict type qualifier annotation.\n</p>',2,NULL,'Value without a type qualifier used where a value is required to have that qualifier','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(186,'NP_NONNULL_RETURN_VIOLATION','NP_NONNULL_RETURN_VIOLATION','findbugs','<p>\n      This method may return a null value, but the method (or a superclass method\n      which it overrides) is declared to return @NonNull.\n      </p>',3,NULL,'Correctness - Method may return null, but is declared @NonNull','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(187,'VA_PRIMITIVE_ARRAY_PASSED_TO_OBJECT_VARARG','VA_PRIMITIVE_ARRAY_PASSED_TO_OBJECT_VARARG','findbugs','<p>\nThis code passes a primitive array to a function that takes a variable number of object arguments.\nThis creates an array of length one to hold the primitive array and passes it to the function.\n</p>',3,NULL,'Correctness - Primitive array passed to function expecting a variable number of object arguments','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5h',NULL,NULL,NULL,0,'HTML'),(188,'DLS_DEAD_LOCAL_STORE','DLS_DEAD_LOCAL_STORE','findbugs','<p>\nThis instruction assigns a value to a local variable,\nbut the value is not read or used in any subsequent instruction.\nOften, this indicates an error, because the value computed is never\nused.\n</p>\n<p>\nNote that Sun\'s javac compiler often generates dead stores for\nfinal local variables.  Because FindBugs is a bytecode-based tool,\nthere is no easy way to eliminate these false positives.\n</p>',3,NULL,'Dodgy - Dead store to local variable','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(189,'HE_EQUALS_USE_HASHCODE','HE_EQUALS_USE_HASHCODE','findbugs','<p> This class overrides <code>equals(Object)</code>, but does not\n  override <code>hashCode()</code>, and inherits the implementation of\n  <code>hashCode()</code> from <code>java.lang.Object</code> (which returns\n  the identity hash code, an arbitrary value assigned to the object\n  by the VM).&nbsp; Therefore, the class is very likely to violate the\n  invariant that equal objects must have equal hashcodes.</p>\n\n<p>If you don\'t think instances of this class will ever be inserted into a HashMap/HashTable,\nthe recommended <code>hashCode</code> implementation to use is:</p>\n<pre>public int hashCode() {\n  assert false : \"hashCode not designed\";\n  return 42; // any arbitrary constant will do\n  }</pre>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1206} instead.\n</p>',3,NULL,'Bad practice - Class defines equals() and uses Object.hashCode()','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(190,'RV_ABSOLUTE_VALUE_OF_RANDOM_INT','RV_ABSOLUTE_VALUE_OF_RANDOM_INT','findbugs','<p> This code generates a random signed integer and then computes\nthe absolute value of that random integer.  If the number returned by the random number\ngenerator is <code>Integer.MIN_VALUE</code>, then the result will be negative as well (since \n<code>Math.abs(Integer.MIN_VALUE) == Integer.MIN_VALUE</code>).\n</p>',3,NULL,'Correctness - Bad attempt to compute absolute value of signed 32-bit random integer','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(191,'FE_FLOATING_POINT_EQUALITY','FE_FLOATING_POINT_EQUALITY','findbugs','<p>\n    This operation compares two floating point values for equality.\n    Because floating point calculations may involve rounding,\n   calculated float and double values may not be accurate.\n    For values that must be precise, such as monetary values,\n   consider using a fixed-precision type such as BigDecimal.\n    For values that need not be precise, consider comparing for equality\n    within some range, for example:\n    <code>if ( Math.abs(x - y) &lt; .0000001 )</code>.\n   See the Java Language Specification, section 4.2.4.\n    </p>',3,NULL,'Dodgy - Test for floating point equality','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(192,'NP_NONNULL_FIELD_NOT_INITIALIZED_IN_CONSTRUCTOR','NP_NONNULL_FIELD_NOT_INITIALIZED_IN_CONSTRUCTOR','findbugs','<p>\nThe field is marked as nonnull, but isn\'t written to by the constructor.\nThe field might be initialized elsewhere during constructor, or might always\nbe initialized before use.\n</p>',3,NULL,'Nonnull field is not initialized','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,NULL,0,'HTML'),(193,'NM_SAME_SIMPLE_NAME_AS_INTERFACE','NM_SAME_SIMPLE_NAME_AS_INTERFACE','findbugs','<p> This class/interface has a simple name that is identical to that of an implemented/extended interface, except\nthat the interface is in a different package (e.g., <code>alpha.Foo</code> extends <code>beta.Foo</code>). \nThis can be exceptionally confusing, create lots of situations in which you have to look at import statements\nto resolve references and creates many\nopportunities to accidently define methods that do not override methods in their superclasses.\n</p>',2,NULL,'Bad practice - Class names shouldn\'t shadow simple name of implemented interface','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(194,'WL_USING_GETCLASS_RATHER_THAN_CLASS_LITERAL','WL_USING_GETCLASS_RATHER_THAN_CLASS_LITERAL','findbugs','<p>\n     This instance method synchronizes on <code>this.getClass()</code>. If this class is subclassed,\n     subclasses will synchronize on the class object for the subclass, which isn\'t likely what was intended.\n     For example, consider this code from java.awt.Label:\n     <pre>\n     private static final String base = \"label\";\n     private static int nameCounter = 0;\n     String constructComponentName() {\n        synchronized (getClass()) {\n            return base + nameCounter++;\n        }\n     }\n     </pre></p>\n     <p>Subclasses of <code>Label</code> won\'t synchronize on the same subclass, giving rise to a datarace.\n     Instead, this code should be synchronizing on <code>Label.class</code>\n      <pre>\n     private static final String base = \"label\";\n     private static int nameCounter = 0;\n     String constructComponentName() {\n        synchronized (Label.class) {\n            return base + nameCounter++;\n        }\n     }\n     </pre></p>\n      <p>Bug pattern contributed by Jason Mehrens</p>',3,NULL,'Multithreaded correctness - Sychronization on getClass rather than class literal','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(195,'SQL_NONCONSTANT_STRING_PASSED_TO_EXECUTE','SQL_NONCONSTANT_STRING_PASSED_TO_EXECUTE','findbugs','<p>The method invokes the execute method on an SQL statement with a String that seems\nto be dynamically generated. Consider using\na prepared statement instead. It is more efficient and less vulnerable to\nSQL injection attacks.\n</p>',3,NULL,'Security - Nonconstant string passed to execute method on an SQL statement','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,17,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(196,'RE_BAD_SYNTAX_FOR_REGULAR_EXPRESSION','RE_BAD_SYNTAX_FOR_REGULAR_EXPRESSION','findbugs','<p>\nThe code here uses a regular expression that is invalid according to the syntax\nfor regular expressions. This statement will throw a PatternSyntaxException when\nexecuted.\n</p>',3,NULL,'Correctness - Invalid syntax for regular expression','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(197,'NP_PARAMETER_MUST_BE_NONNULL_BUT_MARKED_AS_NULLABLE','NP_PARAMETER_MUST_BE_NONNULL_BUT_MARKED_AS_NULLABLE','findbugs','<p> This parameter is always used in a way that requires it to be nonnull,\nbut the parameter is explicitly annotated as being Nullable. Either the use\nof the parameter or the annotation is wrong.\n</p>',3,NULL,'Dodgy - Parameter must be nonnull but is marked as nullable','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(198,'STCAL_INVOKE_ON_STATIC_CALENDAR_INSTANCE','STCAL_INVOKE_ON_STATIC_CALENDAR_INSTANCE','findbugs','<p>Even though the JavaDoc does not contain a hint about it, Calendars are inherently unsafe for multihtreaded use. \nThe detector has found a call to an instance of Calendar that has been obtained via a static\nfield. This looks suspicous.</p>\n<p>For more information on this see <a href=\"http://bugs.sun.com/bugdatabase/view_bug.do?bug_id=6231579\">Sun Bug #6231579</a>\nand <a href=\"http://bugs.sun.com/bugdatabase/view_bug.do?bug_id=6178997\">Sun Bug #6178997</a>.</p>',3,NULL,'Multithreaded correctness - Call to static Calendar','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(199,'DMI_BIGDECIMAL_CONSTRUCTED_FROM_DOUBLE','DMI_BIGDECIMAL_CONSTRUCTED_FROM_DOUBLE','findbugs','<p>This code creates a BigDecimal from a double value that doesn\'t translate well to a decimal number. For example, \none might assume that writing <code>new BigDecimal(0.1)</code> in Java creates a BigDecimal which is exactly equal to 0.1 \n(an unscaled value of 1, with a scale of 1), but it is actually equal to 0.1000000000000000055511151231257827021181583404541015625. \nYou probably want to use the <code>BigDecimal.valueOf(double d)</code> method, which uses the String representation of the double to \ncreate the BigDecimal (e.g., <code>BigDecimal.valueOf(0.1)</code> gives 0.1).</p>',2,NULL,'BigDecimal constructed from double that isn\'t represented precisely','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(200,'INT_BAD_COMPARISON_WITH_NONNEGATIVE_VALUE','INT_BAD_COMPARISON_WITH_NONNEGATIVE_VALUE','findbugs','<p> This code compares a value that is guaranteed to be non-negative with a negative constant.\n</p>',3,NULL,'Correctness - Bad comparison of nonnegative value with negative constant','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(201,'IS_INCONSISTENT_SYNC','IS_INCONSISTENT_SYNC','findbugs','<p> The fields of this class appear to be accessed inconsistently with respect\n  to synchronization.&nbsp; This bug report indicates that the bug pattern detector\n  judged that\n  </p>\n  <ol>\n  <li> The class contains a mix of locked and unlocked accesses,</li>\n  <li> At least one locked access was performed by one of the class\'s own methods, and</li>\n  <li> The number of unsynchronized field accesses (reads and writes) was no more than\n       one third of all accesses, with writes being weighed twice as high as reads</li>\n  </ol>\n\n  <p> A typical bug matching this bug pattern is forgetting to synchronize\n  one of the methods in a class that is intended to be thread-safe.</p>\n\n  <p> Note that there are various sources of inaccuracy in this detector;\n  for example, the detector cannot statically detect all situations in which\n  a lock is held.&nbsp; Also, even when the detector is accurate in\n  distinguishing locked vs. unlocked accesses, the code in question may still\n  be correct.</p>',2,NULL,'Multithreaded correctness - Inconsistent synchronization','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(202,'RV_REM_OF_HASHCODE','RV_REM_OF_HASHCODE','findbugs','<p> This code computes a hashCode, and then computes\nthe remainder of that value modulo another value. Since the hashCode\ncan be negative, the result of the remainder operation\ncan also be negative. </p>\n<p> Assuming you want to ensure that the result of your computation is nonnegative,\nyou may need to change your code.\nIf you know the divisor is a power of 2,\nyou can use a bitwise and operator instead (i.e., instead of\nusing <code>x.hashCode()%n</code>, use <code>x.hashCode()&amp;(n-1)</code>. \nThis is probably faster than computing the remainder as well.\nIf you don\'t know that the divisor is a power of 2, take the absolute\nvalue of the result of the remainder operation (i.e., use\n<code>Math.abs(x.hashCode()%n)</code>\n</p>',3,NULL,'Dodgy - Remainder of hashCode could be negative','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(203,'LG_LOST_LOGGER_DUE_TO_WEAK_REFERENCE','LG_LOST_LOGGER_DUE_TO_WEAK_REFERENCE','findbugs','<p>\n      OpenJDK introduces a potential incompatibility.\n      In particular, the java.util.logging.Logger behavior has\n      changed. Instead of using strong references, it now uses weak references\n      internally. That\'s a reasonable change, but unfortunately some code relies on\n      the old behavior - when changing logger configuration, it simply drops the\n      logger reference. That means that the garbage collector is free to reclaim\n      that memory, which means that the logger configuration is lost. For example,\n      consider:\n      </p>\n      <p><pre>public static void initLogging() throws Exception {\n      Logger logger = Logger.getLogger(\"edu.umd.cs\");\n      logger.addHandler(new FileHandler()); // call to change logger configuration\n      logger.setUseParentHandlers(false); // another call to change logger configuration\n      }</pre></p>\n      <p>The logger reference is lost at the end of the method (it doesn\'t\n      escape the method), so if you have a garbage collection cycle just\n      after the call to initLogging, the logger configuration is lost\n      (because Logger only keeps weak references).</p>\n      <p><pre>public static void main(String[] args) throws Exception {\n      initLogging(); // adds a file handler to the logger\n      System.gc(); // logger configuration lost\n      Logger.getLogger(\"edu.umd.cs\").info(\"Some message\"); // this isn\'t logged to the file as expected\n      }</pre></p>\n      <p><em>Ulf Ochsenfahrt and Eric Fellheimer</em>\n    </p>',0,NULL,'Experimental - Potential lost logger changes due to weak reference in OpenJDK','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,9,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(204,'DMI_ENTRY_SETS_MAY_REUSE_ENTRY_OBJECTS','DMI_ENTRY_SETS_MAY_REUSE_ENTRY_OBJECTS','findbugs','<p>The entrySet() method is allowed to return a view of the underlying Map in which a single Entry\n object is reused and returned during the iteration. As of Java 1.6, both IdentityHashMap and EnumMap\n did so. When iterating through such a Map, the Entry value is only valid until you advance to the \n next iteration. If, for example, you try to pass such an entrySet to an addAll method, things will \n go badly wrong.</p>',2,NULL,'Adding elements of an entry set may fail due to reuse of Entry objects','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(205,'ICAST_INT_CAST_TO_FLOAT_PASSED_TO_ROUND','ICAST_INT_CAST_TO_FLOAT_PASSED_TO_ROUND','findbugs','<p>\nThis code converts an int value to a float precision\nfloating point number and then\npassing the result to the Math.round() function, which returns the int/long closest\nto the argument. This operation should always be a no-op,\nsince the converting an integer to a float should give a number with no fractional part.\nIt is likely that the operation that generated the value to be passed\nto Math.round was intended to be performed using \nfloating point arithmetic.\n</p>',3,NULL,'Correctness - int value cast to float and then passed to Math.round','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(206,'RV_ABSOLUTE_VALUE_OF_HASHCODE','RV_ABSOLUTE_VALUE_OF_HASHCODE','findbugs','<p> This code generates a hashcode and then computes\nthe absolute value of that hashcode.  If the hashcode \nis <code>Integer.MIN_VALUE</code>, then the result will be negative as well (since \n<code>Math.abs(Integer.MIN_VALUE) == Integer.MIN_VALUE</code>).\n</p>',3,NULL,'Correctness - Bad attempt to compute absolute value of signed 32-bit hashcode','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(207,'DMI_CALLING_NEXT_FROM_HASNEXT','DMI_CALLING_NEXT_FROM_HASNEXT','findbugs','<p>\nThe hasNext() method invokes the next() method. This is almost certainly wrong,\nsince the hasNext() method is not supposed to change the state of the iterator,\nand the next method is supposed to change the state of the iterator.\n</p>',3,NULL,'Correctness - hasNext method invokes next','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(208,'NP_NULL_ON_SOME_PATH','NP_NULL_ON_SOME_PATH','findbugs','<p> There is a branch of statement that, <em>if executed,</em>  guarantees that\na null value will be dereferenced, which\nwould generate a <code>NullPointerException</code> when the code is executed.\nOf course, the problem might be that the branch or statement is infeasible and that\nthe null pointer exception can\'t ever be executed; deciding that is beyond the ability of FindBugs.\n</p>',3,NULL,'Correctness - Possible null pointer dereference','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(209,'RS_READOBJECT_SYNC','RS_READOBJECT_SYNC','findbugs','<p> This serializable class defines a <code>readObject()</code> which is\n  synchronized.&nbsp; By definition, an object created by deserialization\n  is only reachable by one thread, and thus there is no need for\n  <code>readObject()</code> to be synchronized.&nbsp; If the <code>readObject()</code>\n  method itself is causing the object to become visible to another thread,\n  that is an example of very dubious coding style.</p>',3,NULL,'Multithreaded correctness - Class\'s readObject() method is synchronized','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(210,'EC_INCOMPATIBLE_ARRAY_COMPARE','EC_INCOMPATIBLE_ARRAY_COMPARE','findbugs','This method invokes the .equals(Object o) to compare two arrays, but the arrays of of incompatible types (e.g., String[] and StringBuffer[], or String[] and int[]). They will never be equal. In addition, when equals(...) is used to compare arrays it only checks to see if they are the same array, and ignores the contents of the arrays.\n<p>\n  This rule is deprecated, use {rule:squid:S1294} instead.\n</p>',4,NULL,'Correctness - equals(...) used to compare incompatible arrays','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(211,'BC_UNCONFIRMED_CAST','BC_UNCONFIRMED_CAST','findbugs','<p>\nThis cast is unchecked, and not all instances of the type casted from can be cast to\nthe type it is being cast to. Ensure that your program logic ensures that this\ncast will not fail.\n</p>',3,NULL,'Dodgy - Unchecked/unconfirmed cast','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(212,'EQ_GETCLASS_AND_CLASS_CONSTANT','EQ_GETCLASS_AND_CLASS_CONSTANT','findbugs','<p> This class has an equals method that will be broken if it is inherited by subclasses.\nIt compares a class literal with the class of the argument (e.g., in class <code>Foo</code>\nit might check if <code>Foo.class == o.getClass()</code>).\nIt is better to check if <code>this.getClass() == o.getClass()</code>.\n</p>',3,NULL,'Bad practice - equals method fails for subtypes','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(213,'SA_FIELD_DOUBLE_ASSIGNMENT','SA_FIELD_DOUBLE_ASSIGNMENT','findbugs','<p> This method contains a double assignment of a field; e.g.\n</p>\n<pre>\n  int x,y;\n  public void foo() {\n    x = x = 17;\n  }\n</pre>\n<p>Assigning to a field twice is useless, and may indicate a logic error or typo.</p>',3,NULL,'Correctness - Double assignment of field','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(214,'VA_FORMAT_STRING_ARG_MISMATCH','VA_FORMAT_STRING_ARG_MISMATCH','findbugs','<p>\nA format-string method with a variable number of arguments is called,\nbut the number of arguments passed does not match with the number of\n% placeholders in the format string.  This is probably not what the\nauthor intended.\n</p>',3,NULL,'Correctness - Number of format-string arguments does not correspond to number of placeholders','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(215,'BX_UNBOXED_AND_COERCED_FOR_TERNARY_OPERATOR','BX_UNBOXED_AND_COERCED_FOR_TERNARY_OPERATOR','findbugs','<p>A wrapped primitive value is unboxed and converted to another primitive type as part of the\nevaluation of a conditional ternary operator (the <code> b ? e1 : e2</code> operator). The\nsemantics of Java mandate that if <code>e1</code> and <code>e2</code> are wrapped\nnumeric values, the values are unboxed and converted/coerced to their common type (e.g,\nif <code>e1</code> is of type <code>Integer</code> \nand <code>e2</code> is of type <code>Float</code>, then <code>e1</code> is unboxed,\nconverted to a floating point value, and boxed. See JLS Section 15.25.\n</p>',2,NULL,'Correctness - Primitive value is unboxed and coerced for ternary operator','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5h',NULL,NULL,NULL,0,'HTML'),(216,'SF_SWITCH_FALLTHROUGH','SF_SWITCH_FALLTHROUGH','findbugs','<p>\n      This method contains a switch statement where one case branch will fall\n      through to the next case. Usually you need to end this case with a break or return.\n      </p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S128} instead.\n</p>',3,NULL,'Switch statement found where one case falls through to the next case','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(217,'DMI_LONG_BITS_TO_DOUBLE_INVOKED_ON_INT','DMI_LONG_BITS_TO_DOUBLE_INVOKED_ON_INT','findbugs','<p> The Double.longBitsToDouble method is invoked, but a 32 bit int value is passed\n	as an argument. This almostly certainly is not intended and is unlikely \n	to give the intended result.\n</p>',3,NULL,'Correctness - Double.longBitsToDouble invoked on an int','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(218,'IJU_NO_TESTS','IJU_NO_TESTS','findbugs','<p> Class is a JUnit TestCase but has not implemented any test methods</p>',3,NULL,'Correctness - TestCase has no tests','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(219,'RE_POSSIBLE_UNINTENDED_PATTERN','RE_POSSIBLE_UNINTENDED_PATTERN','findbugs','<p>\nA String function is being invoked and \".\" is being passed\nto a parameter that takes a regular expression as an argument. Is this what you intended?\nFor example\ns.replaceAll(\".\", \"/\") will return a String in which <em>every</em>\ncharacter has been replaced by a / character.\n</p>',3,NULL,'Correctness - \".\" used for regular expression','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(220,'SA_LOCAL_SELF_COMPARISON','SA_LOCAL_SELF_COMPARISON','findbugs','<p> This method compares a local variable with itself, and may indicate a typo or\na logic error.  Make sure that you are comparing the right things.\n</p>',3,NULL,'Correctness - Self comparison of value with itself','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(221,'IC_SUPERCLASS_USES_SUBCLASS_DURING_INITIALIZATION','IC_SUPERCLASS_USES_SUBCLASS_DURING_INITIALIZATION','findbugs','<p> During the initialization of a class, the class makes an active use of a subclass.\nThat subclass will not yet be initialized at the time of this use.\nFor example, in the following code, <code>foo</code> will be null.</p>\n\n<pre>\npublic class CircularClassInitialization {\n	static class InnerClassSingleton extends CircularClassInitialization {\n		static InnerClassSingleton singleton = new InnerClassSingleton();\n	}\n	\n	static CircularClassInitialization foo = InnerClassSingleton.singleton;\n}\n</pre>',2,NULL,'Bad practice - Superclass uses subclass during initialization','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,24,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(222,'UG_SYNC_SET_UNSYNC_GET','UG_SYNC_SET_UNSYNC_GET','findbugs','<p> This class contains similarly-named get and set\n  methods where the set method is synchronized and the get method is not.&nbsp;\n  This may result in incorrect behavior at runtime, as callers of the get\n  method will not necessarily see a consistent state for the object.&nbsp;\n  The get method should be made synchronized.</p>',2,NULL,'Multithreaded correctness - Unsynchronized get method, synchronized set method','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(223,'BC_IMPOSSIBLE_DOWNCAST','BC_IMPOSSIBLE_DOWNCAST','findbugs','This cast will always throw a ClassCastException. The analysis believes it knows the precise type of the value being cast, and the attempt to downcast it to a subtype will always fail by throwing a ClassCastException.',4,NULL,'Correctness - Impossible downcast','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(224,'SA_FIELD_SELF_COMPUTATION','SA_FIELD_SELF_COMPUTATION','findbugs','<p> This method performs a nonsensical computation of a field with another\nreference to the same field (e.g., x&x or x-x). Because of the nature\nof the computation, this operation doesn\'t seem to make sense,\nand may indicate a typo or\na logic error.  Double check the computation.\n</p>',3,NULL,'Correctness - Nonsensical self computation involving a field (e.g., x & x)','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(225,'NO_NOTIFY_NOT_NOTIFYALL','NO_NOTIFY_NOT_NOTIFYALL','findbugs','<p> This method calls <code>notify()</code> rather than <code>notifyAll()</code>.&nbsp;\n  Java monitors are often used for multiple conditions.&nbsp; Calling <code>notify()</code>\n  only wakes up one thread, meaning that the thread woken up might not be the\n  one waiting for the condition that the caller just satisfied.</p>',3,NULL,'Multithreaded correctness - Using notify() rather than notifyAll()','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(226,'BX_UNBOXING_IMMEDIATELY_REBOXED','BX_UNBOXING_IMMEDIATELY_REBOXED','findbugs','<p>A boxed value is unboxed and then immediately reboxed.</p>',2,NULL,'Boxed value is unboxed and then immediately reboxed','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(227,'SF_DEAD_STORE_DUE_TO_SWITCH_FALLTHROUGH','SF_DEAD_STORE_DUE_TO_SWITCH_FALLTHROUGH','findbugs','<p>\n      A value stored in the previous switch case is overwritten here due \n      to a switch fall through. It is likely that you forgot to put a \n      break or return at the end of the previous case.\n      </p>',3,NULL,'Dead store due to switch statement fall through','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(228,'EQ_COMPARETO_USE_OBJECT_EQUALS','EQ_COMPARETO_USE_OBJECT_EQUALS','findbugs','<p> This class defines a <code>compareTo(...)</code> method but inherits its\n  <code>equals()</code> method from <code>java.lang.Object</code>.\n  Generally, the value of compareTo should return zero if and only if\n  equals returns true. If this is violated, weird and unpredictable\n  failures will occur in classes such as PriorityQueue.\n  In Java 5 the PriorityQueue.remove method uses the compareTo method,\n  while in Java 6 it uses the equals method.\n\n<p>From the JavaDoc for the compareTo method in the Comparable interface:\n<blockquote>\nIt is strongly recommended, but not strictly required that <code>(x.compareTo(y)==0) == (x.equals(y))</code>.\nGenerally speaking, any class that implements the Comparable interface and violates this condition\nshould clearly indicate this fact. The recommended language\nis \"Note: this class has a natural ordering that is inconsistent with equals.\"\n</blockquote>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1210} instead.\n</p>',3,NULL,'Bad practice - Class defines compareTo(...) and uses Object.equals()','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(229,'LI_LAZY_INIT_UPDATE_STATIC','LI_LAZY_INIT_UPDATE_STATIC','findbugs','<p> This method contains an unsynchronized lazy initialization of a static field.\nAfter the field is set, the object stored into that location is further accessed. \nThe setting of the field is visible to other threads as soon as it is set. If the\nfuther accesses in the method that set the field serve to initialize the object, then\nyou have a <em>very serious</em> multithreading bug, unless something else prevents\nany other thread from accessing the stored object until it is fully initialized.\n</p>',3,NULL,'Multithreaded correctness - Incorrect lazy initialization and update of static field','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(230,'SE_NONLONG_SERIALVERSIONID','SE_NONLONG_SERIALVERSIONID','findbugs','<p> This class defines a <code>serialVersionUID</code> field that is not long.&nbsp;\n  The field should be made long\n   if it is intended to specify\n   the version UID for purposes of serialization.</p>',2,NULL,'Bad practice - serialVersionUID isn\'t long','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(231,'ODR_OPEN_DATABASE_RESOURCE','ODR_OPEN_DATABASE_RESOURCE','findbugs','<p> The method creates a database resource (such as a database connection\nor row set), does not assign it to any\nfields, pass it to other methods, or return it, and does not appear to close\nthe object on all paths out of the method.&nbsp; Failure to\nclose database resources on all paths out of a method may\nresult in poor performance, and could cause the application to\nhave problems communicating with the database.\n</p>',3,NULL,'Bad practice - Method may fail to close database resource','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(232,'RC_REF_COMPARISON_BAD_PRACTICE','RC_REF_COMPARISON_BAD_PRACTICE','findbugs','This method compares a reference value to a constant using the == or != operator, where the correct way to compare instances of this type is generally with the equals() method. It is possible to create distinct instances that are equal but do not compare as == since they are different objects. Examples of classes which should generally not be compared by reference are java.lang.Integer, java.lang.Float, etc.',2,NULL,'Correctness - Suspicious reference comparison to constant','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(233,'NM_LCASE_HASHCODE','NM_LCASE_HASHCODE','findbugs','<p>\n      This class defines a method called <code>hashcode()</code>.\n      This method does not override the <code>hashCode()</code>\n      method in <code>java.lang.Object</code>, which is probably what was intended.\n      </p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1221} instead.\n</p>',3,NULL,'Class defines hashcode(); should it be hashCode()?','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(234,'XSS_REQUEST_PARAMETER_TO_JSP_WRITER','XSS_REQUEST_PARAMETER_TO_JSP_WRITER','findbugs','<p>This code directly writes an HTTP parameter to JSP output, which allows for a cross site scripting\nvulnerability. See <a href=\"http://en.wikipedia.org/wiki/Cross-site_scripting\">http://en.wikipedia.org/wiki/Cross-site_scripting</a>\nfor more information.</p>\n<p>FindBugs looks only for the most blatant, obvious cases of cross site scripting.\nIf FindBugs found <em>any</em>, you <em>almost certainly</em> have more cross site scripting\nvulnerabilities that FindBugs doesn\'t report. If you are concerned about cross site scripting, you should seriously \nconsider using a commercial static analysis or pen-testing tool.\n</p>',3,NULL,'Security - JSP reflected cross site scripting vulnerability','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,17,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'3h',NULL,NULL,NULL,0,'HTML'),(235,'ITA_INEFFICIENT_TO_ARRAY','ITA_INEFFICIENT_TO_ARRAY','findbugs','<p> This method uses the toArray() method of a collection derived class, and passes\nin a zero-length prototype array argument.  It is more efficient to use\n<code>myCollection.toArray(new Foo[myCollection.size()])</code>\nIf the array passed in is big enough to store all of the\nelements of the collection, then it is populated and returned\ndirectly. This avoids the need to create a second array\n(by reflection) to return as the result.</p>',3,NULL,'Performance - Method uses toArray() with zero-length array argument','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(236,'SIC_INNER_SHOULD_BE_STATIC','SIC_INNER_SHOULD_BE_STATIC','findbugs','<p> This class is an inner class, but does not use its embedded reference\n  to the object which created it.&nbsp; This reference makes the instances\n  of the class larger, and may keep the reference to the creator object\n  alive longer than necessary.&nbsp; If possible, the class should be\n   made static.\n</p>',2,NULL,'Performance - Should be a static inner class','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,20,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(237,'ES_COMPARING_PARAMETER_STRING_WITH_EQ','ES_COMPARING_PARAMETER_STRING_WITH_EQ','findbugs','<p>This code compares a <code>java.lang.String</code> parameter for reference\nequality using the == or != operators. Requiring callers to \npass only String constants or interned strings to a method is unnecessarily\nfragile, and rarely leads to measurable performance gains. Consider\nusing the <code>equals(Object)</code> method instead.</p>',2,NULL,'Bad practice - Comparison of String parameter using == or !=','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(238,'IL_CONTAINER_ADDED_TO_ITSELF','IL_CONTAINER_ADDED_TO_ITSELF','findbugs','<p>A collection is added to itself. As a result, computing the hashCode of this\nset will throw a StackOverflowException.\n</p>',3,NULL,'Correctness - A collection is added to itself','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(239,'VA_FORMAT_STRING_BAD_CONVERSION','VA_FORMAT_STRING_BAD_CONVERSION','findbugs','<p>\nOne of the arguments is uncompatible with the corresponding format string specifier.\nAs a result, this will generate a runtime exception when executed.\nFor example, <code>String.format(\"%d\", \"1\")</code> will generate an exception, since\nthe String \"1\" is incompatible with the format specifier %d.\n</p>',3,NULL,'Correctness - The type of a supplied argument doesn\'t match format specifier','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(240,'IP_PARAMETER_IS_DEAD_BUT_OVERWRITTEN','IP_PARAMETER_IS_DEAD_BUT_OVERWRITTEN','findbugs','<p>\nThe initial value of this parameter is ignored, and the parameter\nis overwritten here. This often indicates a mistaken belief that\nthe write to the parameter will be conveyed back to\nthe caller.\n</p>',3,NULL,'Correctness - A parameter is dead upon entry to a method but overwritten','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(241,'CO_SELF_NO_OBJECT','CO_SELF_NO_OBJECT','findbugs','<p> This class defines a covariant version of <code>compareTo()</code>.&nbsp;\n  To correctly override the <code>compareTo()</code> method in the\n  <code>Comparable</code> interface, the parameter of <code>compareTo()</code>\n  must have type <code>java.lang.Object</code>.</p>',2,NULL,'Bad practice - Covariant compareTo() method defined','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(242,'MS_MUTABLE_ARRAY','MS_MUTABLE_ARRAY','findbugs','<p> A final static field references an array\n   and can be accessed by malicious code or\n        by accident from another package.\n   This code can freely modify the contents of the array.</p>',2,NULL,'Malicious code vulnerability - Field is a mutable array','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,15,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(243,'UW_UNCOND_WAIT','UW_UNCOND_WAIT','findbugs','<p> This method contains a call to <code>java.lang.Object.wait()</code> which\n  is not guarded by conditional control flow.&nbsp; The code should\n	verify that condition it intends to wait for is not already satisfied\n	before calling wait; any previous notifications will be ignored.\n  </p>',2,NULL,'Multithreaded correctness - Unconditional wait','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(244,'VO_VOLATILE_INCREMENT','VO_VOLATILE_INCREMENT','findbugs','<p>This code increments a volatile field. Increments of volatile fields aren\'t atomic. If more \nthan one thread is incrementing the field at the same time, increments could be lost. </p>',3,NULL,'An increment to a volatile field isn\'t atomic','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(245,'DLS_DEAD_LOCAL_STORE_SHADOWS_FIELD','DLS_DEAD_LOCAL_STORE_SHADOWS_FIELD','findbugs','<p>This instruction assigns a value to a local variable, but the value is not read or used in \nany subsequent instruction. Often, this indicates an error, because the value computed is never \nused. There is a field with the same name as the local variable. Did you mean to assign to that \nvariable instead?</p>',2,NULL,'Dead store to local variable that shadows field','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(246,'CO_COMPARETO_RESULTS_MIN_VALUE','CO_COMPARETO_RESULTS_MIN_VALUE','findbugs','<p>In some situation, this compareTo or compare method returns the constant Integer.MIN_VALUE, \nwhich is an exceptionally bad practice. The only thing that matters about the return value of \ncompareTo is the sign of the result. But people will sometimes negate the return value of compareTo, \nexpecting that this will negate the sign of the result. And it will, except in the case where \nthe value returned is Integer.MIN_VALUE. So just return -1 rather than Integer.MIN_VALUE.</p>',2,NULL,'compareTo()/compare() returns Integer.MIN_VALUE','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(247,'UOE_USE_OBJECT_EQUALS','UOE_USE_OBJECT_EQUALS','findbugs','<p>\n      This method invokes the .equals(Object o) method on a final class that doesn\'t override the equals method\n      in the Object class, effectively making the equals method test for sameness, like ==. It is good to use\n      the .equals method, but you should consider adding an .equals method in this class.\n      </p>\n      <p>[Bill Pugh]: Sorry, but I strongly disagree that this should be a warning, and I think your code\n      is just fine. Users of your code shouldn\'t care how you\'ve implemented equals(), and they should never\n      depend on == to compare instances, since that bypasses the libraries ability to control how objects\n      are compared.\n      </p>',0,NULL,'Experimental - Calls to equals on a final class that doesn\'t override Object\'s equals method','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'3h',NULL,NULL,NULL,0,'HTML'),(248,'DL_SYNCHRONIZATION_ON_UNSHARED_BOXED_PRIMITIVE','DL_SYNCHRONIZATION_ON_UNSHARED_BOXED_PRIMITIVE','findbugs','<p> The code synchronizes on an apparently unshared boxed primitive, \nsuch as an Integer.\n<pre>\nprivate static final Integer fileLock = new Integer(1);\n...\n  synchronized(fileLock) { \n     .. do something ..\n     }\n...\n</pre>\n</p>\n<p>It would be much better, in this code, to redeclare fileLock as\n<pre>\nprivate static final Object fileLock = new Object();\n</pre>\nThe existing code might be OK, but it is confusing and a \nfuture refactoring, such as the \"Remove Boxing\" refactoring in IntelliJ,\nmight replace this with the use of an interned Integer object shared \nthroughout the JVM, leading to very confusing behavior and potential deadlock.\n</p>',3,NULL,'Multithreaded correctness - Synchronization on boxed primitive values','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(249,'NP_BOOLEAN_RETURN_NULL','NP_BOOLEAN_RETURN_NULL','findbugs','<p>\n	A method that returns either Boolean.TRUE, Boolean.FALSE or null is an accident waiting to happen.\n	This method can be invoked as though it returned a value of type boolean, and\n	the compiler will insert automatic unboxing of the Boolean value. If a null value is returned,\n	this will result in a NullPointerException.\n  	 </p>',2,NULL,'Bad practice - Method with Boolean return type returns explicit null','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(250,'DM_GC','DM_GC','findbugs','<p> Code explicitly invokes garbage collection.\n  Except for specific use in benchmarking, this is very dubious.</p>\n  <p>In the past, situations where people have explicitly invoked\n  the garbage collector in routines such as close or finalize methods\n  has led to huge performance black holes. Garbage collection\n   can be expensive. Any situation that forces hundreds or thousands\n   of garbage collections will bring the machine to a crawl.</p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1215} instead.\n</p>',2,NULL,'Performance - Explicit garbage collection; extremely dubious except in benchmarking code','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(251,'DL_SYNCHRONIZATION_ON_BOXED_PRIMITIVE','DL_SYNCHRONIZATION_ON_BOXED_PRIMITIVE','findbugs','<p> The code synchronizes on a boxed primitive constant, such as an Integer.\n<pre>\nprivate static Integer count = 0;\n...\n  synchronized(count) { \n     count++;\n     }\n...\n</pre>\n</p>\n<p>Since Integer objects can be cached and shared,\nthis code could be synchronizing on the same object as other, unrelated code, leading to unresponsiveness\nand possible deadlock</p>',3,NULL,'Multithreaded correctness - Synchronization on boxed primitive could lead to deadlock','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(252,'DE_MIGHT_DROP','DE_MIGHT_DROP','findbugs','<p> This method might drop an exception.&nbsp; In general, exceptions\n  should be handled or reported in some way, or they should be thrown\n  out of the method.</p>',2,NULL,'Bad practice - Method might drop exception','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,30,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(253,'RV_DONT_JUST_NULL_CHECK_READLINE','RV_DONT_JUST_NULL_CHECK_READLINE','findbugs','<p> The value returned by readLine is discarded after checking to see if the return\nvalue is non-null. In almost all situations, if the result is non-null, you will want\nto use that non-null value. Calling readLine again will give you a different line.</p>',2,NULL,'Dodgy - Method discards result of readLine after checking if it is nonnull','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(254,'BAC_BAD_APPLET_CONSTRUCTOR','BAC_BAD_APPLET_CONSTRUCTOR','findbugs','<p>\n      This constructor calls methods in the parent Applet that rely on the AppletStub. Since the AppletStub\n      isn\'t initialized until the init() method of this applet is called, these methods will not perform\n      correctly.\n      </p>',0,NULL,'Experimental - Bad Applet Constructor relies on uninitialized AppletStub','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(255,'URF_UNREAD_FIELD','URF_UNREAD_FIELD','findbugs','<p> This field is never read.&nbsp; Consider removing it from the class.</p>',2,NULL,'Performance - Unread field','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(256,'NP_NULL_INSTANCEOF','NP_NULL_INSTANCEOF','findbugs','<p>\nThis instanceof test will always return false, since the value being checked is guaranteed to be null.\nAlthough this is safe, make sure it isn\'t\nan indication of some misunderstanding or some other logic error.\n</p>',4,NULL,'Correctness - A known null value is checked to see if it is an instance of a type','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(257,'MS_PKGPROTECT','MS_PKGPROTECT','findbugs','<p> A mutable static field could be changed by malicious code or\n   by accident.\n   The field could be made package protected to avoid\n   this vulnerability.</p>',2,NULL,'Malicious code vulnerability - Field should be package protected','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,15,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(258,'TQ_EXPLICIT_UNKNOWN_SOURCE_VALUE_REACHES_NEVER_SINK','TQ_EXPLICIT_UNKNOWN_SOURCE_VALUE_REACHES_NEVER_SINK','findbugs','<p>\n      A value is used in a way that requires it to be never be a value denoted by a type qualifier, but\n	there is an explicit annotation stating that it is not known where the value is prohibited from having that type qualifier.\n	Either the usage or the annotation is incorrect.\n      </p>',3,NULL,'Correctness - Value required to not have type qualifier, but marked as unknown','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(259,'IMA_INEFFICIENT_MEMBER_ACCESS','IMA_INEFFICIENT_MEMBER_ACCESS','findbugs','<p>\n      This method of an inner class reads from or writes to a private member variable of the owning class,\n      or calls a private method of the owning class. The compiler must generate a special method to access this\n      private member, causing this to be less efficient. Relaxing the protection of the member variable or method\n      will allow the compiler to treat this as a normal access.\n      </p>',0,NULL,'Experimental - Method accesses a private member variable of owning class','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,26,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(260,'RV_CHECK_COMPARETO_FOR_SPECIFIC_RETURN_VALUE','RV_CHECK_COMPARETO_FOR_SPECIFIC_RETURN_VALUE','findbugs','<p>This code invoked a compareTo or compare method, and checks to see if the return value is a specific \nvalue, such as 1 or -1. When invoking these methods, you should only check the sign of the result, not \nfor any specific non-zero value. While many or most compareTo and compare methods only return -1, 0 or 1, \nsome of them will return other values.</p>',2,NULL,'Code checks for specific values returned by compareTo','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(261,'ICAST_INT_2_LONG_AS_INSTANT','ICAST_INT_2_LONG_AS_INSTANT','findbugs','<p>This code converts a 32-bit int value to a 64-bit long value, and then passes that value for a \nmethod parameter that requires an absolute time value. An absolute time value is the number of \nmilliseconds since the standard base time known as \"the epoch\", namely January 1, 1970, 00:00:00 GMT. \nFor example, the following method, intended to convert seconds since the epoc into a Date, is badly broken:\n<pre>\nDate getDate(int seconds) { return new Date(seconds * 1000); }\n</pre>\n</p>\n<p>The multiplication is done using 32-bit arithmetic, and then converted to a 64-bit value. When a 32-bit \nvalue is converted to 64-bits and used to express an absolute time value, only dates in December 1969 and \nJanuary 1970 can be represented.</p>\n<p>Correct implementations for the above method are:\n<pre>\n// Fails for dates after 2037\nDate getDate(int seconds) { return new Date(seconds * 1000L); }\n\n// better, works for all dates\nDate getDate(long seconds) { return new Date(seconds * 1000); }\n</pre>\n</p>',2,NULL,'int value converted to long and used as absolute time','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(262,'SWL_SLEEP_WITH_LOCK_HELD','SWL_SLEEP_WITH_LOCK_HELD','findbugs','<p>\n      This method calls Thread.sleep() with a lock held.  This may result\n      in very poor performance and scalability, or a deadlock, since other threads may\n      be waiting to acquire the lock.  It is a much better idea to call\n      wait() on the lock, which releases the lock and allows other threads\n      to run.\n      </p>',3,NULL,'Multithreaded correctness - Method calls Thread.sleep() with a lock held','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(263,'FI_PUBLIC_SHOULD_BE_PROTECTED','FI_PUBLIC_SHOULD_BE_PROTECTED','findbugs','<p> A class\'s <code>finalize()</code> method should have protected access,\n   not public.</p>',2,NULL,'Malicious code vulnerability - Finalizer should be protected, not public','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,15,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(264,'STI_INTERRUPTED_ON_CURRENTTHREAD','STI_INTERRUPTED_ON_CURRENTTHREAD','findbugs','<p>\nThis method invokes the Thread.currentThread() call, just to call the interrupted() method. As interrupted() is a\nstatic method, is more simple and clear to use Thread.interrupted().\n</p>',3,NULL,'Correctness - Unneeded use of currentThread() call, to call interrupted()','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(265,'BIT_SIGNED_CHECK','BIT_SIGNED_CHECK','findbugs','<p> This method compares an expression such as\n<pre>((event.detail &amp; SWT.SELECTED) &gt; 0)</pre>.\nUsing bit arithmetic and then comparing with the greater than operator can\nlead to unexpected results (of course depending on the value of\nSWT.SELECTED). If SWT.SELECTED is a negative number, this is a candidate\nfor a bug. Even when SWT.SELECTED is not negative, it seems good practice\nto use \'!= 0\' instead of \'&gt; 0\'.\n</p>\n<p>\n<em>Boris Bokowski</em>\n</p>',3,NULL,'Bad practice - Check for sign of bitwise operation','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(266,'UWF_FIELD_NOT_INITIALIZED_IN_CONSTRUCTOR','UWF_FIELD_NOT_INITIALIZED_IN_CONSTRUCTOR','findbugs','<p>This field is never initialized within any constructor, and is therefore could be null after the object is constructed. This could be a either an error or a questionable design, since it means a null pointer exception will be generated if that field is dereferenced before being initialized.</p>',1,NULL,'Correctness - Field not initialized in constructor','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(267,'EQ_OTHER_NO_OBJECT','EQ_OTHER_NO_OBJECT','findbugs','<p> This class defines an <code>equals()</code>\n  method, that doesn\'t override the normal <code>equals(Object)</code> method\n  defined in the base <code>java.lang.Object</code> class.&nbsp; Instead, it\n  inherits an <code>equals(Object)</code> method from a superclass.\n  The class should probably define a <code>boolean equals(Object)</code> method.\n  </p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1201} instead.\n</p>',2,NULL,'Correctness - equals() method defined that doesn\'t override equals(Object)','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(268,'NP_NONNULL_PARAM_VIOLATION','NP_NONNULL_PARAM_VIOLATION','findbugs','<p>\n      This method passes a null value as the parameter of a method which\n	must be nonnull. Either this parameter has been explicitly marked\n	as @Nonnull, or analysis has determined that this parameter is\n	always dereferenced.\n      </p>',3,NULL,'Correctness - Method call passes null to a nonnull parameter','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(269,'FI_EMPTY','FI_EMPTY','findbugs','<p> Empty <code>finalize()</code> methods are useless, so they should\n  be deleted.</p>',2,NULL,'Bad practice - Empty finalizer should be deleted','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(270,'NP_CLOSING_NULL','NP_CLOSING_NULL','findbugs','close() is being invoked on a value that is always null. If this statement is executed, a null pointer exception will occur. But the big risk here you never close something that should be closed.',4,NULL,'Correctness - close() invoked on a value that is always null','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(271,'UWF_NULL_FIELD','UWF_NULL_FIELD','findbugs','<p> All writes to this field are of the constant value null, and thus\nall reads of the field will return null.\nCheck for errors, or remove it if it is useless.</p>',3,NULL,'Correctness - Field only ever set to null','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(272,'NN_NAKED_NOTIFY','NN_NAKED_NOTIFY','findbugs','<p> A call to <code>notify()</code> or <code>notifyAll()</code>\n  was made without any (apparent) accompanying\n  modification to mutable object state.&nbsp; In general, calling a notify\n  method on a monitor is done because some condition another thread is\n  waiting for has become true.&nbsp; However, for the condition to be meaningful,\n  it must involve a heap object that is visible to both threads.</p>\n\n  <p> This bug does not necessarily indicate an error, since the change to\n  mutable object state may have taken place in a method which then called\n  the method containing the notification.</p>',3,NULL,'Multithreaded correctness - Naked notify','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(273,'OS_OPEN_STREAM','OS_OPEN_STREAM','findbugs','<p> The method creates an IO stream object, does not assign it to any\nfields, pass it to other methods that might close it, \nor return it, and does not appear to close\nthe stream on all paths out of the method.&nbsp; This may result in\na file descriptor leak.&nbsp; It is generally a good\nidea to use a <code>finally</code> block to ensure that streams are\nclosed.</p>',3,NULL,'Bad practice - Method may fail to close stream','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(274,'NM_SAME_SIMPLE_NAME_AS_SUPERCLASS','NM_SAME_SIMPLE_NAME_AS_SUPERCLASS','findbugs','<p> This class has a simple name that is identical to that of its superclass, except\nthat its superclass is in a different package (e.g., <code>alpha.Foo</code> extends <code>beta.Foo</code>). \nThis can be exceptionally confusing, create lots of situations in which you have to look at import statements\nto resolve references and creates many\nopportunities to accidently define methods that do not override methods in their superclasses.\n</p>',2,NULL,'Bad practice - Class names shouldn\'t shadow simple name of superclass','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(275,'EQ_ABSTRACT_SELF','EQ_ABSTRACT_SELF','findbugs','<p> This class defines a covariant version of <code>equals()</code>.&nbsp;\n  To correctly override the <code>equals()</code> method in\n  <code>java.lang.Object</code>, the parameter of <code>equals()</code>\n  must have type <code>java.lang.Object</code>.</p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1201} instead.\n</p>',2,NULL,'Bad practice - Abstract class defines covariant equals() method','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(276,'J2EE_STORE_OF_NON_SERIALIZABLE_OBJECT_INTO_SESSION','J2EE_STORE_OF_NON_SERIALIZABLE_OBJECT_INTO_SESSION','findbugs','<p>\nThis code seems to be storing a non-serializable object into an HttpSession.\nIf this session is passivated or migrated, an error will result.\n</p>',3,NULL,'Bad practice - Store of non serializable object into HttpSession','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(277,'RCN_REDUNDANT_COMPARISON_TWO_NULL_VALUES','RCN_REDUNDANT_COMPARISON_TWO_NULL_VALUES','findbugs','<p> This method contains a redundant comparison of two references known to\nboth be definitely null.</p>',3,NULL,'Dodgy - Redundant comparison of two null values','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(278,'SIC_INNER_SHOULD_BE_STATIC_ANON','SIC_INNER_SHOULD_BE_STATIC_ANON','findbugs','<p> This class is an inner class, but does not use its embedded reference\n  to the object which created it.&nbsp; This reference makes the instances\n  of the class larger, and may keep the reference to the creator object\n  alive longer than necessary.&nbsp; If possible, the class should be\n  made into a <em>static</em> inner class. Since anonymous inner\nclasses cannot be marked as static, doing this will require refactoring\nthe inner class so that it is a named inner class.</p>',2,NULL,'Performance - Could be refactored into a named static inner class','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(279,'NM_CLASS_NOT_EXCEPTION','NM_CLASS_NOT_EXCEPTION','findbugs','<p> This class is not derived from another exception, but ends with \'Exception\'. This will\nbe confusing to users of this class.</p>',2,NULL,'Bad practice - Class is not derived from an Exception, even though it is named as such','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(280,'FB_UNEXPECTED_WARNING','FB_UNEXPECTED_WARNING','findbugs','<p>\n      FindBugs generated a warning that, according to a @NoWarning annotated,\n      is unexpected or undesired\n      </p>',0,NULL,'Experimental - Unexpected/undesired warning from FindBugs','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(281,'SE_METHOD_MUST_BE_PRIVATE','SE_METHOD_MUST_BE_PRIVATE','findbugs','<p> This class implements the <code>Serializable</code> interface, and defines a method\n  for custom serialization/deserialization. But since that method isn\'t declared private,\n  it will be silently ignored by the serialization/deserialization API.</p>',2,NULL,'Correctness - Method must be private in order for serialization to work','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(282,'QBA_QUESTIONABLE_BOOLEAN_ASSIGNMENT','QBA_QUESTIONABLE_BOOLEAN_ASSIGNMENT','findbugs','<p>\n      This method assigns a literal boolean value (true or false) to a boolean variable inside\n      an if or while expression. Most probably this was supposed to be a boolean comparison using \n      ==, not an assignment using =.\n      </p>',3,NULL,'Correctness - Method assigns boolean literal in boolean expression','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(283,'SS_SHOULD_BE_STATIC','SS_SHOULD_BE_STATIC','findbugs','<p> This class contains an instance final field that\n   is initialized to a compile-time static value.\n   Consider making the field static.</p>',2,NULL,'Performance - Unread field: should this field be static?','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(284,'FI_EXPLICIT_INVOCATION','FI_EXPLICIT_INVOCATION','findbugs','<p> This method contains an explicit invocation of the <code>finalize()</code>\n  method on an object.&nbsp; Because finalizer methods are supposed to be\n  executed once, and only by the VM, this is a bad idea.</p>\n<p>If a connected set of objects beings finalizable, then the VM will invoke the\nfinalize method on all the finalizable object, possibly at the same time in different threads.\nThus, it is a particularly bad idea, in the finalize method for a class X, invoke finalize\non objects referenced by X, because they may already be getting finalized in a separate thread.\n\n<p>\nThis rule is deprecated, use {rule:squid:ObjectFinalizeCheck} instead.\n</p>',2,NULL,'Bad practice - Explicit invocation of finalizer','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(285,'EC_ARRAY_AND_NONARRAY','EC_ARRAY_AND_NONARRAY','findbugs','<p>\nThis method invokes the .equals(Object o) to compare an array and a reference that doesn\'t seem\nto be an array. If things being compared are of different types, they are guaranteed to be unequal\nand the comparison is almost certainly an error. Even if they are both arrays, the equals method\non arrays only determines of the two arrays are the same object.\nTo compare the\ncontents of the arrays, use java.util.Arrays.equals(Object[], Object[]).\n</p>',3,NULL,'Correctness - equals() used to compare array and nonarray','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(286,'BIT_IOR','BIT_IOR','findbugs','<p> This method compares an expression of the form (e | C) to D.\nwhich will always compare unequal\ndue to the specific values of constants C and D.\nThis may indicate a logic error or typo.</p>\n\n<p> Typically, this bug occurs because the code wants to perform\na membership test in a bit set, but uses the bitwise OR\noperator (\"|\") instead of bitwise AND (\"&amp;\").</p>',3,NULL,'Correctness - Incompatible bit masks (BIT_IOR)','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(287,'MS_SHOULD_BE_FINAL','MS_SHOULD_BE_FINAL','findbugs','<p>\n A mutable static field could be changed by malicious code or\n        by accident from another package.\n        The field could be made final to avoid\n        this vulnerability.</p>\n<p>\n  This rule is deprecated, use {rule:squid:S1444} instead.\n</p>',2,NULL,'Malicious code vulnerability - Field isn\'t final but should be','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,15,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(288,'SE_TRANSIENT_FIELD_NOT_RESTORED','SE_TRANSIENT_FIELD_NOT_RESTORED','findbugs','<p> This class contains a field that is updated at multiple places in the class, thus it seems to be part of the state of the class. However, since the field is marked as transient and not set in readObject or readResolve, it will contain the default value in any \ndeserialized instance of the class.\n</p>',2,NULL,'Bad practice - Transient field that isn\'t set by deserialization.','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(289,'EQ_DONT_DEFINE_EQUALS_FOR_ENUM','EQ_DONT_DEFINE_EQUALS_FOR_ENUM','findbugs','<p> This class defines an enumeration, and equality on enumerations are defined\nusing object identity. Defining a covariant equals method for an enumeration\nvalue is exceptionally bad practice, since it would likely result\nin having two different enumeration values that compare as equals using\nthe covariant enum method, and as not equal when compared normally.\nDon\'t do it.\n</p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1201} instead.\n</p>',2,NULL,'Correctness - Covariant equals() method defined for enum','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(290,'VA_FORMAT_STRING_EXTRA_ARGUMENTS_PASSED','VA_FORMAT_STRING_EXTRA_ARGUMENTS_PASSED','findbugs','<p>\nA format-string method with a variable number of arguments is called,\nbut more arguments are passed than are actually used by the format string.\nThis won\'t cause a runtime exception, but the code may be silently omitting \ninformation that was intended to be included in the formatted string.\n</p>',2,NULL,'Correctness - More arguments are passed that are actually used in the format string','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(291,'EQ_ALWAYS_FALSE','EQ_ALWAYS_FALSE','findbugs','<p> This class defines an equals method that always returns false. This means that an object is not equal to itself, and it is impossible to create useful Maps or Sets of this class. More fundamentally, it means\nthat equals is not reflexive, one of the requirements of the equals method.</p>\n<p>The likely intended semantics are object identity: that an object is equal to itself. This is the behavior inherited from class <code>Object</code>. If you need to override an equals inherited from a different \nsuperclass, you can use use:\n<pre>\npublic boolean equals(Object o) { return this == o; }\n</pre>\n</p>',4,NULL,'Correctness - equals method always returns false','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(292,'URF_UNREAD_PUBLIC_OR_PROTECTED_FIELD','URF_UNREAD_PUBLIC_OR_PROTECTED_FIELD','findbugs','<p>This field is never read.  The field is public or protected, so perhaps it is intended to be \nused with classes not seen as part of the analysis. If not, consider removing it from the class.</p>',0,NULL,'Unread public/protected field','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(293,'INT_VACUOUS_BIT_OPERATION','INT_VACUOUS_BIT_OPERATION','findbugs','<p> This is an integer bit operation (and, or, or exclusive or) that doesn\'t do any useful work\n(e.g., <code>v & 0xffffffff</code>).\n\n</p>',3,NULL,'Dodgy - Vacuous bit mask operation on integer value','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5h',NULL,NULL,NULL,0,'HTML'),(294,'SF_SWITCH_NO_DEFAULT','SF_SWITCH_NO_DEFAULT','findbugs','<p>\n      This method contains a switch statement where default case is missing.\n      Usually you need to provide a default case.\n      </p>\n\n<p>\nThis rule is deprecated, use {rule:squid:SwitchLastCaseIsDefaultCheck} instead.\n</p>',2,NULL,'Switch statement found where default case is missing','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(295,'DM_BOXED_PRIMITIVE_FOR_PARSING','DM_BOXED_PRIMITIVE_FOR_PARSING','findbugs','<p>\nA boxed primitive is created from a String, just to extract the unboxed primitive value.\nIt is more efficient to just call the static parseXXX method.\n</p>',2,NULL,'Boxing/unboxing to parse a primitive','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(296,'IL_INFINITE_LOOP','IL_INFINITE_LOOP','findbugs','<p>This loop doesn\'t seem to have a way to terminate (other than by perhaps\nthrowing an exception).</p>',3,NULL,'Correctness - An apparent infinite loop','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(297,'EQ_COMPARING_CLASS_NAMES','EQ_COMPARING_CLASS_NAMES','findbugs','<p> This method checks to see if two objects are the same class by checking to see if the names\nof their classes are equal. You can have different classes with the same name if they are loaded by\ndifferent class loaders. Just check to see if the class objects are the same.\n</p>',2,NULL,'Correctness - equals method compares class names rather than class objects','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(298,'NP_ALWAYS_NULL_EXCEPTION','NP_ALWAYS_NULL_EXCEPTION','findbugs','<p> A pointer which is null on an exception path is dereferenced here.&nbsp;\nThis will lead to a <code>NullPointerException</code> when the code is executed.&nbsp;\nNote that because FindBugs currently does not prune infeasible exception paths,\nthis may be a false warning.</p>\n\n<p> Also note that FindBugs considers the default case of a switch statement to\nbe an exception path, since the default case is often infeasible.</p>',3,NULL,'Correctness - Null pointer dereference in method on exception path','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(299,'DB_DUPLICATE_BRANCHES','DB_DUPLICATE_BRANCHES','findbugs','<p>\n      This method uses the same code to implement two branches of a conditional branch.\n	Check to ensure that this isn\'t a coding mistake.\n      </p>',3,NULL,'Dodgy - Method uses the same code for two branches','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(300,'IMSE_DONT_CATCH_IMSE','IMSE_DONT_CATCH_IMSE','findbugs','<p>IllegalMonitorStateException is generally only\n   thrown in case of a design flaw in your code (calling wait or\n   notify on an object you do not hold a lock on).</p>',2,NULL,'Bad practice - Dubious catching of IllegalMonitorStateException','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,30,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(301,'XSS_REQUEST_PARAMETER_TO_SERVLET_WRITER','XSS_REQUEST_PARAMETER_TO_SERVLET_WRITER','findbugs','<p>This code directly writes an HTTP parameter to Servlet output, which allows for a reflected cross site scripting\nvulnerability. See <a href=\"http://en.wikipedia.org/wiki/Cross-site_scripting\">http://en.wikipedia.org/wiki/Cross-site_scripting</a>\nfor more information.</p>\n<p>FindBugs looks only for the most blatant, obvious cases of cross site scripting.\nIf FindBugs found <em>any</em>, you <em>almost certainly</em> have more cross site scripting\nvulnerabilities that FindBugs doesn\'t report. If you are concerned about cross site scripting, you should seriously \nconsider using a commercial static analysis or pen-testing tool.\n</p>',3,NULL,'Security - Servlet reflected cross site scripting vulnerability','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,17,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'3h',NULL,NULL,NULL,0,'HTML'),(302,'DMI_HARDCODED_ABSOLUTE_FILENAME','DMI_HARDCODED_ABSOLUTE_FILENAME','findbugs','<p>This code constructs a File object using a hard coded to an absolute pathname\n(e.g., <code>new File(\"/home/dannyc/workspace/j2ee/src/share/com/sun/enterprise/deployment\");</code>\n</p>',3,NULL,'Dodgy - Code contains a hard coded reference to an absolute pathname','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,6,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(303,'HE_HASHCODE_NO_EQUALS','HE_HASHCODE_NO_EQUALS','findbugs','<p> This class defines a <code>hashCode()</code> method but not an\n  <code>equals()</code> method.&nbsp; Therefore, the class may\n  violate the invariant that equal objects must have equal hashcodes.</p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1206} instead.\n</p>',3,NULL,'Bad practice - Class defines hashCode() but not equals()','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(304,'EC_UNRELATED_CLASS_AND_INTERFACE','EC_UNRELATED_CLASS_AND_INTERFACE','findbugs','<p>\nThis method calls equals(Object) on two references,  one of which is a class\nand the other an interface, where neither the class nor any of its\nnon-abstract subclasses implement the interface.\nTherefore, the objects being compared\nare unlikely to be members of the same class at runtime\n(unless some application classes were not analyzed, or dynamic class\nloading can occur at runtime).\nAccording to the contract of equals(),\nobjects of different\nclasses should always compare as unequal; therefore, according to the\ncontract defined by java.lang.Object.equals(Object),\nthe result of this comparison will always be false at runtime.\n</p>',3,NULL,'Correctness - Call to equals() comparing unrelated class and interface','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(305,'NP_DEREFERENCE_OF_READLINE_VALUE','NP_DEREFERENCE_OF_READLINE_VALUE','findbugs','<p> The result of invoking readLine() is dereferenced without checking to see if the result is null. If there are no more lines of text\nto read, readLine() will return null and dereferencing that will generate a null pointer exception.\n</p>',3,NULL,'Dodgy - Dereference of the result of readLine() without nullcheck','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(306,'BC_IMPOSSIBLE_CAST','BC_IMPOSSIBLE_CAST','findbugs','<p>\nThis cast will always throw a ClassCastException.\n</p>',4,NULL,'Correctness - Impossible cast','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(307,'NP_NULL_ON_SOME_PATH_EXCEPTION','NP_NULL_ON_SOME_PATH_EXCEPTION','findbugs','<p> A reference value which is null on some exception control path is\ndereferenced here.&nbsp; This may lead to a <code>NullPointerException</code>\nwhen the code is executed.&nbsp;\nNote that because FindBugs currently does not prune infeasible exception paths,\nthis may be a false warning.</p>\n\n<p> Also note that FindBugs considers the default case of a switch statement to\nbe an exception path, since the default case is often infeasible.</p>',3,NULL,'Correctness - Possible null pointer dereference in method on exception path','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(308,'ICAST_QUESTIONABLE_UNSIGNED_RIGHT_SHIFT','ICAST_QUESTIONABLE_UNSIGNED_RIGHT_SHIFT','findbugs','<p>\nThe code performs an unsigned right shift, whose result is then\ncast to a short or byte, which discards the upper bits of the result.\nSince the upper bits are discarded, there may be no difference between\na signed and unsigned right shift (depending upon the size of the shift).\n</p>',3,NULL,'Dodgy - Unsigned right shift cast to short/byte','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5h',NULL,NULL,NULL,0,'HTML'),(309,'IC_INIT_CIRCULARITY','IC_INIT_CIRCULARITY','findbugs','<p> A circularity was detected in the static initializers of the two\n  classes referenced by the bug instance.&nbsp; Many kinds of unexpected\n  behavior may arise from such circularity.</p>',3,NULL,'Dodgy - Initialization circularity','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(310,'UM_UNNECESSARY_MATH','UM_UNNECESSARY_MATH','findbugs','<p> This method uses a static method from java.lang.Math on a constant value. This method\'s\nresult in this case, can be determined statically, and is faster and sometimes more accurate to\njust use the constant. Methods detected are:\n</p>\n<table>\n<tr>\n   <th>Method</th> <th>Parameter</th>\n</tr>\n<tr>\n   <td>abs</td> <td>-any-</td>\n</tr>\n<tr>\n   <td>acos</td> <td>0.0 or 1.0</td>\n</tr>\n<tr>\n   <td>asin</td> <td>0.0 or 1.0</td>\n</tr>\n<tr>\n   <td>atan</td> <td>0.0 or 1.0</td>\n</tr>\n<tr>\n   <td>atan2</td> <td>0.0</td>\n</tr>\n<tr>\n   <td>cbrt</td> <td>0.0 or 1.0</td>\n</tr>\n<tr>\n   <td>ceil</td> <td>-any-</td>\n</tr>\n<tr>\n   <td>cos</td> <td>0.0</td>\n</tr>\n<tr>\n   <td>cosh</td> <td>0.0</td>\n</tr>\n<tr>\n   <td>exp</td> <td>0.0 or 1.0</td>\n</tr>\n<tr>\n   <td>expm1</td> <td>0.0</td>\n</tr>\n<tr>\n   <td>floor</td> <td>-any-</td>\n</tr>\n<tr>\n   <td>log</td> <td>0.0 or 1.0</td>\n</tr>\n<tr>\n   <td>log10</td> <td>0.0 or 1.0</td>\n</tr>\n<tr>\n   <td>rint</td> <td>-any-</td>\n</tr>\n<tr>\n   <td>round</td> <td>-any-</td>\n</tr>\n<tr>\n   <td>sin</td> <td>0.0</td>\n</tr>\n<tr>\n   <td>sinh</td> <td>0.0</td>\n</tr>\n<tr>\n   <td>sqrt</td> <td>0.0 or 1.0</td>\n</tr>\n<tr>\n   <td>tan</td> <td>0.0</td>\n</tr>\n<tr>\n   <td>tanh</td> <td>0.0</td>\n</tr>\n<tr>\n   <td>toDegrees</td> <td>0.0 or 1.0</td>\n</tr>\n<tr>\n   <td>toRadians</td> <td>0.0</td>\n</tr>\n</table>',3,NULL,'Performance - Method calls static Math class method on a constant value','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(311,'NM_CLASS_NAMING_CONVENTION','NM_CLASS_NAMING_CONVENTION','findbugs','<p>\n      Class names should be nouns, in mixed case with the first letter of each internal word capitalized. \n      Try to keep your class names simple and descriptive. Use whole words-avoid acronyms and abbreviations \n      (unless the abbreviation is much more widely used than the long form, such as URL or HTML).\n      </p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S00101} and {rule:squid:S00114} instead.\n</p>',2,NULL,'Class names should start with an upper case letter','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(312,'RCN_REDUNDANT_NULLCHECK_WOULD_HAVE_BEEN_A_NPE','RCN_REDUNDANT_NULLCHECK_WOULD_HAVE_BEEN_A_NPE','findbugs','<p> A value is checked here to see whether it is null, but this value can\'t\nbe null because it was previously dereferenced and if it were null a null pointer\nexception would have occurred at the earlier dereference. \nEssentially, this code and the previous dereference\ndisagree as to whether this value is allowed to be null. Either the check is redundant\nor the previous dereference is erroneous.</p>',3,NULL,'Correctness - Nullcheck of value previously dereferenced','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(313,'EQ_DOESNT_OVERRIDE_EQUALS','EQ_DOESNT_OVERRIDE_EQUALS','findbugs','<p> This class extends a class that defines an equals method and adds fields, but doesn\'t\ndefine an equals method itself. Thus, equality on instances of this class will\nignore the identity of the subclass and the added fields. Be sure this is what is intended,\nand that you don\'t need to override the equals method. Even if you don\'t need to override\nthe equals method, consider overriding it anyway to document the fact\nthat the equals method for the subclass just return the result of\ninvoking super.equals(o).\n  </p>',2,NULL,'Dodgy - Class doesn\'t override equals in superclass','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(314,'SA_LOCAL_SELF_ASSIGNMENT_INSTEAD_OF_FIELD','SA_LOCAL_SELF_ASSIGNMENT_INSTEAD_OF_FIELD','findbugs','<p>This method contains a self assignment of a local variable, and there is a field with an identical name.\nAssignment appears to have been ; e.g.\n<pre>\n  int foo;\n  public void setFoo(int foo) {\n    foo = foo;\n  }\n</pre>\nThe assignment is useless. Did you mean to assign to the field instead?</p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1226} instead.\n</p>',2,NULL,'Self assignment of local rather than assignment to field','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(315,'NM_LCASE_TOSTRING','NM_LCASE_TOSTRING','findbugs','<p>\n      This class defines a method called <code>tostring()</code>.  \n      This method does not override the <code>toString()</code> \n      method in <code>java.lang.Object</code>, which is probably what was intended.\n      </p>',2,NULL,'Class defines tostring(); should it be toString()?','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(316,'DM_USELESS_THREAD','DM_USELESS_THREAD','findbugs','<p>This method creates a thread without specifying a run method either by deriving from the Thread class, or\n  by passing a Runnable object. This thread, then, does nothing but waste time.\n</p>',2,NULL,'Multithreaded correctness - A thread was created using the default empty run method','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(317,'JML_JSR166_CALLING_WAIT_RATHER_THAN_AWAIT','JML_JSR166_CALLING_WAIT_RATHER_THAN_AWAIT','findbugs','<p>This method calls <code>wait()</code>, <code>notify()</code> or <code>notifyAll()</code> on an object that also \nprovides an <code>await()</code>, <code>signal()</code>, <code>signalAll()</code> method (such as util.concurrent \nCondition objects). This probably isn\'t what you want, and even if you do want it, you should consider changing your \ndesign, as other developers will find it exceptionally confusing.</p>',2,NULL,'Using monitor style wait methods on util.concurrent abstraction','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(318,'FI_NULLIFY_SUPER','FI_NULLIFY_SUPER','findbugs','<p> This empty <code>finalize()</code> method explicitly negates the\n  effect of any finalizer defined by its superclass.&nbsp; Any finalizer\n  actions defined for the superclass will not be performed.&nbsp;\n  Unless this is intended, delete this method.</p>',3,NULL,'Bad practice - Finalizer nullifies superclass finalizer','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(319,'MS_MUTABLE_HASHTABLE','MS_MUTABLE_HASHTABLE','findbugs','<p>A final static field references a Hashtable\n   and can be accessed by malicious code or\n        by accident from another package.\n   This code can freely modify the contents of the Hashtable.</p>',2,NULL,'Malicious code vulnerability - Field is a mutable Hashtable','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,15,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(320,'NM_CONFUSING','NM_CONFUSING','findbugs','<p> The referenced methods have names that differ only by capitalization.</p>',2,NULL,'Bad practice - Confusing method names','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(321,'DM_NEW_FOR_GETCLASS','DM_NEW_FOR_GETCLASS','findbugs','<p>This method allocates an object just to call getClass() on it, in order to\n  retrieve the Class object for it. It is simpler to just access the .class property of the class.</p>',2,NULL,'Performance - Method allocates an object, only to get the class object','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,20,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(322,'IM_AVERAGE_COMPUTATION_COULD_OVERFLOW','IM_AVERAGE_COMPUTATION_COULD_OVERFLOW','findbugs','<p>The code computes the average of two integers using either division or signed right shift,\nand then uses the result as the index of an array.\nIf the values being averaged are very large, this can overflow (resulting in the computation\nof a negative average).  Assuming that the result is intended to be nonnegative, you \ncan use an unsigned right shift instead. In other words, rather that using <code>(low+high)/2</code>,\nuse <code>(low+high) &gt;&gt;&gt; 1</code>\n</p>\n<p>This bug exists in many earlier implementations of binary search and merge sort.\nMartin Buchholz <a href=\"http://bugs.sun.com/bugdatabase/view_bug.do?bug_id=6412541\">found and fixed it</a>\nin the JDK libraries, and Joshua Bloch\n<a href=\"http://googleresearch.blogspot.com/2006/06/extra-extra-read-all-about-it-nearly.html\">widely\npublicized the bug pattern</a>.\n</p>',3,NULL,'Dodgy - Computation of average could overflow','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(323,'SE_BAD_FIELD_INNER_CLASS','SE_BAD_FIELD_INNER_CLASS','findbugs','<p> This Serializable class is an inner class of a non-serializable class.\nThus, attempts to serialize it will also attempt to associate instance of the outer\nclass with which it is associated, leading to a runtime error.\n</p>\n<p>If possible, making the inner class a static inner class should solve the \nproblem. Making the outer class serializable might also work, but that would\nmean serializing an instance of the inner class would always also serialize the instance\nof the outer class, which it often not what you really want.',1,NULL,'Bad practice - Non-serializable class has a serializable inner class','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(324,'NP_UNWRITTEN_FIELD','NP_UNWRITTEN_FIELD','findbugs','<p>The program is dereferencing a field that does not seem to ever have a non-null value written to it. Dereferencing this value will generate a null pointer exception.</p>',2,NULL,'Correctness - Read of unwritten field','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(325,'RV_RETURN_VALUE_IGNORED_BAD_PRACTICE','RV_RETURN_VALUE_IGNORED_BAD_PRACTICE','findbugs','<p> This method returns a value that is not checked. The return value should be checked\nsince it can indicate an unusual or unexpected function execution. For\nexample, the <code>File.delete()</code> method returns false\nif the file could not be successfully deleted (rather than \nthrowing an Exception).\nIf you don\'t check the result, you won\'t notice if the method invocation\nsignals unexpected behavior by returning an atypical return value.\n</p>',2,NULL,'Bad practice - Method ignores exceptional return value','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(326,'TQ_COMPARING_VALUES_WITH_INCOMPATIBLE_TYPE_QUALIFIERS','TQ_COMPARING_VALUES_WITH_INCOMPATIBLE_TYPE_QUALIFIERS','findbugs','<p>\nA value specified as carrying a type qualifier annotation is\ncompared with a value that doesn\'t ever carry that qualifier.\n</p>\n\n<p>\nMore precisely, a value annotated with a type qualifier specifying when=ALWAYS\nis compared with a value that where the same type qualifier specifies when=NEVER.\n</p>\n\n<p>\nFor example, say that @NonNegative is a nickname for\nthe type qualifier annotation @Negative(when=When.NEVER).\nThe following code will generate this warning because\nthe return statement requires a @NonNegative value,\nbut receives one that is marked as @Negative.\n</p>\n<pre>\npublic boolean example(@Negative Integer value1, @NonNegative Integer value2) {\n  return value1.equals(value2);\n}\n</pre>',2,NULL,'Comparing values with incompatible type qualifiers','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(327,'RC_REF_COMPARISON','RC_REF_COMPARISON','findbugs','<p> This method compares two reference values using the == or != operator,\nwhere the correct way to compare instances of this type is generally\nwith the equals() method.  Examples of classes which should generally\nnot be compared by reference are java.lang.Integer, java.lang.Float, etc.</p>',3,NULL,'Bad practice - Suspicious reference comparison','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(328,'MF_CLASS_MASKS_FIELD','MF_CLASS_MASKS_FIELD','findbugs','<p> This class defines a field with the same name as a visible\ninstance field in a superclass.  This is confusing, and\nmay indicate an error if methods update or access one of\nthe fields when they wanted the other.</p>',2,NULL,'Correctness - Class defines field that masks a superclass field','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,24,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(329,'PS_PUBLIC_SEMAPHORES','PS_PUBLIC_SEMAPHORES','findbugs','<p>\n    This class uses synchronization along with wait(), notify() or notifyAll() on itself (the this\n    reference). Client classes that use this class, may, in addition, use an instance of this class\n    as a synchronizing object. Because two classes are using the same object for synchronization,\n    Multithread correctness is suspect. You should not synchronize nor call semaphore methods on\n    a public reference. Consider using a internal private member variable to control synchronization.\n    </p>',3,NULL,'Dodgy - Class exposes synchronization and semaphores in its public interface','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(330,'SKIPPED_CLASS_TOO_BIG','SKIPPED_CLASS_TOO_BIG','findbugs','<p>This class is bigger than can be effectively handled, and was not fully analyzed for errors.\n</p>',1,NULL,'Dodgy - Class too big for analysis','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'3h',NULL,NULL,NULL,0,'HTML'),(331,'HSC_HUGE_SHARED_STRING_CONSTANT','HSC_HUGE_SHARED_STRING_CONSTANT','findbugs','<p>\n	A large String constant is duplicated across multiple class files. \n	This is likely because a final field is initialized to a String constant, and the Java language\n	mandates that all references to a final field from other classes be inlined into\nthat classfile. See <a href=\"http://bugs.sun.com/bugdatabase/view_bug.do?bug_id=6447475\">JDK bug 6447475</a>\n	for a description of an occurrence of this bug in the JDK and how resolving it reduced\n	the size of the JDK by 1 megabyte.\n</p>',3,NULL,'Performance - Huge string constants is duplicated across multiple class files','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,20,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(332,'SE_NO_SUITABLE_CONSTRUCTOR','SE_NO_SUITABLE_CONSTRUCTOR','findbugs','<p> This class implements the <code>Serializable</code> interface\n   and its superclass does not. When such an object is deserialized,\n   the fields of the superclass need to be initialized by\n   invoking the void constructor of the superclass.\n   Since the superclass does not have one,\n   serialization and deserialization will fail at runtime.</p>',2,NULL,'Bad practice - Class is Serializable but its superclass doesn\'t define a void constructor','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(333,'MWN_MISMATCHED_NOTIFY','MWN_MISMATCHED_NOTIFY','findbugs','<p> This method calls Object.notify() or Object.notifyAll() without obviously holding a lock\non the object.&nbsp;  Calling notify() or notifyAll() without a lock held will result in\nan <code>IllegalMonitorStateException</code> being thrown.</p>',3,NULL,'Multithreaded correctness - Mismatched notify()','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(334,'STCAL_INVOKE_ON_STATIC_DATE_FORMAT_INSTANCE','STCAL_INVOKE_ON_STATIC_DATE_FORMAT_INSTANCE','findbugs','<p>As the JavaDoc states, DateFormats are inherently unsafe for multithreaded use. \nThe detector has found a call to an instance of DateFormat that has been obtained via a static\nfield. This looks suspicous.</p>\n<p>For more information on this see <a href=\"http://bugs.sun.com/bugdatabase/view_bug.do?bug_id=6231579\">Sun Bug #6231579</a>\nand <a href=\"http://bugs.sun.com/bugdatabase/view_bug.do?bug_id=6178997\">Sun Bug #6178997</a>.</p>',3,NULL,'Multithreaded correctness - Call to static DateFormat','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(335,'SA_LOCAL_DOUBLE_ASSIGNMENT','SA_LOCAL_DOUBLE_ASSIGNMENT','findbugs','<p> This method contains a double assignment of a local variable; e.g.\n</p>\n<pre>\n  public void foo() {\n    int x,y;\n    x = x = 17;\n  }\n</pre>\n<p>Assigning the same value to a variable twice is useless, and may indicate a logic error or typo.</p>',3,NULL,'Dodgy - Double assignment of local variable','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(336,'DP_DO_INSIDE_DO_PRIVILEGED','DP_DO_INSIDE_DO_PRIVILEGED','findbugs','<p> This code invokes a method that requires a security permission check.\n  If this code will be granted security permissions, but might be invoked by code that does not\n  have security permissions, then the invocation needs to occur inside a doPrivileged block.</p>',2,NULL,'Bad practice - Method invoked that should be only be invoked inside a doPrivileged block','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,18,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(337,'RV_RETURN_VALUE_IGNORED2','RV_RETURN_VALUE_IGNORED2','findbugs','<p> The return value of this method should be checked. One common\ncause of this warning is to invoke a method on an immutable object,\nthinking that it updates the object. For example, in the following code\nfragment,</p>\n<blockquote>\n<pre>\nString dateString = getHeaderField(name);\ndateString.trim();\n</pre>\n</blockquote>\n<p>the programmer seems to be thinking that the trim() method will update\nthe String referenced by dateString. But since Strings are immutable, the trim()\nfunction returns a new String value, which is being ignored here. The code\nshould be corrected to: </p>\n<blockquote>\n<pre>\nString dateString = getHeaderField(name);\ndateString = dateString.trim();\n</pre>\n</blockquote>',2,NULL,'Correctness - Method ignores return value','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(338,'NM_VERY_CONFUSING','NM_VERY_CONFUSING','findbugs','<p> The referenced methods have names that differ only by capitalization. \nThis is very confusing because if the capitalization were\nidentical then one of the methods would override the other.\n</p>',2,NULL,'Correctness - Very confusing method names','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(339,'IO_APPENDING_TO_OBJECT_OUTPUT_STREAM','IO_APPENDING_TO_OBJECT_OUTPUT_STREAM','findbugs','<p>\n     This code opens a file in append mode and then wraps the result in an object output stream. \n     This won\'t allow you to append to an existing object output stream stored in a file. If you want to be\n     able to append to an object output stream, you need to keep the object output stream open.\n      </p>\n      <p>The only situation in which opening a file in append mode and the writing an object output stream\n      could work is if on reading the file you plan to open it in random access mode and seek to the byte offset\n      where the append started.\n      </p> \n      \n      <p>\n      TODO: example.\n      </p>',3,NULL,'Correctness - Doomed attempt to append to an object output stream','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(340,'DM_RUN_FINALIZERS_ON_EXIT','DM_RUN_FINALIZERS_ON_EXIT','findbugs','<p> <em>Never call System.runFinalizersOnExit\nor Runtime.runFinalizersOnExit for any reason: they are among the most\ndangerous methods in the Java libraries.</em> -- Joshua Bloch</p>',2,NULL,'Bad practice - Method invokes dangerous method runFinalizersOnExit','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,18,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(341,'STCAL_STATIC_SIMPLE_DATE_FORMAT_INSTANCE','STCAL_STATIC_SIMPLE_DATE_FORMAT_INSTANCE','findbugs','<p>As the JavaDoc states, DateFormats are inherently unsafe for multithreaded use. \nSharing a single instance across thread boundaries without proper synchronization will result in erratic behavior of the\napplication.</p>\n<p>You may also experience serialization problems.</p>\n<p>Using an instance field is recommended.</p>\n<p>For more information on this see <a href=\"http://bugs.sun.com/bugdatabase/view_bug.do?bug_id=6231579\">Sun Bug #6231579</a>\nand <a href=\"http://bugs.sun.com/bugdatabase/view_bug.do?bug_id=6178997\">Sun Bug #6178997</a>.</p>',3,NULL,'Multithreaded correctness - Static DateFormat','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(342,'FI_FINALIZER_NULLS_FIELDS','FI_FINALIZER_NULLS_FIELDS','findbugs','<p> This finalizer nulls out fields.  This is usually an error, as it does not aid garbage collection,\n  and the object is going to be garbage collected anyway.',2,NULL,'Bad practice - Finalizer nulls fields','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(343,'FE_TEST_IF_EQUAL_TO_NOT_A_NUMBER','FE_TEST_IF_EQUAL_TO_NOT_A_NUMBER','findbugs','<p>\n    This code checks to see if a floating point value is equal to the special\n	Not A Number value (e.g., <code>if (x == Double.NaN)</code>). However,\n	because of the special semantics of <code>NaN</code>, no value\n	is equal to <code>Nan</code>, including <code>NaN</code>. Thus,\n	<code>x == Double.NaN</code> always evaluates to false.\n\n	To check to see if a value contained in <code>x</code>\n	is the special Not A Number value, use \n	<code>Double.isNaN(x)</code> (or <code>Float.isNaN(x)</code> if\n	<code>x</code> is floating point precision).\n    </p>',3,NULL,'Correctness - Doomed test for equality to NaN','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(344,'TLW_TWO_LOCK_WAIT','TLW_TWO_LOCK_WAIT','findbugs','<p> Waiting on a monitor while two locks are held may cause\n  deadlock.\n   &nbsp;\n   Performing a wait only releases the lock on the object\n   being waited on, not any other locks.\n   &nbsp;\nThis not necessarily a bug, but is worth examining\n  closely.</p>',2,NULL,'Multithreaded correctness - Wait with two locks held','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(345,'DMI_CONSTANT_DB_PASSWORD','DMI_CONSTANT_DB_PASSWORD','findbugs','<p>This code creates a database connect using a hardcoded, constant password. Anyone with access to either the source code or the compiled code can \n	easily learn the password.\n</p>',4,NULL,'Security - Hardcoded constant database password','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,18,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(346,'DMI_ARGUMENTS_WRONG_ORDER','DMI_ARGUMENTS_WRONG_ORDER','findbugs','<p>The arguments to this method call seem to be in the wrong order. For example, a call \n<code>Preconditions.checkNotNull(\"message\", message)</code> has reserved arguments: the value \nto be checked is the first argument.</p>',1,NULL,'Reversed method arguments','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(347,'DMI_COLLECTION_OF_URLS','DMI_COLLECTION_OF_URLS','findbugs','<p> This method or field is or uses a Map or Set of URLs. Since both the equals and hashCode\nmethod of URL perform domain name resolution, this can result in a big performance hit.\nSee <a href=\"http://michaelscharf.blogspot.com/2006/11/javaneturlequals-and-hashcode-make.html\">http://michaelscharf.blogspot.com/2006/11/javaneturlequals-and-hashcode-make.html</a> for more information.\nConsider using <code>java.net.URI</code> instead.\n   </p>',4,NULL,'Performance - Maps and sets of URLs can be performance hogs','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(348,'NM_METHOD_NAMING_CONVENTION','NM_METHOD_NAMING_CONVENTION','findbugs','<p>\n      Methods should be verbs, in mixed case with the first letter lowercase, \n      with the first letter of each internal word capitalized.\n      </p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S00100} instead.\n</p>',2,NULL,'Method names should start with a lower case letter','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(349,'SIC_THREADLOCAL_DEADLY_EMBRACE','SIC_THREADLOCAL_DEADLY_EMBRACE','findbugs','This class is an inner class, but should probably be a static inner class. As it is, there is a serious danger of a deadly embrace between the inner class and the thread local in the outer class. Because the inner class isn\'t static, it retains a reference to the outer class. If the thread local contains a reference to an instance of the inner class, the inner and outer instance will both be reachable and not eligible for garbage collection.',2,NULL,'Correctness - Deadly embrace of non-static inner class and thread local','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(350,'NM_WRONG_PACKAGE_INTENTIONAL','NM_WRONG_PACKAGE_INTENTIONAL','findbugs','<p> The method in the subclass doesn\'t override a similar method in a superclass because the type of a parameter doesn\'t exactly match\nthe type of the corresponding parameter in the superclass. For example, if you have:</p>\n\n<blockquote>\n<pre>\nimport alpha.Foo;\npublic class A {\n  public int f(Foo x) { return 17; }\n}\n----\nimport beta.Foo;\npublic class B extends A {\n  public int f(Foo x) { return 42; }\n  public int f(alpha.Foo x) { return 27; }\n}\n</pre>\n</blockquote>\n\n<p>The <code>f(Foo)</code> method defined in class <code>B</code> doesn\'t\noverride the \n<code>f(Foo)</code> method defined in class <code>A</code>, because the argument\ntypes are <code>Foo</code>\'s from different packages.\n</p>\n\n<p>In this case, the subclass does define a method with a signature identical to the method in the superclass,\nso this is presumably understood. However, such methods are exceptionally confusing. You should strongly consider\nremoving or deprecating the method with the similar but not identical signature.\n</p>',2,NULL,'Bad practice - Method doesn\'t override method in superclass due to wrong package for parameter','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(351,'INT_BAD_REM_BY_1','INT_BAD_REM_BY_1','findbugs','<p> Any expression (exp % 1) is guaranteed to always return zero.\nDid you mean (exp &amp; 1) or (exp % 2) instead?\n</p>',3,NULL,'Correctness - Integer remainder modulo 1','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(352,'ES_COMPARING_STRINGS_WITH_EQ','ES_COMPARING_STRINGS_WITH_EQ','findbugs','<p>This code compares <code>java.lang.String</code> objects for reference\nequality using the == or != operators.\nUnless both strings are either constants in a source file, or have been\ninterned using the <code>String.intern()</code> method, the same string\nvalue may be represented by two different String objects. Consider\nusing the <code>equals(Object)</code> method instead.</p>',2,NULL,'Bad practice - Comparison of String objects using == or !=','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(353,'QF_QUESTIONABLE_FOR_LOOP','QF_QUESTIONABLE_FOR_LOOP','findbugs','<p>Are you sure this for loop is incrementing the correct variable?\n   It appears that another variable is being initialized and checked\n   by the for loop.\n</p>',3,NULL,'Dodgy - Complicated, subtle or wrong increment in for-loop','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(354,'VA_FORMAT_STRING_BAD_CONVERSION_TO_BOOLEAN','VA_FORMAT_STRING_BAD_CONVERSION_TO_BOOLEAN','findbugs','<p>\nAn argument not of type Boolean is being formatted with a %b format specifier. This won\'t throw an\nexception; instead, it will print true for any nonnull value, and false for null.\nThis feature of format strings is strange, and may not be what you intended.\n</p>',2,NULL,'Dodgy - Non-Boolean argument formatted using %b format specifier','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(355,'XFB_XML_FACTORY_BYPASS','XFB_XML_FACTORY_BYPASS','findbugs','<p>\n      This method allocates a specific implementation of an xml interface. It is preferable to use\n      the supplied factory classes to create these objects so that the implementation can be\n      changed at runtime. See\n      </p>\n      <ul>\n         <li>javax.xml.parsers.DocumentBuilderFactory</li>\n         <li>javax.xml.parsers.SAXParserFactory</li>\n         <li>javax.xml.transform.TransformerFactory</li>\n         <li>org.w3c.dom.Document.create<i>XXXX</i></li>\n      </ul>\n      <p>for details.</p>',3,NULL,'Dodgy - Method directly allocates a specific implementation of xml interfaces','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,9,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(356,'WS_WRITEOBJECT_SYNC','WS_WRITEOBJECT_SYNC','findbugs','<p> This class has a <code>writeObject()</code> method which is synchronized;\n  however, no other method of the class is synchronized.</p>',3,NULL,'Multithreaded correctness - Class\'s writeObject() method is synchronized but nothing else is','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(357,'CN_IDIOM_NO_SUPER_CALL','CN_IDIOM_NO_SUPER_CALL','findbugs','<p> This non-final class defines a clone() method that does not call super.clone().\nIf this class (\"<i>A</i>\") is extended by a subclass (\"<i>B</i>\"),\nand the subclass <i>B</i> calls super.clone(), then it is likely that\n<i>B</i>\'s clone() method will return an object of type <i>A</i>,\nwhich violates the standard contract for clone().</p>\n\n<p> If all clone() methods call super.clone(), then they are guaranteed\nto use Object.clone(), which always returns an object of the correct type.</p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1182} instead.\n</p>',2,NULL,'Bad practice - clone method does not call super.clone()','DEPRECATED','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(358,'DLS_DEAD_STORE_OF_CLASS_LITERAL','DLS_DEAD_STORE_OF_CLASS_LITERAL','findbugs','<p>\nThis instruction assigns a class literal to a variable and then never uses it.\n<a href=\"//java.sun.com/j2se/1.5.0/compatibility.html#literal\">The behavior of this differs in Java 1.4 and in Java 5.</a>\nIn Java 1.4 and earlier, a reference to <code>Foo.class</code> would force the static initializer\nfor <code>Foo</code> to be executed, if it has not been executed already.\nIn Java 5 and later, it does not.\n</p>\n<p>See Sun\'s <a href=\"//java.sun.com/j2se/1.5.0/compatibility.html#literal\">article on Java SE compatibility</a>\nfor more details and examples, and suggestions on how to force class initialization in Java 5.\n</p>',3,NULL,'Correctness - Dead store of class literal','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(359,'BC_EQUALS_METHOD_SHOULD_WORK_FOR_ALL_OBJECTS','BC_EQUALS_METHOD_SHOULD_WORK_FOR_ALL_OBJECTS','findbugs','<p>\nThe <code>equals(Object o)</code> method shouldn\'t make any assumptions\nabout the type of <code>o</code>. It should simply return\nfalse if <code>o</code> is not the same type as <code>this</code>.\n</p>',3,NULL,'Bad practice - Equals method should not assume anything about the type of its argument','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(360,'ML_SYNC_ON_FIELD_TO_GUARD_CHANGING_THAT_FIELD','ML_SYNC_ON_FIELD_TO_GUARD_CHANGING_THAT_FIELD','findbugs','<p> This method synchronizes on a field in what appears to be an attempt\nto guard against simultaneous updates to that field. But guarding a field\ngets a lock on the referenced object, not on the field. This may not \nprovide the mutual exclusion you need, and other threads might \nbe obtaining locks on the referenced objects (for other purposes). An example\nof this pattern would be:\n\n<p><pre>\nprivate Long myNtfSeqNbrCounter = new Long(0);\nprivate Long getNotificationSequenceNumber() {\n     Long result = null;\n     synchronized(myNtfSeqNbrCounter) {\n         result = new Long(myNtfSeqNbrCounter.longValue() + 1);\n         myNtfSeqNbrCounter = new Long(result.longValue());\n     }\n     return result;\n }\n</pre>\n\n\n</p>',2,NULL,'Multithreaded correctness - Synchronization on field in futile attempt to guard that field','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(361,'MWN_MISMATCHED_WAIT','MWN_MISMATCHED_WAIT','findbugs','<p> This method calls Object.wait() without obviously holding a lock\non the object.&nbsp;  Calling wait() without a lock held will result in\nan <code>IllegalMonitorStateException</code> being thrown.</p>',3,NULL,'Multithreaded correctness - Mismatched wait()','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(362,'DM_NEXTINT_VIA_NEXTDOUBLE','DM_NEXTINT_VIA_NEXTDOUBLE','findbugs','<p>If <code>r</code> is a <code>java.util.Random</code>, you can generate a random number from <code>0</code> to <code>n-1</code>\nusing <code>r.nextInt(n)</code>, rather than using <code>(int)(r.nextDouble() * n)</code>.\n</p>',2,NULL,'Performance - Use the nextInt method of Random rather than nextDouble to generate a random integer','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(363,'AT_OPERATION_SEQUENCE_ON_CONCURRENT_ABSTRACTION','AT_OPERATION_SEQUENCE_ON_CONCURRENT_ABSTRACTION','findbugs','<p>This code contains a sequence of calls to a concurrent abstraction (such as a concurrent hash map). These calls will not be executed atomically.</p>',2,NULL,'Sequence of calls to concurrent abstraction may not be atomic','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(364,'DLS_DEAD_LOCAL_STORE_OF_NULL','DLS_DEAD_LOCAL_STORE_OF_NULL','findbugs','<p>The code stores null into a local variable, and the stored value is not\nread. This store may have been introduced to assist the garbage collector, but\nas of Java SE 6.0, this is no longer needed or useful.\n</p>',3,NULL,'Dodgy - Dead store of null to local variable','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(365,'DMI_BLOCKING_METHODS_ON_URL','DMI_BLOCKING_METHODS_ON_URL','findbugs','<p> The equals and hashCode\nmethod of URL perform domain name resolution, this can result in a big performance hit.\nSee <a href=\"http://michaelscharf.blogspot.com/2006/11/javaneturlequals-and-hashcode-make.html\">http://michaelscharf.blogspot.com/2006/11/javaneturlequals-and-hashcode-make.html</a> for more information.\nConsider using <code>java.net.URI</code> instead.\n   </p>',4,NULL,'Performance - The equals and hashCode methods of URL are blocking','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(366,'NP_NULL_ON_SOME_PATH_MIGHT_BE_INFEASIBLE','NP_NULL_ON_SOME_PATH_MIGHT_BE_INFEASIBLE','findbugs','<p> There is a branch of statement that, <em>if executed,</em>  guarantees that\na null value will be dereferenced, which\nwould generate a <code>NullPointerException</code> when the code is executed.\nOf course, the problem might be that the branch or statement is infeasible and that\nthe null pointer exception can\'t ever be executed; deciding that is beyond the ability of FindBugs.\nDue to the fact that this value had been previously tested for nullness, this is a definite possibility.\n</p>',3,NULL,'Dodgy - Possible null pointer dereference on path that might be infeasible','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(367,'PT_ABSOLUTE_PATH_TRAVERSAL','PT_ABSOLUTE_PATH_TRAVERSAL','findbugs','<p>\nThe software uses an HTTP request parameter to construct a pathname that should be within a restricted directory,\nbut it does not properly neutralize absolute path sequences such as \"/abs/path\" that can resolve to a location that is outside of that directory.\n\nSee <a href=\"http://cwe.mitre.org/data/definitions/36.html\">http://cwe.mitre.org/data/definitions/36.html</a> for more information.\n</p>\n\n<p>\nFindBugs looks only for the most blatant, obvious cases of absolute path traversal.\nIf FindBugs found <em>any</em>, you <em>almost certainly</em> have more\nvulnerabilities that FindBugs doesn\'t report. If you are concerned about absolute path traversal, you should seriously\nconsider using a commercial static analysis or pen-testing tool.\n</p>',2,NULL,'Absolute path traversal in servlet','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,18,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(368,'NM_VERY_CONFUSING_INTENTIONAL','NM_VERY_CONFUSING_INTENTIONAL','findbugs','<p> The referenced methods have names that differ only by capitalization. \nThis is very confusing because if the capitalization were\nidentical then one of the methods would override the other. From the existence of other methods, it\nseems that the existence of both of these methods is intentional, but is sure is confusing. \nYou should try hard to eliminate one of them, unless you are forced to have both due to frozen APIs.\n</p>',2,NULL,'Bad practice - Very confusing method names (but perhaps intentional)','READY','java','2014-11-26 15:18:23','2014-11-26 15:18:23',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(369,'XSS_REQUEST_PARAMETER_TO_SEND_ERROR','XSS_REQUEST_PARAMETER_TO_SEND_ERROR','findbugs','<p>This code directly writes an HTTP parameter to a Server error page (using HttpServletResponse.sendError). Echoing this untrusted input allows\nfor a reflected cross site scripting\nvulnerability. See <a href=\"http://en.wikipedia.org/wiki/Cross-site_scripting\">http://en.wikipedia.org/wiki/Cross-site_scripting</a>\nfor more information.</p>\n<p>FindBugs looks only for the most blatant, obvious cases of cross site scripting.\nIf FindBugs found <em>any</em>, you <em>almost certainly</em> have more cross site scripting\nvulnerabilities that FindBugs doesn\'t report. If you are concerned about cross site scripting, you should seriously \nconsider using a commercial static analysis or pen-testing tool.\n</p>',3,NULL,'Security - Servlet reflected cross site scripting vulnerability','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,17,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'3h',NULL,NULL,NULL,0,'HTML'),(370,'SE_PRIVATE_READ_RESOLVE_NOT_INHERITED','SE_PRIVATE_READ_RESOLVE_NOT_INHERITED','findbugs','<p> This class defines a private readResolve method. Since it is private, it won\'t be inherited by subclasses.\nThis might be intentional and OK, but should be reviewed to ensure it is what is intended.\n</p>',2,NULL,'Dodgy - private readResolve method not inherited by subclasses','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5h',NULL,NULL,NULL,0,'HTML'),(371,'DMI_INVOKING_TOSTRING_ON_ARRAY','DMI_INVOKING_TOSTRING_ON_ARRAY','findbugs','<p>\nThe code invokes toString on an array, which will generate a fairly useless result\nsuch as [C@16f0472. Consider using Arrays.toString to convert the array into a readable\nString that gives the contents of the array. See Programming Puzzlers, chapter 3, puzzle 12.\n</p>',3,NULL,'Correctness - Invocation of toString on an array','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(372,'NP_ARGUMENT_MIGHT_BE_NULL','NP_ARGUMENT_MIGHT_BE_NULL','findbugs','<p>\n	A parameter to this method has been identified as a value that should\n	always be checked to see whether or not it is null, but it is being dereferenced\n	without a preceding null check.\n      </p>',2,NULL,'Correctness - Method does not check for null argument','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(373,'CO_ABSTRACT_SELF','CO_ABSTRACT_SELF','findbugs','<p> This class defines a covariant version of <code>compareTo()</code>.&nbsp;\n  To correctly override the <code>compareTo()</code> method in the\n  <code>Comparable</code> interface, the parameter of <code>compareTo()</code>\n  must have type <code>java.lang.Object</code>.</p>',2,NULL,'Bad practice - Abstract class defines covariant compareTo() method','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(374,'DM_EXIT','DM_EXIT','findbugs','<p> Invoking System.exit shuts down the entire Java virtual machine. This\n   should only been done when it is appropriate. Such calls make it\n   hard or impossible for your code to be invoked by other code.\n   Consider throwing a RuntimeException instead.</p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1147} instead.\n</p>',2,NULL,'Bad practice - Method invokes System.exit(...)','DEPRECATED','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,18,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(375,'RV_RETURN_VALUE_OF_PUTIFABSENT_IGNORED','RV_RETURN_VALUE_OF_PUTIFABSENT_IGNORED','findbugs','The putIfAbsent method is typically used to ensure that a single value is associated with a given key (the first value for which put if absent succeeds). If you ignore the return value and retain a reference to the value passed in, you run the risk of retaining a value that is not the one that is associated with the key in the map. If it matters which one you use and you use the one that isn\'t stored in the map, your program will behave incorrectly.',2,NULL,'Correctness - Return value of putIfAbsent ignored, value passed to putIfAbsent reused','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(376,'UL_UNRELEASED_LOCK_EXCEPTION_PATH','UL_UNRELEASED_LOCK_EXCEPTION_PATH','findbugs','<p> This method acquires a JSR-166 (<code>java.util.concurrent</code>) lock,\nbut does not release it on all exception paths out of the method.  In general, the correct idiom\nfor using a JSR-166 lock is:\n</p>\n<pre>\n    Lock l = ...;\n    l.lock();\n    try {\n        // do something\n    } finally {\n        l.unlock();\n    }\n</pre>',3,NULL,'Multithreaded correctness - Method does not release lock on all exception paths','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(377,'SE_BAD_FIELD','SE_BAD_FIELD','findbugs','<p>\n      This Serializable class defines a non-primitive instance field which is neither transient, \n      Serializable, or <code>java.lang.Object</code>, and does not appear to implement the <code>Externalizable</code> \n      interface or the <code>readObject()</code> and <code>writeObject()</code> methods.  \n      Objects of this class will not be deserialized correctly if a non-Serializable object is stored in this field.\n      </p>',2,NULL,'Non-transient non-serializable instance field in serializable class','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(378,'SA_LOCAL_SELF_ASSIGNMENT','SA_LOCAL_SELF_ASSIGNMENT','findbugs','<p> This method contains a self assignment of a local variable; e.g.</p>\n<pre>\n  public void foo() {\n    int x = 3;\n    x = x;\n  }\n</pre>\n<p>\nSuch assignments are useless, and may indicate a logic error or typo.\n</p>',3,NULL,'Dodgy - Self assignment of local variable','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(379,'NP_UNWRITTEN_PUBLIC_OR_PROTECTED_FIELD','NP_UNWRITTEN_PUBLIC_OR_PROTECTED_FIELD','findbugs','<p>The program is dereferencing a public or protected field that does not seem to ever have a non-null\n value written to it. Unless the field is initialized via some mechanism not seen by the analysis, \n dereferencing this value will generate a null pointer exception.</p>',2,NULL,'Read of unwritten public or protected field','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(380,'RR_NOT_CHECKED','RR_NOT_CHECKED','findbugs','<p> This method ignores the return value of one of the variants of\n  <code>java.io.InputStream.read()</code> which can return multiple bytes.&nbsp;\n  If the return value is not checked, the caller will not be able to correctly\n  handle the case where fewer bytes were read than the caller requested.&nbsp;\n  This is a particularly insidious kind of bug, because in many programs,\n  reads from input streams usually do read the full amount of data requested,\n  causing the program to fail only sporadically.</p>',2,NULL,'Bad practice - Method ignores results of InputStream.read()','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(381,'ST_WRITE_TO_STATIC_FROM_INSTANCE_METHOD','ST_WRITE_TO_STATIC_FROM_INSTANCE_METHOD','findbugs','<p> This instance method writes to a static field. This is tricky to get\ncorrect if multiple instances are being manipulated,\nand generally bad practice.\n</p>',3,NULL,'Dodgy - Write to static field from instance method','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5h',NULL,NULL,NULL,0,'HTML'),(382,'EQ_SELF_NO_OBJECT','EQ_SELF_NO_OBJECT','findbugs','<p> This class defines a covariant version of <code>equals()</code>.&nbsp;\n  To correctly override the <code>equals()</code> method in\n  <code>java.lang.Object</code>, the parameter of <code>equals()</code>\n  must have type <code>java.lang.Object</code>.</p>\n\n<p>\nThis rule is deprecated, use {rule:squid:S1201} instead.\n</p>',2,NULL,'Bad practice - Covariant equals() method defined','DEPRECATED','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(383,'NP_TOSTRING_COULD_RETURN_NULL','NP_TOSTRING_COULD_RETURN_NULL','findbugs','<p>\n	This toString method seems to return null in some circumstances. A liberal reading of the\n	spec could be interpreted as allowing this, but it is probably a bad idea and could cause\n	other code to break. Return the empty string or some other appropriate string rather than null.\n      </p>',3,NULL,'Bad practice - toString method may return null','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(384,'GC_UNRELATED_TYPES','GC_UNRELATED_TYPES','findbugs','<p> This call to a generic collection method contains an argument\n     with an incompatible class from that of the collection\'s parameter\n	(i.e., the type of the argument is neither a supertype nor a subtype \n		of the corresponding generic type argument).\n     Therefore, it is unlikely that the collection contains any objects \n	that are equal to the method argument used here.\n	Most likely, the wrong value is being passed to the method.</p>\n	<p>In general, instances of two unrelated classes are not equal. \n	For example, if the <code>Foo</code> and <code>Bar</code> classes\n	are not related by subtyping, then an instance of <code>Foo</code>\n		should not be equal to an instance of <code>Bar</code>.\n	Among other issues, doing so will likely result in an equals method\n	that is not symmetrical. For example, if you define the <code>Foo</code> class\n	so that a <code>Foo</code> can be equal to a <code>String</code>,\n	your equals method isn\'t symmetrical since a <code>String</code> can only be equal\n	to a <code>String</code>.\n	</p>\n	<p>In rare cases, people do define nonsymmetrical equals methods and still manage to make \n	their code work. Although none of the APIs document or guarantee it, it is typically\n	the case that if you check if a <code>Collection&lt;String&gt;</code> contains\n	a <code>Foo</code>, the equals method of argument (e.g., the equals method of the \n	<code>Foo</code> class) used to perform the equality checks.\n	</p>',3,NULL,'Correctness - No relationship between generic parameter and method argument','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(385,'IL_INFINITE_RECURSIVE_LOOP','IL_INFINITE_RECURSIVE_LOOP','findbugs','<p>This method unconditionally invokes itself. This would seem to indicate\nan infinite recursive loop that will result in a stack overflow.</p>',3,NULL,'Correctness - An apparent infinite recursive loop','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(386,'DM_STRING_TOSTRING','DM_STRING_TOSTRING','findbugs','<p> Calling <code>String.toString()</code> is just a redundant operation.\n  Just use the String.</p>',0,NULL,'Performance - Method invokes toString() method on a String','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(387,'AM_CREATES_EMPTY_ZIP_FILE_ENTRY','AM_CREATES_EMPTY_ZIP_FILE_ENTRY','findbugs','<p>The code calls <code>putNextEntry()</code>, immediately\nfollowed by a call to <code>closeEntry()</code>. This results\nin an empty ZipFile entry. The contents of the entry\nshould be written to the ZipFile between the calls to\n<code>putNextEntry()</code> and\n<code>closeEntry()</code>.</p>',2,NULL,'Bad practice - Creates an empty zip file entry','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(388,'NS_NON_SHORT_CIRCUIT','NS_NON_SHORT_CIRCUIT','findbugs','<p> This code seems to be using non-short-circuit logic (e.g., &amp;\nor |)\nrather than short-circuit logic (&amp;&amp; or ||).\nNon-short-circuit logic causes both sides of the expression\nto be evaluated even when the result can be inferred from\nknowing the left-hand side. This can be less efficient and\ncan result in errors if the left-hand side guards cases\nwhen evaluating the right-hand side can generate an error.\n\n<p>See <a href=\"http://java.sun.com/docs/books/jls/third_edition/html/expressions.html#15.22.2\">the Java\nLanguage Specification</a> for details\n\n</p>',2,NULL,'Dodgy - Questionable use of non-short-circuit logic','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(389,'DM_BOOLEAN_CTOR','DM_BOOLEAN_CTOR','findbugs','<p> Creating new instances of <code>java.lang.Boolean</code> wastes\n  memory, since <code>Boolean</code> objects are immutable and there are\n  only two useful values of this type.&nbsp; Use the <code>Boolean.valueOf()</code>\n  method (or Java 1.5 autoboxing) to create <code>Boolean</code> objects instead.</p>',2,NULL,'Performance - Method invokes inefficient Boolean constructor; use Boolean.valueOf(...) instead','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(390,'BC_BAD_CAST_TO_CONCRETE_COLLECTION','BC_BAD_CAST_TO_CONCRETE_COLLECTION','findbugs','<p>\nThis code casts an abstract collection (such as a Collection, List, or Set)\nto a specific concrete implementation (such as an ArrayList or HashSet).\nThis might not be correct, and it may make your code fragile, since\nit makes it harder to switch to other concrete implementations at a future\npoint. Unless you have a particular reason to do so, just use the abstract\ncollection class.\n</p>',3,NULL,'Dodgy - Questionable cast to concrete collection','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(391,'SIC_INNER_SHOULD_BE_STATIC_NEEDS_THIS','SIC_INNER_SHOULD_BE_STATIC_NEEDS_THIS','findbugs','<p> This class is an inner class, but does not use its embedded reference\n  to the object which created it except during construction of the\ninner object.&nbsp; This reference makes the instances\n  of the class larger, and may keep the reference to the creator object\n  alive longer than necessary.&nbsp; If possible, the class should be\n  made into a <em>static</em> inner class. Since the reference to the\n   outer object is required during construction of the inner instance,\n   the inner class will need to be refactored so as to\n   pass a reference to the outer instance to the constructor\n   for the inner class.</p>',2,NULL,'Performance - Could be refactored into a static inner class','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(392,'LI_LAZY_INIT_STATIC','LI_LAZY_INIT_STATIC','findbugs','<p> This method contains an unsynchronized lazy initialization of a non-volatile static field.\nBecause the compiler or processor may reorder instructions,\nthreads are not guaranteed to see a completely initialized object,\n<em>if the method can be called by multiple threads</em>.\nYou can make the field volatile to correct the problem.\nFor more information, see the\n<a href=\"http://www.cs.umd.edu/~pugh/java/memoryModel/\">Java Memory Model web site</a>.\n</p>',3,NULL,'Multithreaded correctness - Incorrect lazy initialization of static field','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(393,'NM_FUTURE_KEYWORD_USED_AS_IDENTIFIER','NM_FUTURE_KEYWORD_USED_AS_IDENTIFIER','findbugs','<p>The identifier is a word that is reserved as a keyword in later versions of Java, and your code will need to be changed\nin order to compile it in later versions of Java.</p>',2,NULL,'Bad practice - Use of identifier that is a keyword in later versions of Java','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,5,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(394,'ICAST_INTEGER_MULTIPLY_CAST_TO_LONG','ICAST_INTEGER_MULTIPLY_CAST_TO_LONG','findbugs','<p>\nThis code performs integer multiply and then converts the result to a long,\nas in:\n<code>\n<pre> \n	long convertDaysToMilliseconds(int days) { return 1000*3600*24*days; } \n</pre></code>\nIf the multiplication is done using long arithmetic, you can avoid\nthe possibility that the result will overflow. For example, you\ncould fix the above code to:\n<code>\n<pre> \n	long convertDaysToMilliseconds(int days) { return 1000L*3600*24*days; } \n</pre></code>\nor \n<code>\n<pre> \n	static final long MILLISECONDS_PER_DAY = 24L*3600*1000;\n	long convertDaysToMilliseconds(int days) { return days * MILLISECONDS_PER_DAY; } \n</pre></code>\n</p>',3,NULL,'Dodgy - Result of integer multiplication cast to long','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(395,'STI_INTERRUPTED_ON_UNKNOWNTHREAD','STI_INTERRUPTED_ON_UNKNOWNTHREAD','findbugs','<p>\nThis method invokes the Thread.interrupted() method on a Thread object that appears to be a Thread object that is\nnot the current thread. As the interrupted() method is static, the interrupted method will be called on a different\nobject than the one the author intended.\n</p>',3,NULL,'Correctness - Static Thread.interrupted() method invoked on thread instance','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(396,'DMI_DOH','DMI_DOH','findbugs','<p>This partical method invocation doesn\'t make sense, for reasons that should be apparent from inspection.</p>',2,NULL,'D\'oh! A nonsensical method invocation','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(397,'SA_FIELD_SELF_ASSIGNMENT','SA_FIELD_SELF_ASSIGNMENT','findbugs','<p> This method contains a self assignment of a field; e.g.\n</p>\n<pre>\n  int x;\n  public void foo() {\n    x = x;\n  }\n</pre>\n<p>Such assignments are useless, and may indicate a logic error or typo.</p>',3,NULL,'Correctness - Self assignment of field','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(398,'DMI_EMPTY_DB_PASSWORD','DMI_EMPTY_DB_PASSWORD','findbugs','<p>This code creates a database connect using a blank or empty password. This indicates that the database is not protected by a password. \n</p>',3,NULL,'Security - Empty database password','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,18,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(399,'IJU_BAD_SUITE_METHOD','IJU_BAD_SUITE_METHOD','findbugs','<p> Class is a JUnit TestCase and defines a suite() method.\nHowever, the suite method needs to be declared as either\n<pre>public static junit.framework.Test suite()</pre>\nor \n<pre>public static junit.framework.TestSuite suite()</pre>\n</p>',3,NULL,'Correctness - TestCase declares a bad suite method','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(400,'VA_FORMAT_STRING_MISSING_ARGUMENT','VA_FORMAT_STRING_MISSING_ARGUMENT','findbugs','<p>\nNot enough arguments are passed to satisfy a placeholder in the format string.\nA runtime exception will occur when \nthis statement is executed.\n</p>',3,NULL,'Correctness - Format string references missing argument','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(401,'BIT_ADD_OF_SIGNED_BYTE','BIT_ADD_OF_SIGNED_BYTE','findbugs','<p> Adds a byte value and a value which is known to the 8 lower bits clear.\nValues loaded from a byte array are sign extended to 32 bits\nbefore any any bitwise operations are performed on the value.\nThus, if <code>b[0]</code> contains the value <code>0xff</code>, and\n<code>x</code> is initially 0, then the code \n<code>((x &lt;&lt; 8) + b[0])</code>  will sign extend <code>0xff</code>\nto get <code>0xffffffff</code>, and thus give the value\n<code>0xffffffff</code> as the result.\n</p>\n\n<p>In particular, the following code for packing a byte array into an int is badly wrong: </p>\n<pre>\nint result = 0;\nfor(int i = 0; i &lt; 4; i++) \n  result = ((result &lt;&lt; 8) + b[i]);\n</pre>\n\n<p>The following idiom will work instead: </p>\n<pre>\nint result = 0;\nfor(int i = 0; i &lt; 4; i++) \n  result = ((result &lt;&lt; 8) + (b[i] &amp; 0xff));\n</pre>',3,NULL,'Correctness - Bitwise add of signed byte value','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(402,'SBSC_USE_STRINGBUFFER_CONCATENATION','SBSC_USE_STRINGBUFFER_CONCATENATION','findbugs','<p> The method seems to be building a String using concatenation in a loop.\nIn each iteration, the String is converted to a StringBuffer/StringBuilder,\n   appended to, and converted back to a String.\n   This can lead to a cost quadratic in the number of iterations,\n   as the growing string is recopied in each iteration. </p>\n\n<p>Better performance can be obtained by using\na StringBuffer (or StringBuilder in Java 1.5) explicitly.</p>\n\n<p> For example:</p>\n<pre>\n  // This is bad\n  String s = \"\";\n  for (int i = 0; i &lt; field.length; ++i) {\n    s = s + field[i];\n  }\n\n  // This is better\n  StringBuffer buf = new StringBuffer();\n  for (int i = 0; i &lt; field.length; ++i) {\n    buf.append(field[i]);\n  }\n  String s = buf.toString();\n</pre>\n\n<p>\n  This rule is deprecated, use {rule:squid:S1643} instead.\n</p>',3,NULL,'Performance - Method concatenates strings using + in a loop','DEPRECATED','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(403,'TQ_ALWAYS_VALUE_USED_WHERE_NEVER_REQUIRED','TQ_ALWAYS_VALUE_USED_WHERE_NEVER_REQUIRED','findbugs','<p>\n        A value specified as carrying a type qualifier annotation is\n        consumed in a location or locations requiring that the value not\n        carry that annotation.\n        </p>\n        \n        <p>\n        More precisely, a value annotated with a type qualifier specifying when=ALWAYS\n        is guaranteed to reach a use or uses where the same type qualifier specifies when=NEVER.\n        </p>\n        \n        <p>\n        For example, say that @NonNegative is a nickname for\n        the type qualifier annotation @Negative(when=When.NEVER).\n        The following code will generate this warning because\n        the return statement requires a @NonNegative value,\n        but receives one that is marked as @Negative.   \n        </p>\n        <blockquote>\n<pre>\npublic @NonNegative Integer example(@Negative Integer value) {\n    return value;\n}\n</pre>\n        </blockquote>',3,NULL,'Correctness - Value annotated as carrying a type qualifier used where a value that must not carry that qualifier is required','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(404,'EQ_ALWAYS_TRUE','EQ_ALWAYS_TRUE','findbugs','<p> This class defines an equals method that always returns true. This is imaginative, but not very smart.\nPlus, it means that the equals method is not symmetric.\n</p>',4,NULL,'Correctness - equals method always returns true','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(405,'ISC_INSTANTIATE_STATIC_CLASS','ISC_INSTANTIATE_STATIC_CLASS','findbugs','<p> This class allocates an object that is based on a class that only supplies static methods. This object\ndoes not need to be created, just access the static methods directly using the class name as a qualifier.</p>',2,NULL,'Bad practice - Needless instantiation of class that only supplies static methods','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(406,'BC_BAD_CAST_TO_ABSTRACT_COLLECTION','BC_BAD_CAST_TO_ABSTRACT_COLLECTION','findbugs','<p>\nThis code casts a Collection to an abstract collection\n(such as <code>List</code>, <code>Set</code>, or <code>Map</code>).\nEnsure that you are guaranteed that the object is of the type\nyou are casting to. If all you need is to be able\nto iterate through a collection, you don\'t need to cast it to a Set or List.\n</p>',2,NULL,'Dodgy - Questionable cast to abstract collection','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(407,'IT_NO_SUCH_ELEMENT','IT_NO_SUCH_ELEMENT','findbugs','<p> This class implements the <code>java.util.Iterator</code> interface.&nbsp;\n  However, its <code>next()</code> method is not capable of throwing\n  <code>java.util.NoSuchElementException</code>.&nbsp; The <code>next()</code>\n  method should be changed so it throws <code>NoSuchElementException</code>\n  if is called when there are no more elements to return.</p>',1,NULL,'Bad practice - Iterator next() method can\'t throw NoSuchElementException','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(408,'EI_EXPOSE_REP','EI_EXPOSE_REP','findbugs','<p> Returning a reference to a mutable object value stored in one of the object\'s fields\n  exposes the internal representation of the object.&nbsp;\n   If instances\n   are accessed by untrusted code, and unchecked changes to\n   the mutable object would compromise security or other\n   important properties, you will need to do something different.\n  Returning a new copy of the object is better approach in many situations.</p>',2,NULL,'Malicious code vulnerability - May expose internal representation by returning reference to mutable object','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,17,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(409,'MSF_MUTABLE_SERVLET_FIELD','MSF_MUTABLE_SERVLET_FIELD','findbugs','<p>A web server generally only creates one instance of servlet or jsp class (i.e., treats\nthe class as a Singleton), \nand will \nhave multiple threads invoke methods on that instance to service multiple \nsimultaneous requests.\nThus, having a mutable instance field generally creates race conditions.',2,NULL,'Multithreaded correctness - Mutable servlet field','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(410,'BIT_IOR_OF_SIGNED_BYTE','BIT_IOR_OF_SIGNED_BYTE','findbugs','<p> Loads a value from a byte array and performs a bitwise OR with\nthat value. Values loaded from a byte array are sign extended to 32 bits\nbefore any any bitwise operations are performed on the value.\nThus, if <code>b[0]</code> contains the value <code>0xff</code>, and\n<code>x</code> is initially 0, then the code \n<code>((x &lt;&lt; 8) | b[0])</code>  will sign extend <code>0xff</code>\nto get <code>0xffffffff</code>, and thus give the value\n<code>0xffffffff</code> as the result.\n</p>\n\n<p>In particular, the following code for packing a byte array into an int is badly wrong: </p>\n<pre>\nint result = 0;\nfor(int i = 0; i &lt; 4; i++) \n  result = ((result &lt;&lt; 8) | b[i]);\n</pre>\n\n<p>The following idiom will work instead: </p>\n<pre>\nint result = 0;\nfor(int i = 0; i &lt; 4; i++) \n  result = ((result &lt;&lt; 8) | (b[i] &amp; 0xff));\n</pre>',3,NULL,'Correctness - Bitwise OR of signed byte value','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(411,'JLM_JSR166_LOCK_MONITORENTER','JLM_JSR166_LOCK_MONITORENTER','findbugs','<p> This method performs synchronization on an implementation of\n<code>java.util.concurrent.locks.Lock</code>.  You should use\nthe <code>lock()</code> and <code>unlock()</code> methods instead.\n</p>',3,NULL,'Multithreaded correctness - Synchronization performed on java.util.concurrent Lock','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(412,'SE_NONSTATIC_SERIALVERSIONID','SE_NONSTATIC_SERIALVERSIONID','findbugs','<p> This class defines a <code>serialVersionUID</code> field that is not static.&nbsp;\n  The field should be made static\n   if it is intended to specify\n   the version UID for purposes of serialization.</p>',2,NULL,'Bad practice - serialVersionUID isn\'t static','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(413,'BC_VACUOUS_INSTANCEOF','BC_VACUOUS_INSTANCEOF','findbugs','<p>\nThis instanceof test will always return true (unless the value being tested is null). \nAlthough this is safe, make sure it isn\'t\nan indication of some misunderstanding or some other logic error.\nIf you really want to test the value for being null, perhaps it would be clearer to do\nbetter to do a null test rather than an instanceof test.\n</p>',3,NULL,'Dodgy - instanceof will always return true','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(414,'RC_REF_COMPARISON_BAD_PRACTICE_BOOLEAN','RC_REF_COMPARISON_BAD_PRACTICE_BOOLEAN','findbugs','This method compares two Boolean values using the == or != operator. Normally, there are only two Boolean values (Boolean.TRUE and Boolean.FALSE), but it is possible to create other Boolean objects using the new Boolean(b) constructor. It is best to avoid such objects, but if they do exist, then checking Boolean objects for equality using == or != will give results than are different than you would get using .equals(...)',2,NULL,'Correctness - Suspicious reference comparison of Boolean values','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(415,'NS_DANGEROUS_NON_SHORT_CIRCUIT','NS_DANGEROUS_NON_SHORT_CIRCUIT','findbugs','<p> This code seems to be using non-short-circuit logic (e.g., &amp;\nor |)\nrather than short-circuit logic (&amp;&amp; or ||). In addition, \nit seem possible that, depending on the value of the left hand side, you might not\nwant to evaluate the right hand side (because it would have side effects, could cause an exception\nor could be expensive.</p>\n<p>\nNon-short-circuit logic causes both sides of the expression\nto be evaluated even when the result can be inferred from\nknowing the left-hand side. This can be less efficient and\ncan result in errors if the left-hand side guards cases\nwhen evaluating the right-hand side can generate an error.\n</p>\n\n<p>See <a href=\"http://java.sun.com/docs/books/jls/third_edition/html/expressions.html#15.22.2\">the Java\nLanguage Specification</a> for details\n\n</p>',3,NULL,'Dodgy - Potentially dangerous use of non-short-circuit logic','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(416,'BC_IMPOSSIBLE_DOWNCAST_OF_TOARRAY','BC_IMPOSSIBLE_DOWNCAST_OF_TOARRAY','findbugs','<p>This code is casting the result of calling toArray() on a collection to a type more specific than Object[], as in:</p>\n<pre>\n  String[] getAsArray(Collection<String> c) {\n    return (String[]) c.toArray();\n  }\n</pre>\n<p>This will usually fail by throwing a ClassCastException. The <code>toArray()</code> of almost all collections return an <code>Object[]</code>. They can\'t really do anything else, since the Collection object has no reference to the declared generic type of the collection.</p>\n<p>The correct way to do get an array of a specific type from a collection is to use <code>c.toArray(new String[]);</code> or <code>c.toArray(new String[c.size()]);</code> (the latter is slightly more efficient).</p>\n<p>There is one common/known exception exception to this. The toArray() method of lists returned by Arrays.asList(...) will return a covariantly typed array. For example, <code>Arrays.asArray(new String[] { \"a\" }).toArray()</code> will return a String []. FindBugs attempts to detect and suppress such cases, but may miss some.</p>',4,NULL,'Correctness - Impossible downcast of toArray() result','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(417,'MS_OOI_PKGPROTECT','MS_OOI_PKGPROTECT','findbugs','<p>\n A final static field that is\ndefined in an interface references a mutable\n   object such as an array or hashtable.\n   This mutable object could\n   be changed by malicious code or\n        by accident from another package.\n   To solve this, the field needs to be moved to a class\n   and made package protected\n   to avoid\n        this vulnerability.</p>',2,NULL,'Malicious code vulnerability - Field should be moved out of an interface and made package protected','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,15,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(418,'EC_UNRELATED_TYPES','EC_UNRELATED_TYPES','findbugs','<p> This method calls equals(Object) on two references of different\nclass types with no common subclasses.\nTherefore, the objects being compared\nare unlikely to be members of the same class at runtime\n(unless some application classes were not analyzed, or dynamic class\nloading can occur at runtime).\nAccording to the contract of equals(),\nobjects of different\nclasses should always compare as unequal; therefore, according to the\ncontract defined by java.lang.Object.equals(Object),\nthe result of this comparison will always be false at runtime.\n</p>',3,NULL,'Correctness - Call to equals() comparing different types','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(419,'MS_EXPOSE_REP','MS_EXPOSE_REP','findbugs','<p> A public static method returns a reference to\n   an array that is part of the static state of the class.\n   Any code that calls this method can freely modify\n   the underlying array.\n   One fix is to return a copy of the array.</p>',3,NULL,'Malicious code vulnerability - Public static method may expose internal representation by returning array','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,17,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(420,'NP_IMMEDIATE_DEREFERENCE_OF_READLINE','NP_IMMEDIATE_DEREFERENCE_OF_READLINE','findbugs','<p> The result of invoking readLine() is immediately dereferenced. If there are no more lines of text\nto read, readLine() will return null and dereferencing that will generate a null pointer exception.\n</p>',3,NULL,'Dodgy - Immediate dereference of the result of readLine()','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(421,'ESync_EMPTY_SYNC','ESync_EMPTY_SYNC','findbugs','<p> The code contains an empty synchronized block:</p>\n<pre>\nsynchronized() {}\n</pre>\n<p>Empty synchronized blocks are far more subtle and hard to use correctly\nthan most people recognize, and empty synchronized blocks\nare almost never a better solution\nthan less contrived solutions.\n</p>',2,NULL,'Multithreaded correctness - Empty synchronized block','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,35,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(422,'HRS_REQUEST_PARAMETER_TO_COOKIE','HRS_REQUEST_PARAMETER_TO_COOKIE','findbugs','<p>This code constructs an HTTP Cookie using an untrusted HTTP parameter. If this cookie is added to an HTTP response, it will allow a HTTP response splitting\nvulnerability. See <a href=\"http://en.wikipedia.org/wiki/HTTP_response_splitting\">http://en.wikipedia.org/wiki/HTTP_response_splitting</a>\nfor more information.</p>\n<p>FindBugs looks only for the most blatant, obvious cases of HTTP response splitting.\nIf FindBugs found <em>any</em>, you <em>almost certainly</em> have more \nvulnerabilities that FindBugs doesn\'t report. If you are concerned about HTTP response splitting, you should seriously \nconsider using a commercial static analysis or pen-testing tool.\n</p>',2,NULL,'Security - HTTP cookie formed from untrusted input','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,17,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(423,'UMAC_UNCALLABLE_METHOD_OF_ANONYMOUS_CLASS','UMAC_UNCALLABLE_METHOD_OF_ANONYMOUS_CLASS','findbugs','<p> This anonymous class defined a method that is not directly invoked and does not override\na method in a superclass. Since methods in other classes cannot directly invoke methods\ndeclared in an anonymous class, it seems that this method is uncallable. The method\nmight simply be dead code, but it is also possible that the method is intended to\noverride a method declared in a superclass, and due to an typo or other error the method does not,\nin fact, override the method it is intended to.\n</p>',3,NULL,'Correctness - Uncallable method defined in anonymous class','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(424,'DLS_OVERWRITTEN_INCREMENT','DLS_OVERWRITTEN_INCREMENT','findbugs','<p>\nThe code performs an increment operation (e.g., <code>i++</code>) and then\nimmediately overwrites it. For example, <code>i = i++</code> immediately\noverwrites the incremented value with the original value.\n</p>',3,NULL,'Correctness - Overwritten increment','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(425,'PT_RELATIVE_PATH_TRAVERSAL','PT_RELATIVE_PATH_TRAVERSAL','findbugs','<p>\nThe software uses an HTTP request parameter to construct a pathname that should be within a restricted directory,\nbut it does not properly neutralize sequences such as \"..\" that can resolve to a location that is outside of that directory.\n\nSee <a href=\"http://cwe.mitre.org/data/definitions/23.html\">http://cwe.mitre.org/data/definitions/23.html</a> for more information.</p>\n\n<p>\nFindBugs looks only for the most blatant, obvious cases of relative path traversal.\nIf FindBugs found <em>any</em>, you <em>almost certainly</em> have more\nvulnerabilities that FindBugs doesn\'t report. If you are concerned about relative path traversal, you should seriously\nconsider using a commercial static analysis or pen-testing tool.\n</p>',2,NULL,'Relative path traversal in servlet','READY','java','2014-11-26 15:18:24','2014-11-26 15:18:24',NULL,NULL,NULL,NULL,NULL,18,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(426,'NAB_NEEDLESS_BOX_TO_UNBOX','NAB_NEEDLESS_BOX_TO_UNBOX','fb-contrib','<p>This method constructs a Boxed Primitive from a primitive only to call the primitiveValue() method to\nconvert it back to a primitive. Just use the primitive value instead.</p>\n<pre>\n  primitive i = new BoxedPrimitive(1).primitiveValue();\n    or\n  primitive i = BoxedPrimitive.valueOf(1).primitiveValue();\n\n    should just use\n  primitive i = 1;\n</pre>',0,NULL,'Performance - Method creates Boxed primitive from primitive only to get primitive value','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(427,'S508C_NON_ACCESSIBLE_JCOMPONENT','S508C_NON_ACCESSIBLE_JCOMPONENT','fb-contrib','<p>This class extends the JComponent gui control but does not implement the Accessibility interface.\nThis makes this control unable to be processed by screen readers, etc, for people with reading/vision\ndifficulties</p>',0,NULL,'Correctness - Class extends JComponent but does not implement Accessible interface','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(428,'HES_EXECUTOR_NEVER_SHUTDOWN','HES_EXECUTOR_NEVER_SHUTDOWN','fb-contrib','<p>Most <code>ExecutorService</code> objects must be explicitly shutdown,\notherwise, their internal threads can prolong the running of the JVM, even when everything\nelse has stopped.</p>\n\n<p>FindBugs has detected that there are no calls to either the <code>shutdown()</code> or <code>shutdownNow()</code>\nmethod, and thus, the <code>ExecutorService</code> is not guaranteed to ever terminate.  This is especially\nproblematic for <code>Executors.newFixedThreadPool()</code> and most of the other convenience methods in\nthe <code>Executors</code> class.</p>\n\n<p>Even though there are some exceptions to this, particularly when a custom <code>ThreadFactory</code> is\nprovided, or for <code>ThreadPoolExecutor</code>s with <code>allowsCoreThreadTimeOut()</code> set to true,\nit is good practice to explictly shutdown the <code>ExecutorService</code> when its utility is done.</p>',0,NULL,'Correctness - Hanging ExecutorService','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(429,'MDM_SETDEFAULTLOCALE','MDM_SETDEFAULTLOCALE','fb-contrib','<p>Do not use the <code>Locale.setDefault()</code> method to change the default locale. It changes the JVM\'s default locale for all threads and makes your applications unsafe to threads. It does not affect the host locale. Since changing the JVM\'s default locale may affect many different areas of functionality, this method should only be used if the caller is prepared to reinitialize locale-sensitive code running within the same Java Virtual Machine, such as the user interface.</p>',0,NULL,'MT Correctness - Method calls Locale.setDefault()','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(430,'CVAA_CONTRAVARIANT_ARRAY_ASSIGNMENT','CVAA_CONTRAVARIANT_ARRAY_ASSIGNMENT','fb-contrib','<p>This method contains a contravariant array assignment. Since arrays are mutable data structures, their use \nmust be restricted to covariant or invariant usage</p>\n\n<pre>\nclass A {}\nclass B extends A {}\n\n B[] b = new B[2];\n A[] a = b;\n</pre>',0,NULL,'Correctness - Method performs a contravariant array assignment','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(431,'ITC_INHERITANCE_TYPE_CHECKING','ITC_INHERITANCE_TYPE_CHECKING','fb-contrib','<p>This method uses the instanceof operator in a series of if/else statements to\ndifferentiate blocks of code based on type. If these types are related by inheritance,\nit is cleaner to just define a method in the base class, and use overridden methods\nin these classes.</p>',0,NULL,'Style - Method uses instanceof on multiple types to arbitrate logic','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(432,'UCC_UNRELATED_COLLECTION_CONTENTS','UCC_UNRELATED_COLLECTION_CONTENTS','fb-contrib','<p>This method adds unrelated objects to a collection or array, requiring careful and brittle\ndata access to that collection. Create a separate class with properties needed, and add\nan instance of this class to the collection or array, if possible.</p>',0,NULL,'Style - Method adds unrelated types to collection or array','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(433,'MDM_LOCK_ISLOCKED','MDM_LOCK_ISLOCKED','fb-contrib','<p>Calling <code>ReentrantLock.isLocked()</code> or <code>ReentrantLock.isHeldByCurrentThread()</code> might indicate race conditions or incorrect locking. These methods are designed for use in debug code or monitoring of the system state, not for synchronization control.</p>',0,NULL,'MT Correctness - Method tests if a lock is locked','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(434,'SPP_TEMPORARY_TRIM','SPP_TEMPORARY_TRIM','fb-contrib','This method calls trim() on a String without assigning the new string to another variable.\nIt then calls length() or equals on this trimmed string. If trimming the string was important\nfor determining it\'s length of it\'s equality, it should be trimmed when you actually go to use it.\nIt would make more sense to first trim the String, store the trimmed value in a variable, and then\ncontinue to test and use that trimmed string.',0,NULL,'Style - Method trims a String temporarily','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(435,'NCMU_NON_COLLECTION_METHOD_USE','NCMU_NON_COLLECTION_METHOD_USE','fb-contrib','<p>This method makes calls to collection classes where the method is not defined by the Collections\ninterface, and an equivalent method exists in the interface. By using the new methods,\nyou can define this object by the Collections interface and allow better decoupling.</p>',0,NULL,'Style - Method uses old non collections interface methods','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(436,'SPP_INVALID_CALENDAR_COMPARE','SPP_INVALID_CALENDAR_COMPARE','fb-contrib','<p>This method passes a non calendar object to the java.util.Calendar.after or java.util.Calendar.before methods.\nEven though these methods take an Object as a parameter type, only Calendar type objects are supported, otherwise\nfalse is returned</p>',0,NULL,'Correctness - Method passes a non calendar object to Calendar.before or Calendar.after','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(437,'MDM_WAIT_WITHOUT_TIMEOUT','MDM_WAIT_WITHOUT_TIMEOUT','fb-contrib','<p>Calling <code>{2}</code> without timeout could block forever. Consider using a timeout to detect deadlocks or performance problems. Thread.join() Object.wait() Condition.await() Lock.lock() Lock.lockInterruptibly()</p>',0,NULL,'MT Correctness - Method sleeps without timeout','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(438,'SPP_USELESS_TERNARY','SPP_USELESS_TERNARY','fb-contrib','<p>This method tests the value of a boolean and using a ternary operator to return either true or false.\nThe ternary operator is completely unecessary, just use the original boolean value.</p>',0,NULL,'Performance - Method uses a ternary operator to cast a boolean to true or false','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(439,'CU_CLONE_USABILITY_MISMATCHED_RETURN','CU_CLONE_USABILITY_MISMATCHED_RETURN','fb-contrib','<p>This class implements the Cloneable interface but defines its clone method to return a type\nthat is different than the class itself, or any interfaces that the class implements.\n</p>',0,NULL,'Style - Clone method declares it returns an type different then the owning class','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(440,'MAC_MANUAL_ARRAY_COPY','MAC_MANUAL_ARRAY_COPY','fb-contrib','<p>This method copies data from one array to another manually using a loop.\nIt is much better performing to use System.arraycopy as this method is native.</p>',0,NULL,'Performance - Method copies arrays manually','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(441,'LO_STUTTERED_MESSAGE','LO_STUTTERED_MESSAGE','fb-contrib','This method uses a logger method that takes an exception, and passes the result of\nthe getMessage() method on the exception that occurred as the log message.\nSince you are already passing in the exception, that message is already present in the\nlogs, and by passing it in as the message, you are just stuttering information.\nIt would be more helpful to provide a hand written message that describes the error in\nthis method, possibly including the values of key variables.',0,NULL,'Style - Method stutters exception message in logger','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(442,'NRTL_NON_RECYCLEABLE_TAG_LIB','NRTL_NON_RECYCLEABLE_TAG_LIB','fb-contrib','<p>This Tag library class implements an attribute who\'s associated backing store field\nis modified at another point in the tag library. In order for a taglibrary to be\nrecycleable, only the container is allowed to change this attribute, through the use\nof the setXXX method of the taglib. By modifying the value programmatically, the\ncontainer will not initialize the attribute correctly on reuse.</p>',0,NULL,'Correctness - Tag library is not recycleable','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(443,'EXS_EXCEPTION_SOFTENING_HAS_CHECKED','EXS_EXCEPTION_SOFTENING_HAS_CHECKED','fb-contrib','<p>This method\'s exception signature is constrained by an interface of super class to not throw a \nchecked exception that was caught. Therefore this exception was converted to an unchecked exception and \nthrown. It would probably be better to throw the closest checked exception allowed, and to annotate\nthe new exception with the original exception using the initial cause field.</p>',0,NULL,'Style - Constrained method converts checked exception to unchecked instead of another allowable checked exception','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(444,'EXS_EXCEPTION_SOFTENING_NO_CHECKED','EXS_EXCEPTION_SOFTENING_NO_CHECKED','fb-contrib','<p>This method\'s exception signature is constrained by an interface or super class to not throw\nany checked exceptions. Therefore a caught checked exception was converted to an unchecked exception\nand thrown. However it appears that the class in question is owned by the same author as the constraining\ninterface or superclass. Consider changes the signature of this method to include the checked exception.</p>',0,NULL,'Style - Constrained method converts checked exception to unchecked','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(445,'JVR_JDBC_VENDOR_RELIANCE','JVR_JDBC_VENDOR_RELIANCE','fb-contrib','<p>This method uses jdbc vendor specific classes and method to perform database work.\nThis makes the code specific to this vendor, and unable to run on other databases.</p>',0,NULL,'Correctness - Method uses jdbc vendor specific classes and methods','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(446,'SPP_STRINGBUFFER_WITH_EMPTY_STRING','SPP_STRINGBUFFER_WITH_EMPTY_STRING','fb-contrib','<p>This method calls the StringBuffer of StringBuilder constructor passing in a constant empty string (\"\").\nThis is the same as calling the default constructor, but makes the code work harder. Consider passing in a\ndefault size instead.',0,NULL,'Performance - Method passes empty string to StringBuffer of StringBuilder constructor','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(447,'ODN_ORPHANED_DOM_NODE','ODN_ORPHANED_DOM_NODE','fb-contrib','<p>This method creates a DOM node but does not attach it to a DOM document.\n</p>',0,NULL,'Correctness - Method creates DOM node but doesn\'t attach it to a document','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(448,'SC_SUSPICIOUS_COMPARATOR_RETURN_VALUES','SC_SUSPICIOUS_COMPARATOR_RETURN_VALUES','fb-contrib','<p>This compareTo or compare method returns constant values for to represent less than,\nequals and greater than. However it does not return each type. Given that comparators\nare transitive, this seems incorrect.</p>',0,NULL,'Correctness - Comparator method doesn\'t seem to return all ordering values','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(449,'NPMC_NON_PRODUCTIVE_METHOD_CALL','NPMC_NON_PRODUCTIVE_METHOD_CALL','fb-contrib','<p>This method ignores the return value of a common method that is assumed to be none mutating.\nIf this method does in fact not modify the object it is called on, there is no reason to call\nthis method, and it can be removed.',0,NULL,'Correctness - Method ignores return value of a non mutating method','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(450,'ACEM_ABSTRACT_CLASS_EMPTY_METHODS','ACEM_ABSTRACT_CLASS_EMPTY_METHODS','fb-contrib','<p>This method is empty or merely throws an exception. Since the class it is defined in is \nabstract, it may be more correct to define this method as abstract instead, so that proper\nsubclass behavior is enforced.</p>',0,NULL,'Style - Empty method could be declared abstract','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(451,'ITU_INAPPROPRIATE_TOSTRING_USE','ITU_INAPPROPRIATE_TOSTRING_USE','fb-contrib','<p>This method calls algorithmic operations on a String that was returned from a toString() method.\nAs these methods are for debugging/logging purposes, it shouldn\'t be the basis of core logic in your code.',0,NULL,'Correctness - Method performs algorithmic operations on the result of a toString() call','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(452,'SPP_STRINGBUILDER_IS_MUTABLE','SPP_STRINGBUILDER_IS_MUTABLE','fb-contrib','This method calls StringBuilder.append and assigns the results to the same StringBuilder as\n  <pre>sb = sb.append(\"foo\")</pre>\n  As StringBuilder is mutable this is not necessary.\n  This is also true of StringBuffer.',0,NULL,'Correctness - Method needlessly assigns a StringBuilder to itself, as it\'s mutable','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(453,'MDM_THREAD_YIELD','MDM_THREAD_YIELD','fb-contrib','<p>Manual thread scheduling with <code>Thread.sleep()</code> or <code>Thread.yield()</code> has no guaranteed semantics and is often used to mask race conditions.</p>',0,NULL,'MT Correctness - Method attempts to manually schedule threads','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(454,'NIR_NEEDLESS_INSTANCE_RETRIEVAL','NIR_NEEDLESS_INSTANCE_RETRIEVAL','fb-contrib','<p>This method calls a method to load a reference to an object, and then only\nuses it to load a static member of that instance\'s class. It is simpler and\nbetter performant to just load the static field from the class itself.</p>',0,NULL,'Performance - Method retrieves instance to load static member','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(455,'AIOB_ARRAY_STORE_TO_NULL_REFERENCE','AIOB_ARRAY_STORE_TO_NULL_REFERENCE','fb-contrib','<p>This method attempts to store an array element into an an array that appears to not have been allocated.',0,NULL,'Correctness - Method attempts to store an array element to an array that does not appear to be allocated','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(456,'URV_UNRELATED_RETURN_VALUES','URV_UNRELATED_RETURN_VALUES','fb-contrib','<p>This method returns two or more unrelated types of objects (Related only through java.lang.Object).\nThis will be very confusing to the code that must call it.</p>',0,NULL,'Style - Method returns different types of unrelated Objects','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(457,'UMTP_UNBOUND_METHOD_TEMPLATE_PARAMETER','UMTP_UNBOUND_METHOD_TEMPLATE_PARAMETER','fb-contrib','<p>This method declares a method level template parameter that is not bound by any parameter of this\nmethod. Therefore the template parameter adds no validation or type safety and can be removed, as it\'s\njust confusing to the reader.',0,NULL,'Correctness - Method declares unbound method template parameter(s)','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(458,'ISB_TOSTRING_APPENDING','ISB_TOSTRING_APPENDING','fb-contrib','<p>This method concatenates the output of a toString() call into a StringBuffer/Builder.\nIt is simpler just pass the object you want to append to the to append call, as that form\ndoes not suffer the potential for NullPointerExceptions, and is easier to read.</p>',0,NULL,'Correctness - Method concatenates the result of a toString() call','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(459,'SPP_USE_CHARAT','SPP_USE_CHARAT','fb-contrib','<p>This method calls the toCharArray method on a String the fetch an array of characters, only\nto retrieve one of those characters by index. It is more performant to just use the charAt method.\n</p>',0,NULL,'Performance - Method fetches character array just to do the equivalent of the charAt method','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(460,'TBP_TRISTATE_BOOLEAN_PATTERN','TBP_TRISTATE_BOOLEAN_PATTERN','fb-contrib','<p>This method declares that it returns a Boolean value. However the code\ncan return a null value. As this is now three values that can be returned;\nBoolean.TRUE, Boolean.FALSE, null; you have changed what a Boolean means.\nIt would be clearer to just create a new Enum that has the three values\nyou want, and define that the method returns that type.</p>',0,NULL,'Style - Method returns null for Boolean type','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(461,'TR_TAIL_RECURSION','TR_TAIL_RECURSION','fb-contrib','<p>This method recursively calls itself as the last statement of the method\n(Tail Recursion). This method can be easily refactored into a simple loop, which\nwill make it more performant, and reduce the stack size requirements.</p>',0,NULL,'Performance - Method employs tail recursion','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(462,'UNNC_UNNECESSARY_NEW_NULL_CHECK','UNNC_UNNECESSARY_NEW_NULL_CHECK','fb-contrib','<p>This method allocations an object with new, and then checks that the object is null\nor non null. As the new operator is guaranteed to either succeed or throw an exception,\nthis null check is unnecessary and can be removed.',0,NULL,'Correctness - Method checks the result of a new allocation','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(463,'SPP_USE_ISEMPTY','SPP_USE_ISEMPTY','fb-contrib','<p>This method calls the size() method on a collection and compares the result to zero to see if the collection\nis empty. For better code clarity, it is better to just use col.isEmpty() or !col.isEmpty()</p>',0,NULL,'Style - Method checks the size of a collection against zero rather than using isEmpty()','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(464,'SG_SLUGGISH_GUI','SG_SLUGGISH_GUI','fb-contrib','<p>This method implements an awt or swing listener and performs time \nconsuming operations. Doing these operations in the gui thread will cause the\ninterface to appear sluggish and non-responsive to the user. Consider\nusing a separate thread to do the time consuming work so that the user\nhas a better experience.</p>',0,NULL,'Performance - Method performs time consuming operation in gui thread','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(465,'NCS_NEEDLESS_CUSTOM_SERIALIZATION','NCS_NEEDLESS_CUSTOM_SERIALIZATION','fb-contrib','<p>This method implements the Serializable interface by performing the same operations that\nwould be done if this method did not exist. Since this is the case, this method is not needed.</p>',0,NULL,'Correctness - Method needlessly implements what is default streaming behavior','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(466,'USBR_UNNECESSARY_STORE_BEFORE_RETURN','USBR_UNNECESSARY_STORE_BEFORE_RETURN','fb-contrib','<p>This method stores the return result in a local variable, and then immediately\nreturns the local variable. It would be simpler just to return the value that is\nassigned to the local variable, directly.\n</p>',0,NULL,'Style - Method stores return result in local before immediately returning it','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(467,'SEC_SIDE_EFFECT_CONSTRUCTOR','SEC_SIDE_EFFECT_CONSTRUCTOR','fb-contrib','<p>This method creates an object but does not assign this object to any variable or field.\nThis implies that the class operates through side effects in the constructor, which is a\nbad pattern to use, as it adds unnecessary coupling. Consider pulling the side effect out of\nthe constructor, into a separate method, or into the calling method.',0,NULL,'Style - Method uses a Side Effect Constructor','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(468,'CD_CIRCULAR_DEPENDENCY','CD_CIRCULAR_DEPENDENCY','fb-contrib','<p>\nThis class has a circular dependency with other classes. This makes building these classes\ndifficult, as each is dependent on the other to build correctly. Consider using interfaces\nto break the hard dependency.\n</p>',0,NULL,'Correctness - Circular Dependencies','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(469,'S508C_NON_TRANSLATABLE_STRING','S508C_NON_TRANSLATABLE_STRING','fb-contrib','<p>This method creates a component and passes a string literal to the title or label\nof the component. As this string will be shown to users, it should be internationalizable\nthrough the use of a resource bundle.</p>',0,NULL,'Correctness - Method passes constant string to title/label of component','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(470,'IICU_INCORRECT_INTERNAL_CLASS_USE','IICU_INCORRECT_INTERNAL_CLASS_USE','fb-contrib','<p>This class makes use of internal api classes. As these\nclasses are not documented, nor externally released as part of the api, they are subject\nto change or removal. You should not be using these classes.</p>\nPackages that shouldn\'t be used are:\n<ul>\n  <li>com.sun.xxx</li>\n  <li>org.apache.xerces.xxx</li>\n  <li>org.apache.xalan.xxx</li>\n</ul>',0,NULL,'Correctness - Class relies on internal api classes','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(471,'UAA_USE_ADD_ALL','UAA_USE_ADD_ALL','fb-contrib','<p>This method uses a simple for loop to copy the contents of a set, list, map key/value, array or other collection\nto another collection. It is simpler and more straight forward to just call the addAll method of the destination collection\npassing in the source collection. In the case that the source is an array, you can use Array.asList method to massage the array\ninto a collection</p>',0,NULL,'Style - Method uses simple loop to copy contents of one collection to another','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(472,'IKNC_INCONSISTENT_HTTP_PARAM_CASING','IKNC_INCONSISTENT_HTTP_PARAM_CASING','fb-contrib','<p>This method fetches an HttpServletRequest parameter with a parameter name that was used in other locations\nbut with a different casing. As HttpServletRequest parameters are case sensitive, this will be very confusing.',0,NULL,'Style - Method uses the same HttpRequest parameter name but with different casing','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(473,'STS_SPURIOUS_THREAD_STATES','STS_SPURIOUS_THREAD_STATES','fb-contrib','<p>This method invokes the methods wait, notify or notifyAll on a Thread instance.\nDoing so will confuse the internal thread state behaviour causing spurious thread\nwakeups/sleeps because the internal mechanism also uses the thread instance for it\'s \nnotifications.\n</p>',0,NULL,'MT Correctness - Method calls wait, notify or notifyAll on a Thread instance','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(474,'MDM_PROMISCUOUS_SERVERSOCKET','MDM_PROMISCUOUS_SERVERSOCKET','fb-contrib','<p>Do not use the <code>ServerSocket</code> constructor or <code>ServerSocketFactory.createServerSocket()</code> factory methods that accepts connections on any network interface. By default, an application that listens on a socket will listen for connection attempts on any network interface, which can be a security risk. Only the long form the <code>ServerSocket</code> constructor or <code>ServerSocketFactory.createServerSocket()</code> factory methods take a specific local address to define which network interface the socket should bind.</p>',0,NULL,'Correctness - Method creates promiscuous ServerSocket object','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(475,'LO_INVALID_FORMATTING_ANCHOR','LO_INVALID_FORMATTING_ANCHOR','fb-contrib','This method attempts to use an SLF4J logger to log a parameterized expression using formatting anchors.\nHowever, slf4j uses simple non numbered anchors such as {}, rather than anchors with digits in them as the \ncode uses. Thus no parameter replacement will occur.',0,NULL,'Correctness - Method attempts to log using numbered formatting anchors','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(476,'EXS_EXCEPTION_SOFTENING_NO_CONSTRAINTS','EXS_EXCEPTION_SOFTENING_NO_CONSTRAINTS','fb-contrib','<p>This method is not constrained by an interface or superclass, but converts a caught checked exception\nto unchecked exception and thrown. It would be more appropriate just throw the checked exception, adding\nthe exception to the throws clause of the method.',0,NULL,'Style - Unconstrained method converts checked exception to unchecked','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(477,'DLC_DUBIOUS_LIST_COLLECTION','DLC_DUBIOUS_LIST_COLLECTION','fb-contrib','<p>This class defines a field based on java.util.List, but uses it to some extent like a Set. Since\nlookup type operations are performed using a linear search for Lists, the performance for large\nLists will be poor. Consider changing this fields implementation to a set based one. If order of\niteration is important to maintain insert order, perhaps consider a LinkedHashSet.</p>',0,NULL,'Performance - Class defines List based fields but uses them like Sets','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(478,'CSBTS_COMMONS_STRING_BUILDER_TOSTRING','CSBTS_COMMONS_STRING_BUILDER_TOSTRING','fb-contrib','<p>This method returns the result of toString() on ToStringBuilder without an\nintermediate invocation of append()</p>',0,NULL,'Correctness - Method returns the result of invoking toString() without intermediate invocation of append() in ToStringBuilder','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(479,'PCOA_PARTIALLY_CONSTRUCTED_OBJECT_ACCESS','PCOA_PARTIALLY_CONSTRUCTED_OBJECT_ACCESS','fb-contrib','<p>This constructor makes a call to a non-final method. Since this method can be overriden, a subclasses\nimplementation will be executing against an object that has not been initialized at the subclass level.\nYou should mark all methods called from the constructor as final to avoid this problem.</p>',0,NULL,'Correctness - Constructor makes call to non-final method','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(480,'AIOB_ARRAY_INDEX_OUT_OF_BOUNDS','AIOB_ARRAY_INDEX_OUT_OF_BOUNDS','fb-contrib','<p>This method access an array element using a literal index that is know to be outside the size of the specified\narray. This will cause an ArrayIndexOutOfBoundsException at runtime</p>',0,NULL,'Correctness - Method attempts to access an array element outside the array\'s size','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(481,'SNG_SUSPICIOUS_NULL_FIELD_GUARD','SNG_SUSPICIOUS_NULL_FIELD_GUARD','fb-contrib','<p>This method tests a field to make sure it\'s not null before executing a conditional block of\ncode. However in the conditional block it reassigns the field. It is likely that the guard\nshould have been a check to see if the field is null, not that the field was not null.</p>',0,NULL,'Correctness - Method tests a field for not null as guard and reassigns it','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(482,'SWCO_SUSPICIOUS_WAIT_ON_CONCURRENT_OBJECT','SWCO_SUSPICIOUS_WAIT_ON_CONCURRENT_OBJECT','fb-contrib','<p>This method calls wait() on a on mutex defined in the java.util.concurrent package.\nThese classes, define await, instead of wait, and it is most likely that await\nwas intended.</p>',0,NULL,'Correctness - Method calls wait when await was probably intended','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(483,'PRMC_POSSIBLY_REDUNDANT_METHOD_CALLS','PRMC_POSSIBLY_REDUNDANT_METHOD_CALLS','fb-contrib','<p>This method makes two consecutive calls to the same method using the same constant\nparameters, on the same instance without any intervening changes to the objects. If this\nmethod does not make changes to the object, which it appears it doesn\'t, then making\ntwo calls is just a waste. These method calls could be combined by assigning the\nresult into a temporary, and using the temporary the second time.',0,NULL,'Performance - Method appears to call the same method on the same object redundantly','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(484,'MDM_STRING_BYTES_ENCODING','MDM_STRING_BYTES_ENCODING','fb-contrib','<p>The behavior of the <code>String(byte[] bytes)</code> and <code>String.getBytes()</code> is undefined if the string cannot be encoded in the platform\'s default charset. Instead, use the <code>String(byte[] bytes, String encoding)</code> or <code>String.getBytes(String encoding)></code> constructor which accepts the string\'s encoding as an argument. Be sure to specify the encoding used for the user\'s locale.</p>',0,NULL,'Correctness - Method encodes String bytes without specifying the character encoding','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(485,'USS_USE_STRING_SPLIT','USS_USE_STRING_SPLIT','fb-contrib','<p>This method uses a StringTokenizer to split up a String and then walks thru the\nseparated elements and builds an array from these enumerated values. It is simpler \nand easier to use the String.split method.</p>\n<p>PLEASE NOTE: String.split will return an array of 1 element when passed the \nempty string, as opposed to using StringTokenizer which returns false on the first\nhasMoreElements/hasMoreTokens call. So you may need to use</p>\n<pre>\n  if (s.length() > 0)\n    return s.split(\";\");\n  return new String[0];\n</pre>',0,NULL,'Style - Method builds String array using String Tokenizing','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(486,'S508C_NULL_LAYOUT','S508C_NULL_LAYOUT','fb-contrib','<p>This class passes null to setLayout, which specifies that components are\nto be laid out using absolute coordinates. This makes making changes for\nfont sizes, etc, difficult as items will not reposition\n</p>',0,NULL,'Correctness - Gui uses absolute layout','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(487,'JAO_JUNIT_ASSERTION_ODDITIES_USE_ASSERT_EQUALS','JAO_JUNIT_ASSERTION_ODDITIES_USE_ASSERT_EQUALS','fb-contrib','<p>This method evaluates a boolean expression and passes that to Assert.assertTrue. It is better \nto pass the two values that are being equated to the Assert.assertEquals method so that the\njunit failure method is more meaningful of the intended test.</p>',0,NULL,'Correctness - Method passes boolean expression to Assert.assertTrue','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(488,'SPP_NON_ARRAY_PARM','SPP_NON_ARRAY_PARM','fb-contrib','This method expects an array to be passed as one of its parameters, but unfortunately defines\nthe parameter as Object. This invocation of this method does not pass an array and will throw\nan exception when run.',0,NULL,'Correctness - Method passes a non array object to a parameter that expects an array','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(489,'IPU_IMPROPER_PROPERTIES_USE_SETPROPERTY','IPU_IMPROPER_PROPERTIES_USE_SETPROPERTY','fb-contrib','<p>This method uses the inherited method from Hashtable put(String key, Object value) in\na Properties object. Since the Properties object was intended to be only a String to String\nmap, use of the derived put method is discouraged. Use the Properties.setProperty method instead.',0,NULL,'Correctness - Method uses Properties.put instead of Properties.setProperty','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(490,'DRE_DECLARED_RUNTIME_EXCEPTION','DRE_DECLARED_RUNTIME_EXCEPTION','fb-contrib','<p>This method declares a RuntimeException derived class in it\'s throws clause.\nThis may indicate a misunderstanding as to how unchecked exceptions are handled.\nIf is felt that a RuntimeException is so prevalent that it should be declared, it \nis probably a better idea to prevent the occurance in code.</p>',0,NULL,'Style - Method declares RuntimeException in throws clause','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(491,'BRPI_BACKPORT_REUSE_PUBLIC_IDENTIFIERS','BRPI_BACKPORT_REUSE_PUBLIC_IDENTIFIERS','fb-contrib','<p>This class uses Backport Utils concurrent classes. Updated/Efficient version of these\nclasses are available in versions of the JDK 5.0 and higher, and these\nclasses should only be used if you are targeting JDK 1.4 and lower.\n</p>',0,NULL,'Performance - Method uses backport concurrency utils','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(492,'SPP_USE_CONTAINSKEY','SPP_USE_CONTAINSKEY','fb-contrib','<p>This method calls mySet.keySet().contains(\"foo\") when mySet.containsKey(\"foo\") is simpler</p>',0,NULL,'Style - Method calls keySet() just to call contains, use containsKey instead','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(493,'ROOM_REFLECTION_ON_OBJECT_METHODS','ROOM_REFLECTION_ON_OBJECT_METHODS','fb-contrib','<p>This method uses reflection to call a method that is defined in java.lang.Object.\nAs these methods are always available, it is not necessary to call these methods with\nreflection.',0,NULL,'Correctness - Method uses reflection to call a method available on java.lang.Object','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(494,'URV_INHERITED_METHOD_WITH_RELATED_TYPES','URV_INHERITED_METHOD_WITH_RELATED_TYPES','fb-contrib','<p>This inherited method is defined to return a java.lang.Object. However, the return types returned\nfrom this method can be defined by a more specific class or interface. If possible consider changing the\nreturn type in the inheritance hierarchy of this method, otherwise the caller of this method will be brittle\nin handling of the return type.</p>',0,NULL,'Style - Inherited method returns more specific type of object than declared','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(495,'S508C_SET_COMP_COLOR','S508C_SET_COMP_COLOR','fb-contrib','<p>This method sets a Components explicitly foreground or background color which may\ncause difficulty with people with vision problems from using this application.\nColors should be allowed to be set from the operating system.</p>',0,NULL,'Correctness - Method explicitly sets the color of a Component','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(496,'BAS_BLOATED_ASSIGNMENT_SCOPE','BAS_BLOATED_ASSIGNMENT_SCOPE','fb-contrib','<p><em>THIS DETECTOR IS HIGHLY EXPERIMENTAL AND IS LIKELY TO CREATE A LOT OF FUD</em>\nThis method assigns a value to a variable in an outer scope compared to where the variable is actually used. \nAssuming this evaluation does not have side effects, the assignment can be moved into the inner scope (if block)\nso that its execution time isn\'t taken up if the if guard is false. Care should be\ntaken however that the right hand side of the assignment does not contain side \neffects that are required to happen, or that changes are not made further down that\nwill effect the execution of the assignment when done later on.</p>',0,NULL,'Performance - Method assigns a variable in a larger scope then is needed','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(497,'FCBL_FIELD_COULD_BE_LOCAL','FCBL_FIELD_COULD_BE_LOCAL','fb-contrib','<p>This class defines fields that are used in a locals only fashion, \nspecifically private fields or protected fields in final classes that are accessed \nfirst in each method with a store vs. a load. This field could be replaced by one\nor more local variables.</p>',0,NULL,'Correctness - Class defines fields that are used only as locals','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(498,'NOS_NON_OWNED_SYNCHRONIZATION','NOS_NON_OWNED_SYNCHRONIZATION','fb-contrib','<p>This method uses a synchronize block where the object that is being synchronized on,\nis not owned by this current instance. This means that other instances may use this same\nobject for synchronization for its own purposes causing synchronization confusion. It is \nalways cleaner and safer to only synchronize on private fields of this class. Note that \'this\'\nis not owned by the current instance, but is owned by whomever assigns it to a field of its \nclass. Synchronizing on \'this\' is also not a good idea.</p>',0,NULL,'Style - Class uses non owned variables to synchronize on','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(499,'LGO_LINGERING_GRAPHICS_OBJECT','LGO_LINGERING_GRAPHICS_OBJECT','fb-contrib','<p>This method allocates a java.awt.Graphics object but doesn\'t dispose of it when done. While\nthe garbage collecter will clean this up, given that a large number of Graphics objects can be\ncreated in a short period of time, it is recommended that you explicitly dispose() of them.\n  </p>',0,NULL,'Performance - Method allocations a java.awt.Graphics object without disposing it','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(500,'SUA_SUSPICIOUS_UNINITIALIZED_ARRAY','SUA_SUSPICIOUS_UNINITIALIZED_ARRAY','fb-contrib','<p>This method returns an array that was allocated but apparently not initialized. It is\npossible that the caller of this method will do the work of initializing this array, but\nthat is not a common pattern, and it is assumed that this array has just been forgotten to \nbe initialized.</p>',0,NULL,'Correctness - Method returns an array that appears not to be initialized','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(501,'NMCS_NEEDLESS_MEMBER_COLLECTION_SYNCHRONIZATION','NMCS_NEEDLESS_MEMBER_COLLECTION_SYNCHRONIZATION','fb-contrib','<p>This class defines a private collection member as synchronized. It appears however\nthat this collection isn\'t only modified in a static initializer, or constructor. As these\ntwo areas are guaranteed to be thread safe, defining this collection as synchronized is\nunnecessary and a potential performance bottleneck.</p>',0,NULL,'Performance - Class defines unneeded synchronization on member collection','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(502,'LO_LOGGER_LOST_EXCEPTION_STACK_TRACE','LO_LOGGER_LOST_EXCEPTION_STACK_TRACE','fb-contrib','<p>This method passes an exception as the first argument to a logger method. The stack\ntrace is potentially lost due to the logger emitting the exception using toString(). It\nis better to construct a log message with sufficient context and pass the exception as\nthe second argument to capture the stack trace.</p>',0,NULL,'Correctness - Method incorrectly passes exception as first argument to logger method','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(503,'SPP_USE_ISNAN','SPP_USE_ISNAN','fb-contrib','<p>This method compares a douhle or float to the constant Double.NaN or Float.NaN. You should use\nDouble.isNaN(d) or Float.isNaN(f) if a primitive; or d.isNaN() or f.isNaN() if a boxed double, instead.</p>',0,NULL,'Correctness - Method compares a double to Double.NAN','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(504,'DSOC_DUBIOUS_SET_OF_COLLECTIONS','DSOC_DUBIOUS_SET_OF_COLLECTIONS','fb-contrib','<p>This method creates a set that contains other collections, or a Map whose keySet is\nanother collection. As collections tend to calculate hashCode, equals and compareTo by \niterating the contents of the collection, this can perform poorly.</p>\n<p>In addition, when a set is used, you typically are using it to do \'contains\', or \'find\'\ntype functionality, which seems dubious when done on a collection</p>\n<p>Finally, as a collection is often modified, problems will occur if the collection is \ncontained in a set, because the hashCode, equals or compareTo values will change while the\ncollection is in the set</p>\n<p>If you wish to maintain a collection of collections, it is probably better to use a List\nas the outer collection</p>',0,NULL,'Performance - Method uses a set of collections','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(505,'NAB_NEEDLESS_BOXING_PARSE','NAB_NEEDLESS_BOXING_PARSE','fb-contrib','<p>This method passes a String to a wrapped primitive object\'s valueOf method, which in turn calls\nthe boxedValue() method to convert to a primitive. When it is desired to convert from a String\nto a primitive value, it is simpler to use the BoxedPrimitive.parseBoxedPrimitive(myString)\nmethod. </p>',0,NULL,'Performance - Method converts String to primitive using excessive boxing','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(506,'JAO_JUNIT_ASSERTION_ODDITIES_ASSERT_USED','JAO_JUNIT_ASSERTION_ODDITIES_ASSERT_USED','fb-contrib','<p>This method uses a java assert to assure that a certain state is in effect. As this is\na junit test it makes more sense to either check this condition with a junit assert, or allow\na following exception to occur.</p>',0,NULL,'Correctness - Method uses java asserts rather than a junit assertion','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(507,'NAB_NEEDLESS_BOXING_VALUEOF','NAB_NEEDLESS_BOXING_VALUEOF','fb-contrib','<p>This method passes a String to a wrapped primitive object\'s parse method, which in turn calls\nthe valueOf() method to convert to a boxed primitive. When it is desired to convert from a String\nto a boxed primitive object, it is simpler to use the BoxedPrimitive.valueOf(myString)\nmethod. </p>',0,NULL,'Performance - Method converts String to boxed primitive using excessive boxing','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(508,'UCPM_USE_CHARACTER_PARAMETERIZED_METHOD','UCPM_USE_CHARACTER_PARAMETERIZED_METHOD','fb-contrib','<p>This method passes a constant literal String of length 1 as a parameter to a method, that\nexposes a similar method that takes a character. It is simpler and more expedient to handle one\ncharacter, rather than pass a string.</p>',0,NULL,'Performance - Method passes constant String of length 1 to character overridden method','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(509,'MDM_SIGNAL_NOT_SIGNALALL','MDM_SIGNAL_NOT_SIGNALALL','fb-contrib','<p><code>Condition.signalAll()</code> is prefered over <code>Condition.signal()</code>. Calling <code>signal()</code> only wakes up one thread, meaning that the thread woken up might not be the one waiting for the condition that the caller just satisfied.</p>',0,NULL,'MT Correctness - Method calls Condition.signal() rather than Condition.signalAll()','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(510,'SCA_SUSPICIOUS_CLONE_ALGORITHM','SCA_SUSPICIOUS_CLONE_ALGORITHM','fb-contrib','<p>The clone method stores a value to a member field of the source object. Normally, all \nchanges are made to the cloned object, and given that cloning is almost always considered\na read-only operation, this seems incorrect.</p>',0,NULL,'Correctness - Clone method stores a new value to member field of source object','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(511,'SPP_USELESS_CASING','SPP_USELESS_CASING','fb-contrib','This method compares two strings with compareToIgnoreCase or equalsIgnoreCase, after having\ncalled toUpperCase or toLowerCase on the string in question. As you are comparing with out\nconcern to case, the toUpperCase or toLowerCase calls are pointless and can be removed.',0,NULL,'Performance - Method compares string without case after enforcing a case','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(512,'DWI_DELETING_WHILE_ITERATING','DWI_DELETING_WHILE_ITERATING','fb-contrib','<p>This method removes items from a collection using the remove method of the collection, while\nat the same time iterating across the collection. Doing this will invalidate the iterator, and further\nuse of it, will cause ConcurrentModificationExceptions to be thrown. To avoid this, the remove \nmethod of the iterator should be used.\n</p>',0,NULL,'Correctness - Method deletes collection element while iterating','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(513,'CNC_COLLECTION_NAMING_CONFUSION','CNC_COLLECTION_NAMING_CONFUSION','fb-contrib','<p>This class defines a field or local collection variable with a name that contains a different type\nof collection in its name. An example woutd be a Set<User> called userList. This is confusing to the reader,\nand likely caused by a previous refactor of type, without changing the name.</p>',0,NULL,'Style - Collection Naming Confusion','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(514,'CBX_CUSTOM_BUILT_XML','CBX_CUSTOM_BUILT_XML','fb-contrib','<p>This method generates an xml based string by concatenating together various \nxml fragments, and variable values. Doing so makes the code difficult to read, modify \nand validate. It is much more clean to built xml structures in external files that are\nread in and transformed into the final product, thru modification by Transformer.setParameter.\n</p>',0,NULL,'Style - Method builds xml strings through adhoc concatenation','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(515,'LII_LIST_INDEXED_ITERATING','LII_LIST_INDEXED_ITERATING','fb-contrib','<p>This method uses an integer based for loop to iterator over a java.util.List, by calling\nList.get(i) each time thru the loop. The integer is not used for other reasons. It is better\nto use an Iterator instead, as depending on List implementation, iterators can perform better, \nand they also allow for exchanging of other collection types without issue.</p>',0,NULL,'Style - Method uses integer based for loops to iterate over a List','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(516,'BSB_BLOATED_SYNCHRONIZED_BLOCK','BSB_BLOATED_SYNCHRONIZED_BLOCK','fb-contrib','<p>This methods implements a synchronized block, but the code found at the beginning\nof this block  only accesses local variables, and not member variables, or this. \nTo be better performance move the code that access local variables only, above the\nsynchronized block, and leave the synchronized block only for field accesses, or access\nto this object.</p>',0,NULL,'Performance - Method overly synchronizes a block of code','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(517,'NAB_NEEDLESS_BOXING_STRING_CTOR','NAB_NEEDLESS_BOXING_STRING_CTOR','fb-contrib','<p>This method passes a primitive value retrieved from a BoxedPrimitive.parseBoxedPrimitive(\"1\") call  to \nthe same class\'s constructor. It is simpler to just pass the string to the BoxedPrimitives constructor.\n</p>',0,NULL,'Performance - Method passes parsed string to primitive wrapper constructor','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(518,'ICA_INVALID_CONSTANT_ARGUMENT','ICA_INVALID_CONSTANT_ARGUMENT','fb-contrib','<p>This method passes an invalid constant value to a method parameter that expects only a select number of possible values.\nThis is likely going to cause this method to fail to operate correctly.</p>',0,NULL,'Correctness - Invalid Constant Argument','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(519,'JAO_JUNIT_ASSERTION_ODDITIES_IMPOSSIBLE_NULL','JAO_JUNIT_ASSERTION_ODDITIES_IMPOSSIBLE_NULL','fb-contrib','<p>This method asserts that a primitive value that was autoboxed into a boxed primitive was not \nnull. This will never happen, as primitives are never null, and thus the autoboxed value isn\'t \neither.</p>',0,NULL,'Correctness - Method asserts that an auto-boxed value is not null','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(520,'HES_LOCAL_EXECUTOR_SERVICE','HES_LOCAL_EXECUTOR_SERVICE','fb-contrib','<p><code>ExecutorService</code>s are typically instantiated as fields so that many tasks can be executed on a controlled number of <code>Thread</code>s across many method calls.  Therefore, it is unusual for <code>ExecutorService</code>s to be a local variable, where tasks will be added only one time, in the enclosing method. </p>\n\n<p>Furthermore, when a local <code>ExecutorService</code> reaches the end of scope and goes up for garbage collection, the internal <code>Thread</code>s are not necessarily terminated and can prevent the JVM from ever shutting down.</p>\n\n<p>Consider making this local variable a field and create a method that will explicitly shutdown the <code>ExecutorService</code></p>',0,NULL,'Correctness - Hanging ExecutorService','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(521,'AOM_ABSTRACT_OVERRIDDEN_METHOD','AOM_ABSTRACT_OVERRIDDEN_METHOD','fb-contrib','<p>This abstract method is derived from a concrete method implementation. It is highly\nsuspect that the super class method\'s implementation would be cast away. \n</p>',0,NULL,'Correctness - Abstract method overrides a concrete implementation','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(522,'UEC_USE_ENUM_COLLECTIONS','UEC_USE_ENUM_COLLECTIONS','fb-contrib','<p>This class uses an ordinary set or map collection and uses an enum class as the key type.\nIt is better performant to use the jdk 1.5 EnumSet or EnumMap classes.</p>',0,NULL,'Performance - Class uses an ordinary set or map with an enum class as the key','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(523,'SPP_USE_GET0','SPP_USE_GET0','fb-contrib','This Method calls myList.iterator().next() on a List to get the first item. It is more performant \nto just use myList.get(0).',0,NULL,'Performance - Method uses iterator().next() on a List to get the first item','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(524,'CFS_CONFUSING_FUNCTION_SEMANTICS','CFS_CONFUSING_FUNCTION_SEMANTICS','fb-contrib','<p>This method appears to modify a parameter, and then return this parameter as the \nmethods return value. This will be confusing to callers of this method, as it won\'t be\napparent that the \'original\' passed in parameter will be changed as well. If the purpose\nof this method is to change the parameter, it would be more clear to change the method to \na have a void return value. If a return type is required due to interface or superclass contract,\nperhaps a clone of the parameter should be made.</p>',0,NULL,'Style - Method returns modified parameter','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(525,'BED_BOGUS_EXCEPTION_DECLARATION','BED_BOGUS_EXCEPTION_DECLARATION','fb-contrib','<p>This method declares that it throws a checked exception that it does not throw. As this method is\neither a constructor, static method or private method, there is no reason for this method to declare\nthe exception in its throws clause, and just causes calling methods to unnecessarily handle an exception\nthat will never be thrown. The exception in question should be removed from the throws clause.</p>',0,NULL,'Correctness - Non derivable method declares throwing an exception that isn\'t thrown','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(526,'NAB_NEEDLESS_BOOLEAN_CONSTANT_CONVERSION','NAB_NEEDLESS_BOOLEAN_CONSTANT_CONVERSION','fb-contrib','<p>This method assigns a Boxed boolean constant to a primitive boolean variable, or assigns a primitive boolean\nconstant to a Boxed boolean variable. Use the correct constant for the variable desired. Use</p>\n<pre>\n  boolean b = true;\n  boolean b = false;\n\n  or\n\n  Boolean b = Boolean.TRUE;\n  Boolean b = Boolean.FALSE;\n</pre>',0,NULL,'Performance - Method needlessly boxes a boolean constant','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(527,'SPP_USE_BIGDECIMAL_STRING_CTOR','SPP_USE_BIGDECIMAL_STRING_CTOR','fb-contrib','<p>This method calls the BigDecimal constructor that takes a double, and passes a literal double constant value. Since \nthe use of BigDecimal is to get better precision than double, by passing a double, you only get the precision of double number\nspace. To take advantage of the BigDecimal space, pass the number as a string. </p>',0,NULL,'Correctness - Method passes double value to BigDecimal Constructor','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(528,'SPP_EQUALS_ON_ENUM','SPP_EQUALS_ON_ENUM','fb-contrib','<p>This method calls the equals(Object) method on an enum instance. Since enums values are singletons,\nyou can use == to safely compare two enum values. In fact, the implementation for Enum.equals does just\nthat.</p>',0,NULL,'Correctness - Method calls equals on an enum instance','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(529,'OCP_OVERLY_CONCRETE_PARAMETER','OCP_OVERLY_CONCRETE_PARAMETER','fb-contrib','<p>This method uses concrete classes for parameters when only methods defined in an implemented\ninterface or super class are used. Consider increasing the abstraction of the interface to\nmake low impact changes easier to accomplish in the future.</p>',0,NULL,'Style - Method needlessly defines parameter with concrete classes','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(530,'SPP_INTERN_ON_CONSTANT','SPP_INTERN_ON_CONSTANT','fb-contrib','<p>This method calls intern on a constant string. As constant strings are already interned, this call\nis superfluous</p>',0,NULL,'Correctness - Method calls intern on a string constant','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(531,'PIS_POSSIBLE_INCOMPLETE_SERIALIZATION','PIS_POSSIBLE_INCOMPLETE_SERIALIZATION','fb-contrib','<p>This method implements Serializable but is derived from a\nclass that does not. The super class has fields that are not serialized\nbecause this class does not take the responsibility of writing these fields out\neither using Serializable\'s writeObject method, or Externalizable\'s writeExternal\nmethod. Therefore when this class is read from a stream, the superclass fields\nwill only be initialized to the values specified in it\'s default constructor.\nIf possible, change the superclass to implement Serializable, or implement\nSerializable or Externalizable methods in the child class.</p>',0,NULL,'Correctness - Class doesn\'t serialize superclass fields','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(532,'PCAIL_POSSIBLE_CONSTANT_ALLOCATION_IN_LOOP','PCAIL_POSSIBLE_CONSTANT_ALLOCATION_IN_LOOP','fb-contrib','<p>This method allocates an object using the default constructor in a loop, and then\nonly uses it in a quasi-static way. It is never assigned to anything that lives outside\nthe loop, and could potentially be allocated once outside the loop. Often this can be\nachieved by calling a clear() like method in the loop, to reset the state of the object\nin the loop.',0,NULL,'Performance - Method allocates an object that is used in a constant way in a loop','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(533,'PME_POOR_MANS_ENUM','PME_POOR_MANS_ENUM','fb-contrib','<p>This field, although defined as a simple variable (int, String, etc) only has a set of constant values\nassigned to it. Thus it appears to be used like an enum value, and should probably be defined as such.\n</p>',0,NULL,'Style - Poor Mans Enum','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(534,'COM_COPIED_OVERRIDDEN_METHOD','COM_COPIED_OVERRIDDEN_METHOD','fb-contrib','<p>This method is implemented using an exact copy of it\'s super class method\'s \nimplementation, which usually means that this method can just be removed.\n</p>',0,NULL,'Style - Method is implemented with an exact copy of it\'s superclass\'s method','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(535,'ISB_INEFFICIENT_STRING_BUFFERING','ISB_INEFFICIENT_STRING_BUFFERING','fb-contrib','<p>This method uses StringBuffer or StringBuilder\'s append method to concatenate strings. However, it passes the result\nof doing a simple String concatenation to one of these append calls, thus removing any performance gains\nof using the StringBuffer or StringBuilder class.</p>',0,NULL,'Performance - Method passes simple concatenating string in StringBuffer or StringBuilder append','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(536,'MRC_METHOD_RETURNS_CONSTANT','MRC_METHOD_RETURNS_CONSTANT','fb-contrib','<p>This private or static method only returns one constant value. As this method is private or static,\nit\'s behavior can\'t be overridden, and thus the return of a constant value seems dubious.\nEither the method should be changed to return no value, or perhaps another return value\nwas expected to be returned in another code path in this method.</p>',0,NULL,'Style - Private method only returns one constant value','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(537,'MDM_RUNTIME_EXIT_OR_HALT','MDM_RUNTIME_EXIT_OR_HALT','fb-contrib','<p>Calling <code>Runtime.exit()</code> or <code>Runtime.halt()</code> shuts down the entire Java virtual machine. This should only been done when it is appropriate. Such calls make it hard or impossible for your code to be invoked by other code. Consider throwing a RuntimeException instead.</p>',0,NULL,'Correctness - Method calls Runtime.exit() or Runtime.halt()','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(538,'PMB_POSSIBLE_MEMORY_BLOAT','PMB_POSSIBLE_MEMORY_BLOAT','fb-contrib','<p>This class defines static fields that are collections or StringBuffers that do not\nappear to have any way to clear or reduce their size. This is a potential cause of \nmemory bloat.</p>',0,NULL,'Correctness - Class defines static field that appears to allow memory bloat','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(539,'S508C_NO_SETSIZE','S508C_NO_SETSIZE','fb-contrib','<p>This class creates a window, and sizes the window using setSize. It is better\nto handle font size changes to use the pack method.\n</p>',0,NULL,'Correctness - Window sets size manually, and doesn\'t use pack','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(540,'JAO_JUNIT_ASSERTION_ODDITIES_BOOLEAN_ASSERT','JAO_JUNIT_ASSERTION_ODDITIES_BOOLEAN_ASSERT','fb-contrib','<p>This method asserts that a value is equal to true or false. It is simpler to just \nuse assertTrue, or assertFalse, instead.</p>',0,NULL,'Style - Method asserts that a value is true or false','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(541,'NAB_NEEDLESS_BOX_TO_CAST','NAB_NEEDLESS_BOX_TO_CAST','fb-contrib','<p>This method constructs a Boxed Primitive from a primitive only to call the primitiveValue() method to\ncast the value to another primitive typee. It is simpler to just use casting</p>\n<pre>\n  primitive i = new BoxedPrimitive(1.0).primitiveValue();\n    or\n  primitive i = BoxedPrimitive.valueOf(1.0).primitiveValue();\n\n    should just use \n  primitive i = (primitive)1.0;\n</pre>',0,NULL,'Performance - Method creates Boxed primitive from primitive only to cast to another primitive type','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(542,'ISB_EMPTY_STRING_APPENDING','ISB_EMPTY_STRING_APPENDING','fb-contrib','<p>This method concatenates an empty string with a literal value, in order to convert\nthe literal value into a string. It is more efficient to use String.valueOf() to do the same\nthing as you do not incur the cost of creating a StringBuffer/Builder and calling methods on it\nto accomplish this.</p>',0,NULL,'Performance - Method concatenates an empty string to effect type conversion','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(543,'SPP_USE_STRINGBUILDER_LENGTH','SPP_USE_STRINGBUILDER_LENGTH','fb-contrib','<p>This method calls the toString method on a StringBuffer or StringBuilder only to call length() on the resulting\nstring. It is faster, and less memory intensive to just call the length method directly on the StringBuffer or StringBuilder\nitself.</p>',0,NULL,'Performance - Method converts StringBuffer or Builder to String just to get it\'s length','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(544,'OC_OVERZEALOUS_CASTING','OC_OVERZEALOUS_CASTING','fb-contrib','<p>This method casts the right hand side of an expression to a class that is more specific than the \nvariable on the left hand side of the assignment. The cast only has to be as specific as what the variable\nthat is on the left. Using a more specific type on the right hand side just increases cohesion.',0,NULL,'Correctness - Method manually casts the right hand side of an assignment more specifically than needed','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(545,'CEBE_COMMONS_EQUALS_BUILDER_ISEQUALS','CEBE_COMMONS_EQUALS_BUILDER_ISEQUALS','fb-contrib','<p>This method returns the result of equals on the EqualsBuilder type\ninstead of calling the method isEqual().</p>',0,NULL,'Correctness - Method returns the result of invoking equals() on EqualsBuilder','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(546,'SPP_EMPTY_CASING','SPP_EMPTY_CASING','fb-contrib','This method passes the empty string \"\" to equalsIgnoreCase or compareToIgnoreCase, as the empty string\nis not case sensitive using equals is simpler. It would be even simpler to do a length() == 0 test.',0,NULL,'Style - Method passes an empty string to equalsIgnoreCase or compareToIgnoreCase','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(547,'LO_SUSPECT_LOG_CLASS','LO_SUSPECT_LOG_CLASS','fb-contrib','<p>This method creates a Logger by passing in a specification for a class that is unrelated\nto the class in which the logger is going to be used. This is likely caused by copy/paste code.',0,NULL,'Correctness - Method specifies an unrelated class when allocating a Logger','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(548,'IKNC_INCONSISTENT_HTTP_ATTRIBUTE_CASING','IKNC_INCONSISTENT_HTTP_ATTRIBUTE_CASING','fb-contrib','<p>This method sets or gets an HttpSession attribute with a parmeter name that was used in other locations\nbut with a different casing. As HttpSession attribute are case sensitive, this will be very confusing.',0,NULL,'Style - Method uses the same HttpSession attribute name but with different casing','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(549,'MDM_BIGDECIMAL_EQUALS','MDM_BIGDECIMAL_EQUALS','fb-contrib','<p><code>equals()</code> being called to compare two <code>java.math.BigDecimal</code> numbers. This is normally a mistake, as two <code>BigDecimal</code> objects are only equal if they are equal in both value and scale, so that <i>2.0</i> is not equal to <i>2.00</i>. To compare <code>BigDecimal</code> objects for mathematical equality, use <code>compareTo()</code> instead.</p>',0,NULL,'Correctness - Method calls BigDecimal.equals()','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(550,'CVAA_CONTRAVARIANT_ELEMENT_ASSIGNMENT','CVAA_CONTRAVARIANT_ELEMENT_ASSIGNMENT','fb-contrib','<p>This method contains a contravariant array element assignment. Since arrays are mutable \ndata structures, their use must be restricted to covariant or invariant usage</p>\n\n<pre>\nclass A {}\nclass B extends A {}\n\n B[] b = new B[2];\n A[] a = b;\n a[0] = new A(); // results in ArrayStoreException (Runtime)\n</pre>',0,NULL,'Correctness - Method performs a contravariant array element assignment','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(551,'SPP_NULL_BEFORE_INSTANCEOF','SPP_NULL_BEFORE_INSTANCEOF','fb-contrib','This method checks a reference for null just before seeing if the reference is an instanceof some class.\nSince instanceof will return false for null references, the null check is not needed.',0,NULL,'Correctness - Method checks a reference for null before calling instanceof','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(552,'JAO_JUNIT_ASSERTION_ODDITIES_INEXACT_DOUBLE','JAO_JUNIT_ASSERTION_ODDITIES_INEXACT_DOUBLE','fb-contrib','<p>This method calls assert with two doubles or Doubles. Due to the inprecision of doubles, you\nshould be using the assert method that takes a range parameter that gives a range of error.</p>',0,NULL,'Style - Method asserts that two doubles are exactly equal','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(553,'CTU_CONFLICTING_TIME_UNITS','CTU_CONFLICTING_TIME_UNITS','fb-contrib','<p>This method takes two values that appear to be representing time, and performs arithmetic operations on this\ntwo values directly, even though it appears that the two values are representing different time units, such as\nadding a millisecond value to a nanosecond value. You should convert the two values to the same time unit before\nperforming this calculation in order for it to be meaningful.',0,NULL,'Correctness - Conflicting Time Units','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(554,'MDM_THREAD_PRIORITIES','MDM_THREAD_PRIORITIES','fb-contrib','<p>Getting or setting thread priorities is not portable and could cause or mask race conditions.</p>',0,NULL,'MT Correctness - Method uses suspicious thread priorities','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(555,'NAB_NEEDLESS_AUTOBOXING_CTOR','NAB_NEEDLESS_AUTOBOXING_CTOR','fb-contrib','<p>This method passes a wrapped primitive object to the same class\'s constructor.\nSince wrapper classes are immutable, you can just use the original object, rather\nthan constructing a new one. This code works because of an abuse of autoboxing.\n</p>',0,NULL,'Performance - Method passes primitive wrapper to same primitive wrapper constructor','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(556,'NFF_NON_FUNCTIONAL_FIELD','NFF_NON_FUNCTIONAL_FIELD','fb-contrib','<p>This serializable class defines a field as both transient and final. As transient fields\nare not serialized across the stream, it is required that some piece of code reinitialize that field\nwhen it is deserialized. But since constructors aren\'t called when deserialization, the field is not initialized. \nAnd since the field is final, no other method can initialize it as well.</p>',0,NULL,'Correctness - Serializable class defines a final transient field','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(557,'SPP_SUSPECT_STRING_TEST','SPP_SUSPECT_STRING_TEST','fb-contrib','<p>This method tests a string, and groups null values with real strings, leaving empty strings as another\ncase. This might be perfectly valid, but normally, null strings and empty strings are logically handled the same way,\nand so this test may be flawed.</p>\n<p>Pattern found is one of the following\n<pre>if ((s == null) || (s.length() > 0))</pre> -- did you mean ((s == null) || (s.length() == 0))?\n<pre>if ((s == null) || (s.length() != 0))</pre> -- did you mean ((s == null) || (s.length() == 0))?\n<pre>if ((s != null) && (s.length() == 0))</pre> -- did you mean ((s != null) && (s.length() > 0))?\nor perhaps ((s == null) || (s.length() == 0))?\n</p>',0,NULL,'Correctness - Method treats null and normal strings differently than an empty strings','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(558,'SPP_USE_GETPROPERTY','SPP_USE_GETPROPERTY','fb-contrib','<table>\n    <tr><td>This method uses</td></tr>\n    <tr><td>String prop = System.getProperties().getProperty(\"foo\");</td></tr\n    <tr><td>instead of simply using</td></tr>\n    <tr><td>String prop = System.getProperty(\"foo\");</td></tr>\n  </table>',0,NULL,'Style - Method calls getProperties just to get one property, use getProperty instead','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(559,'DDC_DOUBLE_DATE_COMPARISON','DDC_DOUBLE_DATE_COMPARISON','fb-contrib','<p>This method compares dates with two comparisons, rather than using the reverse comparison.\nSo This pattern\n<pre>\n  if ((date1.equals( date2 )) || (date1.after( date2 )))\n</pre>\ncould become\n<pre>\n  if (date1.compareTo( date2 ) >= 0)\n</pre>\nand\n<pre>\n  if ((date1.equals( date2 )) || (date1.before( date2 )))\n</pre>\ncould become\n<pre>\n  if (date1.compareTo( date2 ) <= 0)\n</pre>\nand\n<pre>\n  if ((date1.before( date2 )) || (date1.after( date2 )))\n</pre>\ncould become\n<pre>\n  if (!date1.equals( date2 ))\n</pre>',0,NULL,'Performance - Method uses two date comparisons when one would do','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(560,'PSC_PRESIZE_COLLECTIONS','PSC_PRESIZE_COLLECTIONS','fb-contrib','<p>This method allocates a collection using the default constructor even though it is known\napriori how many items are going to be placed in the collection (or at least a reasonable guess)\nand thus needlessly causes intermediate reallocations of the collection.\n</p>',0,NULL,'Performance - Method does not presize the allocation of a collection','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(561,'LO_SUSPECT_LOG_PARAMETER','LO_SUSPECT_LOG_PARAMETER','fb-contrib','<p>This constructor declares a parameter that is a Logger. As loggers are meant to be\ncreated statically per class, it doesn\'t make sense that you would pass a Logger from one\nclass to another. Declare the Logger static in each class instead.</p>',0,NULL,'Correctness - Constructor declares a Logger parameter','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(562,'JAO_JUNIT_ASSERTION_ODDITIES_ACTUAL_CONSTANT','JAO_JUNIT_ASSERTION_ODDITIES_ACTUAL_CONSTANT','fb-contrib','<p>This method calls assert passing a constant value as the second of the two values. The assert\nmethod assumes that the expected value is the first parameter, and so it appears that the order\nof values has been swapped here.</p>',0,NULL,'Style - Method passes constant to second (actual) assertion parameter','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(563,'SPP_NEGATIVE_BITSET_ITEM','SPP_NEGATIVE_BITSET_ITEM','fb-contrib','<p>This method passes a constant negative value as a bit position to a java.util.BitSet. The BitSet class\ndoesn\'t support negative values, and thus this method call will not work as expected.</p>',0,NULL,'Correctness - Method passes a negative number as a bit to a BitSet which isn\'t supported','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(564,'ABC_ARRAY_BASED_COLLECTIONS','ABC_ARRAY_BASED_COLLECTIONS','fb-contrib','<p>This method passes an array as the key to a Map, element in a Set, or item in a List when\nthe contains method is used on the List. Since arrays do not, and cannot override the equals \nmethod, collection inclusion is based on the reference\'s address, which is probably not desired.\nIn the case that this is a TreeMap or TreeSet, consider passing a Comparator to the map\'s\nconstructor.\n</p>',0,NULL,'Correctness - Method uses array as basis of collection','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(565,'STB_STACKED_TRY_BLOCKS','STB_STACKED_TRY_BLOCKS','fb-contrib','<P>This method declares two try catch blocks one after another, where each\ncatch block catches the same type of exception. They also throw uniformly the\nsame type of exception. These two catch blocks can be combined into one to\nsimplify the method.</p>',0,NULL,'Style - Method stacks similar try/catch blocks','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(566,'DWI_MODIFYING_WHILE_ITERATING','DWI_MODIFYING_WHILE_ITERATING','fb-contrib','<p>This method modifies the contents of a collection using the collection api methods, while\nat the same time iterating across the collection. Doing this will invalidate the iterator, and further\nuse of it, will cause ConcurrentModificationExceptions to be thrown.\n</p>',0,NULL,'Correctness - Method modifies collection element while iterating','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(567,'CAAL_CONFUSING_ARRAY_AS_LIST','CAAL_CONFUSING_ARRAY_AS_LIST','fb-contrib','<p>This method passes an array of primitive values to the Array.asList call. As primitive\nvalues in arrays aren\'t automatically promoted to boxed primitives in arrays, the asList call\ncannot convert this array in a list of boxed primitives. It therefore just creates an array\nwith one item in it, the array itself. This is rarely what is desired.\n</p>',0,NULL,'Correctness - Method calls Array.asList on an array of primitive values','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(568,'FP_FINAL_PARAMETERS','FP_FINAL_PARAMETERS','fb-contrib','<p>This method correctly does not write to a parameter. To help document this, and to perhaps\nhelp the jvm optimize the invocation of this method, you should consider defining these parameters\nas final.</p>',0,NULL,'Style - Method does not define a parameter as final, but could','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(569,'SJVU_SUSPICIOUS_JDK_VERSION_USE','SJVU_SUSPICIOUS_JDK_VERSION_USE','fb-contrib','<p>This method calls a method that does not exist, on a class that does not exist in the jdk that\nthis class has been compiled for. This can happen if you compile the class specifying the -source and\n-target options, and use a version that is before the version of the compiler\'s JDK.</p>',0,NULL,'Correctness - Method uses rt.jar class or method that does not exist','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(570,'SPP_INVALID_BOOLEAN_NULL_CHECK','SPP_INVALID_BOOLEAN_NULL_CHECK','fb-contrib','<p>This method attempts to check for null by just refering to the variable name\nas would be done in C++. This ordinarily would be considered a compile error, except the\nvariable in question is a Boolean, which does an auto unbox to boolean.</p>\n<pre>\nif (b && b.booleanValue())\nshould be\nif ((b != null) && b.booleanValue())\n</pre>',0,NULL,'Correctness - Method uses invalid C++ style null check on Boolean','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(571,'SPP_STUTTERED_ASSIGNMENT','SPP_STUTTERED_ASSIGNMENT','fb-contrib','<p>This method assigns a value twice in a row in a stuttered way such as\n<code>a = a = 5;</code> This is most probably a cut and paste error where the duplicate\nassignment can be removed.</p>',0,NULL,'Correctness - Method assigns a value to a local twice in a row','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(572,'SCR_SLOPPY_CLASS_REFLECTION','SCR_SLOPPY_CLASS_REFLECTION','fb-contrib','<p>This method accesses the class object of a class that is already statically bound\nin this context, with Class.forName. Using Class.forName makes reflection more fragile\nin regards to code transformations such as obfuscation, and is unneeded here, since \nthe class in question is already \'linked\' to this class.</p>',0,NULL,'Style - Method accesses statically bound class with Class.forName','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(573,'CHTH_COMMONS_HASHCODE_BUILDER_TOHASHCODE','CHTH_COMMONS_HASHCODE_BUILDER_TOHASHCODE','fb-contrib','<p>This method returns the result of hashCode on the HashCodeBuilder type\ninstead of calling the method toHashCode().</p>',0,NULL,'Correctness - Method returns the result of invoking hashCode() on HashCodeBuilder','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(574,'HES_EXECUTOR_OVERWRITTEN_WITHOUT_SHUTDOWN','HES_EXECUTOR_OVERWRITTEN_WITHOUT_SHUTDOWN','fb-contrib','<p>Most <code>ExecutorService</code> objects must be explicitly shutdown, otherwise, their internal threads can prevent the JVM from ever shutting down, even when everything else has stopped.</p>\n\n<p>FindBugs has detected that something like the following is happening:<br/>\n<code>\nExecutorService executor = ... //e.g. Executors.newCachedThreadPool();<br/>\n...<br/>\npublic void reset() {<br/>\n&nbsp;&nbsp;&nbsp;this.executor = Executors.newCachedThreadPool(); <br/>\n&nbsp;&nbsp;&nbsp;this.executor.execute(new SampleExecutable()); <br/>\n}<br/>\n</code>\nFor normal objects, losing the last reference to them like this would trigger the object to be cleaned up\nin garbage collection.  For <code>ExecutorService</code>s, this isn\'t enough to terminate the internal threads in the\nthread pool, and the <code>ExecutorService</code> isn\'t guaranteed to shutdown, causing the JVM to never stop. <br/>\nTo fix this, simply add a call to <code>shutdown()</code> like this:<br/>\n<code>\nExecutorService executor = ... //e.g. Executors.newCachedThreadPool();<br/>\n...<br/>\npublic void reset() {<br/>\n<b>&nbsp;&nbsp;&nbsp;this.executor.shutDown();</b> <br/>\n&nbsp;&nbsp;&nbsp;this.executor = Executors.newCachedThreadPool(); <br/>\n&nbsp;&nbsp;&nbsp;this.executor.execute(new SampleExecutable()); <br/>\n}\n</code>\n</p>\n\n<p>Even though there are some exceptions to this, particularly when a custom <code>ThreadFactory</code> is\nprovided, or for <code>ThreadPoolExecutor</code>s with <code>allowsCoreThreadTimeOut()</code> set to true,\nit is good practice to explictly shutdown the <code>ExecutorService</code> at the end of execution, or\nwhen it is being replaced.</p>\n\n<p><b>Note:</b> <code>ExecutorService</code>s are generally created once in a program\'s lifecycle.  If you find yourself\nreplacing the <code>ExecutorService</code>, perhaps you may consider restructuring your code to use calls like\n<code>awaitTermination()</code> or <code>Future</code>s/<code>Callable</code>s to avoid recreating the <code>ExecutorService</code>.</p>',0,NULL,'Correctness - Hanging ExecutorService','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(575,'LSYC_LOCAL_SYNCHRONIZED_COLLECTION','LSYC_LOCAL_SYNCHRONIZED_COLLECTION','fb-contrib','<p>This method creates a synchronized collection and store the reference to it\nin a local variable. As local variables are by definition threadsafe, it seems\nquestionable that this collection needs to be synchronized.</p>\n<p>\n<table>\n  <tr><th>If you are using</th><th>consider using</th></tr>\n  <tr><td>java.util.Vector</td><td>java.util.ArrayList</td></tr>\n  <tr><td>java.util.Hashtable</td><td>java.util.HashMap</td></tr>\n  <tr><td>java.lang.StringBuffer</td><td>java.lang.StringBuilder</td></tr>\n</table>\n</p>',0,NULL,'Correctness - Method creates local variable-based synchronized collection','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(576,'SMII_STATIC_METHOD_INSTANCE_INVOCATION','SMII_STATIC_METHOD_INSTANCE_INVOCATION','fb-contrib','<p>This method makes a static method call on an instance reference. For\nreading comprehension of the code is better to call the method on the class,\nrather than an instance. Perhaps this method\'s static nature has changed since\nthis code was written, and should be revisited.\n</p>',0,NULL,'Style - Method calls static method on instance reference','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(577,'SPP_DOUBLE_APPENDED_LITERALS','SPP_DOUBLE_APPENDED_LITERALS','fb-contrib','This method appends two literal strings to a StringBuilder back to back. This can be done with just\none append call, and may avoid intermediate reallocations of the StringBuilders backing store.',0,NULL,'Performance - Method appends two literal strings back to back to a StringBuilder','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(578,'SACM_STATIC_ARRAY_CREATED_IN_METHOD','SACM_STATIC_ARRAY_CREATED_IN_METHOD','fb-contrib','<p>This method creates an array initialized by constants. Each time this method is called\nthis array will be recreated. It would be more performant to define the array as a\nstatic field of the class instead.</p>',0,NULL,'Performance - Method creates array using constants','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(579,'LSC_LITERAL_STRING_COMPARISON','LSC_LITERAL_STRING_COMPARISON','fb-contrib','<p>This method calls the equals or compareTo methods on a String variable passing in a String literal.\nA NullPointerException may occur if the string variable is null. If instead the method was called on\nthe string literal, and the variable was passed as an argument, this exception could never happen.</p>',0,NULL,'Style - Method makes literal string comparisons passing the literal as an argument','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(580,'PL_PARALLEL_LISTS','PL_PARALLEL_LISTS','fb-contrib','<p>This class appears to maintain two or more lists or arrays who\'s contains is related one-for-one\nthrough the index of the list or array. Consider creating a separate class to hold all the related \npieces of information, and adding instances of this class to just one list or array, or if just two values, use\na Map to associate one value with the other.</p>',0,NULL,'Style - Class defines two or more one for one associated lists or arrays','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(581,'SGSU_SUSPICIOUS_GETTER_SETTER_USE','SGSU_SUSPICIOUS_GETTER_SETTER_USE','fb-contrib','<p>This method retrieves the property of a java bean, only to use it in the setter\nfor the same property of the same bean. This is usually a copy/paste typo.',0,NULL,'Correctness - Method uses same bean\'s getter value for setter','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(582,'NSE_NON_SYMMETRIC_EQUALS','NSE_NON_SYMMETRIC_EQUALS','fb-contrib','<p>This class implements an equals method that compares this object against another type of object.\nThis is almost always a bad thing to do, but if it is to be done, you must make sure that the basic\nsymmetry rule of equivalence is maintained, that being if a equals b, then b equals a. It does not\nappear that the class that is being compared to this class knows about this class, and doesn\'t compare itself\nto this.</p>',0,NULL,'Correctness - Equals method compares this object against other types in a non symmetric way','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(583,'MUC_MODIFYING_UNMODIFIABLE_COLLECTION','MUC_MODIFYING_UNMODIFIABLE_COLLECTION','fb-contrib','<p>This method attempts to modify a collection that it got from a source that could potentially have created an\nimmutable collection, thru Arrays.asList, Collections.unmodifiableXXX, or one of guava\'s methods. Doing so will cause\nan exception, as these collections are not mutable.',0,NULL,'Correctness - Modifying Unmodifiable Collection','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(584,'S508C_NO_SETLABELFOR','S508C_NO_SETLABELFOR','fb-contrib','<p>This class uses JLabels that do not specify what fields are being labeled.\nThis hampers screen readers from given appropriate feed back to users. Use\nthe JLabel.setLabelFor method to accomplish this.\n</p>',0,NULL,'Correctness - JLabel doesn\'t specify what it\'s labeling','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(585,'SCI_SYNCHRONIZED_COLLECTION_ITERATORS','SCI_SYNCHRONIZED_COLLECTION_ITERATORS','fb-contrib','<p>This method uses a synchronized collection, built from Collections.synchronizedXXXX, but accesses it\nthrough an iterator. Since an iterator is by definition, multithreaded unsafe, this is a conflict in\nconcept. When using iterators, you should do the synchronization manually.</p>',0,NULL,'Correctness - Method creates iterators on synchronized collections','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(586,'IPU_IMPROPER_PROPERTIES_USE','IPU_IMPROPER_PROPERTIES_USE','fb-contrib','<p>This method places non-String objects into a Properties object. As the Properties object\nis intented to be a String to String map, putting non String objects is wrong, and takes advantage\nof a design flaw in the Properties class by deriving from Hashtable instead of using aggregation.\nIf you want a collection that holds other types of objects, use a Hashtable, or better still newer collections\nlike HashMap or TreeMap.',0,NULL,'Correctness - Method puts non-String values into a Properties object','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(587,'SNG_SUSPICIOUS_NULL_LOCAL_GUARD','SNG_SUSPICIOUS_NULL_LOCAL_GUARD','fb-contrib','<p>This method tests a local variable to make sure it\'s not null before executing a conditional block of\ncode. However in the conditional block it reassigns the local variable. It is likely that the guard\nshould have been a check to see if the local variable is null, not that the local variable was not null.</p>',0,NULL,'Correctness - Method tests a local variable for not null as guard and reassigns it','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(588,'CLI_CONSTANT_LIST_INDEX','CLI_CONSTANT_LIST_INDEX','fb-contrib','<p>This method accesses an array or list using a constant integer index. Often,\nthis is a typo where a loop variable is intended to be used. If however, specific\nlist indices mean different specific things, then perhaps replacing the list with\na first-class object with meaningful accessors would make the code less brittle.</p>',0,NULL,'Correctness - Method accesses list or array with constant index','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(589,'URV_CHANGE_RETURN_TYPE','URV_CHANGE_RETURN_TYPE','fb-contrib','<p>This method is defined to return a java.lang.Object. However, the return types\nreturned from this method can be defined by a more specific class or interface. Since this\nmethod is not derived from a superclass or interface, it would be more clear to\nchange the return type of this method.</p>',0,NULL,'Style - Method returns more specific type of object than declared','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(590,'PDP_POORLY_DEFINED_PARAMETER','PDP_POORLY_DEFINED_PARAMETER','fb-contrib','<p>This method defines parameters at a more abstract level than is actually needed to function correctly,\nas the code casts these parameters to more concrete types. Since this method is not derivable, you should \njust define the parameters with the type that is needed.',0,NULL,'Correctness - Method defines parameters more abstractly than needed to function properly','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(591,'MDM_RANDOM_SEED','MDM_RANDOM_SEED','fb-contrib','<p><code>Random()</code> constructor without a seed is insecure because it defaults to easily guessable seed: <code>System.currentTimeMillis()</code>. Initialize seed with <code>Random(SecureRandom.getInstance().generateSeed())</code> or use <code>SecureRandom</code> instead.</p>',0,NULL,'Correctness - Method creates insecure Random object','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(592,'UTA_USE_TO_ARRAY','UTA_USE_TO_ARRAY','fb-contrib','<p>This method manually loops over a collection, pulling each element out and storing\nit in an array to build an array from the collection. It is easier, and clearer to use\nthe built in collections method toArray. Given a collection \'mycollection\' of type T, use\nmycollection.toArray(new T[mycollection.size()]);',0,NULL,'Style - Method manually creates array from collection','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(593,'CAO_CONFUSING_AUTOBOXED_OVERLOADING','CAO_CONFUSING_AUTOBOXED_OVERLOADING','fb-contrib','<p>This class defines two methods that differ only by a parameter being defined\nas Character vs. int, long, float or double. As autoboxing is present, it may be\nassumed that a parameter of \'a\' would map to the Character version, but does not.</p>',0,NULL,'Correctness - Class defines methods which confuse Character with int parameters','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(594,'NAB_NEEDLESS_AUTOBOXING_VALUEOF','NAB_NEEDLESS_AUTOBOXING_VALUEOF','fb-contrib','<p>This method passes a wrapped primitive object to the same class\'s .valueOf method.\nSince wrapper classes are immutable, you can just use the original object, rather\nthan calling valueOf to create a new one. This code works because of an abuse of autoboxing.\n</p>',0,NULL,'Performance - Method passes primitive wrapper to Wrapper class valueOf method','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(595,'UP_UNUSED_PARAMETER','UP_UNUSED_PARAMETER','fb-contrib','<p>This method defines parameters that are never used. As this method is either static of private,\nand can\'t be derived from, it is safe to remove these parameters and simplify your method.\nYou should consider, while unlikely, that this method may be used reflectively, and thus you will\nwant to change that call as well.',0,NULL,'Style - Unused Parameter','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(596,'WEM_WEAK_EXCEPTION_MESSAGING','WEM_WEAK_EXCEPTION_MESSAGING','fb-contrib','<p>This method creates and throws an exception using a static string as the exceptions message.\nWithout any specific context of this particular exception invocation, such as the value of parameters, \nkey member variables, or local variables, it may be difficult to infer how this exception occurred. Consider\nadding context to the exception message.</p>',0,NULL,'Style - Method throws exception with static message string','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(597,'UJM_UNJITABLE_METHOD','UJM_UNJITABLE_METHOD','fb-contrib','<p>This method is longer than 8000 bytes. By default the JIT will not attempt to compile this method no matter\nhow hot it is, and so this method will always be interpreted. If performance is important, you should consider\nbreaking this method up in smaller chunks. (And probably a good idea for readability too!).',0,NULL,'Performance - Unjitable method','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(598,'CE_CLASS_ENVY','CE_CLASS_ENVY','fb-contrib','<p><em>THIS DETECTOR IS HIGHLY EXPERIMENTAL AND IS LIKELY TO CREATE A LOT OF FUD</em></p>\n<p>This method makes extensive use of methods from another class over methods of it\'s own\nclass. Typically this means that the functionality that is accomplished by this method\nmost likely belongs with the class that is being used so liberally. Consider refactoring this\nmethod to be contained in that class, and to accept all the parameters needed in the method signature.</p>',0,NULL,'Style - Method excessively uses methods of another class','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(599,'LO_INCORRECT_NUMBER_OF_ANCHOR_PARAMETERS','LO_INCORRECT_NUMBER_OF_ANCHOR_PARAMETERS','fb-contrib','This method passes the wrong number of parameters to a slf4j logging method (error, warn, info, debug) based on the number of anchors {} in the \nformat string. An additional exception argument is allowed if found.',0,NULL,'Correctness - Method passes an incorrect number of parameters to an SLF4J logging statement','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(600,'MDM_SECURERANDOM','MDM_SECURERANDOM','fb-contrib','<p>The <code>SecureRandom()</code> constructors and <code>SecureRandom.getSeed()</code> method are deprecated. Call <code>SecureRandom.getInstance()</code> and <code>SecureRandom.getInstance().generateSeed()</code> instead.</p>',0,NULL,'Correctness - Method calls deprecated SecureRandom method','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(601,'SMA_STUTTERED_METHOD_ARGUMENTS','SMA_STUTTERED_METHOD_ARGUMENTS','fb-contrib','<p>This method calls a method passing the same value for two or more of the parameters.\nOften this is a cut/paste bug, but if not, it is confusing why you would pass the same value for two\ndifferent parameters. Perhaps an alternative method that just takes one parameter should be overridden\nin this case.</p>',0,NULL,'Style - Code calls a method passing the same value to two different arguments','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(602,'PUS_POSSIBLE_UNSUSPECTED_SERIALIZATION','PUS_POSSIBLE_UNSUSPECTED_SERIALIZATION','fb-contrib','<p>This method serializes an instance of a non-static inner class. Since this class has a\nreference to the containing class, this outer class will be serialized as well. This is often\nnot intentional, and will make the amount of data that is serialized much more than is needed.\nIf the outer classes is not desired to be serialized, either make the inner class static, or\npull it out into a separate \"first class\" class.',0,NULL,'Correctness - Method serializes an instance of a non-static inner class','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(603,'MDM_INETADDRESS_GETLOCALHOST','MDM_INETADDRESS_GETLOCALHOST','fb-contrib','<p>Do not call <code>InetAddress.getLocalHost()</code> on multihomed servers. On a multihomed server, <code>InetAddress.getLocalHost()</code> simply returns the IP address associated with the server\'s internal hostname. This could be any of the network interfaces, which could expose the machine to security risks. Server applications that need to listen on sockets should add configurable properties to define which network interfaces the server should bind.</p>',0,NULL,'Correctness - Method calls InetAddress.getLocalHost()','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(604,'FPL_FLOATING_POINT_LOOPS','FPL_FLOATING_POINT_LOOPS','fb-contrib','<p>This method uses floating point variables to index a loop. Since floating point\nmath is imprecise, rounding errors will accumulate over time each time the loop is\nexecuted. It is usually better to use integer indexing, and calculate the new value\nof the floating point number at the top of the loop body.</p>',0,NULL,'Correctness - Method uses floating point indexed loops','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(605,'SPP_USE_MATH_CONSTANT','SPP_USE_MATH_CONSTANT','fb-contrib','<p>This method defines its own version of <em>PI</em> or <em>e</em> and the value is not as precise as the\none defined in the constants Math.PI or Math.E. Use these constants instead.</p>',0,NULL,'Correctness - Method uses non standard math constant','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(606,'SCII_SPOILED_CHILD_INTERFACE_IMPLEMENTOR','SCII_SPOILED_CHILD_INTERFACE_IMPLEMENTOR','fb-contrib','<p>This class declares that it implements an interface, but does so by relying on methods supplied\nby superclasses, even though those superclasses know nothing about the interface in question. If you wish\nto have the child not implement all the methods of the interface, it would probably be better to declare\nthe superclass as implementing the interface, and if that class does not provide all the methods, then declare\nthat superclass abstract.</p>',0,NULL,'Style - Class implements interface by relying on unknowing superclass methods','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(607,'WOC_WRITE_ONLY_COLLECTION_LOCAL','WOC_WRITE_ONLY_COLLECTION_LOCAL','fb-contrib','<p>This method creates and initializes a collection but then never access this collection\nto gain information, or fetch items from the collection. It is likely that this collection\nis left over from a past effort, and can be removed.',0,NULL,'Correctness - Method creates and initializes a collection but never reads or gains information from it','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(608,'MOM_MISLEADING_OVERLOAD_MODEL','MOM_MISLEADING_OVERLOAD_MODEL','fb-contrib','<p>This class \'overloads\' the same method with both an instance and static version. As the use\nof these two models is different, it will be confusing to the users of these methods.</p>',0,NULL,'Style - Class \'overloads\' a method with both instance and static versions','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(609,'SPP_SERIALVER_SHOULD_BE_PRIVATE','SPP_SERIALVER_SHOULD_BE_PRIVATE','fb-contrib','This class defines a static field \'serialVersionUID\' to define the serialization\nversion for this class. This field is marked as non private. As the serialVersionUID only\ncontrols the current class, and doesn\'t effect any derived classes, defining it as non\nprivate is confusing. It is suggested you change this variable to be private.',0,NULL,'Style - Class defines a serialVersionUID as non private','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(610,'DTEP_DEPRECATED_TYPESAFE_ENUM_PATTERN','DTEP_DEPRECATED_TYPESAFE_ENUM_PATTERN','fb-contrib','<p>This class appears to implement the old style type safe enum pattern that was used in place of\nreal enums. Since this class is compiled with java 1.5 or better, it would be simpler and more \neasy to understand if it was just switched over to an enum.</p>',0,NULL,'Style - Class appears to implement the old style type safe enum pattern','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(611,'UVA_USE_VAR_ARGS','UVA_USE_VAR_ARGS','fb-contrib','<p>This method defines a parameter list that ends with an array. As this class is compiled with\nJava 1.5 or better, this parameter could be defined as a vararg parameter instead, which can be\nmore convienent for client developers to use. This is not a bug, per se, just an improvement.',0,NULL,'Style - Method defines parameter list with array as last argument, rather than vararg','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(612,'AFBR_ABNORMAL_FINALLY_BLOCK_RETURN','AFBR_ABNORMAL_FINALLY_BLOCK_RETURN','fb-contrib','<p>This method returns or throws exceptions from a finally block. This will\nmask real program logic in the try block, and short-circuit normal method termination.\n</p>',0,NULL,'Correctness - Method has abnormal exit from finally block','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(613,'MDM_THREAD_FAIRNESS','MDM_THREAD_FAIRNESS','fb-contrib','<p>Calling <code>Lock.tryLock()</code> or <code>ReentrantLock.tryLock()</code> without a timeout does not honor the lock\'s fairness setting. If you want to honor the fairness setting for this lock, then use <code>tryLock(0, TimeUnit.SECONDS)</code> which is almost equivalent (it also detects interruption).</p>',0,NULL,'MT Correctness - Method ignores Lock\'s fairness settings by calling tryLock()','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(614,'WOC_WRITE_ONLY_COLLECTION_FIELD','WOC_WRITE_ONLY_COLLECTION_FIELD','fb-contrib','<p>This class creates and initializes a collection as a field but then never access this collection\nto gain information, or fetch items from the collection. It is likely that this collection\nis left over from a past effort, and can be removed.',0,NULL,'Correctness - Class creates and initializes a collection but never reads or gains information from it','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(615,'S508C_APPENDED_STRING','S508C_APPENDED_STRING','fb-contrib','<p>This method creates a component and passes a string that was build up from a number of\nstrings through appending multiple strings together. As foreign languages may order phrases\ndifferently, this will make translations difficult.</p>',0,NULL,'Correctness - Method passes appended string to title/label of component','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(616,'CCNE_COMPARE_CLASS_EQUALS_NAME','CCNE_COMPARE_CLASS_EQUALS_NAME','fb-contrib','<p>In a JVM, Two classes are the same class (and consequently the same type) if\nthey are loaded by the same class loader, and they have the same fully\nqualified name [JVMSpec 1999].\n\nComparing class name ignores the class loader.\n</p>',0,NULL,'Correctness - Method compares class name instead of comparing class','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(617,'SCSS_SUSPICIOUS_CLUSTERED_SESSION_SUPPORT','SCSS_SUSPICIOUS_CLUSTERED_SESSION_SUPPORT','fb-contrib','<p>This method fetches a complex object from an HttpSession object, modifies this object, but does\nnot call setAttribute, to inform the application server that this attribute has been changed. This will\ncause this attribute not to be updated in other servers in a clustered environment, as only changes marked\nby a call to setAttribute are replicated.</p>',0,NULL,'Correctness - Method modifies http session attribute without calling setAttribute','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(618,'CU_CLONE_USABILITY_THROWS','CU_CLONE_USABILITY_THROWS','fb-contrib','<p>This class implements the Cloneable interface but defines its clone method to still return\na CloneNotSupportedException. Since you are implementing clone() it would make sense that the method\nin question will <em>not</em> throw that exception, so annotating your method with it just makes client use\nof your more painful as they have to handle an exception that will never happen. Just remove the\nthrows clause from your method.\n</p>',0,NULL,'Style - Clone method declares it throws CloneNotSupportedException','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(619,'LEST_LOST_EXCEPTION_STACK_TRACE','LEST_LOST_EXCEPTION_STACK_TRACE','fb-contrib','<p>This method catches an exception, and throws a different exception, without incorporating the\noriginal exception. Doing so hides the original source of the exception making debugging and fixing\nthese problems difficult. It is better to use the constructor of this new exception that takes an\noriginal exception so that this detail can be passed along to the user.</p>',0,NULL,'Correctness - Method throws alternative exception from catch block without history','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(620,'AWCBR_ARRAY_WRAPPED_CALL_BY_REFERENCE','AWCBR_ARRAY_WRAPPED_CALL_BY_REFERENCE','fb-contrib','<p>This method uses a one element array to wrap an object that is to be passed to a method as an argument\nto simulate call by pointer ala C++. It is better to define a proper return class type that holds all\nthe relevant information retrieved from the called method.</p>',0,NULL,'Style - Method uses 1 element array to simulate call by reference','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(621,'CU_CLONE_USABILITY_OBJECT_RETURN','CU_CLONE_USABILITY_OBJECT_RETURN','fb-contrib','<p>This class implements the Cloneable interface but defines its clone method to return an\nObject. Since most likely users of this method will need to cast it to the real type, this will\nbe more painful than necessary. Just declare the return value to be the type of this class.\n</p>',0,NULL,'Style - Clone method declares it returns an Object','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(622,'SPP_NO_CHAR_SB_CTOR','SPP_NO_CHAR_SB_CTOR','fb-contrib','<p>This method constructs a StringBuffer or a StringBuilder using the constructor that takes an integer, but\nappears to pass a character instead. It is probable that the author assumed that character would be appended to the\nStringBuffer/Builder, but instead the integer value of the character is used as an initial size for the buffer.\n</p>',0,NULL,'Correctness - Method appears to pass character to StringBuffer or StringBuilder integer constructor','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(623,'SIL_SQL_IN_LOOP','SIL_SQL_IN_LOOP','fb-contrib','<p>This method executes sql queries inside of a loop. This pattern is often inefficient\nas the number of queries may mushroom in fencepost cases. It is probably more performant\nto loop over the input and collect the key data needed for the query for all items, and\nissue one query using an in clause, or similar construct, and then loop over this result\nset, and fetch all the data at once.</p>',0,NULL,'Performance - Method executes sql queries inside of loops','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(624,'MDM_RUNFINALIZATION','MDM_RUNFINALIZATION','fb-contrib','<p>Manually triggering finalization can result in serious performance problems and may be masking resource cleanup bugs.</p>',0,NULL,'Correctness - Method triggers finalization','READY','java','2014-11-26 15:18:32','2014-11-26 15:18:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(625,'UselessParenthesesCheck','UselessParenthesesCheck','squid','<p>\nUseless parentheses can sometimes be misleading and so should be removed.\n</p>\n\n<p>\nThe following code snippet illustrates this rule:\n</p>\n\n<pre>\nreturn 3;             // Compliant\nreturn (x);           // Non-Compliant\nreturn (x + 1);       // Non-Compliant\nint x = (y / 2 + 1);  // Non-Compliant\nint y = (4+X) * y;    // Compliant\n</pre>',2,NULL,'Useless parentheses around expressions should be removed to prevent any misunderstanding','READY','java','2014-11-26 15:18:33','2014-11-26 15:18:33',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1min',NULL,NULL,NULL,0,'HTML'),(626,'S1215','S1215','squid','<p>\nCalling <code>System.gc()</code> or <code>Runtime.getRuntime().gc()</code> is a bad idea for a simple reason:\nthere is no way to know exactly what will be done under the hood by the JVM because the behavior will depend on its vendor, version and options:\n</p>\n\n<ul>\n  <li>Will the whole application be frozen during the call?</li>\n  <li>Is the -XX:DisableExplicitGC option activated?</li>\n  <li>Will the JVM simply ignore the call?</li>\n  <li>...</li>\n</ul>\n\n<p>An application relying on those unpredictable methods is also unpredictable and therefore broken.</p>\n\n<p>The task of running the garbage collector should be left exclusively to the JVM.</p>',3,NULL,'Execution of the Garbage Collector should be triggered only by the JVM','READY','java','2014-11-26 15:18:33','2014-11-26 15:18:33',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,'bug',0,'HTML'),(627,'S1217','S1217','squid','<p>\nThe purpose of the <code>Thread.run()</code> and <code>Runnable.run()</code> methods is to execute code in a separate, dedicated thread.\nCalling those methods directly doesn\'t make sense because it causes their code to be executed in the current thread.\n</p>\n\n<p>To get the expected behavior, call the <code>Thread.start()</code> method instead.</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\nThread myThread = new Thread(runnable);\nmyThread.run(); // Noncompliant\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\nThread myThread = new Thread(runnable);\nmyThread.start(); // Compliant\n</pre>',3,NULL,'Thread.run() and Runnable.run() should not be called directly','READY','java','2014-11-26 15:18:33','2014-11-26 15:18:33',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'multithreading',0,'HTML'),(628,'S138','S138','squid','<p>\nA method that grows too large tends to aggregate too many responsibilities.\nSuch methods inevitably become harder to understand and therefore harder to maintain.\n</p>\n\n<p>\nAbove a specific threshold, it is strongly advised to refactor into smaller methods which focus on well-defined tasks.\nThose smaller methods will not only be easier to understand, but also probably easier to test.\n</p>',2,NULL,'Methods should not have too many lines','READY','java','2014-11-26 15:18:33','2014-11-26 15:18:33',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,'brain-overload',0,'HTML'),(629,'S1294','S1294','squid','<p>Since arrays do not override <code>Object.equals()</code>, calling equals on two arrays is the same as comparing their addresses. This means that <code>array1.equals(array2)</code> is equivalent to <code>array1==array2</code>.</p>\n\n<p>However, some developers might expect Array.equals(Object obj) to do more than a simple memory address comparison, comparing for instance the size and content of the two arrays. To prevent such a misunderstanding, the \'==\' operator or <code>Arrays.equals(array1, array2)</code> must always be used in place of the Array.equals(Object obj) method.</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\nString[] array1 = ...\nString[] array2 = ...\n...\nif(array1.equals(array2)){\n...\n}\n</pre>\n\n<h2>Compliant</h2>\n<pre>\nString[] array1 = ...\nString[] array2 = ...\n...\nif(array1 == array2){\n...\n}\n//or\nif(Arrays.equals(array1, array2)) {\n  ...\n}\n</pre>\n\n<h2>See</h2>\n\n<table class=\"data\">\n  <thead>\n    <tr><th>Tool</th>\n    <th>Reference</th>\n    <th>Description</th></tr>\n  </thead>\n  <tbody>\n  <tr>\n    <td>Findbugs</td>\n    <td>EC_INCOMPATIBLE_ARRAY_COMPARE</td>\n    <td>Correctness - equals(...) used to compare incompatible arrays</td>\n  </tr>\n  <tr>\n    <td>Findbugs</td>\n    <td>EC_BAD_ARRAY_COMPARE</td>\n    <td>Correctness - Invocation of equals() on an array, which is equivalent to ==</td>\n  </tr>\n  </tbody>\n</table>',3,NULL,'The Array.equals(Object obj) method should never be used','READY','java','2014-11-26 15:18:33','2014-11-26 15:18:33',NULL,NULL,NULL,NULL,NULL,32,NULL,'LINEAR',NULL,'5min',NULL,NULL,NULL,NULL,'convention',0,'HTML'),(630,'S1219','S1219','squid','<p>Even if it is legal, mixing case and non-case labels in the body of a <code>switch</code> statement is very confusing, and can even be the result of a typing error.</p>\n\n<h2>Noncompliant Code Example</h2>\n<p>Case 1, the code is syntactically correct but the behaviour is not the expected one</p>\n<pre>\nswitch (day) {\n  case MONDAY:\n  case TUESDAY:\n  WEDNESDAY:   //instead of \"case WEDNESDAY\"\n    doSomething();\n    break;\n  ...\n}\n</pre>\n<p>Case 2, the code is correct and behaves as expected but is hardly readable</p>\n<pre>\nswitch (day) {\n  case MONDAY:\n    break;\n  case TUESDAY:\n    foo:for(int i = 0 ; i < X ; i++) {\n         /* ... */\n        break foo;  //This break statement doesn\'t relate to the nesting case TUESDAY\n         /* ... */\n    }\n    break;\n    /* ... */\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n\n<p>Case 1</p>\n<pre>\nswitch (day) {\n  case MONDAY:\n  case TUESDAY:\n  case WEDNESDAY:\n    doSomething();\n    break;\n  ...\n}\n</pre>\n<p>Case 2</p>\n<pre>\nswitch (day) {\n  case MONDAY:\n    break;\n  case TUESDAY:\n    compute(args); //Put the content of the labelled \"for\" statement in a dedicated method\n    break;\n\n    /* ... */\n}\n</pre>',3,NULL,'\"switch\" statements should not contain non-case labels','READY','java','2014-11-26 15:18:33','2014-11-26 15:18:33',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(631,'S135','S135','squid','<p>Restricting the number of <code>break</code> and <code>continue</code> statements in a loop is done in the interest of good structured programming.</p>\n\n<p>\nOne <code>break</code> and <code>continue</code> statement is acceptable in a loop, since it facilitates optimal coding. If there is more than one, the code should be refactored to increase readability.\n</p>\n\n<p>The following code:</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\nfor (int i = 1; i <= 10; i++) {     // Noncompliant - 2 continue - one might be tempted to add some logic in between\n  if (i % 2 == 0) {\n    continue;\n  }\n\n  if (i % 3 == 0) {\n    continue;\n  }\n\n  System.out.println(\"i = \" + i);\n}\n</pre>',2,NULL,'Loops should not contain more than a single \"break\" or \"continue\" statement','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,'brain-overload',0,'HTML'),(632,'S1150','S1150','squid','<p>From the official Oracle Javadoc:</p>\n\n<blockquote>\nNOTE: The functionality of this Enumeration interface is duplicated by the Iterator interface.\nIn addition, Iterator adds an optional remove operation, and has shorter method names.\nNew implementations should consider using Iterator in preference to Enumeration.\n</blockquote>\n\n<p>The following code:</p>\n\n<pre>\npublic class MyClass implements Enumeration {  // Non-Compliant\n  /* ... */\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\npublic class MyClass implements Iterator {     // Compliant\n  /* ... */\n}\n</pre>',2,NULL,'Enumeration should not be implemented','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(633,'S1151','S1151','squid','<p>Switch cases should remain small to keep the overall switch compact and readable.</p>\n\n<p>The following code snippet illustrates this rule with the default threshold of 5:</p>\n\n<pre>\nswitch (myVariable) {\n  case 0:                     // Compliant - 5 lines till following case\n    System.out.println(\"\");\n    System.out.println(\"\");\n    System.out.println(\"\");\n    break;\n  default:                    // Non-Compliant - 6 lines till switch end\n    System.out.println(\"\");\n    System.out.println(\"\");\n    System.out.println(\"\");\n    System.out.println(\"\");\n    break;\n}\n</pre>',2,NULL,'Switch cases should not have too many lines','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'brain-overload',0,'HTML'),(634,'S1210','S1210','squid','<p>\nAccording to the Java <code>Comparable.compareTo(T o)</code> documentation:\n</p>\n\n<blockquote>\nIt is strongly recommended, but not strictly required that <code>(x.compareTo(y)==0) == (x.equals(y))</code>.\nGenerally speaking, any class that implements the Comparable interface and violates this condition should clearly indicate this fact.\nThe recommended language is \"Note: this class has a natural ordering that is inconsistent with equals.\"\n</blockquote>\n\n<p>\nIf this rule is violated, weird and unpredictable failures can occur.\nFor example, in Java 5 the <code>PriorityQueue.remove()</code> method relied on <code>compareTo()</code>, but since Java 6 it relies on <code>equals()</code>.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\npublic class Foo implements Comparable&lt;Foo&gt; {\n  @Override\n  public int compareTo(Foo foo) { /* ... */ }      // Noncompliant as the equals(Object obj) method is not overridden\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n\n<pre>\npublic class Foo implements Comparable&lt;Foo&gt; {\n  @Override\n  public int compareTo(Foo foo) { /* ... */ }      // Compliant\n\n  @Override\n  public boolean equals(Object obj) { /* ... */ }\n}\n</pre>',3,NULL,'\"equals(Object obj)\" should be overridden along with the \"compareTo(T obj)\" method','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,'bug',0,'HTML'),(635,'S1609','S1609','squid','<p>A Single Abstract Method (SAM) interface is a Java interface containing only one method. The Java API is full of SAM interfaces, such as java.lang.Runnable, java.awt.event.ActionListener, java.util.Comparator and java.util.concurrent.Callable. SAM interfaces have a special place in Java 8 because they can be implemented using Lambda expressions or Method references.</p>\n\n<p>Using <code>@FunctionalInterface</code> forces a compile break when an additional, non-overriding abstract method is added to a SAM, which would break the use of Lambda implementations.</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\n  public interface Changeable&lt;T&gt; {\n    public void change(T o);\n  }\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\n  @FunctionalInterface\n  public interface Changeable&lt;T&gt; {\n    public void change(T o);\n  }\n</pre>',2,NULL,'@FunctionalInterface annotation should be used to flag Single Abstract Method interfaces','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'2min',NULL,NULL,'java8',0,'HTML'),(636,'S1214','S1214','squid','<p>According to Joshua Bloch, author of \"Effective Java\":</p>\n\n<blockquote>\n<p>\nThe constant interface pattern is a poor use of interfaces.\n</p>\n\n<p>\nThat a class uses some constants internally is an implementation detail.\nImplementing a constant interface causes this implementation detail to leak into the class\'s exported API.\nIt is of no consequence to the users of a class that the class implements a constant interface.\nIn fact, it may even confuse them.\nWorse, it represents a commitment:\nif in a future release the class is modified so that it no longer needs to use the constants,\nit still must implement the interface to ensure binary compatibility.\nIf a nonfinal class implements a constant interface,\nall of its subclasses will have their namespaces polluted by the constants in the interface.\n</p>\n</blockquote>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\ninterface Status {                      // Non-Compliant\n   int OPEN = 1;\n   int CLOSED = 2;\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n\n<pre>\npublic enum Status {                    // Compliant\n  OPEN,\n  CLOSED;\n}\n</pre>\n\n<p>or</p>\n\n<pre>\npublic final class Status {             // Compliant\n   public static final int OPEN = 1;\n   public static final int CLOSED = 2;\n}\n</pre>',1,NULL,'Constants should not be defined in interfaces','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,24,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,NULL,0,'HTML'),(637,'NoSonar','NoSonar','squid','<p>Any issue to quality rule can be deactivated with the\n	//NOSONAR marker. This marker is pretty useful to exclude\n	false-positive results but sometimes it can abusively be used to hide\n	real quality flaws.</p>\n<p>This rule allows to track and/or forbid use of this marker</p>',0,NULL,'Avoid use of //NOSONAR marker','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,15,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(638,'S1213','S1213','squid','<p>\nAccording to the Java Code Conventions as defined by Oracle, the parts of a class or interface declaration should appear in the following order in the source files:\n<ul>\n<li>Class and instance variables</li>\n<li>Constructors</li>\n<li>Methods</li>\n</ul>\n</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\npublic class Foo {\n  private int field = 0;\n  isTrue() {...}\n  public Foo() {...}                // Noncompliant, constructor defined after method\n  public static final int OPEN = 4; // Noncompliant, variable defined after method\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\npublic class Foo{  // Compliant\n  public static final int OPEN = 4;\n  private int field = 0;\n  public Foo() {...}\n  public boolean isTrue() {...}\n}\n</pre>',1,NULL,'The members of an interface declaration or class should appear in a pre-defined order','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1min',NULL,NULL,'convention',0,'HTML'),(639,'ObjectFinalizeCheck','ObjectFinalizeCheck','squid','<p>\nAccording to the official Java documentation, <code>Object.finalize()</code> is called by the garbage collector on an object when garbage collection determines that there are no more references to the object.\nCalling this method explicitly breaks this contract and so is misleading.\n</p>\n\n<p>\nThe following code snippet illustrates this rule:\n</p>\n\n<pre>\npublic void dispose() throws Throwable {\n  this.finalize();                       // Non-Compliant\n}\n</pre>',3,NULL,'The Object.finalize() method should never be called','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'pitfall',0,'HTML'),(640,'S1158','S1158','squid','<p>\nCreating temporary primitive wrapper objects only for <code>String</code> conversion is inefficient.\nInstead, the static <code>toString()</code> method of those primitive wrapper classes should be used.\n</p>\n\n<p>For example, the following code:</p>\n\n<pre>\nnew Integer(myInteger).toString();  // Non-Compliant\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\nInteger.toString(myInteger);      // Compliant\n</pre>',2,NULL,'Primitive wrappers should not be instantiated only to perform a to String conversion','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,NULL,0,'HTML'),(641,'S1157','S1157','squid','<p>\nUsing <code>toLowerCase()</code> or <code>toUpperCase()</code> to make case insensitive comparisons is inefficient because it requires the creation of temporary, intermediate <code>String</code> objects.\n</p>\n\n<p>The following code:</p>\n\n<pre>\nboolean result1 = foo.toUpperCase().equals(bar);             // Non-Compliant\nboolean result2 = foo.equals(bar.toUpperCase());             // Non-Compliant\nboolean result3 = foo.toLowerCase().equals(bar.LowerCase()); // Non-Compliant\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\nboolean result = foo.equalsIgnoreCase(bar);                  // Compliant\n</pre>',2,NULL,'Case insensitive string comparisons should be made without intermediate upper or lower casing','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(642,'S1155','S1155','squid','<p>\nUsing <code>Collection.size()</code> to test for emptiness works, but using <code>Collection.isEmpty()</code> makes the code more readable.\n</p>\n\n<p>The following code:</p>\n\n<pre>\nif (myCollection.size() == 0) {  // Non-Compliant\n  /* ... */\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\nif (myCollection.isEmpty()) {    // Compliant\n  /* ... */\n}\n</pre>',2,NULL,'Collection.isEmpty() should be used to test for emptiness','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'2min',NULL,NULL,NULL,0,'HTML'),(643,'S1611','S1611','squid','<p>There are two possible syntaxes for a lambda having only one input parameter with an inferred type: with and without parentheses around that single parameter. The simpler syntax, without parentheses, is more compact and readable than the one with parentheses, and is therefore preferred.</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\n(x) -> x * 2\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\nx -> x * 2\n</pre>',1,NULL,'Parentheses should be removed from a single lambda input parameter when its type is inferred','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'2min',NULL,NULL,'java8',0,'HTML'),(644,'S1153','S1153','squid','<p>\nAppending <code>String.valueOf()</code> to a <code>String</code> decreases the code readability.\nThe argument passed to <code>String.valueOf()</code> should be directly appended instead.\n</p>\n\n<p>The following code:</p>\n\n<pre>\npublic void display(int i){\n  System.out.println(\"Output is \" + String.valueOf(i));    // Non-Compliant\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\npublic void display(int i){\n  System.out.println(\"Output is \" + i);                    // Compliant\n}\n</pre>',1,NULL,'String.valueOf() should not be appended to a String','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,NULL,0,'HTML'),(645,'S1612','S1612','squid','<p>Method/constructor references are more compact and readable than using lambdas, and are therefore preferred.</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\n  List<Integer> list = new ArrayList<Integer>();\n  list.add(0);\n  list.add(1);\n  list.add(2);\n\n    list.forEach(n -> { System.out.println(n); });\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\n  List<Integer> list = new ArrayList<Integer>();\n  list.add(0);\n  list.add(1);\n  list.add(2);\n\n  list.forEach(System.out::println);\n</pre>',1,NULL,'Replace lambdas with method references when possible','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'2min',NULL,NULL,'java8',0,'HTML'),(646,'S1610','S1610','squid','<p>With Java 8\'s \"default method\" feature, any abstract class without direct or inherited field should be converted into an interface.</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\npublic abstract class Car {\n  public abstract void start(Environment c);\n\n  public void stop(Environment c) {\n    c.freeze(this);\n  }\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\npublic interface Car {\n  public void start(Environment c);\n\n  public default void stop(Environment c) {\n    c.freeze(this);\n  }\n}\n</pre>',2,NULL,'Abstract classes without fields should be converted to interfaces','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,24,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'java8',0,'HTML'),(647,'UndocumentedApi','UndocumentedApi','squid','<p>\nTry to imagine using the standard Java API (Collections, JDBC, IO, ...) without Javadoc.\nIt would be a nightmare, because Javadoc is the only way to understand of the contract of the API.\nDocumenting API with Javadoc increases the productivity of the developers consuming it.\n</p>\n\n<p>The following Javadoc elements are required:</p>\n<ul>\n  <li>Parameters, using <code>@param parameterName</code>.</li>\n  <li>Method return values, using <code>@return</code>.</li>\n  <li>Generic types, using <code>@param &lt;T&gt;</code>.</li>\n</ul>\n\n<p>The following public methods and constructors are not taken into account by this rule:</p>\n<ul>\n  <li>Getters and setters.</li>\n  <li>Methods with @Override annotation.</li>\n  <li>Empty constructors.</li>\n  <li>Static constants.</li>\n</ul>\n\n<p>The following code snippet illustrates this rule:</p>\n\n<pre>\n/**\n  * This is a Javadoc comment\n  */\npublic class MyClass&lt;T&gt; implements Runnable {    // Non-Compliant - missing \'@param &lt;T&gt;\'\n\n  public static final DEFAULT_STATUS = 0;        // Compliant - static constant\n  private int status;                            // Compliant - not public\n\n  /**\n    * This is a Javadoc comment\n    */\n  public String message;                         // Compliant - well documented\n\n  public MyClass() {                             // Non-Compliant - missing documentation\n    this.status = DEFAULT_STATUS;\n  }\n\n  public void setStatus(int status) {            // Compliant - setter\n    this.status = status;\n  }\n\n  @Override\n  public void run() {                            // Compliant - has @Override annotation\n  }\n\n  protected void doSomething() {                 // Compliant - not public\n  }\n\n  /**\n    * @param value ...\n    */\n  public void doSomething(int value) {           // Compliant\n  }\n\n  /**\n    */\n  public int doSomething(int value) {            // Non-Compliant - missing \'@param value\' and \'@return\'\n    return value;\n  }\n}\n</pre>',2,NULL,'Public types, methods and fields (API) should be documented with Javadoc','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,'convention',0,'HTML'),(648,'TrailingCommentCheck','TrailingCommentCheck','squid','<p>\nThis rule verifies that single-line comments are not located at the end of a line of code.\nThe main idea behind this rule is that in order to be really readable, trailing comments would have to be property written and formatted (correct alignment, no interference with the visual structure of the code, not too long to be visible) but most often, automatic code formatters would not handle this correctly: the code would end up less readable.\nComments are far better placed on the previous empty line\nof code, where they will always be visible and properly formatted.\n</p>\n\n<p>\nHowever, this rule allows to write trailing \"metadata comments\" - for which the pattern is configurable, as those metadata comments are usually very short and heavily used in some cases.\n</p>\n\n<pre>\n// The following line is non-compliant\nint a1 = b + c; // This is a trailing comment that can be very very long\n\n// This very long comment is better placed before the line of code\nint a2 = b + c;\n\n// The following line is compliant with the default configuration of the rule\nString a3 = \"id\"; // $NON-NLS-1$\n</pre>',1,NULL,'Comments should not be located at the end of lines of code','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1min',NULL,NULL,'convention',0,'HTML'),(649,'MaximumInheritanceDepth','MaximumInheritanceDepth','squid','<p>Inheritance is certainly one of the most valuable concept of\n	object-oriented programming. It\'s a way to compartmentalize and reuse\n	code by creating collections of attributes and behaviors called classes\n	which can be based on previously created classes. But abusing of this\n	concept by creating a deep inheritance tree can lead to very complex\n	and unmaintainable source code.</p>\n<p>Most of the time a too deep inheritance tree is due to bad object\n	oriented design which has led to systematically use \'inheritance\' when\n	\'composition\' would suit better.</p>',2,NULL,'Avoid too deep inheritance tree','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(650,'EmptyFile','EmptyFile','squid','<p>Detect empty files, which do not have any lines of code.</p>\n<p>Example:</p>\n<pre>\n//package org.foo;\n//\n//public class Bar {}\n</pre>',2,NULL,'Empty file','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(651,'S128','S128','squid','<p>\nWhen the execution is not explicitly terminated at the end of a switch case, it continues to execute the statements of the following case. While this is sometimes intentional, it often is a mistake which leads to unexpected behavior.\n</p>\n\n<h2>\nNoncompliant Code Example\n</h2>\n\n<pre>\nswitch (myVariable) {\n  case 1:                              \n    foo();\n    break;\n  case 2:  // Both \'doSomething()\' and \'doSomethingElse()\' will be executed. Is it on purpose ?\n    doSomething();\n  default:                               \n    doSomethingElse();\n    break;\n}\n</pre>\n\n<h2>\nCompliant Solution\n</h2>\n\n<pre>\nswitch (myVariable) {\n  case 1:                              \n    foo();\n    break;\n  case 2: \n    doSomething();\n    break;\n  default:                               \n    doSomethingElse();\n    break;\n}\n</pre>\n\n<h2>\nExceptions\n</h2>\n\n<pre>\nswitch (myVariable) {\n  case 0:                                // Empty case used to specify the same behavior for a group of cases.\n  case 1:                               \n    doSomething();\n    break;\n  case 2:                                // Use of return statement\n    return;\n  case 3:                                // Use of throw statement\n    throw new IllegalStateException();\n  default:                               // For the last case, use of break statement is optional \n    doSomethingElse();\n}\n</pre>',3,NULL,'Switch cases should end with an unconditional break statement','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'pitfall',0,'HTML'),(652,'UnusedPrivateMethod','UnusedPrivateMethod','squid','<p>Private methods that are never executed are dead code. Dead code\n  means unnecessary, inoperative code that should be removed. This helps\n  in maintenance by decreasing the maintained code size, making it easier\n  to understand the program and preventing bugs from being introduced.</p>\n<p>In the following two cases, private methods are not considered as\n  dead code by SonarQube :</p>\n<ul>\n  <li>Private empty constructors that are intentionally used to\n    prevent any direct instantiation of a class.</li>\n  <li>Private methods : readObject(...), writeObject(...),\n    writeReplace(...), readResolve(...) which can contractually be used\n    when implementing the Serializable interface.</li>\n</ul>',2,NULL,'Unused private method','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'unused',0,'HTML'),(653,'S1226','S1226','squid','<p>\nWhile it is technically correct to assign to parameters from within method bodies, it is better to use temporary variables to store intermediate results.\nThis rule will typically detect cases where a constructor parameter is assigned to itself instead of a field of the same name, i.e. when <code>this</code> was forgotten.\nAllowing parameters to be assigned to also reduces the code readability as developers will not be able to know whether the original parameter or some temporary variable is being accessed without going through the whole method.\nMoreover, some developers might also expect assignments of method parameters to be visible from callers, which is not the case and can confuse them.\nAll parameters should be treated as <code>final</code>.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\nclass MyClass {\n  public String name;\n\n  public MyClass(String name) {\n    name = name;                    // Noncompliant - useless identity assignment\n  }\n\n  public int add(int a, int b) {\n    a = a + b;                      // Noncompliant\n\n    /* additional logic */\n\n    return a;                       // Seems like the parameter is returned as is, what is the point?\n  }\n\n  public static void main(String[] args) {\n    MyClass foo = new MyClass();\n    int a = 40;\n    int b = 2;\n    foo.add(a, b);                  // Variable \"a\" will still hold 40 after this call\n  }\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\nclass MyClass {\n  public String name;\n\n  public MyClass(String name) {\n    this.name = name;               // Compliant\n  }\n\n  public int add(int a, int b) {\n    return a + b;                   // Compliant\n  }\n\n  public static void main(String[] args) {\n    MyClass foo = new MyClass();\n    int a = 40;\n    int b = 2;\n    foo.add(a, b);\n  }\n}\n</pre>',2,NULL,'Method parameters, caught exceptions and foreach variables should not be reassigned','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'pitfall',0,'HTML'),(654,'CallToDeprecatedMethod','CallToDeprecatedMethod','squid','<p>Once deprecated, a method should no longer be used as it means\n	that the method might be removed sooner or later.</p>',1,NULL,'Avoid use of deprecated method','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,9,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(655,'AssignmentInSubExpressionCheck','AssignmentInSubExpressionCheck','squid','<p>\nAssignments within sub-expressions are hard to spot and therefore make the code less readable.\nIt is also a common mistake to write <code>=</code> when <code>==</code> was meant.\nIdeally, expressions should not have side-effects.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\nSystem.out.println(i = 42);\n</pre>\n\n<h2>Compliant Solution</h2>\n\n<pre>\nSystem.out.println(i == 42);\n</pre>\n\n<p>or:</p>\n\n<pre>\ni = 42;\nSystem.out.println(i);\n</pre>\n\n<h2>Exceptions</h2>\n<p>Assignments enclosed in relational expressions are allowed.</p>\n\n<pre>\nBufferedReader br = new BufferedReader(/* ... */);\nString line;\nwhile ((line = br.readLine()) != null) {\n  /* ... */\n}\n</pre>',2,NULL,'Assignments should not be made from within sub-expressions','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(656,'S1221','S1221','squid','<p>Naming a method <code>hashcode()</code> is either:</p>\n\n<ul>\n  <li>A bug. Overriding <code>Object.hashCode()</code> was meant and the application does not behave as expected.</li>\n  <li>Done on purpose. The name however will confuse every other developer, who will think it is a bug.</li>\n</ul>\n\n<p>In both cases, the method should be renamed.</p>\n\n<p>The following code:</p>\n\n<pre>\npublic int hashcode() { /* ... */ }    // Non-Compliant\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\n@Override\npublic int hashCode() { /* ... */ }    // Compliant\n</pre>',3,NULL,'Methods should not be named \"hashcode\"','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'pitfall',0,'HTML'),(657,'S1160','S1160','squid','<p>\nUsing checked exceptions forces method callers to deal with errors, either by propagating them or by handling them.\nThis makes those exceptions fully part of the API of the method.\n</p>\n\n<p>\nTo keep the complexity for callers reasonable, methods should not throw more than one kind of checked exception.\n</p>\n\n<p>The following code:</p>\n\n<pre>\npublic void delete() throws IOException, SQLException {      // Non-Compliant\n  /* ... */\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\npublic void delete() throws SomeApplicationLevelException {  // Compliant\n  /* ... */\n}\n</pre>\n\nOverriding methods are not checked by this rule and are allowed to throw several checked exceptions.',2,NULL,'Public methods should throw at most one checked exception','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,39,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'error-handling',0,'HTML'),(658,'S1220','S1220','squid','<p>According to the Java Language Specification:</p>\n\n<blockquote>\nUnnamed packages are provided by the Java platform principally for convenience when developing small or temporary applications or when just beginning development.\n</blockquote>\n\n<p>To enforce this best practice, classes located in default package can no longer be access from named ones since Java 1.4.</p>\n\n<p>The following piece of code:</p>\n\n<pre>\npublic class MyClass { /* ... */ }\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\npackage org.example;\n\npublic class MyClass{ /* ... */ }\n</pre>',2,NULL,'The default unnamed package should not be used','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,24,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(659,'S1694','S1694','squid','<p>The purpose of an abstract class is to provide some heritable behaviors while also defining methods which must be implemented by sub-classes.</p>\n\n<p>A class with no abstract methods that was made abstract purely to prevent instantiation should be converted to a concrete class (i.e. remove the <code>abstract</code> keyword) with a private constructor.</p>\n\n<p>A class with only abstract methods and no inheritable behavior should be converted to an interface.</p>\n\n<h2>Noncompliant Code Sample</h2>\n<pre>\npublic abstract class Animal {\n  abstract void move();\n  abstract void feed();\n}\n\npublic abstract class Color {\n  private int red = 0;\n  private int green = 0;\n  private int blue = 0;\n\n  public int getRed(){\n    return red;\n  }\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\npublic interface Animal {\n  void move();\n  void feed();\n}\n\npublic class Color {\n  private int red = 0;\n  private int green = 0;\n  private int blue = 0;\n\n  private Color (){\n  }\n\n  public int getRed() {\n    return red;\n  }\n}\n\npublic abstract class Lamp {\n\n  private boolean switchLamp=false;\n  public abstract void glow();\n\n  public void flipSwitch() {\n    switchLamp = !switchLamp;\n    if (switchLamp) {\n       glow();\n    }\n  }\n}\n</pre>',2,NULL,'An abstract class should have both abstract and concrete methods','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'convention',0,'HTML'),(660,'S1695','S1695','squid','A <code>NullPointerException</code> should indicate that a <code>null</code> value was unexpectedly encountered. Good programming practice dictates that code is structured to avoid NPE\'s. \n\nExplicitly throwing <code>NullPointerException</code> forces a method\'s callers to explicitly catch it, rather than coding to avoid it. Further, it makes it difficult to distinguish between the unexpectedly-encountered <code>null</code> value and the condition which causes the method to purposely throw an NPE.\n\nIf an NPE is being thrown to indicate that a parameter to the method should not have been null, use the <code>@NotNull</code> annotation instead.\n\n<h2>Noncompliant Code Sample</h2>\n<pre>\npublic void doSomething (String aString) throws NullPointerException \n{}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\npublic void doSomething (@NotNull String aString)\n{}\n</pre>',2,NULL,'\"NullPointerException\" should not be explicitly thrown','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'pitfall',0,'HTML'),(661,'S00101','S00101','squid','<p>\nSharing some naming conventions is a key point to make it possible for a team to efficiently collaborate. This rule allows to check that all class names match a provided regular expression.\n</p>\n\n<p>\nThe following code snippet illustrates this rule when the regular expression value is \"^[A-Z][a-zA-Z0-9]*$\":\n</p>\n<pre>\npublic class MyFirstClass { ... } // Compliant\n\npublic class mySecondClass { ... }    // Non-Compliant\n</pre>',2,NULL,'Class names should comply with a naming convention','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'convention',0,'HTML'),(662,'S1696','S1696','squid','<p><code>NullPointerException</code> should be avoided, not caught. Any situation in which <code>NullPointerException</code> is explicitly caught can easily be converted to a <code>null</code> test, and any behavior being carried out in the catch block can easily be moved to the \"is null\" branch of the conditional.</p>\n\n<h2>Noncompliant Code Sample</h2>\n<pre>\npublic int lengthPlus(String str) {\n  int len = 2;\n  try {\n    len += str.length();\n  }\n  catch (NullPointerException e) {\n    log.info(\"argument was null\");\n  }\n  return len;\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\npublic int lengthPlus(String str) {\n  int len = 2;\n\n  if (str != null) {\n    len += str.length();\n  }\n  else {\n    log.info(\"argument was null\");\n  }\n  return len;\n}\n</pre>',2,NULL,'\"NullPointerException\" should not be caught','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'error-handling',0,'HTML'),(663,'S00100','S00100','squid','<p>\nSharing some naming conventions is a key point to make it possible for a team to efficiently collaborate. This rule allows to check that all function/method names match a provided regular expression.\n</p>\n\n<h2>\nNoncompliant Code Example\n</h2>\n<p>\nWith default provided regular expression: \"^[a-z][a-zA-Z0-9]*$\":\n</p>\n<pre>\npublic void Do_Something() {...}\n</pre>\n\n<h2>\nCompliant Solution\n</h2>\n<pre>\npublic void doSomething(int value) {}\n}\n</pre>\n\n<h2>\nExceptions\n</h2>\n<p>\nOverriding methods are excluded.\n</p>\n<pre>\n@Override\npublic void Do_Something() {...}\n</pre>',2,NULL,'Method names should comply with a naming convention','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'convention',0,'HTML'),(664,'S1697','S1697','squid','<p>When either the equality operator in a null test or the logical operator that follows it is reversed, the code has the appearance of safely null-testing the object before dereferencing it. Unfortunately the effect is just the opposite - the object is null-tested and then dereferenced _only_ if it is null, leading to a guaranteed null pointer dereference.</p>\n\n<h2>Noncompliant Code Sample</h2>\n<pre>\nif (str == null && str.length() == 0) {\n  System.out.println(\"String is empty\");\n}\n\nif (str != null || str.length() > 0) {\n System.out.println(\"String is not empty\");\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\nif (str == null || str.length() == 0) {\n  System.out.println(\"String is empty\");\n}\n\nif (str != null && str.length() > 0) {\n  System.out.println(\"String is not empty\");\n}\n</pre>',4,NULL,'Short-circuit logic should be used to prevent null pointer dereferences in conditionals','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,31,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'2min',NULL,NULL,'bug',0,'HTML'),(665,'S1223','S1223','squid','Having a class and some of its methods sharing the same name is misleading, and leaves others to wonder whether it was done that way on purpose, or was the methods supposed to be a constructor.\n\n<h2>Noncompliant Code Example</h2>\n<pre>\nclass Foo {\n  public Foo() {...}\n  public int Foo(String label) {...} // Noncompliant\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\nclass Foo {\n  public Foo() {...}\n  public int foo(String label) {...} // Compliant\n}\n</pre>',2,NULL,'Non-constructor methods should not have the same name as the enclosing class','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'pitfall',0,'HTML'),(666,'S1698','S1698','squid','<p>Using the equality (<code>==</code>) and inequality (<code>!=</code>) operators to compare two objects does not check to see if they have the same values. Rather it checks to see if both object references point to exactly the same object in memory. The vast majority of the time, this is not what you want to do. Use the .equals() method to compare the values of two objects or to compare a string object to a string literal.</p>\n\n<h2>Noncompliant Code Sample</h2>\n<pre>\nString str1 = \"blue\";\nString str2 = \"blue\";\nString str3 = str1;\n\nif (str1 == str2)\n{\n  System.out.println(\"they\'re both \'blue\'\"); // this doesn\'t print because the objects are different\n}\n\nif (str1 == \"blue\")\n{\n  System.out.println(\"they\'re both \'blue\'\"); // this doesn\'t print because the objects are different\n}\n\nif (str1 == str3)\n{\n  System.out.println(\"they\'re the same object\"); // this prints\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\nString str1 = \"blue\";\nString str2 = \"blue\";\nString str3 = str1;\n\nif (str1.equals(str2))\n{\n  System.out.println(\"they\'re both \'blue\'\"); // this prints\n}\n\nif (str1.equals(\"blue\"))\n{\n  System.out.println(\"they\'re both \'blue\'\"); // this prints\n}\n\nif (str1 == str3)\n{\n  System.out.println(\"they\'re the same object\"); // this still prints, but it\'s probably not what you meant to do\n}\n</pre>',2,NULL,'Objects should be compared with \"equals()\"','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'2min',NULL,NULL,'error-handling',0,'HTML'),(667,'StringEqualityComparisonCheck','StringEqualityComparisonCheck','squid','<p>\nString literals, just like any other <code>Object</code>, should be compared using the <code>equals()</code> method.\nUsing <code>==</code> and <code>!=</code> does not work in general.\n</p>\n\n<p>The following code:</p>\n\n<pre>\nif (variable == \"foo\") { /* ... */ }         // Non-Compliant\nif (variable != \"foo\") { /* ... */ }         // Non-Compliant\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\nif (\"foo\".equals(variable)) { /* ... */ }    // Compliant\nif (!\"foo\".equals(variable)) { /* ... */ }   // Compliant\n</pre>\n\n<p>\n  This rule is deprecated, use {rule:squid:S1698} instead.\n</p>',3,NULL,'Strings should be compared using equals()','DEPRECATED','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'bug',0,'HTML'),(668,'S1168','S1168','squid','<p>\nReturning <code>null</code> instead of an actual array or collection forces callers of the method to explicitly test for nullity, making them more complex and less readable.\nMoreover, in many cases, <code>null</code> is used as a synonym for empty.\n</p>\n\n<p>The following code:</p>\n\n<pre>\npublic static Result[] getResults() {\n  return null;                             // Non-Compliant\n}\n\npublic static void main(String[] args) {\n  Result[] results = getResults();\n\n  if (results != null) {                   // Nullity test required to prevent NPE\n    for (Result result: results) {\n      /* ... */\n    }\n  }\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\npublic static Result[] getResults() {\n  return new Result[0];                    // Compliant\n}\n\npublic static void main(String[] args) {\n  for (Result result: getResults()) {\n    /* ... */\n  }\n}\n</pre>\n\n<p>This rule also applies to collections:</p>\n\n<pre>\npublic static List&lt;Result&gt; getResults() {\n  return null;                             // Non-Compliant\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\npublic static List&lt;Result&gt; getResults() {\n  return Collections.emptyList();           // Compliant\n}\n</pre>',2,NULL,'Empty arrays and collections should be returned instead of null','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(669,'HiddenFieldCheck','HiddenFieldCheck','squid','<p>\nShadowing fields with a local variable is a bad practice reducing code readability: It makes it confusing to know whether the field or the variable is and should be accessed.\n</p>\n\n<p>\nThe following code illustrates this rule:\n</p>\n\n<pre>\nclass Foo {\n  public int myField;\n\n  public Foo(int myField) {                   // Compliant - method parameters are not checked\n    this.myField = myField;\n  }\n\n  @Override\n  public String toString() {\n    int myField = 0;                          // Non-Compliant - should be renamed\n    return \"Foo{MyField: \" + myField + \"}\";\n  }\n}\n</pre>',2,NULL,'Local variables should not shadow class fields','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,'pitfall',0,'HTML'),(670,'S1163','S1163','squid','<p>\nThrowing an exception from within a finally block will mask any exception which was previously thrown in the <code>try</code> or <code>catch</code> block.\nThe masked\'s exception message and stack trace will be lost.\n</p>\n\n<p>The following code:</p>\n\n<pre>\ntry {\n  /* some work which end up throwing an exception */\n  throw new IllegalArgumentException();\n} finally {\n  /* clean up */\n  throw new RuntimeException();                          // Non-Compliant - will mask the IllegalArgumentException\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\ntry {\n  /* some work which end up throwing an exception */\n  throw new IllegalArgumentException();\n} finally {\n  /* clean up */                                         // Compliant\n}\n</pre>',2,NULL,'Exceptions should not be thrown in finally blocks','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,30,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,NULL,0,'HTML'),(671,'S1166','S1166','squid','<p>\nWhen handling a caught exception, two mandatory informations should be logged:\n</p>\n\n<ul>\n  <li>Some context to ease the reproduction of the issue.</li>\n  <li>The original\'s exception, for its message and stack trace.</lu>\n</ul>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\n // Noncompliant - exception is lost\ntry { /* ... */ } catch (Exception e) { LOGGER.info(\"context\"); }\n\n// Noncompliant - context is required\ntry { /* ... */ } catch (Exception e) { LOGGER.info(e); }\n\n// Noncompliant - exception is lost (only message is preserved)\ntry { /* ... */ } catch (Exception e) { LOGGER.info(e.getMessage()); }\n\n// Noncompliant - exception is lost\ntry { /* ... */ } catch (Exception e) { throw new RuntimeException(\"context\"); }\n</pre>\n\n<h2>Compliant Solution</h2>\n\n<pre>\ntry { /* ... */ } catch (Exception e) { LOGGER.info(\"context\", e); }\n\ntry { /* ... */ } catch (Exception e) { throw new RuntimeException(\"context\", e); }\n</pre>\n\n<h2>Exceptions</h2>\n\n<p>It is allowed to let the exception propagate.</p>\n\n<pre>\ntry {\n  /* ... */\n} catch (RuntimeException e) {\n  doSomething();\n  throw e;\n} catch (Exception e) {\n  // Conversion into unchecked exception is also allowed\n  throw new RuntimeException(e);\n}\n</pre>\n\n<p>\n<code>InterruptedException</code>, <code>NumberFormatException</code>, <code>ParseException</code> and <code>MalformedURLException</code> exceptions are arguably used to indicate nonexceptional outcomes.\nAs they are part of Java, developers have no choice but to deal with them. This rule does not verify that those particular exceptions are correctly handled.\n</p>\n\n<pre>\nint myInteger;\ntry {\n  myInteger = Integer.parseInt(myString);\n} catch (NumberFormatException e) {\n  // It is perfectly acceptable to not handle \"e\" here\n  myInteger = 0;\n}\n</pre>',2,NULL,'Exception handlers should preserve the original exception','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,30,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'error-handling',0,'HTML'),(672,'S1165','S1165','squid','<p>\nExceptions are meant to represent the application\'s state at which an error occurred.\n</p>\n\n<p>Making all fields final ensures that this state:</p>\n\n<ul>\n  <li>Will be fully defined at the same time the exception is instantiated.</li>\n  <li>Won\'t be updated or corrupted by some bogus error handler.</li>\n</ul>\n\n<p>This will enable developers to quickly understand what went wrong.</p>\n\n<p>The following code:</p>\n\n<pre>\npublic class MyException extends Exception {\n\n  private int status;                               // Non-Compliant\n\n  public MyException(String message) {\n    super(message);\n  }\n\n  public int getStatus() {\n    return status;\n  }\n\n  public void setStatus(int status) {\n    this.status = status;\n  }\n\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\npublic class MyException extends Exception {\n\n  private final int status;                         // Compliant\n\n  public MyException(String message, int status) {\n    super(message);\n    this.status = status;\n  }\n\n  public int getStatus() {\n    return status;\n  }\n\n}\n</pre>',2,NULL,'Exception classes should be immutable','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,30,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,'error-handling',0,'HTML'),(673,'ArchitecturalConstraint','ArchitecturalConstraint','squid','<p>A source code comply to an architectural model when it fully\n	adheres to a set of architectural constraints. A constraint allows to\n	deny references between classes by pattern.</p>\n<p>You can for instance use this rule to :</p>\n<ul>\n	<li>forbid access to **.web.** from **.dao.** classes</li>\n	<li>forbid access to java.util.Vector, java.util.Hashtable and\n		java.util.Enumeration from any classes</li>\n	<li>forbid access to java.sql.** from **.ui.** and **.web.**\n		classes</li>\n</ul>',2,NULL,'Architectural constraint','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'HTML'),(674,'S134','S134','squid','<p>\nNested <code>if</code>, <code>for</code>, <code>while</code> and <code>try</code> statements is a key ingredient for making what\'s known as \"Spaghetti code\".\nSuch code is hard to read, refactor and therefore maintain.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<p>The following code snippet illustrates this rule with the default threshold of 3.</p>\n\n<pre>\npublic void process() {\n  if (condition1) {                  // Compliant - depth = 1\n    /* ... */\n    if (condition2) {                // Compliant - depth = 2\n      /* ... */\n      for(int i = 0; i < 10; i++) {  // Compliant - depth = 3, not exceeding the limit\n        /* ... */\n        if (condition4) {            // Non-Compliant - depth = 4\n          if (condition5) {          // Depth = 5, exceeding the limit, but issues are only reported on depth = 4\n            /* ... */\n          }\n          return;\n        }\n      }\n    }\n  }\n}\n</pre>',1,NULL,'Control flow statements \"if\", \"for\", \"while\", \"switch\" and \"try\" should not be nested too deeply','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,26,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'brain-overload',0,'HTML'),(675,'S1172','S1172','squid','<p>Unused parameters are misleading. Whatever the value passed to such parameters is, the behavior will be the same.</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\nvoid doSomething(int a, int b) {     // \"b\" is unused\n  compute(a);\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n\n<pre>\nvoid doSomething(int a) { \n  compute(a);\n}\n</pre>\n\n<h2>Exceptions</h2>\n\n<h3>For Java</h3>\nMethods overriding or implementing another one should be excluded\n\n<pre>\n@override\nvoid doSomething(int a, int b) {     // no issue reported on b\n  compute(a);\n}\n</pre>',2,NULL,'Unused method parameters should be removed','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'unused',0,'HTML'),(676,'S1170','S1170','squid','<p>\nMaking a constant just <code>final</code> as opposed to <code>static final</code> leads to duplicating its value for every instance of the class,\nuselessly increasing the amount of memory required to execute the application.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\npublic class Myclass {\n  public final int THRESHOLD = 3;           // Non-Compliant\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n\n<pre>\npublic class Myclass {\n  public static final int THRESHOLD = 3;    // Compliant\n}\n</pre>\n<h2>Exceptions</h2>\n<p>No issues are reported on final fields of inner classes whose type is not a primitive or a String. Indeed according to the Java specification:</p>\n<blockquote>An inner class is a nested class that is not explicitly or implicitly declared static. Inner classes may not declare static initializers (&sect; 8.7) or member interfaces. Inner classes may not declare static members, unless they are compile-time constant fields (&sect; 15.28).</blockquote>',2,NULL,'Constants should be declared \"final static\" rather than merely \"final\"','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,20,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(677,'S1171','S1171','squid','<p>\nNon-static initializers are rarely used, and can be confusing for most developers.\nWhen possible, they should be refactored into standard constructors or field initializers.\n</p>\n\n<p>The following code:</p>\n\n<pre>\nclass MyClass {\n  private static final Map<String, String> MY_MAP = new HashMap<String, String>() {\n\n    // Non-Compliant - HashMap should be extended only to add behavior, not for initialization\n    {\n      put(\"a\", \"b\");\n    }\n\n  };\n}\n</pre>\n\n<p>could be refactored using Guava into:</p>\n\n<pre>\nclass MyClass {\n  // Compliant\n  private static final Map<String, String> MY_MAP = ImmutableMap.of(\"a\", \"b\");\n}\n</pre>',2,NULL,'Non-static class initializers should not be used','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,NULL,0,'HTML'),(678,'S1175','S1175','squid','<p><code>Object.finalize()</code> is called by the Garbage Collector sometime after the object became unreferenced.</p>\n\n<p>Overloading this method is misleading:</p>\n<ul>\n  <li>The overloaded method will not be called by the Garbage Collector.</li>\n  <li>Users are not expected to call <code>Object.finalize()</code> and will get confused.</li>\n</ul>\n\n<p>Another name should be picked for the method.</p>\n\n<p>The following code:</p>\n\n<pre>\npublic void finalize(int someParameter) {        // Non-Compliant\n  /* ... */\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\npublic void someBetterName(int someParameter) {  // Compliant\n  /* ... */\n}\n</pre>',2,NULL,'Object.finalize() should not be overloaded (by adding method parameters)','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'pitfall',0,'HTML'),(679,'S1174','S1174','squid','<p>\nThe contract of the <code>Object.finalize()</code> method is clear: only the Garbage Collector is supposed to call this method.\nMaking this method public is misleading, because it implies that any caller can use it.\n</p>\n\n<p>The following code snippet illustrates this rule:</p>\n\n<pre>\npublic class MyClass {\n\n  @Override\n  public void finalize() {    // Non-Compliant\n    /* ... */\n  }\n}\n</pre>',2,NULL,'Object.finalize() should remain protected (versus public) when overriding','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(680,'RedundantThrowsDeclarationCheck','RedundantThrowsDeclarationCheck','squid','<p>\nAn exception in a <code>throws</code> declaration in Java is redundant if:\n</p>\n\n<ul>\n  <li>It is listed multiple times</li>\n  <li>It is a subclass of another listed exception</li>\n  <li>It is a <code>RuntimeException</code>, or one of its descendants</li>\n</ul>\n\n<p>\nThe following code:\n</p>\n\n<pre>\nvoid foo() throws MyException, MyException {}  // Non-Compliant - should be listed once\nvoid bar() throws Throwable, Exception {}      // Non-Compliant - Exception is a subclass of Throwable\nvoid baz() throws RuntimeException {}          // Non-Compliant - RuntimeException can always be thrown\n</pre>\n\n<p>\nshould be refactored into:\n</p>\n\n<pre>\nvoid foo() throws MyException {}               // Compliant\nvoid bar() throws Throwable {}                 // Compliant\nvoid baz() {}                                  // Compliant\n</pre>',2,NULL,'Throws declarations should not be redundant','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,'error-handling',0,'HTML'),(681,'CallToFileDeleteOnExitMethod','CallToFileDeleteOnExitMethod','squid','<p>Usage of method File#deleteOnExit() is not recommended for following reasons:</p>\n<ul>\n  <li>The deletion occurs only in case of normal JVM shutdown but not when the JVM is killed or crashes</li>\n  <li>For each file handler, the memory associated to this handler is released only at the end of the process</li>\n</ul>',2,NULL,'Do not use File#deleteOnExit()','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,20,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(682,'LabelsShouldNotBeUsedCheck','LabelsShouldNotBeUsedCheck','squid','<p>\nLabels are not commonly used in Java, and many developers do not understand how they work.\nMoreover, their usage make the control flow harder to follow, which reduces the code\'s readability.\n</p>\n\n<p>\nThe following code:\n</p>\n\n<pre>\nint matrix[][] = {\n  {1, 2, 3},\n  {4, 5, 6},\n  {7, 8, 9}\n};\n\nouter: for (int row = 0; row < matrix.length; row++) {   // Non-Compliant\n  for (int col = 0; col < matrix[row].length; col++) {\n    if (col == row) {\n      continue outer;\n    }\n    System.out.println(matrix[row][col]);                // Prints the elements under the diagonal, i.e. 4, 7 and 8\n  }\n}\n</pre>\n\n<p>\nshould be refactored into:\n</p>\n\n<pre>\nfor (int row = 1; row < matrix.length; row++) {          // Compliant\n  for (int col = 0; col < row; col++) {\n    System.out.println(matrix[row][col]);                // Also prints 4, 7 and 8\n  }\n}\n</pre>',2,NULL,'Labels should not be used','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(683,'ForLoopCounterChangedCheck','ForLoopCounterChangedCheck','squid','<p>\nLoop counters should not be modified in the body of the loop.\nHowever other loop control variables representing logical values may be modified in the loop, for example a flag to indicate that something has been completed, which is then tested in the for statement.\n</p>\n\n<p>\nThe following code:\n</p>\n\n<pre>\nString[] names = new String[]{ \"Jack\", \"Jim\", null, \"John\" };\nfor (int i = 0; i < names.length; i++) {\n  if (names[i] == null) {\n    i = names.length;                                             // Non-Compliant\n  } else {\n    System.out.println(names[i]);\n  }\n}\n</pre>\n\n<p>\nshould be refactored into:\n</p>\n\n<pre>\nString[] names = new String[]{ \"Jack\", \"Jim\", null, \"John\" };\nfor (String name: names) {\n  if (name == null) {\n    break;                                                        // Compliant\n  }\n  System.out.println(name);\n}\n</pre>',2,NULL,'Loop counters should not be assigned to from within the loop body','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,'bug',0,'HTML'),(684,'S1488','S1488','squid','<p>Declaring a variable only to immediately return or throw it is a bad practice.\nSome developers argue that the practice improves code readability, because it enables them to explicitly name what is being returned. However, this variable is an internal implementation detail that is not exposed to the callers of the method. The method name should be sufficient for callers to know exactly what will be returned.</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\npublic long computeDurationInMilliseconds() {\n  long duration = (((hours * 60) + minutes) * 60 + seconds ) * 1000 ;\n  return duration;\n}\n\npublic void doSomething() {\n  RuntimeException myException = new RuntimeException();\n  throw myException;\n}\n</pre>\n<h2>Compliant Solution</h2>\n\n<pre>\npublic long computeDurationInMilliseconds() {\n  return (((hours * 60) + minutes) * 60 + seconds ) * 1000 ;\n}\n\npublic void doSomething() {\n  throw new RuntimeException();\n}\n</pre>',1,NULL,'Variables should not be declared and then immediately returned or thrown','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'2min',NULL,NULL,NULL,0,'HTML'),(685,'S1700','S1700','squid','<p>It\'s confusing to have a class member with the same name (case differences aside) as its enclosing class. This is particularly so when you consider the common practice of naming a class instance for the class itself.</p>\n\n<p>Best practice dictates that any field or member with the same name as the enclosing class be renamed to be more descriptive of the particular aspect of the class it represents or holds.</p>\n\n<h2>Noncompliant Code Sample</h2>\n<pre>\npublic class Foo {\n  private String foo;\n\n  public String getFoo() { }\n}\n\nFoo foo = new Foo();\nfoo.getFoo() // what does this return?\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\npublic class Foo {\n  private String name;\n\n  public String getName() { }\n}\n\n//...\n\nFoo foo = new Foo();\nfoo.getName()\n</pre>\n\n<h2>Exception</h2>\n\n<p>When the type of the field is the containing class and that field is static, no issue is raised to allow singletons named like the type.</p>\n<pre>\npublic class Foo {\n...\n  private static Foo foo;\n  public Foo getInstance() {\n    if(foo==null){\n      foo = new Foo();\n    }\n    return foo;\n  }\n...\n}\n</pre>',2,NULL,'A field should not duplicate the name of its containing class','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'brain-overload',0,'HTML'),(686,'S1206','S1206','squid','<p>According to the Java Language Specification, there is a contract between <code>equals(Object)</code> and <code>hashCode()</code>:</p>\n\n<blockquote>\nIf two objects are equal according to the <code>equals(Object)</code> method, then calling the <code>hashCode</code> method on each of the two objects must produce the same integer result.\nIt is not required that if two objects are unequal according to the <code>equals(java.lang.Object)</code> method, then calling the <code>hashCode</code> method on each of the two objects must produce distinct integer results.\nHowever, the programmer should be aware that producing distinct integer results for unequal objects may improve the performance of hashtables.\n</blockquote>\n\n<p>In order to comply with this contract, those methods should be either both inherited, or both overridden.</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\nclass MyClass {    // Non-Compliant - should also override \"hashCode()\"\n\n  @Override\n  public boolean equals(Object obj) {\n    /* ... */\n  }\n\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n\n<pre>\nclass MyClass {    // Compliant\n\n  @Override\n  public boolean equals(Object obj) {\n    /* ... */\n  }\n\n  @Override\n  public int hashCode() {\n    /* ... */\n  }\n\n}\n</pre>',4,NULL,'\"equals(Object obj)\" and \"hashCode()\" should be overridden in pairs','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,'bug',0,'HTML'),(687,'S1701','S1701','squid','<p>It\'s confusing to have a class member with the same name as a method in the class.</p>\n\n<p>Typically this situation indicates that the method is poorly named; method names should be action-oriented, and thus contain a verb, which is unlikely in the case where both a method and a member have the same name. However, renaming a public method could be disruptive to callers. Therefore renaming the member is the recommended action.</p>\n\n<h2>Noncompliant Code Sample</h2>\n<pre>\npublic class Foo {\n\n  private string fiz;\n  public String fiz() {\n    // do something...\n  }\n\n  private void doSomething() {\n\n    String tmp = fiz; // is this what was intended? Should this have been a call to fiz()?\n\n  }\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\npublic class Foo {\n\n  private string fizbah; // member has been renamed\n  public String fiz() {\n    // do something...\n  }\n\n  private void doSomething() {\n\n    String tmp = fiz; // results in a compile error\n    String tmp2 = fiz(); // no question now what was intended\n  }\n}\n</pre>',2,NULL,'Fields should not duplicate method names','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'brain-overload',0,'HTML'),(688,'SwitchLastCaseIsDefaultCheck','SwitchLastCaseIsDefaultCheck','squid','<p>\nThe requirement for a final default clause is defensive programming.\nThis clause should either take appropriate action or contain a suitable comment as to why no action is taken.\n</p>\n\n<p>\nThe following code snippet illustrates this rule:\n</p>\n\n<pre>\nswitch (state) {                       // Non-Compliant - must have a default case\n  case 0:\n  case 1:\n    System.out.println(\"0 or 1!\");\n    break;\n}\n\nswitch (state) {\n  default:                             // Non-Compliant - must be last for better readability\n    throw new IllegalStateException();\n  case 0:\n  case 1:\n    System.out.println(\"0 or 1!\");\n    break;\n}\n\nswitch (state) {\n  case 0:\n  case 1:\n    System.out.println(\"0 or 1!\");\n    break;\n  default:                             // Compliant\n    throw new IllegalStateException();\n</pre>',2,NULL,'Switch statements should end with a default case','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(689,'RightCurlyBraceDifferentLineAsNextBlockCheck','RightCurlyBraceDifferentLineAsNextBlockCheck','squid','<p>\nSharing some coding conventions is a key point to make it possible for a team to efficiently collaborate.\nThis rule make it mandatory to place closing curly braces and next <code>else</code>, <code>catch</code> or <code>finally</code> keywords on two different lines.\n</p>\n\n<p>\nThe following code snippet illustrates this rule:\n</p>\n\n<pre>\npublic void myMethod() {\n  if(something) {\n    executeTask();\n  } else if (somethingElse) {          // Non-Compliant\n    doSomethingElse();\n  }\n  else {                               // Compliant\n     generateError();\n  }\n\n  try {\n    generateOrder();\n  } catch (Exception e) {              // Non-Compliant\n    log(e);\n  }\n  finally {                            // Compliant\n    closeConnection();\n  }\n}\n</pre>',2,NULL,'Right curly brace and next \"else\", \"catch\" and \"finally\" keywords should be located on two different lines','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1min',NULL,NULL,'convention',0,'HTML'),(690,'S1201','S1201','squid','<p>\n\"equals\" as a method name should be exclusively used to override <code>Object.equals(Object)</code> to prevent any confusion.\n</p>\n\n<p>\nIt is tempting to overload the method to take a specific class instead of <code>Object</code> as parameter, to save class comparison check.\nHowever, this will not work as expected.\n</p>\n\n<p>For example:</p>\n\n<pre>\nclass MyClass {\n  private int foo = 1;\n\n  public boolean equals(MyClass o) {                    // Non-Compliant - \"equals\" method which does not override Object.equals(Object)\n    return o != null && o.foo == this.foo;\n  }\n\n  public static void main(String[] args) {\n    MyClass o1 = new MyClass();\n    Object o2 = new MyClass();\n    System.out.println(o1.equals(o2));                  // Will display \"false\" because \"o2\" is of type \"Object\" and not \"MyClass\"\n  }\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\nclass MyClass {\n  private int foo = 1;\n\n  @Override\n  public boolean equals(Object o) {                     // Compliant - overrides Object.equals(Object)\n    if (o == null || !(o instanceof MyClass)) {\n      return false;\n    }\n\n    MyClass other = (MyClass)o;\n    return this.foo == other.foo;\n  }\n\n  /* ... */\n}\n</pre>',3,NULL,'Methods named \"equals\" should override Object.equals(Object)','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,'pitfall',0,'HTML'),(691,'S1200','S1200','squid','<p>\nAccording to the Single Responsibility Principle, introduced by Robert C. Martin in his book \"Principles of Object Oriented Design\", a class should have only one responsibility:\n</p>\n\n<blockquote>\nIf a class has more than one responsibility, then the responsibilities become coupled.\nChanges to one responsibility may impair or inhibit the class ability to meet the others.\nThis kind of coupling leads to fragile designs that break in unexpected ways when changed.\n</blockquote>\n\n<p>\nClasses which rely on many other classes tend to aggregate too many responsibilities and should be split into several smaller ones.\nNested classes dependencies are not counted as dependencies of the outer class.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<p>In case the threshold is set to 5</p>\n<pre>\nclass Foo {                        // Noncompliant - Foo depends on too many classes: T1, T2, T3, T4, T5, T6 and T7\n  T1 a1;                           // Foo is coupled to T1\n  T2 a2;                           // Foo is coupled to T2\n  T3 a3;                           // Foo is coupled to T3\n\n  public T4 compute(T5 a, T6 b) {  // Foo is coupled to T4, T5 and T6\n    T7 result = a.getResult(b);    // Foo is coupled to T7\n    return result;\n  }\n\n  public static class Bar {        // Compliant - Bar depends on 2 classes: T8 and T9\n    T8 a8;\n    T9 a9;\n  }\n}\n</pre>',2,NULL,'Classes should not be coupled to too many other classes (Single Responsibility Principle)','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,24,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'2h',NULL,NULL,'brain-overload',0,'HTML'),(692,'ModifiersOrderCheck','ModifiersOrderCheck','squid','<p>\nThe Java Language Specification recommends listing modifiers in the following order:\n</p>\n\n<ul>\n  <li>Annotations</li>\n  <li><code>public</code></li>\n  <li><code>protected</code></li>\n  <li><code>private</code></li>\n  <li><code>abstract</code></li>\n  <li><code>static</code></li>\n  <li><code>final</code></li>\n  <li><code>transient</code></li>\n  <li><code>volatile</code></li>\n  <li><code>synchronized</code></li>\n  <li><code>native</code></li>\n  <li><code>strictfp</code></li>\n</ul>\n\n<p>\nNot following this convention has no technical impact, but will reduce the code\'s readability because most developers are used to the standard order.\n</p>\n\n<p>\nThe following code:\n</p>\n\n<pre>\nstatic public void main(String[] args) {   // Non-Compliant\n}\n</pre>\n\n<p>\nshould be refactored into:\n</p>\n\n<pre>\npublic static void main(String[] args) {   // Compliant\n}\n</pre>',1,NULL,'Modifiers should be declared in the correct order','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'convention',0,'HTML'),(693,'ClassCyclomaticComplexity','ClassCyclomaticComplexity','squid','<p>The Cyclomatic Complexity is measured by the number of (&&, ||)\n	operators and (if, while, do, for, ?:, catch, switch, case, return,\n	throw) statements in the body of a class plus one for each constructor,\n	method (but not getter/setter), static initializer, or instance\n	initializer in the class. The last return stament in method, if exists,\n	is not taken into account.</p>\n<p>\n	Even when the Cyclomatic Complexity of a class is very high, this\n	complexity might be well distributed among all methods. Nevertheless,\n	most of the time, a very complex class is a class which breaks the <a\n		href=\'http://en.wikipedia.org/wiki/Single_responsibility_principle\'>Single\n		Responsibility Principle</a> and which should be re-factored to be split\n	in several classes.\n</p>',2,NULL,'Avoid too complex class','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,39,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'brain-overload',0,'HTML'),(694,'S1181','S1181','squid','<p>\n<code>Throwable</code> is the superclass of all errors and exceptions in Java.\n<code>Error</code> is the superclass of all errors which are not meant to be caught by applications.\n</p>\n\n<p>\nCatching either <code>Throwable</code> or <code>Error</code> will also catch <code>OutOfMemoryError</code> or <code>InternalError</code> from which an application should not attempt to recover.\n</p>\n\n<p>Only <code>Exception</code> and its subclasses should be caught.</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\ntry { /* ... */ } catch (Throwable t) { /* ... */ }\ntry { /* ... */ } catch (Error e) { /* ... */ } \n</pre>\n\n<h2>Compliant Solution</h2>\n\n<pre>\ntry { /* ... */ } catch (Exception e) { /* ... */ }  \ntry { /* ... */ } catch (RuntimeException e) { /* ... */ }  \ntry { /* ... */ } catch (MyException e) { /* ... */ }  \n</pre>',4,NULL,'Throwable and Error classes should not be caught','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,30,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'error-handling',0,'HTML'),(695,'S1182','S1182','squid','<p>The usual convention for <code>Object.clone()</code> according to Oracle\'s Javadoc is that:</p>\n<ul>\n  <li><code>x.clone() != x</code></li>\n  <li><code>x.clone().getClass() == x.getClass()</code></li>\n  <li><code>x.clone().equals(x)</code></li>\n</ul>\n\n<p>Obtaining the object that will be returned by calling <code>super.clone()</code> helps to satisfy those invariants:</p>\n<ul>\n  <li><code>super.clone()</code> returns a new object instance</li>\n  <li><code>super.clone()</code> returns an object of the same type as the one <code>clone()</code> was called on</li>\n  <li><code>Object.clone()</code> performs a shallow copy of the object\'s state</li>\n</ul>\n\n<p>For example, the following code:</p>\n\n<pre>\nclass BaseClass implements Cloneable {\n  @Override\n  public Object clone() throws CloneNotSupportedException {    // Non-Compliant - should return the super.clone() instance\n    return new BaseClass();\n  }\n}\n\nclass DerivedClass extends BaseClass implements Cloneable {\n  /* Does not override clone() */\n\n  public void sayHello() {\n    System.out.println(\"Hello, world!\");\n  }\n}\n\nclass Application {\n  public static void main(String[] args) throws Exception {\n    DerivedClass instance = new DerivedClass();\n    ((DerivedClass) instance.clone()).sayHello();              // Throws a ClassCastException because invariant #2 is violated\n  }\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\nclass BaseClass implements Cloneable {\n  @Override\n  public Object clone() throws CloneNotSupportedException {    // Compliant\n    return super.clone();\n  }\n}\n\nclass DerivedClass extends BaseClass implements Cloneable {\n  /* Does not override clone() */\n\n  public void sayHello() {\n    System.out.println(\"Hello, world!\");\n  }\n}\n\nclass Application {\n  public static void main(String[] args) throws Exception {\n    DerivedClass instance = new DerivedClass();\n    ((DerivedClass) instance.clone()).sayHello();              // Displays \"Hello, world!\" as expected. Invariant #2 is satisfied\n  }\n}\n</pre>',2,NULL,'super.clone() should be called when overriding Object.clone()','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,NULL,0,'HTML'),(696,'S1186','S1186','squid','<p>There are three reasons for a method not to have a method body:</p>\n\n<ul>\n  <li>It is an unintentional omission, and should be fixed.</li>\n  <li>It is not yet, or never will be, supported. In this case an <code>UnsupportedOperationException</code> should be thrown.</li>\n  <li>The method is an intentionally-blank override. In this case a nested comment should explain the reason for the blank override.</li>\n</ul>\n\n<p>The following code snippet:</p>\n\n<pre>\n// Non-Compliant\npublic void doSomething() {\n}\n</pre>\n\nshould be refactored into:\n\n<pre>\n// Compliant\n@Override\npublic void doSomethingElse() {\n  // Do nothing because of X and Y.\n}\n</pre>\n\nor:\n\n<pre>\n// Compliant\n@Override\npublic void doSomethingElse() {\n  throw new UnsupportedOperationException();\n}\n</pre>\n\n<p>Empty methods not having any nested comments are tolerated in Abstract classes as those empty methods are usual when implementing the visitor pattern.</p>',2,NULL,'Methods should not be empty','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,NULL,0,'HTML'),(697,'S1185','S1185','squid','<p>Overriding a method just to call the same method from the super class without performing any other actions is useless and misleading.</p>\n\n<p>The following code snippet illustrates this rule:</p>\n\n<pre>\npublic void doSomething() {                     // Non-Compliant\n  super.doSomething();\n}\n\n@Override\npublic boolean isLegal(Action action) {         // Non-Compliant\n  return super.isLegal(action);\n}\n\n@Override\npublic boolean isLegal(Action action) {         // Compliant - not simply forwarding the call\n  return super.isLegal(new Action(/* ... */));\n}\n\n@Id\n@Override\npublic int getId() {                            // Compliant - there is annotation different from @Override\n  return super.getId();\n}\n</pre>',1,NULL,'Overriding methods should do more than simply call the same method in the super class','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'brain-overload',0,'HTML'),(698,'S1602','S1602','squid','<p>There are two ways to write lambdas that contain single statement, but one is definitely more compact and readable than the other.</p>\n<h2>Noncompliant Code Example</h2>\n\n<pre>\n x -> {System.out.println(x+1);}\n(a, b) -> { return a + b; }\n</pre>\n\n<h2>Compliant Solution</h2>\n\n<pre>\n x -> System.out.println(x+1)\n(a, b) -> a + b\n</pre>',2,NULL,'Lamdbas containing only one statement should not nest this statement in a block','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'java8',0,'HTML'),(699,'S1188','S1188','squid','<p>\nAnonymous classes and lambdas (with Java 8) are a very convenient and compact way to inject a behavior without having to create a dedicated class. But those anonymous inner classes and lambdas should be used only if the behavior to be injected can be defined in a few lines of code, otherwise the source code can quickly become unreadable.\n</p>',2,NULL,'Lambdas and anonymous classes should not have too many lines','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'brain-overload',0,'HTML'),(700,'S1604','S1604','squid','<p>Before Java 8, the only way to partially support closures in Java was by using anonymous inner classes. But the syntax of anonymous classes may seem unwieldy and unclear.</p>\n\n<p>With Java 8, most uses of anonymous inner classes should be replaced by lambdas to highly increase the readability of the source code.</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\nmyCollection.map(new Mapper<String,String>() {\n  public String map(String input) {\n    return new StringBuilder(input).reverse().toString();\n  }\n});\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\nmyCollection.map(element -> new StringBuilder(element).reverse().toString());\n</pre>',2,NULL,'Anonymous inner classes containing only one method should become lambdas','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'java8',0,'HTML'),(701,'UselessImportCheck','UselessImportCheck','squid','<p>\nThe imports part of a file should be handled by the Integrated Development Environment (IDE), not manually by the developer.\nUnused and useless imports should not occur if that is the case.\nLeaving them in reduces the code\'s readability, since their presence can be confusing.\n</p>\n\n<p>The following code snippet illustrates this rule:</p>\n\n<pre>\npackage my.company;\n\nimport java.lang.String;        // Non-Compliant - java.lang classes are always implicitly imported\nimport my.company.SomeClass;    // Non-Compliant - same package files are always implicitly imported\nimport java.io.File;            // Non-Compliant - File is not used\n\nimport my.company2.SomeType;\nimport my.company2.SomeType;    // Non-Compliant - \'SomeType\' is already imported\n\nclass ExampleClass {\n\n  public String someString;\n  public SomeType something;\n\n}\n</pre>',1,NULL,'Useless imports should be removed','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'unused',0,'HTML'),(702,'S1481','S1481','squid','<p>\nIf a local variable is declared but not used in the program, it can be considered dead code and should therefore be removed.\nThis will improve maintainability because developers will not wonder what the variable is used for.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\npublic int compute(int a){\n  int foo = 6;\n  return a * 4;\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\npublic int compute(int a){\n  return a * 4;\n}\n</pre>',2,NULL,'Unused local variables should be removed','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'unused',0,'HTML'),(703,'MissingDeprecatedCheck','MissingDeprecatedCheck','squid','<p>Deprecation should be marked with both the <code>@Deprecated</code> annotation and @deprecated Javadoc tag. The annotation enables tools such as IDEs to warn about referencing deprecated elements, and the tag can be used to explain when it was deprecated, why, and how references should be refactored.</p>\n\n<p>The following code illustrates this rule:</p>\n\n<h2>Noncompliant Code Sample</h2>\n<pre>\nclass MyClass {\n\n@Deprecated\npublic void foo1() {\n}\n\n/**\n* @deprecated\n*/\npublic void foo2() {    // Non-Compliant\n}\n\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\nclass MyClass {\n\n/**\n* @deprecated (when, why, refactoring advice...)\n*/\n@Deprecated\npublic void foo1() {\n}\n\n/**\n* @deprecated (when, why, refactoring advice...)\n*/\n@Deprecated\npublic void foo2() {    // Non-Compliant\n}\n\n}\n</pre>\n\n<h2>Exceptions</h2>\n<p>The members and methods of a deprecated class or interface are ignored by this rule. The classes and interfaces themselves are still subject to it.</p>\n\n<pre>\n/**\n* @deprecated (when, why, &etc...)\n*/\n@Deprecated\nclass Qix  {\n\npublic void foo() {} // Compliant; class is deprecated\n\n}\n\n/**\n* @deprecated (when, why, &etc...)\n*/\n@Deprecated\ninterface Plop {\n\nvoid bar();\n\n}\n</pre>',2,NULL,'Deprecated elements should have both the annotation and the Javadoc tag','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(704,'XPath','XPath','squid','<p>\nThis rule allows to define some homemade Java rules with help of an XPath expression.\n</p>\n\n<p>\nIssues are created depending on the return value of the XPath expression. If the XPath expression returns:\n</p>\n<ul>\n  <li>a single or list of AST nodes, then a line issue with the given message is created for each node</li>\n  <li>a boolean, then a file issue with the given message is created only if the boolean is true</li>\n  <li>anything else, no issue is created</li>\n</ul>\n\n<p>\nHere is an example of an XPath expression to log an issue on each if statement : //ifStatement\n</p>',2,NULL,'XPath rule','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'HTML'),(705,'S1301','S1301','squid','<p>\n<code>switch</code> statements are useful when there are many different cases depending on the value of the same expression.\nFor just one or two cases however, the code will be more readable with <code>if</code> statements.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\nswitch (variable) {\n  case 0:\n    doSomething();\n    break;\n  default:\n    doSomethingElse();\n    break;\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\nif (variable == 0) {\n  doSomething();\n} else {\n  doSomethingElse();\n}\n</pre>',1,NULL,'\"switch\" statements should have at least 3 cases','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(706,'ObjectFinalizeOverridenCheck','ObjectFinalizeOverridenCheck','squid','<p>\nThis Object.finalize() method is called by the garbage collector on an object when garbage collection determines that there are no more references to the object.\nBut there is absolutely no warranty that this method will be called AS SOON AS the last references to the object are removed.\nIt can be few microseconds to few minutes later.\nSo when some system resources need to be disposed by an object it\'s better to not rely on this asynchronous mechanism to dispose them.\n</p>\n\n<p>\nThe following piece of code illustrates this rule:\n</p>\n\n<pre>\npublic class MyClass {\n\n  protected void finalize() {\n    releaseSomeResources();     // Non-Compliant\n  }\n\n}\n</pre>',3,NULL,'The Object.finalize() method should never be overriden','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,NULL,0,'HTML'),(707,'LowerCaseLongSuffixCheck','LowerCaseLongSuffixCheck','squid','<p>\nThe long suffix should always be written in upper case, i.e. \'L\', as the lower case \'l\' can easily be confused with the digit one \'1\'.\n</p>\n\n<p>\nThe following code:\n</p>\n\n<pre>\nlong n = 10l;  // Non-Compliant - easily confused with one zero one\n</pre>\n\n<p>\nshould be refactored into:\n</p>\n\n<pre>\nlong n = 10L;  // Compliant\n</pre>',2,NULL,'Long suffix \"L\" should be upper case','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'convention',0,'HTML'),(708,'S1710','S1710','squid','<p>Before Java 8 if you needed to use multiple instances of the same annotation, they had to be wrapped in a container annotation. With Java 8, that\'s no longer necessary, allowing for cleaner, more readable code.</p>\n\n<h2>Noncompliant Code Sample</h2>\n<pre>\n@SomeAnnotations({\n@SomeAnnotation(..a..),\n@SomeAnnotation(..b..),\n@SomeAnnotation(..c..),\n})\npublic class SomeClass {\n...\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\n@SomeAnnotation(..a..)\n@SomeAnnotation(..b..)\n@SomeAnnotation(..c..)\npublic class SomeClass {\n...\n}\n</pre>',3,NULL,'Annotation repetitions should not be wrapped','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'2min',NULL,NULL,'java8',0,'HTML'),(709,'S1310','S1310','squid','<p>This rule allows to track usages of this PMD suppression comment filtering mechanism.</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\n// NOPMD\n</pre>',1,NULL,'NOPMD suppression comment filters should not be used','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(710,'S1313','S1313','squid','<p>Hardcoding an IP address into source code is a bad idea for several reasons:</p>\n\n<ul>\n  <li>a recompile is required if the address changes</li>\n  <li>it forces the same address to be used in every environment (dev, sys, qa, prod)</li>\n  <li>it places the responsibility of setting the value to use in production on the shoulders of the developer</li>\n</ul>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\nString ip = \"127.0.0.1\";\nSocket socket = new Socket(ip, 6667);\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\nString ip = System.getProperty(\"myapplication.ip\");\nSocket socket = new Socket(ip, 6667);\n</pre>',2,NULL,'IP addresses should not be hardcoded','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,24,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,'security',0,'HTML'),(711,'S1312','S1312','squid','<p>Whatever is the logging framework (logback, log4j, commons-logging, java.util.logging, ...), a logger should be:</p>\n\n<ul>\n  <li><code>private</code>: Never be accessible outside of its parent class. If another class needs to log something, it should instantiate its own logger.</li>\n  <li><code>static</code>: Not dependent on an instance of a class (an object). When logging something, contextual information can of course be provided in the messages but the logger should be created at class level to prevent creating a logger along with each object.</li>\n  <li><code>final</code>: Be created once and only once per class.</li>\n</ul>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\npublic class Foo {\n  public Logger logger = LoggerFactory.getLogger(Foo.class);         // Noncompliant\n\n  public void doSomething() {\n    /* ... */\n  }\n}\n\npublic class Bar {\n  public static void main(String[] args) {\n    Foo foo = new Foo();\n    foo.logger.info(\"Program started\");\n    foo.doSomething();\n  }\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\npublic class Foo {\n  private static Logger LOGGER = LoggerFactory.getLogger(Foo.class); // Compliant\n\n  public void doSomething() {\n    /* ... */\n  }\n}\n\npublic class Bar {\n  private static Log LOGGER = LogFactory.getLogger(Bar.class);       // Compliant\n\n  public static void main(String[] args) {\n    LOGGER.info(\"Program started\");\n    Foo foo = new Foo();\n    foo.run();\n  }\n}\n</pre>',2,NULL,'Loggers should be \"private static final\" and should share a naming convention','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'convention',0,'HTML'),(712,'S1118','S1118','squid','<p>\nUtility classes, which are a collection of static members, are not meant to be instantiated.\nThey should therefore not have public constructors.\n</p>\n\n<p>\nJava adds an implicit public constructor to every class which does not define at least one explicitly.\nHence, at least one non-public constructor should be defined.\n</p>\n\n<p>The following code:</p>\n\n<pre>\nclass StringUtils { // Non-Compliant\n\n  public static String concatenate(String s1, String s2) {\n    return s1 + s2;\n  }\n\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\nclass StringUtils { // Compliant\n\n  private StringUtils() {\n  }\n\n  public static String concatenate(String s1, String s2) {\n    return s1 + s2;\n  }\n\n}\n</pre>',2,NULL,'Utility classes should not have a public constructor','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'30min',NULL,NULL,NULL,0,'HTML'),(713,'UnusedProtectedMethod','UnusedProtectedMethod','squid','<p>Protected methods that are never used by any classes in the same\n  project are strongly suspected to be dead code. Dead code means\n  unnecessary, inoperative code that should be removed. This helps in\n  maintenance by decreasing the maintained code size, making it easier to\n  understand the program and preventing bugs from being introduced.</p>\n<p>In the following case, unused protected methods are not\n  considered as dead code by SonarQube :</p>\n<ul>\n  <li>Protected methods which override a method from a parent class.</li>\n  <li>Protected methods of an abstract class.</li>\n</ul>',2,NULL,'Unused protected method','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'unused',0,'HTML'),(714,'S1319','S1319','squid','<p>\nThe purpose of the Java Collections API is to provide a well defined hierarchy of interfaces in order to hide all implementation details.\nImplementating classes must be used to instantiate a new collection, but the result of an instantiation should immediately be stored in a variable whose type is a Java Collection interface.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\npublic class Employees {\n  private HashSet&lt;Employee&gt; employees = new HashSet&lt;Employee&gt;();  // Noncompliant - \"employees\" should have type \"Set\" rather than \"HashSet\"\n\n  public HashSet&lt;Employee&gt; getEmployees() {                       // Noncompliant\n    return employees;\n  }\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\npublic class Employees {\n  private Set&lt;Employee&gt; employees = new HashSet&lt;Employee&gt;();      // Compliant\n\n  public Set&lt;Employee&gt; getEmployees() {                           // Compliant\n    return employees;\n  }\n}\n</pre>',2,NULL,'Declarations should use Java collection interfaces such as \"List\" rather than specific implementation classes such as \"LinkedList\"','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,24,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(715,'S1318','S1318','squid','<p>Inexperienced Java developers might expect the <code>Object.equals(Object obj)</code> method to correctly handle the case where the left hand side is null, but that is not the case.</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\nif (variable.equals(null)) { /* ... */ }   // Noncompliant - \"variable\" is really null, a NullPointerException is thrown\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\nif (variable == null) { /* ... */ }        // Compliant\n</pre>',3,NULL,'\"object == null\" should be used instead of \"object.equals(null)\"','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,NULL,0,'HTML'),(716,'S1452','S1452','squid','<p>\n  Using a wildcard as a return type implicitly means that the return parameter should be considered as real-only but without any way to enforce this contract.\n</p>\n<p>\n  Let\'s take the example of method returning a \"List&lt;&#63; extends Animal&gt;\". Is it possible on this list to add a Dog, a Cat, ... we simply don\'t know. The consumer of a method should not have to deal with such disruptive questions.\n</p>\n\n\n<h2>Noncompliant Code Example</h2>\n<pre>\nList&lt;? extends Animal&gt; getAnimals(){...}\n</pre>\n\n<h2>Compliant solution</h2>\n<pre>\n//First Solution: the list can contain any kind of animals\nList&lt;Animal&gt; getAnimals(){...}\n\n//Second Solution: the list can contain only one type of animal\nList&lt;E&gt; getAnimals(){...} //Where E extends Animal in the signature of the nesting class\n</pre>',2,NULL,'Generic wildcard types should not be used in return parameters','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,NULL,0,'HTML'),(717,'S1451','S1451','squid','<p>\nEach source file should start with a header stating file ownership and the license which must be used to distribute the application.\nThis rule must be fed with the header text which is expected at the beginning of every file.\n</p>\n\n<p>For example, for SonarSource\'s open source softwares, the <code>headerFormat</code> property must be set to:</p>\n<pre>\n/*\n * SonarQube, open source software quality management tool.\n * Copyright (C) 2008-2013 SonarSource\n * mailto:contact AT sonarsource DOT com\n *\n * SonarQube is free software; you can redistribute it and/or\n * modify it under the terms of the GNU Lesser General Public\n * License as published by the Free Software Foundation; either\n * version 3 of the License, or (at your option) any later version.\n *\n * SonarQube is distributed in the hope that it will be useful,\n * but WITHOUT ANY WARRANTY; without even the implied warranty of\n * MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the GNU\n * Lesser General Public License for more details.\n *\n * You should have received a copy of the GNU Lesser General Public License\n * along with this program; if not, write to the Free Software Foundation,\n * Inc., 51 Franklin Street, Fifth Floor, Boston, MA  02110-1301, USA.\n */\n</pre>',4,NULL,'Copyright and license headers should be defined in all source files','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,18,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'convention',0,'HTML'),(718,'IndentationCheck','IndentationCheck','squid','<p>\nProper indentation is a simple and effective way to improve the code\'s readability.\nConsistent indentation among developers also reduces the differences that are committed to source control systems, making code reviews easier.\n</p>\n\n<p>The following code illustrates this rule with an indentation level of 2:</p>\n\n<pre>\nclass Foo {\n  public int a; // Compliant\npublic int b;   // Non-Compliant\n}\n</pre>',2,NULL,'Source code should be correctly indented','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1min',NULL,NULL,'convention',0,'HTML'),(719,'CommentedOutCodeLine','CommentedOutCodeLine','squid','<p>Here are the main reasons why commented code is a code smell :</p>\n<ul>\n    <li>It always raises more questions than it gives answers</li>\n    <li>Everybody will forget very quickly how relevant the commented code is</li>\n    <li>This is distraction when going down the code as it stops the flow of eyes</li>\n    <li>It is a bad SCM engine : Subversion, CVS and Git are really more trustworthy !</li>\n    <li>The simple fact of understanding why code was commented out in the first place can take a lot of time</li>\n</ul>',2,NULL,'Avoid commented-out lines of code','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,'unused',0,'HTML'),(720,'S1315','S1315','squid','<p>This rule allows to track usages of this Checkstyle suppression comment filtering mechanism.</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\n// CHECKSTYLE:OFF\n</pre>',1,NULL,'CHECKSTYLE:OFF suppression comment filters should not be used','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,NULL,0,'HTML'),(721,'S1314','S1314','squid','<p>\nInteger literals starting with a zero are octal rather than decimal values.\nWhile using octal values in Java is fully supported, most developers do not have experience with them.\nThey may not recognize octal values as such, mistaking them instead for decimal values.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\nint myNumber = 010;   // myNumber will hold 8, not 10 - was this really expected?\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\nint myNumber = 8;\n</pre>',2,NULL,'Octal values should not be used','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'pitfall',0,'HTML'),(722,'S1317','S1317','squid','<p>\n  Instantiating a StringBuilder or a StringBuffer with a character is misleading because most Java developers would expect the character to be the initial value of the StringBuffer.\n</p>\n<p>\n  What actually happens is that the int representation of the character is used to determine the initial size of the StringBuffer.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\nStringBuffer foo = new StringBuffer(\'x\');   //equivalent to StringBuffer foo = new StringBuffer(120);\n</pre>\n\n<h2>Compliant Solution</h2>\n\n<pre>\nStringBuffer foo = new StringBuffer(\"x\");\n</pre>',2,NULL,'StringBuilder and StringBuffer should not be instantiated with a character','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,NULL,0,'HTML'),(723,'S1656','S1656','squid','<p>There is no reason to re-assign a variable to itself. Either this statement is redundant and should be removed, or the re-assignment is a mistake and some other value was intended for the assignment instead.</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\npublic void setName(String name) {\n  name = name;\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\npublic void setName(String name) {\n  this.name = name;\n}\n</pre>',2,NULL,'Variables should not be self-assigned','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'3min',NULL,NULL,'bug',0,'HTML'),(724,'S1862','S1862','squid','<p>\n  A chain of if/else if statements is evaluated from top to bottom. At most, only one branch of the chain will be executed: the first one with a condition that evaluates to true.\n</p>\n<p>\n  Therefore, duplicating a condition in a sequence of if/else if statements automatically leads to dead code. Usually, is due to a copy/paste error. Obviously it could lead to unexpected behavior.\n</p>\n\n<h2>Noncompliant Code Sample</h2>\n<pre>\nif (param == 1)\n  openWindow();\nelse if (param == 2)\n  closeWindow();\nelse if (param == 1)  // For sure this is a bug\n  moveWindowToTheBackground();\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\nif (param == 1)\n  openWindow();\nelse if (param == 2)\n  closeWindow();\nelse if (param == 3)\n  moveWindowToTheBackground();\n</pre>',3,NULL,'Conditions in related \"if/else if\" statements should not be duplicated','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'bug,unused',0,'HTML'),(725,'S881','S881','squid','<p>\nThe use of increment and decrement operators in combination with other arithmetic operators is not recommended, because:\nIt can significantly impair the readability of the code.\nIt introduces additional side effects into a statement, with the potential for undefined behavior.\nIt is safer to use these operators in isolation from any other arithmetic operators.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\nu8a = ++u8b + u8c--;\nfoo = bar++ / 4;\n</pre>\n\n<h2>Compliant Solution</h2>\n<p>The following sequence is clearer and therefore safer:</p>\n\n<pre>\n++u8b;\nu8a = u8b + u8c;\nu8c--;\nfoo = bar / 4;\nbar++;\n</pre>',2,NULL,'Increment (++) and decrement (--) operators should not be mixed with other operators in an expression','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,NULL,0,'HTML'),(726,'ParsingError','ParsingError','squid','<p>\nWhen the Java parser fails, it is possible to record the failure as an issue on the file.\nThis way, not only it is possible to track the number of files that do not parse but also to easily find out why they do not parse.\n</p>',2,NULL,'Java parser failure','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'HTML'),(727,'S1598','S1598','squid','<p>By convention, a Java class\' physical location (source directories) and its logical representation (packages) should be kept in sync. Thus a Java file located at \"src/org/sonarqube/Foo.java\" should have a package of \"org.sonarqube\".</p>\n\n<p>Unfortunately, this convention is not enforced by Java compilers, and nothing prevents a developer from making the \"Foo.java\" class part of the \"com.apple\" package, which could degrade the maintainability of both the class and its application.</p>',2,NULL,'Package declaration should match source file directory','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,NULL,0,'HTML'),(728,'S1125','S1125','squid','<p>\nRemove literal boolean values from conditional expressions to improve readability. Anything that can be tested for equality with a boolean value must itself be a boolean value, and boolean values can be tested atomicly.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\nif (booleanVariable == true) { /* ... */ }\nif (booleanVariable != true) { /* ... */ }\nif (booleanVariable || false) { /* ... */ }\ndoSomething(!false);\n</pre>\n\n<h2>Compliant Solution</h2>\n\n<pre>\nif (booleanVariable) { /* ... */ }\nif (!booleanVariable) { /* ... */ }\nif (booleanVariable) { /* ... */ }\ndoSomething(true);\n</pre>',1,NULL,'Literal boolean values should not be used in condition expressions','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(729,'S1596','S1596','squid','<p>Since the introduction of generics in Java 5, it is recommenced to use generic types such as <code>List&lt;String&gt;</code> instead of raw ones such as just <code>List</code>. Assigning a raw type into a generic one is not type safe, and will generate a warning. The old <code>EMPTY_...</code> fields of the <code>Collections</code> class return raw types, whereas the newer <code>empty...()</code> methods return generic ones.</p>\n\nDevelopers will also more easily find the <code>emptyIterator()</code> and <code>emptyListIterator()</code> methods for which there is no field equivalent if they are used to call the methods.\n\n<h2>Noncompliant Code Example</h2>\n<pre>\nList&lt;String&gt; collection1 = Collections.EMPTY_LIST;\nMap&lt;String, String&gt; collection2 = Collections.EMPTY_MAP;\nSet&lt;String&gt; collection3 = Collections.EMPTY_SET;\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\nList&lt;String&gt; collection1 = Collections.emptyList();\nMap&lt;String, String&gt; collection2 = Collections.emptyMap();\nSet&lt;String&gt; collection3 = Collections.emptySet();\n</pre>',2,NULL,'Collections.emptyList(),emptyMap() and emptySet() should be used instead of Collections.EMPTY_LIST, EMPTY_MAP and EMPTY_SET','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'2min',NULL,NULL,NULL,0,'HTML'),(730,'S1126','S1126','squid','<p>\nReturn of boolean literal statements wrapped into <code>if-then-else</code> ones should be simplified.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\nif (expression) {\n  return true;\n} else {\n  return false;\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n\n<pre>\nreturn expression;   \n</pre>',2,NULL,'Return of boolean expressions should not be wrapped into an if-then-else statement','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(731,'ClassVariableVisibilityCheck','ClassVariableVisibilityCheck','squid','<p>\nPublic class variable fields do not respect the encapsulation principle and has two main disadvantages:\n</p>\n\n<ul>\n  <li>Additional behavior such as validation cannot be added.</li>\n  <li>The internal representation is exposed, and cannot be changed afterwards.</li>\n</ul>\n\n<p>The following code:</p>\n\n<pre>\npublic class MyClass {\n\n  public static final int SOME_CONSTANT = 0;     // Compliant - constants are not checked\n\n  public String firstName;                       // Non-Compliant\n\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\npublic class MyClass {\n\n  public static final int SOME_CONSTANT = 0;     // Compliant - constants are not checked\n\n  private String firstName;                      // Compliant\n\n  public String getFirstName() {\n    return firstName;\n  }\n\n  public void setFirstName(String firstName) {\n    this.firstName = firstName;\n  }\n\n}\n</pre>',2,NULL,'Class variable fields should not have public accessibility','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,24,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(732,'S1643','S1643','squid','<p>Strings are immutable objects in Java, so concatenation doesn\'t simply add the new String to the end of the existing string. Instead, in each loop iteration, the first String is converted to an intermediate object type, the second string is appended, and then the intermediate object is converted back to a String. Further, performance of these intermediate operations degrades as the String gets longer. Therefore, the use of StringBuilder is preferred.</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\nString str = \"\";\nfor (int i = 0; i < arrayOfStrings.length ; ++i) {\n  str = str + arrayOfStrings[i];\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\nStringBuilder bld = new StringBuilder();\nfor (int i = 0; i < arrayOfStrings.length; ++i) {\n  bld.append(arrayOfStrings[i]);\n}\nString str = bld.toString();\n</pre>',2,NULL,'Strings should not be concatenated using \'+\' in a loop','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,20,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'performance',0,'HTML'),(733,'RightCurlyBraceSameLineAsNextBlockCheck','RightCurlyBraceSameLineAsNextBlockCheck','squid','<p>\nSharing some coding conventions is a key point to make it possible for a team to efficiently collaborate.\nThis rule make it mandatory to place closing curly braces on the same line that next <code>else</code>, <code>catch</code> or <code>finally</code> keywords.\n</p>\n\n<p>\nThe following code snippet illustrates this rule:\n</p>\n\n<pre>\npublic void myMethod() {\n  if(something) {\n    executeTask();\n  } else if (somethingElse) {          // Compliant\n    doSomethingElse();\n  }\n  else {                               // Non-Compliant\n     generateError();\n  }\n\n  try {\n    generateOrder();\n  } catch (Exception e) {              // Compliant\n    log(e);\n  }\n  finally {                            // Non-Compliant\n    closeConnection();\n  }\n}\n</pre>',2,NULL,'Right curly brace and next \"else\", \"catch\" and \"finally\" keywords should be located on the same line','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1min',NULL,NULL,'convention',0,'HTML'),(734,'S00112','S00112','squid','<p>\nUsing such generic exception prevents calling methods from handling differently each kind of error.\n</p>\n\n<h2>\nNoncompliant Code Example\n</h2>\n\n<pre>\npublic void foo(String bar) throws Throwable { // Noncompliant\n  throw new RuntimeException(\"My Message\");    // Noncompliant\n}\n</pre>\n\n<h2>\nCompliant Solution\n</h2>\n\n<pre>\npublic void foo(String bar) {\n  throw new MyOwnRuntimeException(\"My Message\");\n}\n</pre>\n\n<h2>\nExceptions\n</h2>\n\n<p>\nGeneric exceptions in signature of overriding methods are excluded\n</p>\n\n<pre>\n@Override\npublic void myMethod() throws Exception {...}\n</pre>',2,NULL,'Generic exceptions Error, RuntimeException, Throwable and Exception should never be thrown','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,30,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'error-handling',0,'HTML'),(735,'S1066','S1066','squid','<p>Merging collapsible <code>if</code> statements increases the code\'s readability.</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\nif (file != null) {\n  if (file.isFile() || file.isDirectory()) {\n    /* ... */\n  }\n}\n</pre>\n<h2>Compliant Solution</h2>\n\n<pre>\nif (file != null && isFileOrDirectory(file)) { \n  /* ... */\n}\n\nprivate static boolean isFileOrDirectory(File file) {\n  return file.isFile() || file.isDirectory();\n}\n</pre>',2,NULL,'Collapsible \"if\" statements should be merged','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,NULL,0,'HTML'),(736,'S1067','S1067','squid','<p>\nThe complexity of an expression is defined by the number of <code>&&</code>, <code>||</code> and <code>condition ? ifTrue : ifFalse</code> operators it contains.\nA single expression\'s complexity should not become too high to keep the code readable.\n</p>\n\n<p>The following code, with a maximum complexity of 3:</p>\n\n<pre>\nif (condition1 && condition2 && condition3 && condition4) { /* ... */ }  // Non-Compliant\n</pre>\n\n<p>could be refactored into something like:</p>\n\n<pre>\nif (relevantMethodName1() && relevantMethodName2()) { /* ... */ }        // Compliant\n\n/* ... */\n\nprivate boolean relevantMethodName1() {\n  return condition1 && condition2;\n}\n\nprivate boolean relevantMethodName2() {\n  return condition3 && condition4;\n}\n</pre>',2,NULL,'Expressions should not be too complex','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,39,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'brain-overload',0,'HTML'),(737,'EmptyStatementUsageCheck','EmptyStatementUsageCheck','squid','<p>Empty statements, i.e. <code>;</code>, are usually introduced by mistake, for example because:</p>\n\n<ul>\n  <li>It was meant to be replaced by an actual statement, but this was forgotten.</li>\n  <li>There was a typo which lead to the semicolon to be doubled, i.e. <code>;;</code>.</li>\n</ul>\n\n<p>Examples:</p>\n\n<pre>\nvoid doSomething() {\n  ;                                                       // Non-Compliant - was used as a kind of TODO marker\n}\n</pre>\n\n<pre>\nSystem.out.println(\"Hello, world!\");;                     // Non-Compliant - double ;\n</pre>\n\n<p>Rarely, they are used on purpose, as the body of a loop:</p>\n\n<pre>\nfor (int i = 0; i < 3; System.out.println(i), i++);       // Non-Compliant\n</pre>\n\n<p>It is a bad practice to have side-effects outside of the loop body, and therefore that code should be refactored into:</p>\n\n<pre>\nfor (int i = 0; i < 3; i ++) {                            // Compliant\n  System.out.println(i);\n}\n</pre>',2,NULL,'Empty statements should be removed','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(738,'MethodCyclomaticComplexity','MethodCyclomaticComplexity','squid','<p>The Cyclomatic Complexity is measured by the number of\n	(&amp;&amp;, ||) operators and (if, while, do, for, ?:, catch, switch,\n	case, return, throw) statements in the body of a class plus one for\n	each constructor, method (but not getter/setter), static initializer,\n	or instance initializer in the class. The last return stament in\n	method, if exists, is not taken into account.</p>\n<p>\n	Even when the Cyclomatic Complexity of a class is very high, this\n	complexity might be well distributed among all methods. Nevertheless,\n	most of the time, a very complex class is a class which breaks the <a\n		href=\"http://en.wikipedia.org/wiki/Single_responsibility_principle\">Single\n		Responsibility Principle</a> and which should be re-factored to be split\n	in several classes.\n</p>',2,NULL,'Methods should not be too complex','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,39,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'brain-overload',0,'HTML'),(739,'S1068','S1068','squid','<p>\nIf a private field is declared but not used in the program, it can be considered dead code and should therefore be removed.\nThis will improve maintainability because developers will not wonder what the variable is used for.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\npublic class MyClass {\n  private int foo = 42;\n\n  public int compute(int a) {\n    return a * 42;\n  }\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\npublic class MyClass {\n  public int compute(int a) {\n    return a * 42;\n  }\n}\n</pre>\n\n<h2>Exceptions</h2>\n\n<p>\nThe Java serialization runtime associates with each serializable class a version number, called <code>serialVersionUID</code>, which is used during deserialization to verify that the sender and receiver of a serialized object have loaded classes for that object that are compatible with respect to serialization.\nA serializable class can declare its own <code>serialVersionUID</code> explicitly by declaring a field named <code>serialVersionUID</code> that must be static, final, and of type long. By definition those <code>serialVersionUID</code> fields should not be reported by this rule:\n</p>\n\n<pre>\npublic class MyClass implements java.io.Serializable {\n  private static final long serialVersionUID = 42L;\n}\n</pre>',2,NULL,'Unused private fields should be removed','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'unused',0,'HTML'),(740,'S00107','S00107','squid','<p>\nA long parameter list can indicate that a new structure should be created to wrap the numerous parameters or that the method is doing too many things.\n</p>',2,NULL,'Methods should not have too many parameters','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,39,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,'brain-overload',0,'HTML'),(741,'S1132','S1132','squid','<p>\nIt is preferable to place string literals on the left-hand side of an <code>equals()</code> or <code>equalsIgnoreCase()</code> method call.\nThis prevents null pointer exceptions from being raised, as a string literal can never be null by definition.\n</p>\n\n<p>The following code:</p>\n\n<pre>\nString myString = null;\n\nSystem.out.println(\"Equal? \" + myString.equals(\"foo\"));                        // Non-Compliant - will raise a NPE\nSystem.out.println(\"Equal? \" + (myString != null && myString.equals(\"foo\")));  // Non-Compliant - null check could be removed\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\nSystem.out.println(\"Equal?\" + \"foo\".equals(myString));                         // Compliant - properly deals with the null case\n</pre>',2,NULL,'Strings literals should be placed on the left side when checking for equality','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(742,'S1133','S1133','squid','<p>\nThis rule is meant to be used as a way to track code which is marked as being deprecated.\nDeprecated code should eventually be removed.\n</p>\n\n<p>\nThe following code illustrates this rule:\n</p>\n\n<pre>\nclass Foo {\n  /**\n    * @deprecated\n    */\n  public void foo() {    // Non-Compliant\n  }\n\n  @Deprecated            // Non-Compliant\n  public void bar() {\n  }\n\n  public void baz() {    // Compliant\n  }\n}\n</pre>',0,NULL,'Deprecated code should be removed eventually','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(743,'S00108','S00108','squid','<p>\nMost of the time a block of code is empty when a piece of code is really missing.\nSo such empty block must be either filled or removed.\nWhen a block contains a comment, this block is not considered to be empty.\n</p>\n\n<p>The following code snippet illustrates this rule:</p>\n\n<pre>\nvoid doSomething() {\n  for (int i = 0; i < 42; i++)        // Non-Compliant\n  {\n  }\n  for (int i = 0; i < 42; i++);       // Compliant\n\n  if (myVar == 4)                     // Compliant - contains a comment\n  {\n    // Do nothing because of X and Y\n  }\n  else                                // Compliant\n  {\n    doSomething();\n  }\n\n  try                                 // Non-Compliant\n  {\n  }\n  catch (Exception e)                 // Compliant\n  {\n    // Ignore\n  }\n}\n</pre>',2,NULL,'Nested blocks of code should not be left empty','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,33,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'bug',0,'HTML'),(744,'S00103','S00103','squid','<p>\nHaving to scroll horizontally makes it harder to get a quick overview and understanding of any piece of code.\n</p>',1,NULL,'Lines of code should not be too long','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1min',NULL,NULL,'convention',0,'HTML'),(745,'S00105','S00105','squid','<p>\nDevelopers should not need to configure the tab width of their text editors in order to be able to read source code.\nSo the use of tabulation character must be banned.\n</p>',1,NULL,'Tabulation characters should not be used','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'2min',NULL,NULL,'convention',0,'HTML'),(746,'S1134','S1134','squid','<p>\n<code>FIXME</code> tags are commonly used to mark places where a bug is suspected, but which the developer wants to deal with later.\nSometimes the developer will not have the time or will simply forget to get back to that tag.\nThis rule is meant to track those tags, and ensure that they do not go unnoticed.\n</p>\n\n<p>The following code illustrates this rule:</p>\n\n<pre>\nint divide(int numerator, int denominator) {\n  return numerator / denominator;              // FIXME denominator = 0, Non-Compliant\n}\n</pre>',2,NULL,'FIXME tags should be handled','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,NULL,0,'HTML'),(747,'S00104','S00104','squid','<p>\nA source file that grows too much tends to aggregate too many responsibilities and inevitably becomes harder to understand and therefore to maintain.\nAbove a specific threshold, it is strongly advised to refactor it into smaller pieces of code which focus on well defined tasks.\nThose smaller files will not only be easier to understand but also probably easier to test.\n</p>',2,NULL,'Files should not have too many lines','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,'brain-overload',0,'HTML'),(748,'S1135','S1135','squid','<p>\n<code>TODO</code> tags are commonly used to mark places where some more code is required, but which the developer wants to implement later.\nSometimes the developer will not have the time or will simply forget to get back to that tag.\nThis rule is meant to track those tags, and ensure that they do not go unnoticed.\n</p>\n\n<p>The following code illustrates this rule:</p>\n\n<pre>\nvoid doSomething() {\n  // TODO\n}\n</pre>',0,NULL,'TODO tags should be handled','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,NULL,0,'HTML'),(749,'S00122','S00122','squid','<p>\nFor better readability, do not put more than one statement on a single line.\n</p>\n\n<p>\nThe following code snippet illustrates this rule:\n</p>\n<pre>\na = \"something\"; b = \"somethingElse\"; // Non-Compliant\nc = \"anotherThing\"; // Compliant\n</pre>',2,NULL,'Statements should be on separate lines','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1min',NULL,NULL,'convention',0,'HTML'),(750,'S1197','S1197','squid','<p>\nArray designators should always be located on the type for better code readability.\nOtherwise, developers must look both at the type and the variable name to know whether or not a variable is an array.\n</p>\n\n<p>The following code snippet illustrates this rule:</p>\n\n<pre>\nint matrix[][];   // Non-Compliant\nint[] matrix[];   // Non-Compliant\nint[][] matrix;   // Compliant\n</pre>',1,NULL,'Array designators \"[]\" should be on the type, not the variable','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'convention',0,'HTML'),(751,'S00120','S00120','squid','<p>\nSharing some naming conventions is a key point to make it possible for a team to efficiently collaborate. This rule allows to check that all package names match a provided regular expression.\n</p>\n\n<p>\nThe following code snippet illustrates this rule when the regular expression value is \"^[a-z]+(\\\\.[a-z][a-z0-9]*)*$\":\n</p>\n<pre>\npackage org.Example; // Non-Compliant\n\npackage org.example; // Compliant\n</pre>',2,NULL,'Package names should comply with a naming convention','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'convention',0,'HTML'),(752,'S1199','S1199','squid','<p>\nNested code blocks can be used to create a new scope and restrict the visibility of the variables defined within.\nUsing this feature in a method typically indicates that it takes on too many responsibilities, and should be refactored into smaller ones.\n</p>\n\n<p>The following code:</p>\n\n<pre>\npublic void evaluate(int operator) {\n  switch (operator) {\n    /* ... */\n    case ADD: {                                // Non-Compliant - nested code block \'{\' ... \'}\'\n        int a = stack.pop();\n        int b = stack.pop();\n        int result = a + b;\n        stack.push(result);\n        break;\n      }\n    /* ... */\n  }\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\npublic void evaluate(int operator) {\n  switch (operator) {\n    /* ... */\n    case ADD:                                  // Compliant\n      evaluateAdd();\n      break;\n    /* ... */\n  }\n}\n\nprivate void evaluateAdd() {\n  int a = stack.pop();\n  int b = stack.pop();\n  int result = a + b;\n  stack.push(result);\n}\n</pre>',2,NULL,'Nested code blocks should not be used','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(753,'S00121','S00121','squid','<p>\nNot using curly braces could be error-prone in some cases. For instance in the following example, the two statements seems to be attached to the if statement whereas this is the case only for the first one:\n</p>\n<pre>\nif (condition) // Non-Compliant\n  executeSomething();\n  checkSomething();\n\nif (condition) { // Compliant\n  executeSomething();\n}\ncheckSomething();\n</pre>',2,NULL,'if/else/for/while/do statements should always use curly braces','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'convention',0,'HTML'),(754,'CycleBetweenPackages','CycleBetweenPackages','squid','<p>\nWhen several packages are involved in a cycle (package A > package B > package C > package A where \">\" means \"depends upon\"),\nthat means that those packages are highly coupled and that there is no way to reuse/extract one of those packages without importing all the other packages.\nSuch cycle could quickly increase the effort required to maintain an application and to embrace business change.\nSonarQube not only detect cycles between packages but also determines what is the minimum effort to break those cycles.\nThis rule logs an issue on each source file having an outgoing dependency to be cut in order to break a cycle.\n</p>',2,NULL,'Avoid cycle between java packages','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,24,NULL,'LINEAR',NULL,'1d',NULL,NULL,NULL,NULL,NULL,0,'HTML'),(755,'S1149','S1149','squid','<p>\nEarly classes of the Java API, such as <code>Vector</code>, <code>Hashtable</code> and <code>StringBuffer</code>, were synchronized to make them thread-safe.\nUnfortunately, synchronization has a big negative impact on performance, even when using these collections from a single thread.\n</p>\n\n<p>It is better to use their new unsynchronized replacements:</p>\n\n<ul>\n  <li><code>ArrayList</code> or <code>LinkedList</code> instead of <code>Vector</code></li>\n  <li><code>Deque</code> instead of <code>Stack</code></li>\n  <li><code>HashMap</code> instead of <code>Hashtable</code></li>\n  <li><code>StringBuilder</code> instead of <code>StringBuffer</code></li>\n</ul>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\nVector cats = new Vector();\n</pre>\n\n<h2>Compliant Solution</h2>\n\n<pre>\nArrayList cats = new ArrayList(); \n</pre>\n\n<h2>Exceptions</h2>\n\n<p>Use of those synchronized classes is allowed in method signatures when overriding an existing method.</p>\n\n<pre>\n@Override\npublic Vector getCats() {...} \n</pre>',2,NULL,'Synchronized classes Vector, Hashtable, Stack and StringBuffer should not be used','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,22,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,NULL,0,'HTML'),(756,'LeftCurlyBraceEndLineCheck','LeftCurlyBraceEndLineCheck','squid','<p>\nSharing some coding conventions is a key point to make it possible for a team to efficiently collaborate.\nThis rule make it mandatory to place left curly braces at the end of lines of code.\n</p>\n\n<p>\nThe following code snippet illustrates this rule:\n</p>\n\n<pre>\npublic void myMethod() {              // Compliant\n  if(something)\n  {                                   // Non-Compliant\n    executeTask();\n  } else {                            // Compliant\n    doSomethingElse();\n  }\n  if( param1 && param2 && param3\n    && something3 && something4)\n  {                                   // Non-Compliant\n    executeAnotherTask();\n  }\n}\n</pre>',2,NULL,'Left curly braces should be located at the end of lines of code','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1min',NULL,NULL,'convention',0,'HTML'),(757,'RightCurlyBraceStartLineCheck','RightCurlyBraceStartLineCheck','squid','<p>\nSharing some coding conventions is a key point to make it possible for a team to efficiently collaborate.\nThis rule make it mandatory to place right curly braces at the beginning of lines of code.\n</p>\n\n<p>\nThe following code snippet illustrates this rule:\n</p>\n\n<pre>\npublic void myMethod() {\n  if(something) {\n    executeTask();}                   // Non-Compliant\n  else if (somethingElse) {\n    doSomethingElse();\n  }                                   // Compliant\n\n  try {\n    generateOrder();\n  } finally {                         // Compliant\n    closeConnection();\n  }                                   // Compliant\n\n  try {\n    generateOrder();\n  } finally {                         // Compliant\n    closeConnection(); }              // Non-Compliant\n}\n</pre>',2,NULL,'Right curly braces should be located at the beginning of lines of code','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1min',NULL,NULL,'convention',0,'HTML'),(758,'S1141','S1141','squid','<p>\nNesting <code>try-catch</code> blocks severely impacts the readability of source code because it makes it to difficult to understand which block will catch which exception.\n</p>\n\n<p>The following code:</p>\n\n<pre>\ntry {\n  try {                                     // Non-Compliant\n    doSomething();\n  } catch (RuntimeException e) {\n    /* Ignore */\n  }\n\n  doSomethingElse();\n} catch (Exception e) {\n  /* ... */\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\ntry {\n  dedicatedMethod();                        // Compliant\n  doSomethingElse();\n} catch (Exception e) {\n  /* ... */\n}\n\n/* ... */\n\nprivate void dedicatedMethod() {\n  try {                                     // Compliant\n    doSomething();\n  } catch (RuntimeException e) {\n    /* Ignore */\n  }\n}\n</pre>',2,NULL,'Try-catch blocks should not be nested','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,NULL,0,'HTML'),(759,'S1444','S1444','squid','<p>There is no good reason to declare a field \"public\" and \"static\" without also declaring it \"final\". Most of the time this is a kludge to share a state among several objects. But with this approach, any object can do whatever it wants with the shared state, such as setting it to <code>null</code>.</p>\n\n<h2>Noncompliant Code Example</h2>\n<pre>\npublic class Greeter {\npublic static var foo:Foo = new Foo(...);\n...\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n<pre>\npublic class Greeter {\npublic static const FOO:Foo = new Foo(...);\n...\n}\n</pre>',2,NULL,'\"public static\" fields should always be constant','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,NULL,0,'HTML'),(760,'S00119','S00119','squid','<p>\nSharing some naming conventions is a key point to make it possible for a team to efficiently collaborate. This rule allows to check that all type parameter names match a provided regular expression.\n</p>\n\n<p>\nThe following code snippet illustrates this rule when the regular expression value is \"^[A-Z]$\":\n</p>\n<pre>\nclass MyClass&lt;TYPE&gt; { // Non-Compliant\n  &lt;TYPE&gt; void addAll(Collection&lt;TYPE&gt; c) { // Non-compliant\n  }\n}\n\npublic class MyClass&lt;T&gt; { // Compliant\n  &lt;T&gt; void addAll(Collection&lt;T&gt; c) { // Compliant\n  }\n}\n</pre>',2,NULL,'Type parameter names should comply with a naming convention','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'convention',0,'HTML'),(761,'S1142','S1142','squid','<p>\nHaving too many return statements in a method increases the method\'s essential complexity because the flow of execution is broken each time a return statement is encountered.\nThis makes it harder to read and understand the logic of the method.\n</p>\n\n<p>\nThe following code snippet illustrates this rule with the default threshold of 3:\n</p>\n\n<pre>\npublic boolean myMethod() { // Non-Compliant as there are 4 return statements\n  if (condition1) {\n    return true;\n  } else {\n    if (condition2) {\n      return false;\n    } else {\n      return true;\n    }\n  }\n  return false;\n}\n</pre>',2,NULL,'Methods should not contain too many return statements','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,39,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'brain-overload',0,'HTML'),(762,'S00118','S00118','squid','<p>\nSharing some naming conventions is a key point to make it possible for a team to efficiently collaborate.\nThis rule allows to check that all abstract class names match a provided regular expression and non-abstract classes not match.\n</p>\n\n<p>\nThe following code snippet illustrates this rule when the regular expression value is \"^Abstract[A-Z][a-zA-Z0-9]*$\":\n</p>\n<pre>\nabstract class MyClass { // Non-Compliant\n}\n\nclass AbstractLikeClass { // Non-Compliant\n}\n\nabstract class AbstractClass { // Compliant\n}\n</pre>',2,NULL,'Abstract class names should comply with a naming convention','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'convention',0,'HTML'),(763,'S1143','S1143','squid','<p>\nReturning from a <code>finally</code> block suppresses the propagation of any unhandled <code>Throwable</code> which was thrown in the <code>try</code> or <code>catch</code> block.\n</p>\n\n<p>\nThe following code snippet illustrates this rule.\nThe developer expects to get \"ERROR\" in the console whereas \"OK\" is displayed.\n</p>\n\n<pre>\npublic static void main(String[] args) {\n  try {\n    doSomethingWhichThrowsException();\n    System.out.println(\"OK\");\n  } catch (RuntimeException e) {\n    System.out.println(\"ERROR\");\n  }\n}\n\npublic static void doSomethingWhichThrowsException() {\n  try {\n    throw new RuntimeException();\n  } finally {\n    /* ... */\n    return;                                        // Non-Compliant - prevents the RuntimeException from being propagated\n  }\n}\n</pre>',4,NULL,'Return statements should not occur in finally blocks','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'bug',0,'HTML'),(764,'S1191','S1191','squid','<p>\nClasses in <code>com.sun.*</code> and <code>sun.*</code> packages are considered implementation details, and are not part of the Java API.\nThey can cause problems when moving to new versions of Java because there is no backwards compatibility guarantee.\nSuch classes are almost always wrapped by Java API classes that should be used instead.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\nimport com.sun.jna.Native;     // Non-Compliant\nimport sun.misc.BASE64Encoder; // Non-Compliant\n</pre>',2,NULL,'Classes from \"com.sun.*\" and \"sun.*\" packages should not be used','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,5,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1h',NULL,NULL,NULL,0,'HTML'),(765,'S00117','S00117','squid','<p>\nSharing some naming conventions is a key point to make it possible for a team to efficiently collaborate. This rule allows to check that all local variable and method parameter names match a provided regular expression.\n</p>\n\n<p>\nThe following code snippet illustrates this rule when the regular expression value is \"^[a-z][a-zA-Z0-9]*$\":\n</p>\n\n<pre>\npublic class MyClass {\n  public void method() {\n    int FIRST;                      // Non-Compliant\n    int second;                     // Compliant\n  }\n\n  public void method2(int VALUE) {  // Non-Compliant\n  }\n\n  public void method3(int value) {  // Compliant\n  }\n}\n</pre>',2,NULL,'Local variable and method parameter names should comply with a naming convention','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'convention',0,'HTML'),(766,'S1190','S1190','squid','<p>\nAs of Java 5, <code>enum</code> is a keyword and can therefore no longer be used a variable names for instance.\nRecent versions of the Java compiler will generate errors while compiling code still using <code>enum</code> as a name.\n</p>\n\n<p>The following code snippet illustrates this rule:</p>\n\n<pre>\npublic void doSomething() {\n  int enum = 42;            // Non-Compliant\n}\n</pre>',2,NULL,'\"enum\" should no longer be used as a name','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,5,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(767,'S00116','S00116','squid','<p>\nSharing some naming conventions is a key point to make it possible for a team to efficiently collaborate. This rule allows to check that all field names match a provided regular expression.\n</p>\n\n<p>\nThe following code snippet illustrates this rule when the regular expression value is \"^[a-z][a-zA-Z0-9]*$\":\n</p>\n<pre>\npublic class MyClass {\n  public int FIRST = 1; // Non-Compliant\n  public int second = 2; // Compliant\n}\n</pre>',2,NULL,'Field names should comply with a naming convention','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'convention',0,'HTML'),(768,'S1145','S1145','squid','<p>\nIf statements with conditions that are always either true or false are not required, and make the code less readable.\n</p>\n\n<p>The following code:</p>\n\n<pre>\npublic void myMethod() {\n  if (true) {                   // Non-Compliant\n    doSomething();\n  }\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\npublic void myMethod() {\n  doSomething();                // Compliant\n}\n</pre>\n\n<p>and the following code:</p>\n\n<pre>\npublic void myMethod() {\n  if (false) {                  // Non-Compliant\n    doSomething();\n  }\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\npublic void myMethod() {        // Compliant\n}\n</pre>',2,NULL,'If statement conditions should not always evaluate to \"true\" or to \"false\"','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(769,'S1193','S1193','squid','<p>\nMultiple catch blocks of the appropriate type should be used instead of catching a general exception, and then testing on the type.\n</p>\n\n<p>For example, following code:</p>\n\n<pre>\ntry {\n  /* ... */\n} catch (Exception e) {\n  if(e instanceof IOException) { /* ... */ }         // Non-Compliant\n  if(e instanceof NullPointerException{ /* ... */ }  // Non-Compliant\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\ntry {\n  /* ... */\n} catch (IOException e) { /* ... */ }                // Compliant\n} catch (NullPointerException e) { /* ... */ }       // Compliant\n</pre>',2,NULL,'Exception types should not be tested using \"instanceof\" in catch blocks','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,13,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'error-handling',0,'HTML'),(770,'S109','S109','squid','<p>A magic number is a number that comes out of nowhere, and is directly used in a statement. Magic numbers are often used, for instance to limit the number of iterations of a loops, to test the value of a property, etc.</p>\n\n<p>Using magic numbers may seem obvious and straightforward when you\'re writing a piece of code, but they are much less obvious and straightforward at debugging time.</p>\n\n<p>That is why magic numbers must be demystified by first being assigned to clearly named constants before being used.</p>\n\n<p>-1, 0 and 1 are not considered magic numbers.</p>\n\n<h2>Noncompliant Code Sample</h2>\n\n<pre>\npublic static void doSomething() {\n  for(int i = 0; i < 4; i++){                 //Non-Compliant, 4 is a magic number\n  ...\n  }\n}\n</pre>\n\n<h2>Compliant Solution</h2>\n\n<pre>\npublic static final int NUMBER_OF_CYCLES = 4;\npublic static void doSomething() {\n  for(int i = 0; i < NUMBER_OF_CYCLES ; i++){   //Compliant\n    ...\n  }\n}\n</pre>',1,NULL,'Magic numbers should not be used','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,25,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,NULL,0,'HTML'),(771,'LeftCurlyBraceStartLineCheck','LeftCurlyBraceStartLineCheck','squid','<p>\nSharing some coding conventions is a key point to make it possible for a team to efficiently collaborate.\nThis rule make it mandatory to place left curly braces at the beginning of lines of code.\n</p>\n\n<p>\nThe following code snippet illustrates this rule:\n</p>\n\n<pre>\npublic void myMethod\n{                                               // Compliant\n  if(something)\n  {                                             // Compliant\n    executeTask();\n  } else {                                      // Non-Compliant\n    doSomethingElse();\n  }\n}\n</pre>',2,NULL,'Left curly braces should be located at the beginning of lines of code','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'1min',NULL,NULL,'convention',0,'HTML'),(772,'S00115','S00115','squid','<p>\nSharing some naming conventions is a key point to make it possible for a team to efficiently collaborate. This rule allows to check that all constant names match a provided regular expression.\n</p>\n\n<p>\nThe following code snippet illustrates this rule when the regular expression value is \"^[A-Z][A-Z0-9]*(_[A-Z0-9]+)*$\":\n</p>\n<pre>\npublic class MyClass {\n  public static final int first = 1; // Non-Compliant\n  public static final int SECOND = 2; // Compliant\n}\n\npublic enum MyEnum {\n  first, // Non-Compliant\n  SECOND; // Compliant\n}\n</pre>',2,NULL,'Constant names should comply with a naming convention','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'convention',0,'HTML'),(773,'S1192','S1192','squid','<p>\n  Duplicated string literals make the process of refactoring error-prone, since you must be sure to update all occurrences.\n  On the other hand, constants can be referenced from many places, but only need to be updated in a single place.\n</p>\n\n<h2>Non Compliant Code Example</h2>\n\n<pre>\npublic void run() {\n  prepare(\"action1\");                              // Non-Compliant - \"action1\" is duplicated 3 times\n  execute(\"action1\");\n  release(\"action1\");\n}\n\n@SuppressWarning(\"all\")                            // Compliant - annotations are excluded\nprivate void method1() { /* ... */ }\n@SuppressWarning(\"all\")\nprivate void method2() { /* ... */ }\n\npublic String method3(String a) {\n  System.out.println(\"\'\" + a + \"\'\");               // Compliant - literal \"\'\" has less than 5 characters and is excluded\n  return \"\";                                       // Compliant - literal \"\" has less than 5 characters and is excluded\n}\n</pre>\n\n<h2>Compliant Code Example</h2>\n\n<pre>\nprivate static final String ACTION_1 = \"action1\";  // Compliant\n\npublic void run() {\n  prepare(ACTION_1);                               // Compliant\n  execute(ACTION_1);\n  release(ACTION_1);\n}\n</pre>\n\n<h2>Exceptions</h2>\n<p>To prevent generating some false-positives, literals having less than 5 characters are excluded.</p>',1,NULL,'String literals should not be duplicated','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,29,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(774,'S00114','S00114','squid','<p>\nSharing some naming conventions is a key point to make it possible for a team to efficiently collaborate. This rule allows to check that all interface names match a provided regular expression.\n</p>\n\n<p>\nThe following code snippet illustrates this rule when the regular expression value is \"^[A-Z][a-zA-Z0-9]*$\":\n</p>\n<pre>\npublic interface MyFirstInterface {...} // Compliant\npublic interface mySecondInterface {...} // Non-Compliant\n</pre>',2,NULL,'Interface names should comply with a naming convention','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,'convention',0,'HTML'),(775,'S1147','S1147','squid','<p>\nCalling <code>System.exit(int status)</code> or <code>Rutime.getRuntime().exit(int status)</code> leads to the shut down of the entire Java virtual machine.\nIt should be used with care, when stopping the whole Java process is meant.\nFor instance, it should not be called from applications running in a J2EE container.\n</p>\n\n<h2>Noncompliant Code Example</h2>\n\n<pre>\nSystem.exit(0);\nRuntime.getRuntime().exit(0);\n</pre>',3,NULL,'System.exit(...) and Runtime.getRuntime().exit(...) should not be called','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,28,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'20min',NULL,NULL,NULL,0,'HTML'),(776,'S106','S106','squid','<p>Two important requirements must be fulfilled when logging messages:</p>\n\n<ul>\n  <li>The user must be able to easily retrieve the logs.</li>\n  <li>The format of all messages must be uniform to enable users to easily browse them.</li>\n</ul>\n\n<p>\nIf a program directly writes to the standard output, there is absolutely no way to comply with these requirements.\nThat\'s why defining and using a dedicated logger is highly recommended.\n</p>\n\n<p>\nThe following code snippet illustrates this rule:\n</p>\n\n<pre>\nSystem.out.println(\"My Message\");  // Non-Compliant\n\nlogger.log(\"My Message\");          // Compliant\n</pre>',2,NULL,'System.out and System.err should not be used as loggers','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,16,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,NULL,0,'HTML'),(777,'S1195','S1195','squid','<p>\nAccording to the Java Language Specification:\n</p>\n\n<pre>\nFor compatibility with older versions of the Java SE platform,\nthe declaration of a method that returns an array is allowed to place (some or all of) the empty bracket pairs that form the declaration of the array type after the formal parameter list.\nThis obsolescent syntax should not be used in new code.\n</pre>\n\n<p>The following code snippet illustrates this rule:</p>\n\n<pre>\npublic int getVector()[] { /* ... */ }    // Non-Compliant\n\npublic int[] getVector() { /* ... */ }    // Compliant\n\npublic int[] getMatrix()[] { /* ... */ }  // Non-Compliant\n\npublic int[][] getMatrix() { /* ... */ }  // Compliant\n</pre>',1,NULL,'Array designators \"[]\" should be located after the type in method signatures','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,12,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'convention',0,'HTML'),(778,'ObjectFinalizeOverridenCallsSuperFinalizeCheck','ObjectFinalizeOverridenCallsSuperFinalizeCheck','squid','<p>\nOverriding the <code>Object.finalize()</code> method must be done with caution to dispose some system resources.\nCalling the <code>super.finalize()</code> at the end of this method implementation is highly recommended in case parent implementations must also dispose some system resources.\n</p>\n\n<p>\nThe following code snippet illustrates this rule:\n</p>\n\n<pre>\nprotected void finalize() {            // Non-Compliant\n  releaseSomeResources();\n}\n\nprotected void finalize() {\n  super.finalize();                    // Non-Compliant\n  releaseSomeResources();\n}\n\nprotected void finalize() {\n  releaseSomeResources();\n  super.finalize();                    // Compliant\n}\n</pre>',4,NULL,'super.finalize() should be called at the end of Object.finalize() implementations','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,32,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'bug',0,'HTML'),(779,'S00113','S00113','squid','<p>\nSome tools such as Git work better when files end with an empty line.\nThis rule simply generates an issue if it is missing.\n</p>\n\n<p>For example, a Git diff look like:</p>\n\n<pre>\n+class Test {\n+}\n\\ No newline at end of file\n</pre>\n\n<p>if the empty line is missing at the end of the file.</p>',1,NULL,'Files should contain an empty new line at the end','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,8,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'5min',NULL,NULL,'convention',0,'HTML'),(780,'S1148','S1148','squid','<p>\n<code>Throwable.printStackTrace(...)</code> prints a throwable and its stack trace to some stream.\n</p>\n\n<p>Loggers should be used instead to print throwables, as they have many advantages:</p>\n<ul>\n  <li>Users are able to easily retrieve the logs.</li>\n  <li>The format of log messages is uniform and allow users to browse the logs easily.</li>\n</ul>\n\n<p>The following code:</p>\n\n<pre>\ntry {\n  /* ... */\n} catch(Exception e) {\n  e.printStackTrace();        // Non-Compliant\n}\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\ntry {\n  /* ... */\n} catch(Exception e) {\n  LOGGER.log(\"context\", e);   // Compliant\n}\n</pre>',3,NULL,'Throwable.printStackTrace(...) should never be called','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,30,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'error-handling',0,'HTML'),(781,'S1194','S1194','squid','<p>\n<code>java.lang.Error</code> and its subclasses represent abnormal conditions, such as <code>OutOfMemoryError</code>, which should only be encountered by the Java Virtual Machine.\n</p>\n\n<p>The following code snippet:</p>\n\n<pre>\npublic class MyException extends Error { /* ... */ }       // Non-Compliant\n</pre>\n\n<p>should be refactored into:</p>\n\n<pre>\npublic class MyException extends Exception { /* ... */ }   // Compliant\n</pre>',2,NULL,'\"java.lang.Error\" should not be extended','READY','java','2014-11-26 15:18:34','2014-11-26 15:18:34',NULL,NULL,NULL,NULL,NULL,30,NULL,'CONSTANT_ISSUE',NULL,NULL,NULL,'10min',NULL,NULL,'error-handling',0,'HTML');
/*!40000 ALTER TABLE `rules` ENABLE KEYS */;
UNLOCK TABLES;

