ervice;\n\nimport javax.servlet.http.HttpServletRequest;\nimport javax.servlet.http.HttpServletResponse;\n\n/**\n * An interceptor to log all the requests.\n */\npublic class RequestInterceptor extends HandlerInterceptorAdapter {\n    @Autowired\n    private UserService userService;\n    private static final Logger logger = Logger.getLogger(RequestInterceptor.class);\n    @Override\n    public boolean preHandle(HttpServletRequest request,\n                             HttpServletResponse response, Object handler) throws Exception {\n\n        long startTime = System.currentTimeMillis();\n        String url = request.getRequestURL().toString();\n        try {\n            String userLogin = ((User) request.getSession().getAttribute(\"currentUserU\")).getLogin();\n            logger.info(\"User \" + userLogin + \" requested URL::\" + url);\n            request.setAttribute(\"startTime\", startTime);\n        }\n        //if returned false, we need to make sure \'response\' is sent\n        catch (Exception ex) {\n            logger.info(\"No user found while requesting the URL::\" + url);\n            try {\n                org.springframework.security.core.userdetails.User user = (org.springframework.security.core.userdetails.User) SecurityContextHolder.getContext().getAuthentication().getPrincipal();\n                User currentUser = userService.getUserByLogin(user.getUsername());\n                request.getSession().setAttribute(\"currentUserU\", currentUser);\n            }\n            catch (Exception exception) {\n                return true;\n            }\n        }\n        return true;\n    }\n\n    @Override\n    public void postHandle(HttpServletRequest request,\n                           HttpServletResponse response, Object handler, ModelAndView modelAndView) throws Exception {\n        System.out.println(\"Request URL::\" + request.getRequestURL().toString()\n                + \" Sent to Handler\");\n        //we can add attributes in the modelAndView and use that in the view page\n    }\n\n    @Override\n    public void afterCompletion(HttpServletRequest request,\n                                HttpServletResponse response, Object handler, Exception ex)\n            throws Exception {\n        long startTime = (Long) request.getAttribute(\"startTime\");\n        logger.info(\"Request URL dispatching time taken::\" + (System.currentTimeMillis() - startTime));\n    }\n}\n'),(51,64,'package ru.tsystems.tproject.utils;\n\nimport org.apache.log4j.Logger;\n\nimport java.text.SimpleDateFormat;\n\n/**\n * Created by german on 15.11.14.\n */\n\npublic class Test {\n    private static Logger logger = Logger.getLogger(Test.class);\n    private static final SimpleDateFormat dateFormat = new SimpleDateFormat(\"dd.MM.yyyy\");\n    public static void main(String[] args) {\n\n    }\n\n    }\n\n'),(52,66,'package ru.tsystems.tproject.integration.injection;\n\nimport static org.junit.Assert.*;\nimport org.junit.Test;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.test.context.ContextConfiguration;\nimport org.springframework.test.context.junit4.AbstractJUnit4SpringContextTests;\nimport ru.tsystems.tproject.DAO.API.*;\nimport ru.tsystems.tproject.services.API.*;\n\nimport javax.persistence.EntityManager;\nimport javax.persistence.PersistenceContext;\n\n/**\n * A test of entity manager injection.\n */\n@ContextConfiguration(locations = \"/spring.xml\")\npublic class DependencyInjectionTest extends AbstractJUnit4SpringContextTests {\n\n    @PersistenceContext\n    private EntityManager entityManager;\n    @Autowired\n    private UserService userService;\n    @Autowired\n    private TariffService tariffService;\n    @Autowired\n    private ContractService contractService;\n    @Autowired\n    private RoleService roleService;\n    @Autowired\n    private OptionService optionService;\n    @Autowired\n    private UserDAO userDAO;\n    @Autowired\n    private TariffDAO tariffDAO;\n    @Aut