a user by a specified number.\n     * @param number of the user\'s contract\n     * @return a user\n     * @throws CustomDAOException\n     */\n\n    public User getUserByNumber(long number) throws UserNotFoundException;\n\n    /**\n     * Gets a user by a specified login.\n     * @param login of a user\n     * @return a user\n     * @throws CustomDAOException\n     */\n\n    public User getUserByLogin(String login) throws UserNotFoundException;\n\n}\n'),(540,689,'package ru.tsystems.tproject.DAO.implementation;\n\nimport org.springframework.stereotype.Repository;\nimport ru.tsystems.tproject.DAO.API.ContractDAO;\nimport ru.tsystems.tproject.entities.Contract;\nimport ru.tsystems.tproject.exceptions.ContractNotFoundException;\nimport ru.tsystems.tproject.exceptions.ContractsForEntityNotGotException;\nimport ru.tsystems.tproject.exceptions.CustomDAOException;\n\nimport javax.persistence.EntityManager;\nimport javax.persistence.PersistenceContext;\nimport javax.persistence.PersistenceException;\nimport java.util.List;\nimport javax.persistence.Query;\n\n/**\n * An implementation of a ContractDAO API.\n */\n@Repository(\"contractDAO\")\npublic class ContractDAOImplementation extends GenericDAOImplementation<Contract, Integer> implements ContractDAO {\n    @PersistenceContext\n    private EntityManager entityManager;\n\n    /**\n     * Gets contract by a specified number.\n     * @param number - a number of the contract\n     * @return contract\n     * @throws CustomDAOException\n     */\n    @Override\n    public Contract getContractByNumber(long number) throws ContractNotFoundException {\n        try {\n            return (Contract) entityManager.createQuery(\"select c from Contract c where c.number=:number\").setParameter(\"number\", number).getSingleResult();\n        } catch (PersistenceException e) {\n            throw new ContractNotFoundException(\"Contract with number \" + number + \" not got\", e);\n        }\n    }\n    @SuppressWarnings(\"unchecked\")\n    @Override\n    public List<Contract> getAllContractsForUser(int id) throws ContractsForEntityNotGotException {\n        try{\n            Query query = entityManager.createQuery(\"select u.contracts from User u where u.id=:id\").setParameter(\"id\", id);\n\n            return (List<Contract>)query.getResultList();\n        } catch (PersistenceException ex)\n        {\n            throw new ContractsForEntityNotGotException(\"Contracts for user \" + id + \" not got\", ex);\n        }\n    }\n\n}\n'),(541,690,'package ru.tsystems.tproject.DAO.implementation;\n\nimport ru.tsystems.tproject.DAO.API.GenericDAO;\nimport ru.tsystems.tproject.exceptions.CustomDAOException;\n\nimport javax.persistence.EntityManager;\nimport javax.persistence.PersistenceContext;\nimport javax.persistence.PersistenceException;\nimport java.lang.reflect.ParameterizedType;\nimport java.util.List;\n\n/**\n * A generic DAO Implementation of main operations.\n */\n\npublic abstract class GenericDAOImplementation<E, K> implements GenericDAO<E, K> {\n    protected Class<E> daoType;\n\n    @SuppressWarnings(\"unchecked\")\n    public GenericDAOImplementation() {\n        daoType = (Class<E>) ((ParameterizedType) getClass().getGenericSuperclass())\n                .getActualTypeArguments()[0];\n    }\n\n    @PersistenceContext\n    private EntityManager entityManager;\n\n    @Override\n    public void create(E entity) throws CustomDAOException {\n        try {\n            this.entityManager.persist(entity);\n        } catch (PersistenceException ex)\n        {\n            throw new CustomDAOException(\"Entity not created: \" + entity, ex);\n        }\n    }\n\n    @Override\n    public E read(K id) throws CustomDAOException {\n        try {\n            return (E)this.entityManager.find(daoType, id);\n        } catch (PersistenceException ex) {\n            throw new CustomDAOException(\"Entity with id \" + id + \" not found\", ex);\n        }\n    }\n\n    @Override\n    public void update(E entity) throws CustomDAOException {\n        try {\n            this.entityManager.merge(entity);\n        } catch (PersistenceException ex) {\n            throw new CustomDAOException(\"Entity not updated: \" + entity, ex);\n        }\n\n    }\n\n    @Override\n    public void delete(E entity) throws CustomDAOException {\n        try {\n            this.entityManager.remove(entityManager.merge(entity));\n        } catch (PersistenceException ex) {\n            throw new CustomDAOException(\"Entity not deleted: \" + entity, ex);\n        }\n\n    }\n    @Override\n    public List<E> getAll() throws CustomDAOException {\n        try {\n            return this.entityManager.createNamedQuery(daoType.getSimpleName() + \".getAll\", daoType).getResultList();\n        } catch (PersistenceException ex) {\n            throw new CustomDAOException(\"Unable to get all entities of class \" + daoType.getSimpleName(), ex);\n        }\n    }\n\n\n}\n'),(542,691,'package ru.tsystems.tproject.DAO.implementation;\n\nimport org.springframework.stereotype.Repository;\nimport ru.tsystems.tproject.DAO.API.OptionDAO;\nimport ru.tsystems.tproject.entities.Option;\nimport ru.tsystems.tproject.exceptions.CustomDAOException;\nimport ru.tsystems.tproject.exceptions.OptionsForEntityNotGotException;\n\nimport javax.persistence.PersistenceContext;\nimport javax.persistence.Query;\nimport javax.persistence.EntityManager;\nimport javax.persistence.PersistenceException;\nimport java.util.List;\n\n/**\n * An implementation of OptionDAO API.\n */\n@Repository(\"optionDAO\")\npublic class OptionDAOImplementation extends GenericDAOImplementation<Option, Integer> implements OptionDAO {\n    @PersistenceContext\n    private EntityManager entityManager;\n\n    /**\n     * Gets all available options for a specified tariff.\n     * @param id - id of the tariff\n     * @return a list of options for the tariff\n     * @throws CustomDAOException\n     */\n    @SuppressWarnings(\"unchecked\")\n    @Override\n    public List<Option> getAllOptionsForTariff(int id) throws OptionsForEntityNotGotException {\n        try{\n            Query query = entityManager.createQuery(\"select t.possibleOptions from Tariff t where t.id=:id\").setParameter(\"id\", id);\n\n            return (List<Option>)query.getResultList();\n        } catch (PersistenceException ex)\n        {\n            throw new OptionsForEntityNotGotException(\"Options for tariff \" + id + \" not got\", ex);\n        }\n    }\n    @SuppressWarnings(\"unchecked\")\n    @Override\n    public List<Option> getAllOptionsForContract(int id) throws OptionsForEntityNotGotException{\n        try{\n            Query query = entityManager.createQuery(\"select c.options from Contract c where c.id=:id\").setParameter(\"id\", id);\n\n            return (List<Option>)query.getResultList();\n        } catch (PersistenceException ex)\n        {\n            throw new OptionsForEntityNotGotException(\"Options for contract \" + id + \" not got\", ex);\n        }\n    }\n    @SuppressWarnings(\"unchecked\")\n    @Override\n    public List<Option> getAllOptionsTogetherForOption(int id) throws OptionsForEntityNotGotException{\n        try{\n            Query query = entityManager.createQuery(\"select opt.optionsTogether from Option opt where opt.id=:id\").setParameter(\"id\", id);\n\n            return (List<Option>)query.getResultList();\n        } catch (PersistenceException ex)\n        {\n            throw new OptionsForEntityNotGotException(\"Options for tariff \" + id + \" not got\", ex);\n        }\n    }\n    @SuppressWarnings(\"unchecked\")\n    @Override\n    public List<Option> getAllOptionsIncompatibleForOption(int id) throws OptionsForEntityNotGotException{\n        try{\n            Query query = entityManager.createQuery(\"select opt.optionsIncompatible from Option opt where opt.id=:id\").setParameter(\"id\", id);\n\n            return (List<Option>)query.getResultList();\n        } catch (PersistenceException ex)\n        {\n            throw new OptionsForEntityNotGotException(\"Options for tariff \" + id + \" not got\", ex);\n        }\n    }\n\n}\n'),(543,692,'package ru.tsystems.tproject.DAO.implementation;\n\nimport org.springframework.stereotype.Repository;\nimport ru.tsystems.tproject.DAO.API.RoleDAO;\nimport ru.tsystems.tproject.entities.Role;\n\n/**\n * An implementation of RoleDAO API.\n */\n@Repository(\"roleDAO\")\npublic class RoleDAOImplementation extends GenericDAOImplementation<Role, Integer> implements RoleDAO{\n\n\n}\n'),(544,693,'package ru.tsystems.tproject.DAO.implementation;\n\nimport org.springframework.stereotype.Repository;\nimport ru.tsystems.tproject.DAO.API.TariffDAO;\nimport ru.tsystems.tproject.entities.Tariff;\n\n/**\n * An implementation of TariffDAO API.\n */\n@Repository(\"tariffDAO\")\npublic class TariffDAOImplementation extends GenericDAOImplementation<Tariff, Integer> implements TariffDAO {\n\n\n}\n'),(545,694,'package ru.tsystems.tproject.DAO.implementation;\n\nimport org.springframework.stereotype.Repository;\nimport ru.tsystems.tproject.DAO.API.UserDAO;\nimport ru.tsystems.tproject.entities.User;\nimport ru.tsystems.tproject.exceptions.CustomDAOException;\nimport ru.tsystems.tproject.exceptions.UserNotFoundException;\n\nimport javax.persistence.EntityManager;\nimport javax.persistence.PersistenceContext;\nimport javax.persistence.PersistenceException;\nimport javax.persistence.Query;\n\n/**\n * An implementation of a UserDAO API.\n */\n@Repository(\"userDAO\")\npublic class UserDAOImplementation extends GenericDAOImplementation<User, Integer> implements UserDAO {\n\n    @PersistenceContext\n    private EntityManager entityManager;\n\n\n    /**\n     * Gets user by a specified number.\n     * @param number - a user contract\'s number\n     * @return user\n     * @throws CustomDAOException\n     */\n    @Override\n    public User getUserByNumber(long number) throws UserNotFoundException {\n        try {\n            Query query = entityManager.createQuery(\"select c.user from Contract c where c.number=:number\").setParameter(\"number\", number);\n            return (User) query.getSingleResult();\n        } catch (PersistenceException ex) {\n            throw new UserNotFoundException(\"User with number \" + number + \" not found\", ex);\n        }\n\n    }\n\n    /**\n     * Gets user by a specified login.\n     * @param login - a login of the user\n     * @return user\n     * @throws CustomDAOException\n     */\n   @Override\n    public User getUserByLogin(String login) throws UserNotFoundException {\n        try {\n            Query query = entityManager.createQuery(\"select u from User u where u.login=:login\").setParameter(\"login\", login);\n            return (User) query.getSingleResult();\n        } catch (PersistenceException ex) {\n            throw new UserNotFoundException(\"User with login \" + login + \" not found!\", ex);\n        }\n\n    }\n\n\n}\n'),(546,696,'package ru.tsystems.tproject.aspect;\nimport org.apache.log4j.Logger;\nimport org.aspectj.lang.JoinPoint;\nimport org.aspectj.lang.annotation.*;\nimport ru.tsystems.tproject.entities.User;\n\nimport java.util.Arrays;\n\n@Aspect\npublic class MainAspect {\n    private static final Logger LOGGER = Logger.getLogger(MainAspect.class);\n\n    @Pointcut(\"execution(* ru.tsystems.tproject.services.API..create*(*))\")\n    public void createEntityPointcut(){\n        //a general pointcut of creation\n    }\n    @Pointcut(\"execution(* ru.tsystems.tproject.services.API..get*(..))\")\n    public void getEntityPointcut(){\n        //a general pointcut of getting\n    }\n    @Pointcut(\"execution(* ru.tsystems.tproject.services.API..update*(*))\")\n    public void updateEntityPointcut(){\n        //a general pointcut of updating\n    }\n    @Pointcut(\"execution(* ru.tsystems.tproject.services.API..delete*(*))\")\n    public void deleteEntityPointcut(){\n        //a general pointcut of deleting\n    }\n\n\n    @Before(\"createEntityPointcut()\")\n    public void loggingBeforeCreateActionAdvice(JoinPoint joinPoint) {\n        LOGGER.info(String.format(\"A method: {%s} is called, arguments passed: {%s}\", joinPoint.toString(), Arrays.toString(joinPoint.getArgs())));\n    }\n    @After(\"createEntityPointcut()\")\n    public void loggingAfterCreateActionAdvice(JoinPoint joinPoint) {\n        LOGGER.info(String.format(\"Entity %s is successfully created\", Arrays.toString(joinPoint.getArgs())));\n    }\n\n    @Before(\"getEntityPointcut()\")\n    public void loggingBeforeGetActionAdvice(JoinPoint joinPoint) {\n        LOGGER.info(String.format(\"A method: {%s} is called, arguments passed: {%s}\", joinPoint.toString(), Arrays.toString(joinPoint.getArgs())));\n    }\n    @AfterReturning(pointcut = \"getEntityPointcut()\", returning = \"user\")\n    public void loggingAfterGetActionAdvice(User user) {\n        LOGGER.info(String.format(\"Entity/ies %s has been found\", user));\n    }\n\n    @Before(\"updateEntityPointcut()\")\n    public void loggingBeforeUpdateActionAdvice(JoinPoint joinPoint) {\n        LOGGER.info(String.format(\"A method: {%s} is called, arguments passed: {%s}\", joinPoint.toString(), Arrays.toString(joinPoint.getArgs())));\n    }\n    @After(\"updateEntityPointcut()\")\n    public void loggingAfterUpdateActionAdvice(JoinPoint joinPoint) {\n        LOGGER.info(String.format(\"Entity %s is successfully updated\", Arrays.toString(joinPoint.getArgs())));\n    }\n\n    @Before(\"deleteEntityPointcut()\")\n    public void loggingBeforeDeleteActionAdvice(JoinPoint joinPoint) {\n        LOGGER.info(String.format(\"A method: {%s} is called, arguments passed: {%s}\", joinPoint.toString(), Arrays.toString(joinPoint.getArgs())));\n    }\n    @After(\"deleteEntityPointcut()\")\n    public void loggingAfterDeleteActionAdvice(JoinPoint joinPoint) {\n        LOGGER.info(String.format(\"Entity %s is successfully deleted\", Arrays.toString(joinPoint.getArgs())));\n    }\n    @AfterThrowing(value = \"execution(* ru.tsystems.tproject.services..*(..))\", throwing = \"ex\")\n    public void logExceptions(JoinPoint joinPoint, Exception ex){\n        LOGGER.error(String.format(\"Exception thrown at the method: %s, the message is {%s}\", joinPoint.toString(), ex.getMessage()));\n        LOGGER.error(\"The stack trace is below\");\n        for (StackTraceElement b : ex.getStackTrace()) {\n            LOGGER.error(\"at \" + b);\n        }\n    }\n\n\n\n\n}\n\n'),(547,698,'package ru.tsystems.tproject.controllers;\n\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.stereotype.Controller;\nimport org.springframework.web.bind.annotation.*;\nimport ru.tsystems.tproject.entities.Option;\nimport ru.tsystems.tproject.integration.ContractValidator;\nimport ru.tsystems.tproject.services.API.OptionService;\nimport ru.tsystems.tproject.utils.locale.EnglishLanguage;\nimport ru.tsystems.tproject.utils.locale.RussianLanguage;\n\nimport javax.servlet.http.HttpServletRequest;\nimport java.util.ArrayList;\nimport java.util.List;\nimport static ru.tsystems.tproject.utils.pages.SharedPages.*;\n\n/**\n * A controller to dispatch the ajax queries.\n */\n@Controller\npublic class AjaxDispatcher {\n    @Autowired\n    private OptionService optionService;\n    @Autowired\n    private ContractValidator contractValidator;\n\n    public static final String LANGUAGE = \"language\";\n    @RequestMapping(value = GET_OPTIONS_FOR_TARIFF, method = RequestMethod.GET)\n    @ResponseBody\n    public List<Option> getOptionsForTariff(@PathVariable int tariffId) {\n        List<Option> optionList = new ArrayList<>();\n        for (Option option: optionService.getAllOptionsForTariff(tariffId)) {\n            optionList.add(new Option(option.getId(), option.getName(), option.getPrice(), option.getInitialPrice()));\n        }\n        return optionList;\n    }\n    @RequestMapping(value = GET_OPTIONS_TOGETHER, method = RequestMethod.GET)\n    @ResponseBody\n    public List<Option> getOptionsTogether(@PathVariable int optionId) {\n        List<Option> optionList = new ArrayList<>();\n        for (Option option: optionService.getAllOptionsTogetherForOption(optionId)) {\n            optionList.add(new Option(option.getId(), option.getName(), option.getPrice(), option.getInitialPrice()));\n        }\n        return optionList;\n    }\n    @RequestMapping(value = GET_OPTIONS_INCOMPATIBLE, method = RequestMethod.GET)\n    @ResponseBody\n    public List<Option> getOptionsIncompatible(@PathVariable int optionId) {\n        List<Option> optionList = new ArrayList<>();\n        for (Option option: optionService.getAllOptionsIncompatibleForOption(optionId)) {\n            optionList.add(new Option(option.getId(), option.getName(), option.getPrice(), option.getInitialPrice()));\n        }\n        return optionList;\n    }\n    @SuppressWarnings(\"unchecked\")\n    @RequestMapping(value = VALIDATE_OPTIONS, method = RequestMethod.POST)\n    @ResponseBody\n    public List<String> validateOptions(@RequestParam(value = \"cb3\", required = false) int[] array,\n                                        @RequestParam(value = \"currentUserID\", required = false) Integer userID) {\n        if (array == null || array.length == 0) return null;\n        else {\n            List returnList;\n            List<Exception> list = new ArrayList<>();\n            if (userID != null && userID !=0) {\n                returnList = contractValidator.validateOptions(array, list, userID);\n            } else {\n                returnList = contractValidator.validateOptions(array, list, 0);\n            }\n            list = (List<Exception>) returnList.get(1);\n            if (list.isEmpty()) return null;\n            else {\n                List<String> messageList = new ArrayList<>();\n                for (Exception ex: list) {\n                    messageList.add(ex.getMessage());\n                }\n                return messageList;\n            }\n        }\n    }\n    @RequestMapping(value = EN, method = RequestMethod.GET)\n    @ResponseBody\n    public String setEnglish(HttpServletRequest request) {\n        request.getSession().removeAttribute(LANGUAGE);\n        request.getSession().setAttribute(LANGUAGE, EnglishLanguage.getEnglishLanguage());\n        return \"\";\n    }\n    @RequestMapping(value = RU, method = RequestMethod.GET)\n    @ResponseBody\n    public String setRussian(HttpServletRequest request) {\n        request.getSession().removeAttribute(LANGUAGE);\n        request.getSession().setAttribute(LANGUAGE, RussianLanguage.getRussianLanguage());\n        return \"\";\n    }\n}\n'),(548,699,'\npackage ru.tsystems.tproject.controllers;\nimport static ru.tsystems.tproject.utils.pages.ClientPages.*;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.stereotype.Controller;\nimport org.springframework.ui.Model;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.RequestMethod;\nimport org.springframework.web.bind.annotation.RequestParam;\nimport ru.tsystems.tproject.entities.Contract;\nimport ru.tsystems.tproject.entities.Option;\nimport ru.tsystems.tproject.entities.Tariff;\nimport ru.tsystems.tproject.entities.User;\nimport ru.tsystems.tproject.exceptions.ScriptViolationException;\nimport ru.tsystems.tproject.integration.ContractValidator;\nimport ru.tsystems.tproject.services.API.ContractService;\nimport ru.tsystems.tproject.services.API.OptionService;\nimport ru.tsystems.tproject.services.API.TariffService;\nimport ru.tsystems.tproject.services.API.UserService;\nimport ru.tsystems.tproject.utils.locale.Translatable;\n\nimport javax.servlet.http.HttpServletRequest;\nimport java.util.ArrayList;\nimport java.util.List;\n\n/**\n * A controllers to dispatch the queries of the clients.\n */\n@Controller\npublic class ClientController {\n    @Autowired\n    private UserService userService;\n    @Autowired\n    private ContractService contractService;\n    @Autowired\n    private TariffService tariffService;\n    @Autowired\n    private ContractValidator contractValidator;\n    public static final String CURRENT_USER = \"currentUserU\";\n    public static final int AMOUNT = 100;\n\n\n    /**\n     * This method returns a main page for the user control panel.\n     * @return cp_client_main.jsp\n     */\n    @RequestMapping(value = MAIN, method = RequestMethod.GET)\n    public String getMainPage() {\n        return CLIENT + MAIN;\n    }\n\n    /**\n     * This method returns a profile page.\n     * @return cp_client_profile.jsp\n     */\n    @RequestMapping(value = PROFILE, method = RequestMethod.GET)\n    public String getProfile() {\n        return CLIENT + PROFILE;\n    }\n\n    /**\n     * This method returns a page will all the contracts of current user.\n     * @param request request;\n     * @param model model;\n     * @return cp_client_contracts.jsp\n     */\n    @RequestMapping(value = CONTRACTS, method = RequestMethod.GET)\n    public String getContracts(HttpServletRequest request, Model model) {\n        User user = (User) request.getSession().getAttribute(CURRENT_USER);\n        model.addAttribute(\"contractsUserList\", contractService.getAllContractsForUser(user.getId()));\n        return CLIENT + CONTRACTS;\n    }\n\n    /**\n     * This method returns a page where the tariff for the contract should be selected.\n     * @param contractId the contracts id;\n     * @param request request;\n     * @return cp_client_change_contract.jsp\n     */\n    @RequestMapping(value = CHANGE_CONTRACT, method = RequestMethod.GET)\n    public String changeContract(@RequestParam(value = \"contractId\") int contractId,\n                                 HttpServletRequest request) {\n        Contract contract = contractService.getEntityById(contractId);\n        User user = (User) request.getSession().getAttribute(CURRENT_USER);\n        if (!user.getContracts().contains(contract)) return CLIENT + MAIN;\n        if (contract.isBlocked()) {\n            return CLIENT + MAIN;\n        }\n        request.getSession().setAttribute(\"tariffsList\", tariffService.getAll());\n        request.getSession().setAttribute(\"contract\", contract);\n        /*request.getSession().setAttribute(\"contractNumber\", contract.getNumber());*/\n        return CLIENT + CHANGE_CONTRACT;\n    }\n\n    /**\n     * This method:\n     *              - blocks a contract, if it is not blocked;\n     *              - unblocks a contract, if it had been blocked by user;\n     *              - doesn\'t allow to do any actions, if it has been blocked by employee.\n     * @param number contracts number;\n     * @param request request;\n     * @param model model;\n     * @return cp_client_change_contract.jsp\n     */\n    @RequestMapping(value = BLOCK_CONTRACT, method = RequestMethod.GET)\n    public String blockContract(@RequestParam(value = \"contractId\") int number,\n                                HttpServletRequest request, Model model) {\n        Translatable translatable = (Translatable) request.getSession().getAttribute(\"language\");\n        Contract contract = contractService.getEntityById(number);\n        User user = (User) request.getSession().getAttribute(CURRENT_USER);\n        if (!user.getContracts().contains(contract)) return CLIENT + MAIN;\n        if (contract.isBlocked()) {\n            if (contract.getEmployee() == null) {\n                contract.setBlocked(false);\n                contractService.updateEntity(contract);\n                request.getSession().setAttribute(\"paramIsBlocked\", translatable.getJSP_CONTRACTS_UNBLOCKED());\n                request.getSession().setAttribute(\"action\", translatable.getJSP_CONTRACTS_BLOCK());\n                request.getSession().setAttribute(\"contract\", contract);\n            }\n        } else {\n            contract.setBlocked(true);\n            contractService.updateEntity(contract);\n            request.getSession().setAttribute(\"paramIsBlocked\", translatable.getJSP_CONTRACTS_BLOCKED());\n            request.getSession().setAttribute(\"action\", translatable.getJSP_CONTRACTS_UNBLOCK());\n            request.getSession().setAttribute(\"contract\", contract);\n        }\n        model.addAttribute(\"contractsUserList\", contractService.getAllContractsForUser(user.getId()));\n        return CLIENT + CONTRACTS;\n    }\n\n\n    /** This method returns a page with a bucket with selected options, if the entered data is valid, and redirects back to the page with options otherwise.\n     * The array with options\' id is validated by a contractValidator. If something is incorrect, the exception is\n     * added to the exceptionsList.\n     * @param array the array of options\' ids;\n     * @param request request;\n     * @param model model;\n     * @return cp_client_contract_change_bucket.jsp or exception.jsp\n     */\n    @SuppressWarnings(\"unchecked\")\n    @RequestMapping(value = BUCKET, method = RequestMethod.POST)\n    public String finalContractChange(@RequestParam(value = \"cb\") int tariffId,\n                                      @RequestParam(value = \"cb3\", required = false) int[] array,\n                                      HttpServletRequest request, Model model) throws Exception{\n        if (((Contract) request.getSession().getAttribute(\"contract\")).isBlocked()) {\n            return CLIENT + MAIN;\n        }\n        User user = (User) request.getSession().getAttribute(CURRENT_USER);\n        Tariff tariff = tariffService.getEntityById(tariffId);\n        Contract contract = (Contract) request.getSession().getAttribute(\"contract\");\n        contract.setTariff(tariff);\n        if (array == null || array.length == 0) {\n            contract.removeAllOptions();\n            request.getSession().setAttribute(\"updatedContract\", contract);\n            model.addAttribute(\"optionsList\", contract.getOptions());\n            request.getSession().setAttribute(\"totalAmount\", 0);\n            return CLIENT + BUCKET;\n        } else {\n            List<Exception> exceptionList = new ArrayList<>();\n            List validationResultList = contractValidator.validateOptions(array, exceptionList, user.getId()); //checking if the entered options are correct\n            List<Option> optionList = (List<Option>) validationResultList.get(0);\n            exceptionList = (List<Exception>) validationResultList.get(1);\n            if (exceptionList.isEmpty()) {\n                contract.removeAllOptions();\n                for (Option x : optionList) {\n                    contract.addOption(x);\n                }\n                //the amount to decrease\n                request.getSession().setAttribute(\"totalAmount\", user.getBalance() - contractValidator.balanceCheck(user.getId(), optionList));\n                request.getSession().setAttribute(\"updatedContract\", contract);\n                model.addAttribute(\"optionsList\", contract.getOptions());\n                return CLIENT + BUCKET;\n            } else {\n                throw new ScriptViolationException(\"jQuery required to perform this operation!\");\n            }\n        }\n\n\n    }\n\n    /**\n     * This method finally changes the contract after the approval by the client.\n     * @param request request;\n     * @return success.jsp\n     */\n    @RequestMapping(value = BUCKET_APPROVED, method =  RequestMethod.POST)\n    public String approveBucket(HttpServletRequest request) {\n        Contract contract = (Contract) request.getSession().getAttribute(\"updatedContract\");\n        User user = (User) request.getSession().getAttribute(CURRENT_USER);\n        contractService.updateEntity(contract);\n        //balance decreased\n        user.setBalance(user.getBalance() - (Integer) request.getSession().getAttribute(\"totalAmount\"));\n        userService.updateEntity(user);\n        return CLIENT + SUCCESS;\n    }\n\n    /**\n     * This method returns a page where you can increase the current balance.\n     * @return cp_client_balance\n     */\n    @RequestMapping(value = BALANCE, method = RequestMethod.GET)\n    public String getBalance() {\n        return CLIENT + BALANCE;\n    }\n\n    /**\n     * This method increases the current balance by 100.\n     * @param request request;\n     * @return cp_client_balance.jsp\n     */\n    @RequestMapping(value = INCREASE_BALANCE, method = RequestMethod.GET)\n    public String increaseBalance(HttpServletRequest request) {\n        User user = (User) request.getSession().getAttribute(CURRENT_USER);\n        user.setBalance(user.getBalance() + AMOUNT);\n        userService.updateEntity(user);\n        request.getSession().setAttribute(CURRENT_USER, user);\n        return CLIENT + BALANCE;\n    }\n}\n\n'),(549,700,'package ru.tsystems.tproject.controllers;\n\nimport static ru.tsystems.tproject.utils.pages.EmployeePages.*;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.stereotype.Controller;\nimport org.springframework.ui.Model;\nimport org.springframework.web.bind.annotation.*;\nimport ru.tsystems.tproject.entities.Contract;\nimport ru.tsystems.tproject.entities.Option;\nimport ru.tsystems.tproject.entities.Tariff;\nimport ru.tsystems.tproject.entities.User;\nimport ru.tsystems.tproject.exceptions.CustomDAOException;\nimport ru.tsystems.tproject.exceptions.EntityNotDeletedException;\nimport ru.tsystems.tproject.exceptions.ScriptViolationException;\nimport ru.tsystems.tproject.integration.ContractValidator;\nimport ru.tsystems.tproject.integration.EntityRemoval;\nimport ru.tsystems.tproject.integration.UserUpdater;\nimport ru.tsystems.tproject.services.API.*;\nimport ru.tsystems.tproject.utils.Parser;\n\nimport javax.servlet.http.HttpServletRequest;\nimport java.io.IOException;\nimport java.text.SimpleDateFormat;\nimport java.util.ArrayList;\nimport java.util.List;\n\n/**\n * A controllers to dispatch the queries of the employees.\n */\n@Controller\npublic class EmployeeController {\n    @Autowired\n    private UserService userService;\n    @Autowired\n    private ContractService contractService;\n    @Autowired\n    private TariffService tariffService;\n    @Autowired\n    private OptionService optionService;\n    @Autowired\n    private ContractValidator contractValidator;\n    @Autowired\n    private UserUpdater userUpdater;\n    @Autowired\n    private EntityRemoval entityRemoval;\n\n    private static final SimpleDateFormat DATE_FORMAT = new SimpleDateFormat(\"yyyy-MM-dd\");\n\n    private static final int TARIFF_ID = 11;\n    private static final int OPTION_ID = 12;\n    public static final String TARIFFS_LIST = \"tariffsList\";\n    public static final String OPTIONS_LIST = \"optionsList\";\n\n\n    /**\n     * This method returns the main employee page.\n     * @return cp_employee_main.jsp\n     */\n    @RequestMapping(value = MAIN, method = RequestMethod.GET)\n    public String mainPage() {\n        return EMPLOYEE + MAIN;\n    }\n\n    /**\n     * This method returns a profile page.\n     * @return cp_employee_profile.jsp\n     */\n    @RequestMapping(value = PROFILE, method = RequestMethod.GET)\n    public String getProfile() {\n        return EMPLOYEE + PROFILE;\n    }\n\n    /**\n     * This method resolves a page with all contracts. When contractId is specified, the contract is deleted.\n     * @param id the id of the contract;\n     * @param model model;\n     * @return cp_employee_contracts.jsp\n     */\n    @RequestMapping(value = CONTRACTS, method = RequestMethod.GET)\n    public String contractsPage(@RequestParam(value = \"contractId\", required = false) Integer id,\n                                Model model) {\n        if (id != null && id != 0) {\n            Contract contract = contractService.getEntityById(id);\n            contractService.deleteEntity(contract);\n        }\n        model.addAttribute(\"contractsList\", contractService.getAll());\n        return EMPLOYEE + CONTRACTS;\n    }\n\n    /**\n     * This method returns a page where a new contract is being created. It sets a list with all tariffs to choose from.\n     * If the id is specified, the login of the user will be added to the page.\n     * @param id the id of the user;\n     * @param model model;\n     * @return cp_employee_new_contract.jsp\n     */\n    @RequestMapping(value = NEW_CONTRACT, method = RequestMethod.GET)\n    public String addContract(@RequestParam(value = \"id\", required = false) Integer id, Model model) {\n        if (id != null) {\n            model.addAttribute(\"currentLogin\", userService.getEntityById(id).getLogin());\n        }\n        model.addAttribute(TARIFFS_LIST, tariffService.getAll());\n        return EMPLOYEE + NEW_CONTRACT;\n    }\n\n\n\n    /** This method creates a contract, if the entered data is valid, and redirects back to the page with options otherwise.\n     * The array with options\' id is validated by a contractValidator. If something is incorrect, the exception is\n     * added to the exceptionsList.\n     *\n     * @param contractNumber a number of the contract;\n     * @param tariffId the tariff id;\n     * @param array the array of selected options\' ids;\n     * @return success.jsp\n     */\n    @SuppressWarnings(\"unchecked\")\n    @RequestMapping(value = CONTRACT_CREATED, method = RequestMethod.POST)\n    public String createContract(@RequestParam(value = \"login\") String login,\n                                 @RequestParam(value = \"number\") String contractNumber,\n                                 @RequestParam(value = \"cb\") int tariffId,\n                                 @RequestParam(value = \"cb3\", required = false) int[] array) throws Exception{\n        User user = userService.getUserByLogin(login);\n        long number = Long.parseLong(Parser.doParse(contractNumber));\n        Tariff tariff = tariffService.getEntityById(tariffId);\n        Contract contract = new Contract(number, user, tariff);\n        if (array == null || array.length == 0)  {\n            contractService.createEntity(contract);\n            user.addContract(contract);\n            userService.updateEntity(user);\n            return EMPLOYEE + SUCCESS;\n        } else {\n            List<Exception> exceptionList = new ArrayList<>();\n            List validationResultList = contractValidator.validateOptions(array, exceptionList, 0); //checking if the entered options are correct\n            List<Option> optionList = (List<Option>) validationResultList.get(0);\n            exceptionList = (List<Exception>) validationResultList.get(1);\n            if (exceptionList.isEmpty()) {\n                for (Option x : optionList) {\n                    contract.addOption(x);\n                }\n                contractService.createEntity(contract);\n                user.addContract(contract);\n                userService.updateEntity(user);\n                return EMPLOYEE + SUCCESS;\n            } else {\n                throw new ScriptViolationException(\"jQuery required for performing the action!\");\n            }\n        }\n\n    }\n\n    /**\n     * This method blocks or unblocks a contract.\n     * @param contractId the ID of the contract;\n     * @param request request;\n     * @param model model;\n     * @return cp_employee_contracts.jsp\n     */\n    @RequestMapping(value = BLOCK_CONTRACT, method = RequestMethod.GET)\n    public String blockContract(@RequestParam(value = \"contractId\") Integer contractId,\n                                HttpServletRequest request, Model model) {\n        Contract contract = contractService.getEntityById(contractId);\n        if (contract.isBlocked()) {\n            contract.setBlocked(!contract.isBlocked());\n            contract.setEmployee(null);\n        } else {\n            contract.setBlocked(!contract.isBlocked());\n            contract.setEmployee((User) request.getSession().getAttribute(\"currentUserU\"));\n        }\n        contractService.updateEntity(contract);\n        model.addAttribute(\"contractsList\", contractService.getAll());\n        return EMPLOYEE + CONTRACTS;\n    }\n\n    /**\n     * This method returns a page where you change the contract.\n     * If the number of contract is specified in the request, the contract gets blocked / unblocked.\n     * @param contractId the ID of the contract;\n     * @param contractNumber the number of the contract;\n     * @param model model;\n     * @return cp_employee_change_contract.jsp\n     */\n    @RequestMapping(value = CHANGE_CONTRACT, method = RequestMethod.GET)\n    public String changeContract(@RequestParam(value = \"contractId\") Integer contractId,\n                                 @RequestParam(value = \"contractNumber\", required = false) Long contractNumber,\n                                 HttpServletRequest request, Model model) {\n        Contract contract = contractService.getEntityById(contractId);\n        if (contractNumber != null) {\n            if (contract.isBlocked()) {\n                contract.setBlocked(!contract.isBlocked());\n                contract.setEmployee(null);\n            } else {\n                contract.setBlocked(!contract.isBlocked());\n                contract.setEmployee((User) request.getSession().getAttribute(\"currentUserU\"));\n            }\n            contractService.updateEntity(contract);\n        }\n        if (contract.isBlocked()) {\n            model.addAttribute(\"paramIsBlocked\", \"\");\n            model.addAttribute(\"action\", \"\");\n        } else {\n            model.addAttribute(\"paramIsBlocked\", \"\");\n            model.addAttribute(\"action\", \"\");\n        }\n        request.getSession().setAttribute(\"contractNumber\", contract.getNumber());\n        request.getSession().setAttribute(\"login\", contract.getUser().getLogin());\n        model.addAttribute(TARIFFS_LIST, tariffService.getAll());\n        model.addAttribute(\"number\", contract.getNumber());\n        model.addAttribute(\"login\", contract.getUser().getLogin());\n        model.addAttribute(\"contractId\", contractId);\n        return EMPLOYEE + CHANGE_CONTRACT;\n    }\n\n\n\n    /** This method changes a contract, if the entered data is valid, and redirects back to the page with options otherwise.\n     * The array with options\' id is validated by a contractValidator. If something is incorrect, the exception is\n     * added to the exceptionsList.\n     * @param array the array of selected options\' ids;\n     * @param request request\n     * @return success.jsp or exception.jsp\n     */\n    @SuppressWarnings(\"unchecked\")\n    @RequestMapping(value = CHANGED_CONTRACT, method = RequestMethod.POST)\n    public String finalContractChange(  @RequestParam(value = \"cb\") Integer tariffId,\n                                        @RequestParam(value = \"cb3\", required = false) int[] array,\n                                        HttpServletRequest request) throws Exception{\n        Tariff tariff = tariffService.getEntityById(tariffId);\n        long number = (long) request.getSession().getAttribute(\"contractNumber\");\n        Contract contract = contractService.getContractByNumber(number);\n        contract.setTariff(tariff);\n        if (array == null || array.length == 0) {\n            contract.removeAllOptions();\n            contractService.updateEntity(contract);\n            return EMPLOYEE + SUCCESS;\n        } else {\n            List<Exception> exceptionList = new ArrayList<>();\n            //checking if the entered options are correct\n            List validationResultList = contractValidator.validateOptions(array, exceptionList, 0);\n            List<Option> optionList = (List<Option>) validationResultList.get(0);\n            exceptionList = (List<Exception>) validationResultList.get(1);\n            if (exceptionList.isEmpty()) {\n                contract.removeAllOptions();\n                for (Option x : optionList) {\n                    contract.addOption(x);\n                }\n                contractService.updateEntity(contract);\n                return EMPLOYEE + SUCCESS;\n            } else {\n                throw new ScriptViolationException(\"jQuery required to perform this operation!\");\n            }\n        }\n\n    }\n\n    /**\n     * This method returns a page with all users.\n     * @param model model\n     * @return cp_employee_users.jsp\n     */\n    @RequestMapping(value = USERS, method = RequestMethod.GET)\n    public String getAllUsers(Model model) {\n        model.addAttribute(\"usersList\", userService.getAll());\n        return EMPLOYEE + USERS;\n    }\n\n    /**\n     * This method adds 100 to current balance.\n     * @param id user\'s id\n     * @param model model\n     * @return cp_employee_users.jsp\n     */\n    @RequestMapping(value = ADD_BALANCE, method = RequestMethod.GET)\n    public String addBalance(@RequestParam(value = \"id\") int id,\n                             Model model) {\n        User user = userService.getEntityById(id);\n        user.setBalance(user.getBalance() + 100);\n        userService.updateEntity(user);\n        model.addAttribute(\"usersList\", userService.getAll());\n        return EMPLOYEE + USERS;\n    }\n\n    /**\n     * This method returns a page where users\' data can be changed.\n     * @param id user\'s id\n     * @param model model\n     * @return cp_employee_user_data_change.jsp\n     */\n    @RequestMapping(value = USER_CHANGE, method = RequestMethod.GET)\n    public String changeUser(@RequestParam(value = \"id\") int id,\n                             Model model) {\n        User user = userService.getEntityById(id);\n        model.addAttribute(\"id\", user.getId());\n        model.addAttribute(\"name\", user.getName());\n        model.addAttribute(\"surname\", user.getSurname());\n        model.addAttribute(\"birthday\", DATE_FORMAT.format(user.getBirthday()));\n        model.addAttribute(\"passport\", user.getPassport());\n        model.addAttribute(\"address\", user.getAddress());\n        model.addAttribute(\"email\", user.getEmail());\n        model.addAttribute(\"login\", user.getLogin());\n        model.addAttribute(\"balance\", user.getBalance());\n        model.addAttribute(\"role\", user.getRole().getId());\n        return EMPLOYEE + USER_CHANGE;\n    }\n\n    /**\n     * This method deletes a user.\n     * @param id user\'s id\n     * @param model model\n     * @return cp_employee_users.jsp\n     */\n    @RequestMapping(value = USER_DELETE, method = RequestMethod.GET)\n    public String deleteUser(@RequestParam(value = \"id\") int id,\n                             Model model) {\n        User user = userService.getEntityById(id);\n        if (!contractService.getAllContractsForUser(id).isEmpty()) {\n            throw new EntityNotDeletedException(\"Unable to delete user, you need to remove his contracts first!\");\n        } else {\n            userService.deleteEntity(user);\n            model.addAttribute(\"usersList\", userService.getAll());\n            return EMPLOYEE + USERS;\n        }\n    }\n\n    /**\n     * This method creates a new user. The userUpdater bean is responsible for validating the entered data.\n     * @param name user\'s name\n     * @param surname user\'s surname\n     * @param birthday user\'s birthday\n     * @param passport user\'s passport\n     * @param address user\'s address\n     * @param email user\'s email\n     * @param login user\'s login\n     * @param balance user\'s balance\n     * @param password user\'s password\n     * @param roleId user\'s roleId\n     * @return cp_employee_users.jsp\n     * @throws Exception\n     */\n    @RequestMapping(value = CREATE_USER, method = RequestMethod.POST)\n    public String createUser(@RequestParam(value = \"name\") String name,\n                             @RequestParam(value = \"surname\") String surname,\n                             @RequestParam(value = \"birthday\") String birthday,\n                             @RequestParam(value = \"passport\", required = false) String passport,\n                             @RequestParam(value = \"address\", required = false) String address,\n                             @RequestParam(value = \"email\", required = false) String email,\n                             @RequestParam(value = \"login\") String login,\n                             @RequestParam(value = \"balance\", required = false) Integer balance,\n                             @RequestParam(value = \"password\") String password,\n                             @RequestParam(value = \"cb\") int roleId) throws Exception{\n\n        User user = userUpdater.createUser(name, surname, birthday, passport, address, email, balance, login, password, roleId);\n        userService.createEntity(user);\n        return REDIRECT + USERS;\n    }\n\n    /**\n     * This method updates a user. The userUpdater bean is responsible for validating the entered data.\n     * @param id user\'s id\n     * @param name user\'s name\n     * @param surname user\'s surname\n     * @param birthday user\'s birthday\n     * @param passport user\'s passport\n     * @param address user\'s address\n     * @param email user\'s email\n     * @param balance user\'s balance\n     * @param password user\'s password\n     * @return success.jsp\n     * @throws Exception\n     */\n    @RequestMapping(value = CHANGE_USER, method = RequestMethod.POST)\n    public String updateUser(@RequestParam(value = \"id\") int id,\n                             @RequestParam(value = \"name\") String name,\n                             @RequestParam(value = \"surname\") String surname,\n                             @RequestParam(value = \"birthday\") String birthday,\n                             @RequestParam(value = \"passport\", required = false) String passport,\n                             @RequestParam(value = \"address\", required = false) String address,\n                             @RequestParam(value = \"email\", required = false) String email,\n                             @RequestParam(value = \"balance\", required = false) Integer balance,\n                             @RequestParam(value = \"password\") String password) throws Exception{\n        User user = userUpdater.updateUser(id, name, surname, birthday, passport, address, email, balance, password);\n        userService.updateEntity(user);\n        return EMPLOYEE + SUCCESS;\n    }\n\n    /**\n     * This method redirects to a page for user searching.\n     * @return cp_employee_user_search.jsp\n     */\n    @RequestMapping(value = USER_SEARCH, method = RequestMethod.GET)\n    public String searchForUser() {\n        return EMPLOYEE + USER_SEARCH;\n    }\n\n    /**\n     * This method searches for a user. It redirects to a page where user can be changed, if the user is found, and back otherwise.\n     * @param number user\'s contract number\n     * @param login user\'s login\n     * @param model model\n     * @return cp_employee_user_data_change.jsp or cp_employee_user_search.jsp\n     */\n    @RequestMapping(value = FIND_USER, method = RequestMethod.POST)\n    public String doSearch(@RequestParam(value = \"number\", required = false) String number,\n                           @RequestParam(value = \"login\", required = false) String login,\n                           Model model) {\n        User user;\n        try {\n            if (number == null || (\"\").equals(number)) {\n                user = userService.getUserByLogin(login);\n            } else {\n                long userNumber = Long.parseLong(Parser.doParse(number));\n                user = userService.getUserByNumber(userNumber);\n            }\n\n            model.addAttribute(\"id\", user.getId());\n            return REDIRECT + USER_CHANGE;\n        } catch (Exception ex) {\n            model.addAttribute(\"found\", \"false\");\n            return EMPLOYEE + USER_SEARCH;\n        }\n    }\n\n    /**\n     * This method resolves a page with all tariffs.\n     * @param model model\n     * @return cp_employee_tariffs.jsp\n     */\n    @RequestMapping(value = TARIFFS, method = RequestMethod.GET)\n    public String getTariffs(Model model) {\n        model.addAttribute(TARIFFS_LIST, tariffService.getAll());\n        model.addAttribute(OPTIONS_LIST, optionService.getAll());\n        return EMPLOYEE + TARIFFS;\n    }\n\n    /**\n     * This method creates a new tariff with the specified params.\n     * @param name tariff\'s name;\n     * @param price tariff\'s price;\n     * @param array the array of selected options\' ids;\n     * @return cp_employee_tariffs.jsp\n     */\n    @RequestMapping(value = CREATE_TARIFF, method = RequestMethod.POST)\n    public String createNewTariff(@RequestParam(value = \"name\") String name,\n                                  @RequestParam(value = \"price\") int price,\n                                  @RequestParam(value = \"cb\", required = false) int[] array) throws Exception{\n        contractValidator.priceCheck(price, \"price\");\n        Tariff tariff = new Tariff(name, price);\n        if (null != array && array.length > 0) {\n            for (int optionId : array) {\n                tariff.addPossibleOption(optionService.getEntityById(optionId));\n            }\n        }\n        tariffService.createEntity(tariff);\n        return REDIRECT + TARIFFS;\n    }\n\n    /**\n     * This method returns a page where the tariff can be changed.\n     * @param tariffId the tariff id;\n     * @param request request;\n     * @param model model;\n     * @return cp_employee_change_tariff.jsp\n     */\n    @RequestMapping(value = CHANGE_TARIFF, method = RequestMethod.GET)\n    public String changeTariff(@RequestParam(value = \"id\") int tariffId,\n                               HttpServletRequest request, Model model) {\n        Tariff tariff = tariffService.getEntityById(tariffId);\n        List<Option> allOptionsList = optionService.getAll();\n        List<Option> currentTariffOptionsList = optionService.getAllOptionsForTariff(tariffId);\n        allOptionsList.removeAll(currentTariffOptionsList);\n        model.addAttribute(\"id\", tariff.getId());\n        model.addAttribute(\"currentOptionsList\", currentTariffOptionsList);\n        model.addAttribute(\"allOptionsList\", allOptionsList);\n        request.getSession().setAttribute(\"tariff\", tariff);\n        return EMPLOYEE + CHANGE_TARIFF;\n    }\n\n    /**\n     * This method changes the tariff\'s data.\n     * @param tariffId the tariff id;\n     * @param name the tariff\'s name;\n     * @param price the tariff\'s price;\n     * @param array the array of selected options\' ids;\n     * @return success.jsp\n     */\n    @RequestMapping(value = FINAL_CHANGE_TARIFF, method = RequestMethod.POST)\n    public String finalChangeTariff(@RequestParam(value = \"id\") int tariffId,\n                                    @RequestParam(value = \"name\") String name,\n                                    @RequestParam(value = \"price\") int price,\n                                    @RequestParam(value = \"cb\", required = false) int[] array) throws IOException{\n        contractValidator.priceCheck(price, \"price\");\n        Tariff tariff = tariffService.getEntityById(tariffId);\n        tariff.removePossibleOptions();\n        if (null != array && array.length > 0) {\n            for (int optionId : array) {\n                tariff.addPossibleOption(optionService.getEntityById(optionId));\n            }\n        }\n        tariff.setName(name);\n        tariff.setPrice(price);\n        tariffService.updateEntity(tariff);\n        return EMPLOYEE + SUCCESS;\n    }\n\n    /**\n     * This method deletes a tariff with the help of entityRemoval service.\n     * @param tariffId the tariff id;\n     * @param model model;\n     * @return cp_employee_tariffs.jsp\n     */\n    @RequestMapping(value = DELETE_TARIFF, method = RequestMethod.GET)\n    public String deleteTariff(@RequestParam(value = \"id\") int tariffId,\n                               Model model) {\n        if (tariffId == TARIFF_ID) {\n            throw new EntityNotDeletedException(\"This tariff can not be deleted, some serious business logic is based upon it!\");\n        } else {\n            entityRemoval.removeTariff(tariffId);\n            model.addAttribute(TARIFFS_LIST, tariffService.getAll());\n            return EMPLOYEE + TARIFFS;\n        }\n    }\n\n    /**\n     * This method returns a page with all options where you can create a new one or change the existing ones.\n     * @param model model;\n     * @return cp_employee_options.jsp\n     */\n    @RequestMapping(value = OPTIONS, method = RequestMethod.GET)\n    public String getAllOptions(Model model) {\n        model.addAttribute(OPTIONS_LIST, optionService.getAll());\n        return EMPLOYEE + OPTIONS;\n    }\n\n    /**\n     * This method creates a new option with a list of optionsTogether and optionsIncompatible, if any.\n     * @param name option\'s name;\n     * @param price option\'s price;\n     * @param initialPrice option\'s initialPrice;\n     * @param optionsTogether an array of option\'s ids that will be necessary for current option;\n     * @param optionsIncompatible an array of option\'s ids that will be incompatible for current option;\n     * @return success.jsp\n     */\n    @RequestMapping(value = CREATE_OPTION, method = RequestMethod.POST)\n    public String finalCreateOption(@RequestParam(value = \"name\") String name,\n                                    @RequestParam(value = \"price\") int price,\n                                    @RequestParam(value = \"initialPrice\") int initialPrice,\n                                    @RequestParam(value = \"cb\", required = false) int[] optionsTogether,\n                                    @RequestParam(value = \"cb2\", required = false) int[] optionsIncompatible) throws IOException{\n        contractValidator.priceCheck(price, \"price\");\n        contractValidator.priceCheck(initialPrice, \"initialPrice\");\n        Option option = new Option(name, price, initialPrice);\n        //add a check here if two options were selected incorrectly\n        if (null != optionsTogether && optionsTogether.length > 0) {\n            for (int optionId : optionsTogether) {\n                option.addOptionsTogether(optionService.getEntityById(optionId));\n            }\n        }\n        if (null != optionsIncompatible && optionsIncompatible.length > 0) {\n            for (int optionId : optionsIncompatible) {\n                option.addOptionsIncompatible(optionService.getEntityById(optionId));\n            }\n        }\n        for (Option x : option.getOptionsTogether()) {\n            if (option.getOptionsIncompatible().contains(x)) {\n                throw new ScriptViolationException(\"jQuery required to perform this operation!\");\n            }\n        }\n        optionService.createEntity(option);\n        return REDIRECT + OPTIONS;\n    }\n\n    /**\n     * This method returns a page where an option can be modified. It sets 4 lists to the model:\n     * - the list of options which are currently necessary for the option;\n     * - the list of options which are not necessary for the option, but can be selected as necessary;\n     * - the list of options which are currently incompatible with the option;\n     * - the list of options which are not incompatible, but can be selected as incompatible.\n     * @param optionId option\'s id;\n     * @param request request;\n     * @param model model;\n     * @return cp_employee_change_option.jsp\n     */\n    @RequestMapping(value = CHANGE_OPTION, method = RequestMethod.GET)\n    public String changeOption(@RequestParam(value = \"optionId\") int optionId,\n                               HttpServletRequest request, Model model) {\n        Option option = optionService.getEntityById(optionId);\n        List<Option> optionsListAllIncompatible = new ArrayList<>();\n        List<Option> optionsListAllTogether = optionService.getAll();\n        optionsListAllIncompatible.addAll(optionsListAllTogether);\n        // a list of options together, checked\n        List<Option> optionsTogether = option.getOptionsTogether();\n        optionsListAllTogether.removeAll(optionsTogether);\n        // a list of other options together, unchecked\n        optionsListAllTogether.remove(option);\n        // a list of incompatible options, checked\n        List<Option> optionsIncompatible = option.getOptionsIncompatible();\n        // and unchecked\n        optionsListAllIncompatible.removeAll(optionsIncompatible);\n        optionsListAllIncompatible.remove(option);\n        request.getSession().setAttribute(\"option\", option);\n        model.addAttribute(\"optionsTogether\", optionsTogether);\n        model.addAttribute(\"optionsListAllTogether\", optionsListAllTogether);\n        model.addAttribute(\"optionsIncompatible\", optionsIncompatible);\n        model.addAttribute(\"optionsListAllIncompatible\", optionsListAllIncompatible);\n        return EMPLOYEE + CHANGE_OPTION;\n    }\n\n    /**\n     * This method updates an option with a list of optionsTogether and optionsIncompatible, if any.\n     * @param name option\'s name;\n     * @param price option\'s price;\n     * @param initialPrice option\'s initialPrice;\n     * @param optionsTogether an array of option\'s ids that will be necessary for current option;\n     * @param optionsIncompatible an array of option\'s ids that will be incompatible for current option;\n     * @param request request;\n     * @return success.jsp\n     */\n    @RequestMapping(value = OPTION_CHANGED, method = RequestMethod.POST)\n    public String finalOptionChange(@RequestParam(value = \"name\") String name,\n                                    @RequestParam(value = \"price\") int price,\n                                    @RequestParam(value = \"initialPrice\") int initialPrice,\n                                    @RequestParam(value = \"cb\", required = false) int[] optionsTogether,\n                                    @RequestParam(value = \"cb2\", required = false) int[] optionsIncompatible,\n                                    HttpServletRequest request) throws IOException{\n        contractValidator.priceCheck(price, \"price\");\n        contractValidator.priceCheck(initialPrice, \"initialPrice\");\n        Option option = (Option) request.getSession().getAttribute(\"option\");\n        option.setName(name);\n        option.setPrice(price);\n        option.setInitialPrice(initialPrice);\n        option.removeOptionsIncompatible();\n        option.removeOptionsTogether();\n        //    \n        if (null != optionsTogether && optionsTogether.length > 0) {\n            for (int optionId : optionsTogether) {\n                option.addOptionsTogether(optionService.getEntityById(optionId));\n            }\n        }\n        if (null != optionsIncompatible && optionsIncompatible.length > 0) {\n            for (int optionId : optionsIncompatible) {\n                option.addOptionsIncompatible(optionService.getEntityById(optionId));\n            }\n        }\n        optionService.updateEntity(option);\n        return EMPLOYEE + SUCCESS;\n    }\n\n    /**\n     * This method deletes an option with the help of entityRemoval.deleteOption method.\n     * @param optionId option\'s id;\n     * @param model model;\n     * @return cp_employee_options.jsp\n     */\n    @RequestMapping(value = DELETE_OPTION, method = RequestMethod.GET)\n    public String deleteOption(@RequestParam(value = \"optionId\") int optionId,\n                               Model model) {\n        if (optionId == OPTION_ID) {\n            throw new EntityNotDeletedException(\"This option can not be deleted, as some serious business logic is based upon it!\");\n        } else {\n            entityRemoval.removeOption(optionId);\n            model.addAttribute(OPTIONS_LIST, optionService.getAll());\n            return EMPLOYEE + OPTIONS;\n        }\n    }\n    /*-----------------------------------------------------------------------------------------------*/\n    /*-----------------------------------------------------------------------------------------------*/\n    /*---------------------------------AJAX QUERIES--------------------------------------------------*/\n    /*-----------------------------------------------------------------------------------------------*/\n    /*-----------------------------------------------------------------------------------------------*/\n\n    @RequestMapping(value = AJAX_CHECK_NUMBER, method = RequestMethod.GET)\n    @ResponseBody\n    public boolean checkNumber(@PathVariable String number) {\n        long contractNumber = Long.parseLong(Parser.doParse(number));\n        try {\n            contractService.getContractByNumber(contractNumber);\n        } catch (CustomDAOException ex) {\n            return true;\n        }\n        return false;\n    }\n    @RequestMapping(value = AJAX_CHECK_USER, method = RequestMethod.GET)\n    @ResponseBody\n    public boolean checkUser(@PathVariable String login) {\n        try {\n            userService.getUserByLogin(login);\n        } catch (CustomDAOException ex) {\n            return false;\n        }\n        return true;\n    }\n\n\n\n}\n'),(550,701,'package ru.tsystems.tproject.controllers;\n\nimport org.springframework.web.bind.annotation.ControllerAdvice;\nimport org.springframework.web.bind.annotation.ExceptionHandler;\nimport org.springframework.web.servlet.ModelAndView;\nimport ru.tsystems.tproject.entities.User;\nimport ru.tsystems.tproject.exceptions.EntityNotDeletedException;\nimport static ru.tsystems.tproject.utils.pages.EmployeePages.*;\nimport static ru.tsystems.tproject.utils.pages.ClientPages.CLIENT;\n\nimport javax.servlet.http.HttpServletRequest;\n\n/**\n * A global exception handler to handle the exceptions.\n */\n@ControllerAdvice\npublic class GlobalExceptionHandler {\n\n    @ExceptionHandler(EntityNotDeletedException.class)\n    public ModelAndView handleEntityNotDeletedException(Exception ex) {\n        ModelAndView modelAndView = new ModelAndView();\n        modelAndView.addObject(EXCEPTION, ex);\n        modelAndView.setViewName(EMPLOYEE + ERRORS + EXCEPTION);\n        return modelAndView;\n    }\n\n    @ExceptionHandler(Exception.class)\n    public ModelAndView handleGlobalException(HttpServletRequest request, Exception ex) {\n        User user = (User) request.getSession().getAttribute(\"currentUserU\");\n        ModelAndView modelAndView = new ModelAndView();\n        modelAndView.addObject(EXCEPTION, ex);\n        if (user.getRole().getId() == 2) {\n            modelAndView.setViewName(EMPLOYEE + ERRORS + EXCEPTION_GENERAL);\n        } else {\n            modelAndView.setViewName(CLIENT + ERRORS + EXCEPTION);\n        }\n        return modelAndView;\n    }\n\n}\n'),(551,702,'package ru.tsystems.tproject.controllers;\n\nimport org.apache.log4j.Logger;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.security.core.context.SecurityContextHolder;\nimport org.springframework.stereotype.Controller;\nimport org.springframework.ui.Model;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.RequestMethod;\nimport ru.tsystems.tproject.entities.User;\nimport ru.tsystems.tproject.services.API.UserService;\nimport ru.tsystems.tproject.utils.locale.RussianLanguage;\n\nimport javax.servlet.http.HttpServletRequest;\nimport static ru.tsystems.tproject.utils.pages.SharedPages.*;\n\n/**\n * A controllers that validates the login data and redirects to main page.\n */\n@Controller\npublic class LoginController {\n    private final static Logger logger = Logger.getLogger(LoginController.class);\n    @Autowired\n    private UserService userService;\n\n    /**\n     * This method returns the login page.\n     * @return login.jsp\n     */\n    @RequestMapping(value = LOGIN, method = RequestMethod.GET)\n    public String loginPage() {\n        return LOGIN;\n    }\n\n    /**\'\n     * This method returns the login page when logout is required.\n     * @return login.jsp\n     */\n    @RequestMapping(value = LOGOUT, method = RequestMethod.GET)\n    public String logoutPage() {\n        return LOGIN;\n    }\n\n    /**\n     * This method returns an error403 page when a restricted access page is called.\n     * @return denied.jsp\n     */\n    @RequestMapping(value = DENIED, method = RequestMethod.GET)\n    public String deniedPage() {\n        return DENIED;\n    }\n\n    /**\n     * This method returns a login page with an error block after an unsuccessful attempt.\n     * @param model model;\n     * @return login.jsp\n     */\n    @RequestMapping(value = LOGIN_DENIED, method = RequestMethod.GET)\n    public String loginDenied(Model model) {\n        model.addAttribute(\"isInputValid\", \"false\");\n        return LOGIN;\n    }\n\n    /**\n     * This method dispatches the requests to the starting page of an employee or to the one of a user.\n     * It also sets the current user entity into session.\n     * @param request request;\n     * @param model model;\n     * @return cp_employee_main.jsp or cp_client_main.jsp\n     */\n    @RequestMapping(value = MAIN, method = RequestMethod.GET)\n    public String dispatch(HttpServletRequest request, Model model) {\n        org.springframework.security.core.userdetails.User user = (org.springframework.security.core.userdetails.User) SecurityContextHolder.getContext().getAuthentication().getPrincipal();\n        User currentUser = userService.getUserByLogin(user.getUsername());\n        request.getSession().setAttribute(\"currentUserU\", currentUser);\n        request.getSession().setAttribute(\"language\", RussianLanguage.getRussianLanguage());\n        if (currentUser.getRole().getId() == 2) {\n            return EMPLOYEE_MAIN;\n        } else if (currentUser.getRole().getId() == 1){\n            return CLIENT_MAIN;\n        } else return LOGIN;\n    }\n\n}\n\n'),(552,704,'package ru.tsystems.tproject.entities;\n\nimport javax.persistence.*;\nimport java.util.ArrayList;\nimport java.util.List;\n\n/**\n * One of the entities.\n */\n@Entity\n@Table (name = \"CONTRACTS\", uniqueConstraints = @UniqueConstraint(columnNames = {\"number\"}))\n@NamedQuery (name = \"Contract.getAll\", query = \"SELECT c FROM Contract c\")\npublic class Contract {\n    @Id\n    @GeneratedValue (strategy = GenerationType.AUTO)\n    @Column (name = \"id\")\n    private int id;\n    private long number;\n\n    @ManyToOne (cascade = CascadeType.DETACH)\n    @JoinColumn(name = \"user_id\")\n    private User user;\n\n    @OneToOne\n    @JoinColumn(name = \"tariff_id\")\n    private Tariff tariff;\n    private boolean blocked;\n\n    @ManyToOne\n    @JoinColumn(name = \"blockedEmp_id\")\n    private User employee;\n\n    @ManyToMany(fetch = FetchType.EAGER)\n    @JoinTable\n            (\n                    name = \"CONTRACT_OPTION\",\n                    joinColumns = {@JoinColumn(name = \"contract_id\")},\n                    inverseJoinColumns = {@JoinColumn(name = \"option_id\")}\n            )\n    private final List<Option> options = new ArrayList<>();\n    public Contract(){\n\n    }\n    public Contract(long number, User user, Tariff tariff)\n    {\n        this.number = number;\n        this.user = user;\n        this.tariff = tariff;\n    }\n\n    public int getId() {\n        return id;\n    }\n\n    public void setId(int id) {\n        this.id = id;\n    }\n\n    public long getNumber() {\n        return number;\n    }\n\n    public void setNumber(long number) {\n        this.number = number;\n    }\n\n    public User getUser() {\n        return user;\n    }\n\n    public void setUser(User user) {\n        this.user = user;\n    }\n\n    public Tariff getTariff() {\n        return tariff;\n    }\n\n    public void setTariff(Tariff tariff) {\n        this.tariff = tariff;\n    }\n\n    public boolean isBlocked() {\n        return blocked;\n    }\n\n    public void setBlocked(boolean isBlocked) {\n        this.blocked = isBlocked;\n    }\n\n    public User getEmployee() {\n        return employee;\n    }\n\n    public void setEmployee(User employee) {\n        this.employee = employee;\n    }\n\n    public List<Option> getOptions() {\n        return options;\n    }\n\n    /**\n     * Remove an option from the contract.\n     * @param option option\n     */\n\n    public void removeOption(Option option) { this.options.remove(option); }\n\n    /**\n     * Remove all options from the contract.\n     */\n    public void removeAllOptions() { this.options.clear(); }\n\n    /**\n     * Add an option to the contract.\n     * @param option option\n     */\n    public void addOption(Option option) {\n        this.options.add(option);\n    }\n    @Override\n    public String toString(){\n        return String.format(\"Contract{number: %s, user: %s, tariff: %s, blocked: %s, blockedEmpID: %s}\", this.getNumber(), this.getUser(), this.getTariff(), this.isBlocked(), this.getEmployee());\n    }\n    @Override\n    public boolean equals(Object o) {\n        if (this == o) return true;\n        if (!(o instanceof Contract)) return false;\n\n        Contract contract = (Contract) o;\n        return (number == contract.number);\n    }\n\n    @Override\n    public int hashCode() {\n        return (int) (number ^ (number >>> 32));\n    }\n\n}\n'),(553,705,'package ru.tsystems.tproject.entities;\n\nimport javax.persistence.*;\nimport java.util.ArrayList;\nimport java.util.List;\n\n/**\n * One of the entities.\n */\n@Entity\n@Table (name = \"OPTIONS\")\n@NamedQuery(name = \"Option.getAll\", query = \"SELECT opt FROM Option opt\")\npublic class Option {\n    @Id\n    @GeneratedValue(strategy = GenerationType.AUTO)\n    @Column(name = \"id\")\n    private int id;\n\n    private String name;\n    private int price;\n    private int initialPrice;\n\n    @ManyToMany(fetch = FetchType.EAGER)\n    @JoinTable(name = \"OPTIONS_TOGETHER\",\n            joinColumns = @JoinColumn(name = \"optionOne_id\"),\n            inverseJoinColumns = @JoinColumn(name = \"optionTwo_id\")\n    )\n    private final List<Option> optionsTogether = new ArrayList<>();\n    @ManyToMany(fetch = FetchType.EAGER)\n    @JoinTable(name = \"OPTIONS_INCOMPATIBLE\",\n            joinColumns = @JoinColumn(name = \"optionOne_id\"),\n            inverseJoinColumns = @JoinColumn(name = \"optionTwo_id\")\n    )\n    private final List<Option> optionsIncompatible = new ArrayList<>();\n    public Option(){}\n\n    public Option(String name, int price, int initialPrice) {\n        this.name = name;\n        this.price = price;\n        this.initialPrice = initialPrice;\n    }\n    public Option(int id, String name, int price, int initialPrice) {\n        this.id = id;\n        this.name = name;\n        this.price = price;\n        this.initialPrice = initialPrice;\n    }\n\n    public int getId() {\n        return id;\n    }\n\n    public void setId(int id) {\n        this.id = id;\n    }\n\n    public String getName() {\n        return name;\n    }\n\n    public void setName(String name) {\n        this.name = name;\n    }\n\n    public int getPrice() {\n        return price;\n    }\n\n    public void setPrice(int price) {\n        this.price = price;\n    }\n\n    public int getInitialPrice() {\n        return initialPrice;\n    }\n\n    public void setInitialPrice(int initialPrice) {\n        this.initialPrice = initialPrice;\n    }\n\n    /**\n     * Gets options that are necessary for current option,\n     * @return a list of options\n     */\n    public List<Option> getOptionsTogether() {\n        return optionsTogether;\n    }\n\n    /**\n     * Deletes all options that are necessary for current option,\n     */\n    public void removeOptionsTogether() { this.optionsTogether.clear(); }\n\n    /**\n     * Adds an option necessary for current option.\n     * @param optionTogether an option to add\n     */\n\n    public void addOptionsTogether(Option optionTogether) {\n        this.optionsTogether.add(optionTogether);\n    }\n\n    /**\n     * Gets options that are incompatible with current option,\n     * @return a list of options\n     */\n\n    public List<Option> getOptionsIncompatible() {\n        return optionsIncompatible;\n    }\n\n    /**\n     * Removes all options that are incompatible with current option.\n     */\n\n    public void removeOptionsIncompatible() { this.optionsIncompatible.clear(); }\n\n    /**\n     * Adds an option that is incompatible with current option.\n     * @param optionIncompatible incompatible option\n     */\n\n    public void addOptionsIncompatible(Option optionIncompatible) {\n        this.optionsIncompatible.add(optionIncompatible);\n    }\n        @Override\n        public String toString(){\n            return String.format(\"Option{name: %s, price: %s, initialPrice: %s}\", this.getName(), this.getPrice(), this.getInitialPrice());\n    }\n    @Override\n    public boolean equals(Object o) {\n        if (this == o) return true;\n        if (!(o instanceof Option)) return false;\n\n        Option option = (Option) o;\n\n        return (id == option.id);\n    }\n\n    @Override\n    public int hashCode() {\n        return (int) (id ^ (id >>> 32));\n    }\n}\n'),(554,706,'package ru.tsystems.tproject.entities;\nimport javax.persistence.*;\n\n/**\n * A base entity class.\n */\n@Entity\n@Table (name = \"ROLES\")\n@NamedQuery(name = \"Role.getAll\", query = \"SELECT r FROM Role r\")\npublic class Role {\n    @Id\n    @GeneratedValue (strategy = GenerationType.AUTO)\n    @Column (name = \"id\")\n    private int id;\n    private String name;\n    public Role(){\n    }\n    public Role(String name)\n    {\n        this.name = name;\n    }\n\n    public int getId() {\n        return id;\n    }\n\n    public void setId(int id) {\n        this.id = id;\n    }\n\n    public String getName() {\n        return name;\n    }\n\n    public void setName(String name) {\n        this.name = name;\n    }\n    public String toString(){\n        return String.format(\"Role{name: %s}\", this.getName());\n    }\n}\n'),(555,707,'package ru.tsystems.tproject.entities;\nimport javax.persistence.*;\nimport java.util.ArrayList;\nimport java.util.List;\n\n/**\n * An entity class.\n */\n@Entity\n@Table (name = \"TARIFFS\")\n@NamedQuery(name = \"Tariff.getAll\", query = \"SELECT tar FROM Tariff tar\")\npublic class Tariff {\n    @Id\n    @GeneratedValue(strategy = GenerationType.AUTO)\n    @Column (name = \"id\")\n    private int id;\n    private String name;\n    private int price;\n\n    @ManyToMany(fetch = FetchType.EAGER)\n    @JoinTable(\n            name = \"TARIFF_RULES\",\n            joinColumns = @JoinColumn(name = \"tariff_id\"),\n            inverseJoinColumns = @JoinColumn(name = \"option_id\")\n    )\n    private final List<Option> possibleOptions = new ArrayList<>();\n    public Tariff(){}\n    public Tariff(String name, int price)\n    {\n        this.name = name;\n        this.price = price;\n    }\n\n    public int getId() {\n        return id;\n    }\n\n    public void setId(int id) {\n        this.id = id;\n    }\n\n    public String getName() {\n        return name;\n    }\n\n    public void setName(String name) {\n        this.name = name;\n    }\n\n    public int getPrice() {\n        return price;\n    }\n\n    public void setPrice(int price) {\n        this.price = price;\n    }\n\n    public List<Option> getPossibleOptions() {\n        return this.possibleOptions;\n    }\n\n    public void removePossibleOptions() {\n        this.possibleOptions.clear();\n    }\n\n    /**\n     * This method removes an option from the list of possible options.\n     * @param option the option to delete\n     */\n    public void removeOptionForTariff(Option option) {\n        this.possibleOptions.remove(option);\n    }\n\n    /**\n     * This method adds an option to the list of possible options.\n     * @param option the option to add\n     */\n\n    public void addPossibleOption(Option option) {\n        this.possibleOptions.add(option);\n    }\n    @Override\n    public String toString(){\n        return String.format(\"Tariff{name: %s, price: %s}\", this.getName(), this.getPrice());\n    }\n\n    @Override\n    public boolean equals(Object o) {\n        if (this == o) {\n            return true;\n        }\n        if (!(o instanceof Tariff)) {\n            return false;\n        }\n\n        Tariff tariff = (Tariff) o;\n\n        return (id == tariff.id);\n    }\n\n    @Override\n    public int hashCode() {\n        return (int) (id ^ (id >>> 32));\n    }\n\n\n\n}\n'),(556,708,'package ru.tsystems.tproject.entities;\n\nimport javax.persistence.*;\nimport java.util.*;\n\n/**\n * A basic entity class.\n */\n\n\n@Entity\n@Table (name = \"USERS\")\n@NamedQuery(name = \"User.getAll\", query = \"SELECT u FROM User u\")\npublic class User {\n    @Id\n    @GeneratedValue (strategy = GenerationType.AUTO)\n    @Column (name = \"id\")\n    private int id;\n    private String name;\n    private String surname;\n    @Temporal(TemporalType.DATE)\n    private Date birthday;\n    private String passport;\n    private String address;\n    private String email;\n    private String login;\n    private int balance;\n    private String password;\n    @ManyToOne\n    @JoinColumn (name = \"role\")\n    private Role role;\n    @OneToMany(fetch = FetchType.EAGER, cascade = CascadeType.REMOVE, mappedBy = \"user\")\n    private final List<Contract> contracts = new ArrayList<>();\n\n    public User() {\n    }\n\n    public User(String name, String surname, Date birthday, String passport, String address, String email, String login, int balance, String password, Role role) {\n        this.name = name;\n        this.surname = surname;\n        this.birthday = birthday;\n        this.passport = passport;\n        this.address = address;\n        this.email = email;\n        this.login = login;\n        this.balance = balance;\n        this.password = password;\n        this.role = role;\n    }\n\n    public int getId() {\n        return id;\n    }\n\n    public void setId(int id) {\n        this.id = id;\n    }\n\n    public String getName() {\n        return name;\n    }\n\n    public void setName(String name) {\n        this.name = name;\n    }\n\n    public String getSurname() {\n        return surname;\n    }\n\n    public void setSurname(String surname) {\n        this.surname = surname;\n    }\n\n    public Date getBirthday() {\n        return birthday;\n    }\n\n    public void setBirthday(Date birthday) {\n        this.birthday = birthday;\n    }\n\n    public String getPassport() {\n        return passport;\n    }\n\n    public void setPassport(String passport) {\n        this.passport = passport;\n    }\n\n    public String getAddress() {\n        return address;\n    }\n\n    public void setAddress(String address) {\n        this.address = address;\n    }\n\n    public String getEmail() {\n        return email;\n    }\n\n    public void setEmail(String email) {\n        this.email = email;\n    }\n\n    public String getLogin() {\n        return login;\n    }\n\n    public void setLogin(String login) {\n        this.login = login;\n    }\n\n    public int getBalance() { return balance; }\n\n    public void setBalance(int balance) { this.balance = balance; }\n\n    public String getPassword() {\n        return password;\n    }\n\n    public void setPassword(String password) {\n        this.password = password;\n    }\n\n    public Role getRole() {\n        return role;\n    }\n\n    public void setRole(Role role) {\n        this.role = role;\n    }\n\n    public List<Contract> getContracts() {\n        return contracts;\n    }\n\n    public void addContract(Contract contract) {\n        this.contracts.add(contract);\n    }\n\n    public void removeContracts() {\n        this.contracts.clear();\n    }\n\n    public void removeContract(Contract contract) {\n        this.contracts.remove(contract);\n    }\n\n    public String toString(){\n        return String.format(\"User{name: %s, surname: %s, birthday: %s, address: %s, passport: %s, balance: %s, e-mail: %s, password: %s}\", this.getName(), this.getSurname(), this.getBirthday(), this.getAddress(), this.getPassport(), this.getBalance(), this.getEmail(), this.getPassword());\n    }\n}\n'),(557,710,'package ru.tsystems.tproject.exceptions;\n\n/**\n * An exception to be thrown when a contract is not found.\n */\npublic class ContractNotFoundException extends CustomDAOException {\n    public ContractNotFoundException(String message) {\n        super(message);\n    }\n\n    public ContractNotFoundException(String message, Throwable throwable) {\n        super(message, throwable);\n    }\n}\n'),(558,711,'package ru.tsystems.tproject.exceptions;\n\n/**\n * An exception to be thrown when contracts for a user had not been got.\n */\npublic class ContractsForEntityNotGotException extends CustomDAOException {\n    public ContractsForEntityNotGotException(String message) {\n        super(message);\n    }\n\n    public ContractsForEntityNotGotException(String message, Throwable throwable) {\n        super(message, throwable);\n    }\n}\n'),(559,712,'package ru.tsystems.tproject.exceptions;\n\n/**\n * A custom exception to be thrown.\n */\npublic class CustomDAOException extends RuntimeException {\n    public CustomDAOException(String message)\n    {\n        super(message);\n    }\n    public CustomDAOException(String message, Throwable throwable)\n    {\n        super(message, throwable);\n    }\n}\n'),(560,713,'package ru.tsystems.tproject.exceptions;\n\n/**\n * An exception thrown when an entity which has dependencies and shouldn\'t be deleted, is tried to delete.\n */\npublic class EntityNotDeletedException extends CustomDAOException {\n    public EntityNotDeletedException(String message) {\n        super(message);\n    }\n\n    public EntityNotDeletedException(String message, Throwable throwable) {\n        super(message, throwable);\n    }\n}\n'),(561,714,'package ru.tsystems.tproject.exceptions;\n\n/**\n * An exception thrown when a method tries to get a list of options for another option, or tariff,\n * or contract, and fails.\n */\npublic class OptionsForEntityNotGotException extends CustomDAOException{\n    public OptionsForEntityNotGotException(String message) {\n        super(message);\n    }\n\n    public OptionsForEntityNotGotException(String message, Throwable throwable) {\n        super(message, throwable);\n    }\n}\n'),(562,715,'package ru.tsystems.tproject.exceptions;\n\n/**\n * An exception to be thrown when a javascript check on page is somehow violated.\n */\npublic class ScriptViolationException extends CustomDAOException {\n\n\n    public ScriptViolationException(String message) {\n        super(message);\n    }\n\n    public ScriptViolationException(String message, Throwable throwable) {\n        super(message, throwable);\n    }\n\n}\n'),(563,716,'package ru.tsystems.tproject.exceptions;\n\n/**\n * An exception to be thrown when a user is not found.\n */\npublic class UserNotFoundException extends CustomDAOException {\n    public UserNotFoundException(String message) {\n        super(message);\n    }\n\n    public UserNotFoundException(String message, Throwable throwable) {\n        super(message, throwable);\n    }\n}\n'),(564,718,'package ru.tsystems.tproject.integration;\n\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.stereotype.Service;\nimport ru.tsystems.tproject.entities.Option;\nimport ru.tsystems.tproject.services.API.OptionService;\n\nimport java.io.IOException;\nimport java.util.ArrayList;\nimport java.util.Collections;\nimport java.util.List;\nimport org.apache.log4j.Logger;\nimport ru.tsystems.tproject.services.API.UserService;\n\n/**\n * A class that handles the validation of the contracts creation.\n */\n@Service(\"contractValidator\")\npublic class ContractValidator {\n    @Autowired\n    private OptionService optionService;\n    @Autowired\n    private UserService userService;\n    Logger logger = Logger.getLogger(ContractValidator.class);\n\n    /**\n     * This method checks if the selected options are compatible with each other.\n     * @param array the array of options\' ids;\n     * @param exceptionsList the list of exceptions occured;\n     * @param userId the id of the user to check the balance;\n     * @return a list with a list of options and a list of exceptions.\n     */\n    public List validateOptions(int[] array, List<Exception> exceptionsList, int userId) {\n        List<Option> optionsTogether;\n        List<Option> optionsIncompatible;\n        List<Integer> temporaryList = new ArrayList<>();\n        List<Option> optionList = new ArrayList<>();\n        for (int x : array) {\n            temporaryList.add(x);\n        }\n        for (Integer x : temporaryList) { // for each option\n            Option currentOption = optionService.getEntityById(x);\n            optionList.add(currentOption); //we add it to the final list\n            optionsTogether = currentOption.getOptionsTogether(); // we get a list of necessary options\n            if (!optionsTogether.isEmpty()) {\n                for (Option necessary : optionsTogether) { //for each option from the together list we check whether it was checked\n                    if (!temporaryList.contains(necessary.getId())) { //if it wasn\'t\n                        exceptionsList.add(new Exception(\"You didn\'t select the \" + necessary.getName() + \" option, but it was necessary for the option \" + currentOption.getName()));\n                    }\n                }\n            }\n            optionsIncompatible = currentOption.getOptionsIncompatible(); //we get a list of incompatible options\n            if (!optionsIncompatible.isEmpty()) {\n                for (Option incompatible : optionsIncompatible) {\n                    if (temporaryList.contains(incompatible.getId())) {\n                        exceptionsList.add(new Exception(\"You selected the \" + incompatible.getName() + \" option, but it can\'t be selected with the option \" + currentOption.getName()));\n                    }\n                }\n            }\n        }\n        if (exceptionsList.isEmpty() && userId != 0) {\n            //a check for balance - is the required sum on the account\n            int balance = balanceCheck(userId, optionList);\n            if (balance < 0) {\n                exceptionsList.add(new Exception(\"You do not have enough money on your account to perform the necessary action. Please refill your balance in the amount of \" + (0 - balance) + \" roubles.\"));\n            }\n        }\n        List list = new ArrayList<>();\n        Collections.addAll(list, optionList, exceptionsList);\n        return list;\n    }\n\n    /**\n     * This method asserts whether selected options can be acquired to the user\'s account.\n     * @param userId the user\'s id;\n     * @param optionList the list of options;\n     * @return the remaining sum\n     */\n    public int balanceCheck(int userId, List<Option> optionList) {\n        int balance = userService.getEntityById(userId).getBalance();\n        for (Option x : optionList) {\n            balance-=x.getInitialPrice();\n        }\n        return balance;\n    }\n\n    /**\n     * This method validates the entered sum. It should be between 0 and 400000.\n     * @param price the entered sum;\n     * @param priceName the name of the param to throw the explainable exception;\n     * @throws Exception\n     */\n    public void priceCheck(int price, String priceName) throws IOException{\n        if (price > 400000) throw new IOException(String.format(\"The %s is too high!\", priceName));\n        if (price < 0) throw new IOException(String.format(\"The %s must be > 0!\", priceName));\n    }\n}\n'),(565,719,'package ru.tsystems.tproject.integration;\n\nimport org.apache.log4j.Logger;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.stereotype.Service;\nimport ru.tsystems.tproject.entities.Contract;\nimport ru.tsystems.tproject.entities.Option;\nimport ru.tsystems.tproject.entities.Tariff;\nimport ru.tsystems.tproject.entities.User;\nimport ru.tsystems.tproject.services.API.ContractService;\nimport ru.tsystems.tproject.services.API.OptionService;\nimport ru.tsystems.tproject.services.API.TariffService;\nimport ru.tsystems.tproject.services.API.UserService;\n\nimport java.util.List;\n\n/**\n * This class will handle the logic when an entity is removed,\n */\n@Service(\"entityRemoval\")\npublic class EntityRemoval {\n    private static Logger logger = Logger.getLogger(EntityRemoval.class);\n    @Autowired\n    private TariffService tariffService;\n    @Autowired\n    private ContractService contractService;\n    @Autowired\n    private UserService userService;\n    @Autowired\n    private OptionService optionService;\n\n    /**\n     * When a tariff is removed, all users that have it in contract have the tariff changed to base one. Their balance is increased\n     * by 500.\n     * @param tariffId the tariff\'s id\n     */\n    public void removeTariff(int tariffId) {\n        User user;\n        Tariff tariff = tariffService.getEntityById(tariffId);\n        Tariff baseTariff = tariffService.getEntityById(11);\n        List<Contract> contractList = contractService.getAll();\n        for (Contract x : contractList) {\n            if (x.getTariff().equals(tariff)) {\n                x.setTariff(baseTariff);\n                user = x.getUser();\n                user.setBalance(user.getBalance() + 500);\n                contractService.updateEntity(x);\n                userService.updateEntity(user);\n            }\n        }\n        tariffService.deleteEntity(tariff);\n    }\n\n    /**\n     * When an option is removed, all users that used to have this option get +100 on their balance.\n     * @param optionId the option\'s id\n     */\n    public void removeOption(int optionId) {\n        Option option = optionService.getEntityById(optionId);\n        option.getOptionsTogether().clear();\n        option.getOptionsIncompatible().clear();\n        User user;\n        boolean flag = false;\n        List<Option> options = optionService.getAll();\n        for (Option x : options) {\n            if (x.getOptionsTogether().contains(option)) {\n                x.getOptionsTogether().remove(option);\n                flag = true;\n            }\n            if (x.getOptionsIncompatible().contains(option)) {\n                x.getOptionsIncompatible().remove(option);\n                flag = true;\n            }\n            if (flag) {\n                optionService.updateEntity(x);\n                flag = false;\n            }\n        }\n        List<Tariff> tariffs = tariffService.getAll();\n        for (Tariff x : tariffs) {\n            if (x.getPossibleOptions().contains(option)) {\n                x.removeOptionForTariff(option);\n                tariffService.updateEntity(x);\n            }\n        }\n        List<Contract> contractList = contractService.getAll();\n        for (Contract x : contractList) {\n            if (x.getOptions().contains(option)) {\n                x.removeOption(option);\n                contractService.updateEntity(x);\n                user = x.getUser();\n                user.setBalance(user.getBalance() + 100);\n                userService.updateEntity(user);\n            }\n        }\n        optionService.deleteEntity(option);\n    }\n}\n'),(566,720,'package ru.tsystems.tproject.integration;\n\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.stereotype.Service;\nimport ru.tsystems.tproject.entities.User;\nimport ru.tsystems.tproject.services.API.RoleService;\nimport ru.tsystems.tproject.services.API.UserService;\nimport ru.tsystems.tproject.utils.Converter;\n\nimport java.io.IOException;\nimport java.text.SimpleDateFormat;\n\n/**\n * This class handles the data validation and creating/updating the user\'s data.\n */\n@Service(\"userUpdater\")\npublic class UserUpdater {\n    @Autowired\n    private RoleService roleService;\n    @Autowired\n    private UserService userService;\n    private static final SimpleDateFormat DATE_FORMAT = new SimpleDateFormat(\"yyyy-MM-dd\");\n    public static final int LENGTH = 100;\n    public static final int EMAIL_LENGTH = 50;\n\n    /**\n     * This method validates the entered fields and gives back a user to create.\n     * @param name the user\'s name;\n     * @param surname the user\'s surname;\n     * @param date the user\'s birthday;\n     * @param passport the user\'s passport;\n     * @param address the user\'s address;\n     * @param email the user\'s email;\n     * @param balance the user\'s balance;\n     * @param login the user\'s login;\n     * @param password the user\'s password;\n     * @param roleID the user\'s role, id;\n     * @return user\n     * @throws Exception\n     */\n    public User createUser(String name, String surname, String date, String passport, String address, String email,\n                           Integer balance, String login, String password, int roleID) throws Exception{\n\n        User user = new User();\n        user.setName(name);\n        user.setSurname(surname);\n        user.setBirthday(DATE_FORMAT.parse(date));\n        user.setLogin(login);\n        user.setPassword(Converter.getMD5(password));\n        user.setRole(roleService.getEntityById(roleID));\n        if (passport != null && passport.length() !=0) {\n            if (passport.length() > LENGTH) {\n                throw new IOException(\"The passport length is too big!\");\n            } else {\n                user.setPassport(passport);\n            }\n        }\n        if (address != null && address.length() !=0) {\n            if (address.length() > LENGTH) {\n                throw new IOException(\"The address length is too big!\");\n            } else {\n                user.setAddress(address);\n            }\n        }\n        if (email != null && email.length() !=0) {\n            if (email.length() > EMAIL_LENGTH) {\n                throw new IOException(\"The email length is too big!\");\n            } else {\n                user.setEmail(email);\n            }\n        }\n        if (balance != null) {\n            if (balance > 100000) {\n                throw new IOException(\"The amount is too high!\");\n            } else {\n                user.setBalance(balance);\n            }\n        }\n        return user;\n    }\n\n    /**\n     * This method validates the entered fields and gives back a user to update.\n     * @param id the user\'s id;\n     * @param name the user\'s name;\n     * @param surname the user\'s surname;\n     * @param date the user\'s birthday;\n     * @param passport the user\'s passport;\n     * @param address the user\'s address;\n     * @param email the user\'s email;\n     * @param balance the user\'s balance;\n     * @param password the user\'s password;\n     * @return a user to update;\n     * @throws Exception\n     */\n    public User updateUser(int id, String name, String surname, String date, String passport, String address, String email,\n                           Integer balance, String password) throws Exception {\n        User user = userService.getEntityById(id);\n        user.setName(name);\n        user.setSurname(surname);\n        user.setBirthday(DATE_FORMAT.parse(date));\n        user.setPassword(Converter.getMD5(password));\n        if (passport != null && passport.length() !=0) {\n            if (passport.length() > LENGTH) {\n                throw new IOException(\"The passport length is too big!\");\n            } else {\n                user.setPassport(passport);\n            }\n        }\n        if (address != null && address.length() !=0) {\n            if (address.length() > LENGTH) {\n                throw new IOException(\"The address length is too big!\");\n            } else {\n                user.setAddress(address);\n            }\n        }\n        if (email != null && email.length() !=0) {\n            if (email.length() > EMAIL_LENGTH) {\n                throw new IOException(\"The email length is too big!\");\n            } else {\n                user.setEmail(email);\n            }\n        }\n        if (balance != null) {\n            if (balance > 100000) {\n                throw new IOException(\"The amount is too high!\");\n            } else {\n                user.setBalance(balance);\n            }\n        }\n        return user;\n    }\n}\n'),(567,722,'package ru.tsystems.tproject.security;\n\nimport org.apache.log4j.Logger;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.security.core.authority.SimpleGrantedAuthority;\nimport org.springframework.security.core.userdetails.UserDetails;\nimport org.springframework.security.core.userdetails.UserDetailsService;\nimport org.springframework.security.core.userdetails.UsernameNotFoundException;\nimport org.springframework.stereotype.Service;\nimport ru.tsystems.tproject.DAO.API.UserDAO;\nimport ru.tsystems.tproject.entities.User;\nimport ru.tsystems.tproject.exceptions.CustomDAOException;\n\nimport java.util.ArrayList;\nimport java.util.List;\n\n/**\n * Spring security class needed for authorisation.\n */\n@Service(\"userDetailsService\")\npublic class AppUserDetailsServiceDAO implements UserDetailsService {\n    private static final Logger logger = Logger.getLogger(AppUserDetailsServiceDAO.class);\n    @Autowired\n    private UserDAO userDAO;\n\n    @Override\n    public UserDetails loadUserByUsername(final String username) throws UsernameNotFoundException {\n        logger.info(\"Requested login - \" + username);\n        User user;\n        try {\n            user = this.userDAO.getUserByLogin(username);\n            logger.info(\"User found - \" + user);\n            List<SimpleGrantedAuthority> authorities = new ArrayList<>();\n            authorities.add(new SimpleGrantedAuthority(user.getRole().getName()));\n            logger.info(\"The authorities of the user - \" + user.getRole().getName());\n            return new org.springframework.security.core.userdetails.User(username, user.getPassword(), true, true, true, true, authorities);\n        } catch (CustomDAOException ex) {\n            logger.info(\"User with login \" + username + \" not found!\");\n            throw new UsernameNotFoundException(username + \" not found\");\n        } catch (Exception ex) {\n            logger.error(\"Error! The text is: \" + ex + \", as well as \" + ex.getMessage());\n            return null;\n        }\n\n    }\n}\n'),(568,724,'package ru.tsystems.tproject.services.API;\n\nimport ru.tsystems.tproject.entities.Contract;\nimport ru.tsystems.tproject.exceptions.ContractNotFoundException;\nimport ru.tsystems.tproject.exceptions.ContractsForEntityNotGotException;\nimport ru.tsystems.tproject.exceptions.CustomDAOException;\n\nimport java.util.List;\n\n/**\n * CRUD methods along with the specific ones needed for this class.\n */\npublic interface ContractService extends GenericService<Contract, Integer> {\n\n\n    /**\n     * A method to get contract by number.\n     * @param number the number of the contract\n     * @return a contract\n     * @throws CustomDAOException\n     */\n\n    public Contract getContractByNumber(long number) throws ContractNotFoundException;\n    public List<Contract> getAllContractsForUser(int id) throws ContractsForEntityNotGotException;\n\n}\n'),(569,725,'package ru.tsystems.tproject.services.API;\n\nimport ru.tsystems.tproject.exceptions.CustomDAOException;\n\nimport java.util.List;\n\n/**\n * A generic service to be implemented with basic operations.\n */\npublic interface GenericService<E, K> {\n    public void createEntity(E entity) throws CustomDAOException;\n    public E getEntityById(K id) throws CustomD