tation.Transactional;\nimport ru.tsystems.tproject.DAO.API.UserDAO;\nimport ru.tsystems.tproject.entities.User;\nimport ru.tsystems.tproject.exceptions.CustomDAOException;\nimport ru.tsystems.tproject.exceptions.UserNotFoundException;\nimport ru.tsystems.tproject.services.API.UserService;\n\nimport java.util.List;\n\n/**\n * A UserService API implementation,\n */\n@Service(\"userService\")\npublic class UserServiceImplementation implements UserService {\n    @Autowired\n    private UserDAO userDAO;\n\n    @Override\n    @Transactional\n    public void createEntity(User entity) throws CustomDAOException {\n        this.userDAO.create(entity);\n    }\n\n    @Override\n    @Transactional\n    public User getEntityById(Integer id) throws CustomDAOException {\n        return this.userDAO.read(id);\n    }\n\n    @Override\n    @Transactional\n    public void updateEntity(User entity) throws CustomDAOException {\n        this.userDAO.update(entity);\n    }\n\n    @Override\n    @Transactional\n    public void deleteEntity(User entity) throws CustomDAOException {\n        this.userDAO.delete(entity);\n    }\n\n    /**\n     * Gets all users from the database.\n     * @return a list of users\n     * @throws CustomDAOException\n     */\n    @Override\n    @Transactional\n    public List<User> getAll() throws CustomDAOException {\n        return this.userDAO.getAll();\n\n    }\n\n    /**\n     * Gets user by a specified number.\n     * @param number the number of user\'s contract\n     * @return a user\n     * @throws CustomDAOException\n     */\n    @Override\n    @Transactional\n    public User getUserByNumber(long number) throws UserNotFoundException {\n        return this.userDAO.getUserByNumber(number);\n    }\n\n    /**\n     * Get user by a specified login,\n     * @param login the user\'s login\n     * @return a user\n     * @throws CustomDAOException\n     */\n    @Override\n    @Transactional\n    public User getUserByLogin(String login) throws UserNotFoundException {\n        return this.userDAO.getUserByLogin(login);\n    }\n\n\n}\n'),(579,737,'package ru.tsystems.tproject.utils;\n\nimport java.security.MessageDigest;\nimport java.security.NoSuchAlgorithmException;\n\n/**\n * A controllers that converts to MD5.\n */\npublic class Converter extends org.springframework.security.authentication.encoding.BasePasswordEncoder {\n    public static String getMD5(String word) throws NoSuchAlgorithmException{\n        String password = \"notParanoic\" + word + \"really\";\n        MessageDigest messageDigest = MessageDigest.getInstance(\"MD5\");\n        byte[] array = messageDigest.digest(password.getBytes());\n        StringBuilder sb = new StringBuilder();\n        for (byte anArray : array) {\n            sb.append(Integer.toHexString((anArray & 0xFF) | 0x100).substring(1, 3));\n        }\n        return sb.toString();\n    }\n\n    @Override\n    public boolean isPasswordValid(String s, String s2, Object o) {\n        try {\n            return (s.equals(getMD5(s2)));\n        } catch (NoSuchAlgorithmException ex) {\n            return false;\n        }\n    }\n\n    @Override\n    public String encodePassword(String s, Object o) {\n        try {\n            return getMD5(s);\n        } catch (NoSuchAlgorithmException ex) {\n            return s;\n        }\n    }\n}\n'),(580,738,'package ru.tsystems.tproject.utils;\n\n/**\n * A parser class to parse different numbers like contractNumber.\n * It parses \"(555) 555-55-55\" to \"5555555555\".\n */\npublic class Parser {\n    public static String doParse(String number) {\n        return number.replaceAll(\" \", \"\").replaceAll(\"-\", \"\").replaceAll(\"\\\\(\", \"\").replaceAll(\"\\\\)\", \"\");\n    }\n\n}\n'),(581,739,'package ru.tsystems.tproject.utils;\n\nimport org.apache.log4j.Logger;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.security.core.context.SecurityContextHolder;\nimport org.springframework.web.servlet.ModelAndView;\nimport org.springframework.web.servlet.handler.HandlerInterceptorAdapter;\nimport ru.tsystems.tproject.entities.User;\nimport ru.tsystems.tproject.services.API.UserService;\n\nimport javax.servlet.http.HttpServletRequest;\nimport javax.servlet.http.HttpServletResponse;\n\n/**\n * An interceptor to log all the requests.\n */\npublic class RequestInterceptor extends HandlerInterceptorAdapter {\n    @Autowired\n    private UserService userService;\n    private static final Logger LOGGER = Logger.getLogger(RequestInterceptor.class);\n    @Override\n    public boolean preHandle(HttpServletRequest request,\n                             HttpServletResponse response, Object handler) throws Exception {\n\n        long startTime = System.currentTimeMillis();\n        String url = request.getRequestURL().toString();\n        try {\n            String userLogin = ((User) request.getSession().getAttribute(\"currentUserU\")).getLogin();\n            LOGGER.info(\"User \" + userLogin + \" requested URL::\" + url);\n            request.setAttribute(\"startTime\", startTime);\n        } catch (Exception ex) {\n            LOGGER.info(\"No user found while requesting the URL::\" + url);\n            try {\n                org.springframework.security.core.userdetails.User user = (org.springframework.security.core.userdetails.User) SecurityContextHolder.getContext().getAuthentication().getPrincipal();\n                User currentUser = userService.getUserByLogin(user.getUsername());\n                request.getSession().setAttribute(\"currentUserU\", currentUser);\n            } catch (Exception exception) {\n                return true;\n            }\n        }\n        return true;\n    }\n\n    @Override\n    public void postHandle(HttpServletRequest request,\n                           HttpServletResponse response, Object handler, ModelAndView modelAndView) throws Exception {\n        System.out.println(\"Request URL::\" + request.getRequestURL().toString()\n                + \" Sent to Handler\");\n        //we can add attributes in the modelAndView and use that in the view page\n    }\n\n    @Override\n    public void afterCompletion(HttpServletRequest request,\n                                HttpServletResponse response, Object handler, Exception ex)\n            throws Exception {\n        long startTime = (Long) request.getAttribute(\"startTime\");\n        LOGGER.info(\"Request URL dispatching time taken::\" + (System.currentTimeMillis() - startTime));\n    }\n}\n'),(582,740,'package ru.tsystems.tproject.utils;\n\nimport org.apache.log4j.Logger;\nimport ru.tsystems.tproject.utils.locale.EnglishLanguage;\nimport ru.tsystems.tproject.utils.locale.Translatable;\n\nimport java.text.SimpleDateFormat;\n\n/**\n * Created by german on 15.11.14.\n */\n\npublic class Test {\n    private static Logger logger = Logger.getLogger(Test.class);\n    private static final SimpleDateFormat dateFormat = new SimpleDateFormat(\"dd.MM.yyyy\");\n    public static void main(String[] args) {\n        Translatable translatable = EnglishLanguage.getEnglishLanguage();\n        System.out.println(translatable.getJSP_CONTRACTS_BLOCKED_BY_ADMIN());\n    }\n\n    }\n\n'),(583,742,'package ru.tsystems.tproject.utils.locale;\n\n/**\n * A class to hold the static String values for the English language.\n */\npublic class EnglishLanguage implements Translatable  {\n\n    private static final String JSP_PANEL_NAME = \"Account control panel\";\n    private static final String JSP_CONTRACTS_NAME = \"Contracts\";\n    private static final String JSP_BALANCE_NAME = \"Balance\";\n    private static final String JSP_INFO_NAME = \"Account details\";\n    private static final String JSP_PROFILE_NAME = \"Profile\";\n    private static final String JSP_SUPPORT_NAME = \"Support\";\n    private static final String JSP_INVITE_NAME = \"Welcome\";\n    private static final String JSP_LOGOUT_NAME = \"Logout\";\n    private static final String JSP_CONTRACTS_LIST_NAME = \"Contracts list\";\n